(7, 6, '2026-01-02T00:00:00.000Z', '13:27', '2026-12-01T00:00:00.000Z', '05:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que se presenta ante esta Dependencia Especializada a fin de formular una denuncia sobre un supuesto hecho, menciona el recurrente que en fecha 01/01/2026 en horas de la madrugada procede a descargar, y crear una cuenta en la plataforma telegram, siendo las 03:30 horas procede a entablar una conversación con un perfil de Nombre MILI (menciona el recurrente que dicho perfil de telegram ya fue eliminado), la persona Mili menciona que vende contenidos para adultos el recurrente interesado en dicha propuesta le pide fotos, momento en el cual el mismo tambien procede a enviar fotos intimas, tiempo despues dicha persona (MILI) procede a enviar su cuenta bancaria para el envio de dicho contenido que tendria un valor de Guaranies 70.000 por lo que el recurrente procede a enviar la suma de Guaranies 70.000 en la cuenta de Tu Financiera con Nº de cuenta 11760553 del titular MARI ESTELA CABALLERO FRANCO, luego de lo ocurrido la persona MILI envía su numero telefonico para realizar videollamada por lo que el recurrente procede a realizar la misma al abonado numero 0982060141, la persona MILI no contesta, tiempo despues la misma envia fotos intimas que el recurrente habria enviado en telegram  solicita transferencias de Guaranies 1.500.000 para no escracharlo públicamente, por lo que el recurrente procede a enviar la suma de guaranies de 1.500.000 por giros tigo al abonado numero 0982060141, luego la misma vuelve a pedir que deposite la suma de guaranies 1.000.000 a su Tigo Money, por lo que el recurrente vuelve a enviar la suma de Guaranies 1.000.000 al abonado numero 0982060141 con CI Nº 724099 a nombre de Cirilo Antonio Cabrera Toche, luego de lo acontecido el recurrente recibe un mensaje del abonado numero 0975833293 identificándose como su prima Rosmary Villalba advirtiéndole supuestamente que alguien estaria publicando fotos del mismo escrachandolo en la plataforma Facebook, la supuesta prima menciona que puede ayudar a eliminar dicha cuenta pero que tendria un costo de Guaranies 1.500.000, lo que el recurrente acepta y procede a enviar la suma solicitada en la cuenta Nº 249111916 a nombre de Dario Javier Oviedo Mora con CIº 3.590.747 luego la supuesta prima solicita el correo personal del recurrente para poder eliminar dicha cuenta, por lo que el recurrente facilita su correo Sdvd716@gmail.com a la supuesta prima, luego en fecha 02/01/2025 la supuesta prima envia varios videos del recurrente teniendo intimidad con su pareja, solicitando la suma de guaranies 5.000.000 para que no recorran dichos videos, por lo que el recurente se percata de que su cuenta de Gmail ha sido vulnerada, por todo lo ocurrido el mismo se acerca a esta dependencia para los fines que hubiera lugar  

', 'DEPARTAMENTO CENTRAL, CIUDAD DE ÑEMBY, ARQ. TOMAS ROMEO PEREIRA CASI PASEO VECINAL', NULL, NULL, 6, 184, 'Asunción', 'Suboficial Ayudante', 'AXEL FERNANDO', 'DUARTE ORTIGOZA', NULL, NULL, 'B9AFC9A26', NULL, 'completada', '2026-01-02T18:38:20.729Z', '2025-12-26T00:00:00.000Z', '22:00'),
(8, 7, '2026-01-02T00:00:00.000Z', '15:00', '2025-12-31T00:00:00.000Z', '20:15', 'HECHO PUNIBLE CONTRA EL PATRIMONIO', NULL, 'Que se presenta ante esta Dependencia Especializada a fin de realizar una denuncia, menciona la recurrente que en fecha 31/12/2025 al visualizar en la pagina de Facebook una publicación de alquiler de un dúplex por valor de 2.000.000 Gs. (Dos millones de guaraníes) desde el perfil denominado Cesaar Olazaar con dirección de URL https://www.facebook.com/share/17i3gVdMsg/, decide contactar con el mismo, inicialmente a través de Messenger y posterior a través de WhatsApp después de que esta persona le solicitara su numero de contacto para poder conversar mejor, siendo las 16:30 Hs. recibió varios mensajes desde el numero 0971283489 identificándose con el nombre de Ever Samaniego supuesto encargado y amigo del propietario del dúplex a ser alquilado, quien le envió la ubicación y fotografías del dúplex, la denunciante se presento hasta la ubicación del lugar para poder ver el interior, pero cuando llego al lugar Ever le menciono que tuvo un inconveniente y que no iba poder llegar hasta el lugar para enseñarle la casa, pero que si estaba interesada podía realizar una seña por valor de 1.000.000 Gs (un millón de guaraníes), que seria el 50% del valor total del precio total del alquiler, para que se le reservara y no seguir publicando la oferta, la afectada continua relatando que como tenia interés en acceder al alquiler de dicho lugar accedió al pago de la seña solicitada, una vez que llegan a un acuerdo procedió al envió vía transferencia bancaria a la cuenta N°191610 a nombre del titular Fabio Marcial Garcete Leiva, con C.I. N°4.323.833 a las 20:15hs aproximadamente, cuenta proporcionada por el supuesto encargado y asesor del alquiler, acordaron de que para poder ver el interior de la casa debía ir el día de la fecha una vez en el lugar fueron recibidos por una pareja quien les enseño el interior del dúplex, al visualizar el lugar observaron ciertos detalles que le hacían dudar para poder alquilarlo, el supuesto asesor en todo momento les indico que cualquier cosa debían comunicarle a el motivo por el cual no intercambiaron ningún tipo de información con la pareja que les enseño el lugar por lo que dieron aviso de los detalles que observaron al encargado quien les dijo que esos detalles se podían mejorar o reparar pero que debían abonar la suma de 1.000.000 Gs. (un millón de guaraníes) mas como seña de garantía del lugar el cual iba ser utilizado para la refracción de la casa, como ya realizaron la primera seña accedieron nuevamente al envió del dinero solicitado a la misma cuenta bancaria mencionada con anterioridad, ya que esta persona le había prometido que una vez enviado el dinero iban a firmar un contrato por el alquiler, pero esta persona continuo solicitando mas suma de dinero con la excusa de que faltaba materiales para la refacción, por todo lo expuesto la denunciante cree que es victima de un supuesto hecho de estafa ya que hasta la fecha dejara de tener respuesta alguno por parte del supuesto encargado, también menciona que la misma había anotado el numero publicitado por el dúplex y como no recibís respuesta decidió llamar a ese numero percatándose ahí que la pareja que les había enseñado la casa eran los verdaderos encargados del lugar quienes le mencionaron que desconocían al tal Ever Samaniego y que esta persona estaría cometiendo estafas utilizando la verdadera oferta de alquiler que habían realizado los mismos en otro perfil. Por todo lo expuesto viene a poner a conocimiento de la autoridad competente para los fines que hubiere lugar conforme a derecho.', 'CIUDAD DE ASUNCIÓN, SAN VICENTE/JUAN ZORRILLA DE SAN MARTIN', NULL, NULL, 7, 182, 'Asunción', 'Suboficial Ayudante', 'GERMAN EMANUEL', 'RUIZ DÍAZ', NULL, NULL, '831C80A26', NULL, 'completada', '2026-01-02T18:54:28.045Z', NULL, NULL),
(9, 8, '2026-01-02T00:00:00.000Z', '16:10', '2025-01-02T00:00:00.000Z', '11:45', 'OTRO', 'ESTAFA', 'Que, en fecha y hora indicada arriba, recibe un mensaje desde la plataforma de mensajeria whatsapp del abonado N° +12896996986 identificandose como la persona RAQUEL AGUILAR (su supuesta vecina que habia viajdo a españa) que, en la fotografía de perfil del usuario se visualizaba la última fotografía, la supuesta vecina argumenta que el motivo de su mensaje era para saludar por las fiestas de fin de año y para comentar que regresaria de sorpresa a Paraguay, que envió varios regalos y solicitó reserva y confidencialidad sobre el caso; al respecto, solicitó al denunciante que haga el favor de recibir la encomienda de parte de la empresa DHL. Que, la supuesta vecina del denunciante le envía al recurrente un documento en PDF en el que se visualiza una supuesta resolución de envío con membrete de la empresa DHL en el que se encontraban detallados varios articulos que serian enviados a la ubicación del denunciante; que, la entrega se realizaría recién el viernes es 02/01/2026. Agrega el recurrente que, en fecha viernes 02/01/2026, 11:50 horas, recibe llamada en Whatsapp del Número +18297749218, de parte de supuestos empleados de la empresa DHL, quienes le manifestaron que, en relación a los artículos a ser entregados de parte de su vecina Raquel Aguilar, los mismos estaban retenidos por sobre costo y que se debía pagar una supuesta multa por valor de Gs. 37.475.460 (guaraníes treinta y siete millones cuatrocientos setenta y cinco mil cuatrocientos sesenta); que, para evitar pago de aranceles adicionales, podían disponer de una cuenta local para que pueda recibir la transferencia de la multa, mencionan tambien que de no pagar la multa impuesta por la DNIT el denunciante seria denunciado por evacion de impuestos. En tal sentido, el denunciante informa todo lo anterior a su supuesta vecina, quien le indica que le transferirá el monto a su cuenta bancaria para que se ocupe de pagar las supuestas multas impuestas. Que, en fecha 02/01/2026, la supuesta vecina del recurrente envía una imagen en el que se visualiza un comprobante de transferencia del banco HSBC de USS 6.401 (dólares americanos seis mil cuatrocientos un) a la cuenta del primo del recurrente Junior Riquelme con banco GNB con Cuenta Nº 13066656002, le explica que, por ser una transferencia internacional, la acreditación del valor se haría efectivo en 24 a 72 horas; que, posteriormente volvió a escribir y explicó que, por indicaciones de su asesor jurídico le recomendaba que adelante el pago de la multa con su dinero debido a que se cumplía un supuesto plazo y por ello no quería perder los artículos en cuestión; al respecto, indicó que se realice el pagó por medio del sistema de giros de wester unión o por transferencia a una cuenta bancaria local de Paraguay, por todo lo acontecido el recurrente se apersona al Aeropuerto Silvio Petirossi a la oficina de la empresa DHL y es ahi donde la supuesta vecina le comenta al denunciante que e dicho paquete se encuentra la suma de dolares americanos 250.000 por ende exige al denunciante que apresure el pago de la multa ofreciendo una recompensa del 20% del valor presuntamente incluido en el paquete, es ahi donde el primo del recurrente se pone en contacto con la supuesta vecina explicandole que la mercaderia no estaria en paraguay momento en el cual la supuesta vecina alega que cambiaria de numero telefonico para no tener problemas. Por lo que pone a conocimiento de la autoridad policial para los fines en que hubiere lugar conforme a derecho.', 'CIUDAD DE ASUNCIÓN, PROFESOR AMARILLA 442 CASI 34 CURUGUATEÑOS', NULL, NULL, 8, 184, 'Asunción', 'Suboficial Ayudante', 'AXEL FERNANDO', 'DUARTE ORTIGOZA', NULL, NULL, '0EF8B6A26', NULL, 'completada', '2026-01-02T19:49:16.967Z', NULL, NULL),
(394, 317, '2026-01-22T00:00:00.000Z', '10:23', '2025-12-22T00:00:00.000Z', '12:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que viene a formular una denuncia sobre supuesto hecho a determinar y manifiesta cuanto  sigue que hace aproximadamente 2 años atrás el mismo fue asaltado en donde formulo una denuncia en la comisaria 11 Arroyo seco de la cuidad de Villa Elisa, en esa situación se le sustrajo su billetera el cual contenía sus documentos personales y la cedula de identidad civil mas su aparato celular, sigue manifestando el recurrente que desde el mes de Noviembre del 2025 aproximadamente recibe mensajes de textos del numero de teléfono abonado al 4455 perteneciente al banco INTERFISA quienes le manifiesta que poseía una cuenta atrasada por pago de cuota de préstamo. Por tal situación se apersona ante el banco para solicitar el extracto de su cuenta bancaria en donde le manifiestan que cuenta con dos prestamos pendientes; primer crédito con monto de 653.000 guaraníes, segundo crédito con monto de 177.000 guaraníes con un total de 830.046 guaraníes, que el recurrente desconoce totalmente dicho préstamo en donde le reclama a los oficiales del banco pidiendo una explicación del préstamo en el que los oficiales le menciona que tiene que realizar su denuncia en esta dependencia y que posterior tiene que acercarse de nuevo al banco con la denuncia que realizo para así los oficiales del banco puedan realizar las gestiones correspondiente para cancelar el préstamo que el denunciante desconoce, por lo que viene a realizar su denuncia para los fines correspondiente.', 'DEPARTAMENTO CENTRAL, CIUDAD DE FERNANDO DE LA MORA', NULL, NULL, 207, 167, 'Asunción', 'Suboficial Ayudante', 'FATIMA', 'BERNAL FARIÑA', NULL, NULL, 'C00B35A26', NULL, 'completada', '2026-01-22T13:58:47.131Z', NULL, NULL),
(11, 9, '2026-01-02T00:00:00.000Z', '16:34', '2026-01-01T00:00:00.000Z', '17:30', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que se presenta ante esta Dependencia Especializada la recurrente, a fin de radicar formal denuncia, manifestando que tomó conocimiento de una propuesta laboral a través de una publicidad difundida en la red social Instagram de una supuesta empresa llamada Marketing afiliados Golden. Dicha propuesta consistía en la supuesta reventa de productos digitales y operaciones vinculadas a criptomonedas.
Refiere que, tras contactar con los responsables de la mencionada publicidad, procedió a firmar un contrato digital que se le fue proveído vía WhatsApp por el N°0983788797, en el cual dicho contrato establecía que desempeñaría el puesto de agente de recepción y gestión de pagos. Entre sus responsabilidades principales se encontraba la recepción de fondos provenientes de la venta de productos digitales y su posterior envío a las cuentas bancarias o medios de pago designados por la supuesta empresa.
El contrato establecía, entre otras cláusulas, que la denunciante percibiría una comisión equivalente al cinco por ciento (5%) por cada operación de recepción y envío de fondos realizada de manera exitosa; que contaría con flexibilidad horaria para efectuar dichas operaciones, debiendo, no obstante, remitir los fondos en el menor tiempo posible; y que podría desempeñar sus funciones desde cualquier lugar, siempre que contara con acceso a los medios de pago y transferencia indicados por la empresa.
Manifiesta la recurrente que dichas condiciones resultaron de su interés, motivo por el cual aceptó y firmó el contrato, comenzando a prestar tareas desde fecha 13/10/2025.
La misma sigue manifestando que contactaba a través de numero de teléfono anteriormente mencionado para proveerle de los datos, comprobantes y operaciones bancarias que obtenía al ofrecer exitosamente los supuestos servicios.
Posteriormente, en fecha 01/01/2026, la denunciante tomó conocimiento de que las actividades que venía realizando podrían formar parte de una presunta red de estafas, mediante la cual se perjudicaba a terceros interesados en los servicios ofrecidos por la supuesta empresa, advirtiendo que su participación era involuntaria.
Al tomar conocimiento de dicha situación, la recurrente se negó a continuar prestando servicios para la mencionada empresa y decidió presentarse ante esta Dependencia a fin de radicar la presente denuncia, con el objetivo de deslindar responsabilidades y evitar que su identidad y datos personales continúen siendo utilizados para la comisión de posibles hechos delictivos.
Se adjuntan el supuesto contrato, el extracto bancario y otras operaciones realizadas por la victima.', 'CIUDAD DE ASUNCIÓN, GENERAL BRITEZ BORGES CASI CENTENARIO DE LA EPOPEYA NACIONAL ', NULL, NULL, 9, 176, 'Asunción', 'Suboficial Ayudante', 'ALEXIS MIGUEL', 'AGÜERO GIMÉNEZ', NULL, NULL, '02E701A26', NULL, 'completada', '2026-01-02T20:50:13.075Z', NULL, NULL),
(17, 12, '2026-01-03T00:00:00.000Z', '08:05', '2025-12-31T00:00:00.000Z', '20:00', 'HECHO PUNIBLE CONTRA LA PROPIEDAD', NULL, 'EL RECURRENTE MANIFIESTA QUE EN FECHA Y HORA MENCIONADA RECIBIO UN MENSAJE VIA WHATSAPP DESDE EL ABONADO NUMERO +1 226 737-7031 MENCIONANDO LO QUE SERIA SU PRIMA QUE RADICA EN ARGENTINA, SOLICITANDOLE INFORMACION PERSONAL COMO ASI TAMBIEN LA CUENTA PERSONAL DE SU HERMANO RONAL DIAZ CON CI Nº 3195885, PARA RECIBIR UN PAQUETE DEL EXTRANJERO, DONDE EL ACCEDE A ENVIAR DICHOS DATOS YA QUE EL ANONADO NUMERO TELEFONICO TENDRIA LA IMAGEN DE SU PRIMA DE NOMBRE GRICEL BAEL, PASADO LOS DIAZ ESPECIFICAMENTE 02/01/2026 RECIBE UN MENSAJE DEL ABONADO NUMERO +1 829 774 9218 MENCIONANDO QUE YA SE ENCONTRABA SU ENCOMIENDA, EN DHL EN EL AEROPUERTO INTERNACIONAL SILVIO PETTIROSI, LA CUAL SERIA APARATOS CELULARES, PLAY STEINSHON, DRONES COMO ASI TAMBIEN DINERO EN EFECTIVO, EL SEÑOR SE IDENTIFICO COMO EDISON ESTUPIÑAN MENCIONANDOLE QUE SU PAQUETE SERIA RETENIDO POR PERSONAL DE ADUANA, POR EL MOTIVO DE QUE HABRIA SUPERADO EL LIMITE, MANIFESTANDOLE QUE LA MULTA SERIA DE GS. 37.475.460, AL MOMENTO RECIBE UN MENSAJE DESDE EL ABONADO NUMERO +1 249 524 3135 IDENTIFICANDOSE COMO JOSE RICARDO NUÑEZ, EL MISMO SE PRESENTA COMO EL ABOGADO DE LA SEÑORA GRICEL BAEL MANIFESTANDOLE QUE SI NO ABONABA EL 50% DE LA MULTA EL PAQUETE SE DECLARABA COMO ABANDONADA A LO CUAL EL RECURRENTE NO ACCEDIO A REALIZAR EL PAGO. ', 'CIUDAD DE ASUNCIÓN, TTE. LEONIDAS 4538', NULL, NULL, 12, 169, 'Asunción', 'Suboficial Ayudante', 'WALTER DAVID', 'FRANCO CABRERA', NULL, NULL, '67F47EA26', NULL, 'completada', '2026-01-03T11:43:25.407Z', NULL, NULL),
(18, 13, '2026-01-03T00:00:00.000Z', '08:18', '2025-01-02T00:00:00.000Z', '10:30', 'HECHO PUNIBLE CONTRA LOS BIENES DE LA PERSONA', NULL, 'El recurrente menciona que en fecha y hora mencionada se percata de que se habría realizado varias transacciones sin su consentimiento, específicamente nueve operaciones de 100.000 (cien mil guaraníes) totalizando así la suma de 900.000 (novecientos mil guaraníes), dichas transacciones fueron destinadas al comprobante N°8568002 a nombre de Diego Fleitas Zarate con C.I N° 8168653, el mismo menciona que desconoce quien seria el beneficiario como así también la manera en que se realizo, y en que momento se realizo ya que no recibió ningún tipo de notificación  ', 'CIUDAD DE ASUNCIÓN, COLON Y HUMAITA ', NULL, NULL, 13, 195, 'Asunción', 'Suboficial Ayudante', 'ANGEL GABRIEL', 'CARVALLO FLORENTIN', NULL, NULL, '71213DA26', NULL, 'completada', '2026-01-03T11:51:49.518Z', NULL, NULL),
(396, 321, '2026-01-22T00:00:00.000Z', '10:56', '2022-10-31T00:00:00.000Z', '08:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que se presenta ante esta Dependencia Especializada a fin de realizar una denuncia, menciona la recurrente que en el año 2016, la misma con la intencion de brindar ayuda a una ex compañera de trabajo tambien Docente de nombre MIRTA MELGAREJO, quienes en ese periodo trabajaban en la Supervision Administrativa Region 3, para realiazar un prestamo de dinero con la Empresa denominada JPM COMPANY, la denunciante accedio a ser garante ante la solicitud de prestamo por valor de 1.000.000 Gs. (Un millon de guaranies), por tanto menciona que esta compañera en presencia de NATALIA ZAVAN, otra compañera le presento varios docuementos para la firma y poder realizar la solicitud de prestamo, continua relatando que efectivamente realizo la firma pero que antes habia dado una lectura en el que constaba que solo seria garante de dicha solicitud, pero que unos dias despues la compañera MIRTA MELGAREJO, le menciona que firmo mal una de las hojas de solicitud del prestamo por lo cual necesitaba que volviera a firmar, como la primera vez leyo y vio que estaba en condiciones los documentos esta segunda vez ya no se tomo el tiempo en leer ya que en ese momento se encontraba muy ocupada y procedio a la firma de los documentos, tambien relata que aquella primera vez que se le solicito la firma de documentos la solicitante del prestamo (MIRTA MELGAREJO), aun no habia firmado por lo que ella le pregunto y le pidio que ella firmara primero, pero como se relata anteriormente en la siguiente ocasion ya no se cercioro de que dicha solictud tuviera la firma de la solicitante, pasado un mes del hecho al momento del cobro de su salario visualiza un descuento por valor de 270.000 Gs. (Doscientos setenta mil guaranies), cuyo monto era desconocido por la recurente por la cual posteriormente se acerco hasta una sucursal del Banco Nacional de Fomento para el reclamo del descuento, pero ahi los funcionarios bancarios le mencioanron que la misma contaba con un prestamo con la Empresa JPM COMPANY, y que dicho descuento era en relacion al prestamo en cuestion, la denunciante alega que no fue beneficiaria de ningun prestamo con dicha empresa, que la unica relacion que mantenia con esta empresa era como garante a la ex compañera de trabajo, pese a todo lo acontecisdo la misma relata que conto con varios meses de descuentos y disitintos montos, finalizando inclusive con lla deuda, pero que hasta la fecha al reclamar el supuesto pagare y otros documentos presentados para la solictud del prestamo no tuvo una respuesta favorable ni la entrega del pagaré, por lo que creeque fue victima de personas mal intencionadas quienes abusaron de su buena fe, ya que las 2 (dos), personas mencionadas figuraban como referentes para el préstamo. Ante lo expuesto tambien relata que durante el mes de febrero del año 2022, recibio una notificacion via whatsApp del Juzgado de Paz de Mariano Roque Alonso, referente al hecho denunciado, la misma acudio en fecha 03/02/2022, en el lugar recibio acusaciones y respuestas negativas para el esclarecimiento del hecho, tanto que el Abogado de la recurrente intento acceder al expediente,  recibiendo negativas por lo que hasta la fecha pese a haber lquidado la deuda la misma no cuenta aun con el supuesto pagare, inclusive le mencionaron que  supuestamente contaba con mas pagares a nombre de la misma, por ultimo menciona que recibe distintos tipos de excusas de la firma actual a cargo VANESSA ASOCIADOS S.A., para no entregar el pagare finiquitado. Por todo lo expuesto viene a poner a conocimiento de la autoridad competente para los fines que huebiere lugar conforme a Derecho.', 'CIUDAD DE ASUNCIÓN, BARRIO VILLA MORRA, MCAL. LOPEZ Y MONSEÑOR BOGARÍN - COLEGIO RCA. DE PANAMA', NULL, NULL, 208, 188, 'Asunción', 'Suboficial Segundo', 'ROMINA GISELL', 'SÁNCHEZ SANABRIA', NULL, NULL, '40BEB8A26', NULL, 'completada', '2026-01-22T14:02:17.626Z', NULL, NULL),
(397, 322, '2026-01-22T00:00:00.000Z', '11:04', '2025-06-04T00:00:00.000Z', '21:00', 'Hurto', NULL, 'Que se presenta en esta dependencia especializada a fin de formular una denuncia sobre un supuesto hecho de HURTO DE HOJAS DE CHEQUE, menciona que en fecha y dirección  mencionado mas arriba fue hurtado en la vía publica en lo que fue despojado de sus pertenencias entre ellos una hoja de Cheque Diferido que se detalla a continuación:
CHEQUE DIFERIDO N°54149250 cargo BANCO GNB con cuenta N°132166950001 a nombre del titular CARNES MISIONES S.A en Guaraníes, en blanco.
