(19, 14, '2026-01-03T00:00:00.000Z', '10:34', '2025-12-30T00:00:00.000Z', '16:31', 'HECHO PUNIBLE CONTRA LOS BIENES DE LA PERSONA', NULL, 'El recurrente manifiesta que en fecha y hora  mencionada se percata de que su abonado numero telefónico ( 0991601004) fue vulnerado sigue relatando que la persona que realizo el hecho habría solicitado el pago correspondiente de servicio al señor Jovani Konzen  la cual el le manifestó que el pago ya se habría hecho a la cuenta N°6192515406 de la entidad UENO BANCK con C.I: 5976321 a nombre de Edilson Balbino Acosta Gómez la suma de 5.455.800 guaraníes ( cinco millones cuatrocientos cincuenta y cinco mil ochocientos guaraníes ), el mismo menciona que desconoce quien seria el beneficiario, sigue relatando que el mencionado también solicito  dinero a su señora madre de nombre Esmelda Coronel de Peralta, quien por motivos ajenos no pudo realizar ninguna transacción  utilizando los mismos datos de cuenta, razón por la cual procedió al cambio de su lineal telefónica ', 'DEPARTAMENTO CENTRAL, CIUDAD DE AREGUÁ, MARISCAL LOPEZ CALLE SIN NOMBRE BARRIO SAN MINGUEL', NULL, NULL, 14, 195, 'Asunción', 'Suboficial Ayudante', 'ANGEL GABRIEL', 'CARVALLO FLORENTIN', NULL, NULL, 'D4738FA26', NULL, 'completada', '2026-01-03T14:19:53.967Z', NULL, NULL),
(398, 323, '2026-01-22T00:00:00.000Z', '12:03', '2026-01-21T00:00:00.000Z', '13:05', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que la compareciente se presenta ante esta dependencia a fin de formular una denuncia sobre un supuesto hecho a determinar, relata que desde el mes de febrero del año 2024 integro un grupo en la red social BIGO en el cual interactuaban muchos usuarios que utilizaban dicha red, pasado un tiempo la recurrente empezó a recibir mensajes de diferentes cuentas de Instagram con el nombre de usuario andresousa9112, que dice que su nombre era  CARLOS ALEXANDRE DASILVA SOUSA de nacionalidad  BRASILERA el mismo insistía para salir en algún lugar para conocerse personalmente, pasado un tiempo la misma tenia un viaje establecido para la Republica de Brasil con toda su familia en donde se le acerca una persona de sexo masculino y que le dice que al fin pudo conocerla en persona y la recurrente desconociendo de donde pudo conseguir en donde se encontraba y no sabiendo que hacer le dijo al sujeto que se retirara del lugar y posterior tomo su colectivo rumbo a su destino, ínterin  en el que procedió  bloquearle de su cuenta de Instagram y después de eso empezó a recibir solicitud en dicha red social  de diferentes cuentas por lo que nuevamente procede a bloquear todas las cuentas que la recurrente sospecha que se trataba del mismo que le seguía molestando, y el día de ayer recibió una llamada del abonado N° 0983629398 en el cual la denunciante no contesto y que posterior la persona que le hizo la llamada le dejo un buzón de voz diciéndole "nani habla Carlos, te amo llámame" en donde la afectada quedo desconcertada y teme que la persona de con su domicilio a fin de hacerle algún tipo de daño a ella o a su familia, por lo que viene a poner a conocimiento de la autoridad policial para los fines correspondientes', 'DEPARTAMENTO CENTRAL, CIUDAD DE LAMBARÉ, BARRIO VALLE APU''A I, CRNEL. FRANCISCO MARTINEZ 251 Y CANDIDO BAREIRO', NULL, NULL, 210, 225, 'Asunción', 'Suboficial Ayudante', 'CESAR', 'FERREIRA BARRETO', NULL, NULL, 'E9209BA26', NULL, 'completada', '2026-01-22T15:51:36.462Z', NULL, NULL),
(451, 377, '2026-01-26T00:00:00.000Z', '11:44', '2026-01-25T00:00:00.000Z', '12:50', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Manifiesta la recurrente que en la fecha y hora mencionada mas arriba, se encontraba en su domicilio de la ciudad de San Bernardino, momento en que recibe un mensaje de texto via WhatsApp por parte de su amiga, la señora Victoria Fleitas, y le manifiesta que habia visualizado en la red social Facebook una publicación de un perfil denominado ANAHI E. DROZDOVA MCCRAVEN, en cuya publicacion puso la imagen y nombre de la recurrente diciendo que la misma queria estafarle utilizando el abonado Nº +15486662846, según refiere la recurrente la misma a través de su amiga Victoria pudo contactarse con la señora Anahí, lo cual le manifiesta que se utilizo su imagen con el fin de realizar hechos delictivos, razón por la cual la misma se apersona a formular su denuncia ya que presume que fue usurpada su identidad y niega rotundamente el hecho mencionado. ', 'CIUDAD DE ASUNCIÓN, BARRIO ITA ENRAMADA, CACIQUE LAMBARE E/ CAPITAN FIGARI', NULL, NULL, 249, 178, 'Asunción', 'Suboficial Segundo', 'ARNALDO ANDRÉS', 'AVALOS RUIZ DÍAZ', NULL, NULL, 'EE4A78A26', NULL, 'completada', '2026-01-26T15:14:39.616Z', NULL, NULL),
(23, 16, '2026-01-05T00:00:00.000Z', '09:04', '2025-12-02T00:00:00.000Z', '13:54', 'HECHO PUNIBLE CONTRA EL PATRIMONIO', NULL, 'Que, se presenta ante esta Dependencia Especializada a fin de formular una denuncia sobre un supuesto hecho ocurrido en fecha 02 de diciembre de 2025, el mismo refiere que en la mencionada fecha se encontraba trabajando en la ciudad de Málaga - España, en ese lapso solicita a un grupo de WhatsApp información sobre alquileres de vehículos, minutos después una persona con abonado 0983096522 le escribe en la mensajería instantánea de WhatsApp identificándose como Richard González, supuesto asesor de ventas de la Empresa "Rent a Car Blue Paraguay, ubicado en la sede aeroportuaria del Aeropuerto Internacional Silvio Pettirossi  de la Ciudad de Asunción, subsiguientemente la persona le facilita los datos de un vehículo de la marca Toyota, modelo Fortuner 2023, N° de Chasis MALAM51BACM5868487, con matrícula N° AAJZ 113 y a la vez le manifiesta que el alquiler de tal rodado correspondería a la suma de guaraníes 4.200.000 y que para poder alquilar se tenia que cumplir con el sesenta porciento del pago, para tal efecto la persona le facilita una cuenta bancaria N° 619383011 con cargo Banco UENO BANK S.A a nombre de Gustavo Ramón MartÍnez Aguilera con C.I N° 6561993, el denunciante pensando que se trataba de una persona honesta, responsable y ecuánime acepta todos los términos y condiciones propuestos por el individuo y en fechas 06/12/2025, 9/12/2025, siendo las 10:09 A.M y 16:22 P.M efectúo dos transferencias a la cuenta bancaria de Gustavo Ramón Martínez Aguilera por el valor total de guaraníes 2.400.000 (dos millones cuatrocientos mil de guaraníes), dicho procedimiento de transferencia lo realizó desde Monty Global Pyments (Empresa Tecnológica en Servicio de envío de dinero internacional) estando en la ciudad de Málaga. En fecha 11/12/2025 la persona le envía una fotografía de un supuesto contrato de arrendamiento entre el señor Eduardo Nicolás Ferreira Giménez con C.I N° 862029 (Arrendador del vehículo en mención) y el denunciante, en tal acto jurídico se observa la celebración de un contrato privado de arrendamiento que se regirá por 7 cláusulas, ulteriormente la persona le indica que una vez arribado al aeropuerto internacional iba a poder retirar el vehículo sin ningún inconveniente, específicamente en fecha 26/12/2025 hasta el 26/02/2026 conforme al supuesto contrato de arrendamiento, seguidamente el señor Richard González le solicita la cancelación total del alquiler para poder finiquitar los detalles del contrato, debido a ciertas anomalías que surgió durante la conversación se percató que las personas detalladas más arriba no pertenecían a la empresa ut supra mencionada y que no existía ningún contrato de arrendamiento, por lo que deduce que fue víctima de un supuesto hecho de estafa, además asevera que en el transcurso de los días acercará hasta el Ministerio Público todos los elementos materiales probatorios que pueda ayudar a conducir a su comprobación y calificación legal.
Se adjunta a la presente denuncia las capturas de pantallas de todas las conversaciones que tuvo con la persona.
', 'DEPARTAMENTO CENTRAL, CIUDAD DE VILLA ELISA, SOBRE LA CALLE GUAVIJÚ 124 BARRIO TRES BOCAS CIUDAD DE VILLA ELISA', NULL, NULL, 16, 168, 'Asunción', 'Suboficial Ayudante', 'MARICELA ', 'PEREIRA GONZÁLEZ', NULL, NULL, '9E962CA26', NULL, 'completada', '2026-01-05T13:50:12.930Z', NULL, NULL),
(26, 17, '2026-01-05T00:00:00.000Z', '11:31', '2026-01-03T00:00:00.000Z', '00:00', 'OTRO', 'AMENAZA Y EXTORSION ', 'La denunciante manifiesta que, hace aproximadamente dos años atrás, en el año 2024 conoció a una persona a través de la aplicación de la red social Facebook, y esta persona de sexo masculino de nombre JOSE GRACIANO, de profesión Medico Cirujano, todos estos datos son proveídos mediante relato de la denunciante; en ese entonces la denunciante y el supuesto JOSE GRACIANO mantuvieron una relacion amorosa y sexual, con la condición de que el supuesto JOSE le ayudaría económicamente, dicho encuentro intimo ocurrió en motel del barrio San Pablo, dicho acto ocurrió con el consentimiento de ambos, pero no así la filmación de dicho acto sexual, donde la denunciante se percata que fue filmada por el supuesto JOSE, luego de varios días este sujeto le envía por medio de un mensaje vía WhatsApp dicho contenido sexual desde el abonado numero 0991335549, la misma al enterarse del video le solicita al señor JOSE que elimine esos videos, el supuesto JOSE no responde dicho mensaje y se llama a silencio por un buen tiempo, transcurrido los años vuelve a aparecer con la misma propuesta de tener relaciones sexuales a cambio de una ayuda económica y dicho mensaje de texto vía mensajería de WhatsApp se da en fecha sábado 03/01/2026 desde el numero 0991335549, los mensajes relacionados a la propuesta de estar con el señor JOSE es negada por la denunciante por lo que el sujeto mencionado anteriormente  la amenaza y la extorsiona con publicar dicho video en las redes sociales y manifestar o hacer publico que la denunciante seria una trabajadora sexual (prostituta), la denunciante manifiesta temer por su vida y niega totalmente toda acusación en su contra que este JOSE pudiera hacer o manifestar.', 'CIUDAD DE ASUNCIÓN, ESTANDO EN SU DOMICILIO', NULL, NULL, 19, 202, 'Asunción', 'Suboficial Ayudante', 'DERLIS THOMAS', 'CONCHA PIRIS', NULL, NULL, '3C0A25A26', NULL, 'completada', '2026-01-05T15:26:18.989Z', NULL, NULL),
(27, 18, '2026-01-05T00:00:00.000Z', '11:44', '2026-01-02T00:00:00.000Z', '20:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que, se presenta ante esta Dependencia Especializada a fin de formular una Denuncia sobre un supuesto hecho ocurrido el día 02/01/2026, el mismo refiere que en la mencionada fecha se encontraba en su domicilo particular, sito sobre la calle Concejal Godoy casi Venezuela, Barrio Espiritu Santo de la Ciudad de San Lorenzo, en ese interin intenta ingresar a su banca web del Banco Familiar percatandose de que el pin de acceso estaba inactivo, atonito por lo observado rapidamente procede a llamar a los funcionarios de dicha entidad a fin de poder obtener una respuesta factible de lo que estaba aconteciendo, siendo atendida por una funcionaria quien le indico para hacercarse el dia 03/01/2026, en tal fecha se apersono hasta la sucursal del Banco Familiar ubicado en el predio de Fuente Shoping de la Ciudad de San Lorenzo, una vez en el lugar fue atendidio por un funcionario quien con toda celeridad le manifiesta sobre la existencia de una denuncia en su contra por el supuesto Hecho Punible de ESTAFA y que a consecuencia de tal hecho se procedio a bloquear su Cuenta Bancaria del Banco Familiar, ademas le explica que el factor detonante de todos los hechos que estaba acaeciendo se debio a que el mismo posee una cuenta Bancaria en Tú Financiera, anonadado por lo escuchado y a la vez indignado por el acto irregular que estaba precenciando, se constituyo el dia de la fecha 05/01/2026 hasta la Casa Central de Tu Financiera, ubicado sobre la calle Teresa Lamas Esq. Capitan Roman, destras mismo del Shoping Multiplaza de la Ciudad de Asunción, en el lugar fue recibido por una funcionaria a quien le explico lo sucedido, la misma le confirma con toda certeza y exactitud que el recurrente posee una cuenta bancaria con la entidad Tú Financiera con Nº de Cuenta 20027268 correspondiente a  una Billetera Mango, aseverandole que en fecha 16/10/2025 se realizó un prestamo de 800.000 guaranies, asi mismo recibio 8 transferencias en cuenta bancaria en cuestion por  el valor total de guaranies 9.200.000(nueve millones doscientos mil guaranies), las cuales fueron   enviadas a otra cuentas desconocidas con fecha de operación 16/10/2025, 05/11/2025, 21/11/2025, 22/12/2025, 23/12/2025 y 29/12/2025, posteriormente la funcionaria le comenta que para la creacion de la cuenta bancaria en mencion se  utilizo la foto de su cedula de identad civil y una fotografia que no le correponde de ninguna forma, tal procedimiento de creacion se concreto a traves de la aplicacion de la Billetera Mango-Tú Financiera. 
Sigue manifestando el afectado que la cuenta de Billetera Mango con Nº de Cuenta 20027268, con alias 0982015452 no fue solicitado por su persona en ningun momenrto determinado por lo que responsabiliza del hecho ilicito a los directivos de Tú Financiera S.A.E.C.A al no corroborar u avisar en tiempo y en forma sobre la supuesta existencia de dicha cuenta y deuda de 800.000 guaranies, por ende, exige a los directivios la dilucidacion inmediata del hecho delictuoso nombrado mas arriba. 
Se adjunta en la presente denuncia copia simple del extracto de cuenta, donde se detalla a por menorizado todas las transacciones interbancarias y prestamo efectuado de forma irregular y desconocida.     ', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, SOBRE LA CALLE CONCEJAL GODOY CASI VENEZUELA, BARRIO ESPIRITU SANTO DE LA CIUDAD DE SAN LORENZO A TRES CUADRAS DEL SUPERMERCADO STOCK', NULL, NULL, 20, 203, 'Asunción', 'Suboficial Ayudante', 'PEDRO LUIS', 'MARTINEZ VEGA', NULL, NULL, '59EED1A26', NULL, 'completada', '2026-01-05T16:08:58.323Z', NULL, NULL),
(28, 19, '2026-01-05T00:00:00.000Z', '12:32', '2026-01-03T00:00:00.000Z', '08:30', 'OTRO', 'ESTAFA', 'El mismo manifiesta que, queriendo adquirir un electrodoméstico ( ventilador de techo), se puso a buscar en redes sociales específicamente en la red social de Facebook, donde visualiza en una pagina con el nombre de TODO HOGAR con enlace https://www.facebook.com/share/17patYwjEX/,  y se ponen en contacto para poder concretar dicha compra y venta del ventilador de techo, el sujeto se identifica como EDGAR RIVEROS asesor de ventas de la empresa TODO HOGAR, facilitando su número de celular 0985225011 y cuenta Bancaria de la entidad de BANCO ATLAS ALIAS: CI 6777798 NUMERO DE CUENTA: 1755902 del BANCO ATLAS, el denunciante procede a realizar dicha transferencia a la cuenta mencionada por el valor de 350.000 gs (trescientos cincuenta mil guaraníes) luego de dicha transferencia, acordaron que para la entrega del producto se estaría comunicando con el denunciante un supuesto delivery desde el abonado numero 0991649406, el delivery le indica que el costo del servicio alcanza la suma de gs 50.000( cincuenta mil guaraníes), donde le denunciante procede a realizar un giros Tigo al numero 0985870475 proveído por el supuesto delivery, luego el supuesto delivery se pone en contacto vía llamada telefónica con el afectado y le manifiesta que fue detenido por la patrulla caminera y que para poder ser liberado le solicitan la suma de 100.000 gs (cien mil guaraníes), a lo que el denunciante le manifiesta que solo tiene la suma de 42.000 gs(cuarenta y dos mil guaraníes), donde el supuesto delivery acepta de igual manera esa suma y el denunciante procede nuevamente al enviar vía giros Tigo  al numero 0985870475, posterior al envió el numero del supuesto delivery ya no responde por lo que el denunciante se percata de que fue victima de una estafa ya que hasta la fecha no le fue entregado ningún electrométrico y tampoco obtiene respuesta alguna sobre todo lo acordado. ', 'DEPARTAMENTO CENTRAL, CIUDAD DE AREGUÁ, ESTANDO EN SU DOMICILIO', NULL, NULL, 21, 202, 'Asunción', 'Suboficial Ayudante', 'DERLIS THOMAS', 'CONCHA PIRIS', NULL, NULL, '376FB3A26', NULL, 'completada', '2026-01-05T16:28:54.230Z', NULL, NULL),
(29, 20, '2026-01-05T00:00:00.000Z', '14:32', '2025-05-01T00:00:00.000Z', '00:00', 'HECHO PUNIBLE CONTRA EL ÁMBITO DE VIDA Y LA INTIMIDAD DE LA PERSONA', NULL, 'Que se presenta a esta dependencia policial a fin de realizar una denuncia sobre el hecho punible mas detallado arriba y relata cuanto sigue que aproximandamente desde el mes de mayo recibe mensajes en sus redes sociales de perfiles desconocidos los cuales de forma ostil invita a salir a la recurrente de lo contrario publicaria fotos intimas que desde el perfil hacen entender que son de la recurrente, asi tambien este tipo de propuesta se repitieron en varias ocasiones en distintas redes sociales y perfiles, cuyos enlaces desconoce en su mayoria y detalla uno de los perfiles los cuales repitio la misma conducta en los dias recientes, https://www.facebook.com/share/1BAj2zN1xY/ . La misma sospecha de una persona con la cual tuvo un relacionamiento en los meses anteriores a que comience a recibir estos mensajes, cuya identidad la misma prefiere no describir, tambien manifiesta que cuenta con capturas de pantallas de los mensajes recibidos, por lo que viene a poner a conocimiento para los fines que hubiere lugar. ', 'DEPARTAMENTO CENTRAL, CIUDAD DE ÑEMBY', NULL, NULL, 22, 204, 'Asunción', 'Suboficial Ayudante', 'DANNA ARAMI', 'RODRIGUEZ FERNÁNDEZ', NULL, NULL, '1D2865A26', NULL, 'completada', '2026-01-05T18:14:37.006Z', NULL, NULL),
(30, 21, '2026-01-05T00:00:00.000Z', '15:23', '2025-11-28T00:00:00.000Z', '10:56', 'OTRO', 'TRANSACCION ERRÓNEA ', 'EL DIA Y LA FECHA INDICADA MAS ARRIBA EL MISMO REALIZO UNA TRANSFERENCIA A LA CUENTA Nº 619177937, TITULAR ADRIAN GUSTAVO BARRETO BURGOS, A CARGO DE UENO BANK, EL MONTO DE 500.000 GS (QUINIENTOS MIL GUARANIES), ACTO SEGUIDO SE PONE EN CONTACTO CON LA ENTIDAD FINANCIERA PARA INFORMAR LO ACONTECIDO, DESDE ESA ENTIDAD  LE MANIFIESTAN QUE SE PONDRIAN EN CONTACTO CON EL TITULAR DE LA CUENTA DE DESTINO Y LE SOLICITAN AL RECURRENTE UN MES DE TIEMPO A FIN DE TRATAR DE REGULARIZAR LA DEVOLUCION, PERO HASTA EL DIA DE LA FECHA NO LE HAN DADO RETORNO, POR LO QUE SE PRESENTA A ESTA DEPENDENCIA POLICIAL PARA LOS FIBNES QUE DIERE LUGAR.', 'CIUDAD DE ASUNCIÓN', NULL, NULL, 23, 204, 'Asunción', 'Suboficial Ayudante', 'DANNA ARAMI', 'RODRIGUEZ FERNÁNDEZ', NULL, NULL, 'AAC23CA26', NULL, 'completada', '2026-01-05T18:37:31.153Z', NULL, NULL),
