(33, 24, '2026-01-05T00:00:00.000Z', '14:48', '2026-01-05T00:00:00.000Z', '13:30', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que, se presenta ante esta Dependencia Especializada a fin de formular una Denuncia sobre un supuesto hecho ocurrido el día 05/01/2026, la misma refiere que en la mencionada fecha se encontraba  en la UNIDA (UNIVERSIDAD DE LA INTERGRACION DE LAS AMERICAS), sito sobre la calle Venezuela casi Nicasio Insaurralde de la Ciudad de Asunción, en ese ínterin recibió una llamada telefónica de parte de una persona con abonado N° 0994507371, identificándose como un supuesto funcionario del banco Itaú y a la vez mencionándole que tiene una tarjeta de Crédito  que supuestamente la misma había solicitado a través de la app de Itaú, estupefacta por lo escuchado la afectada le responde con toda celeridad que en ningún momento solicito dicha tarjeta y que por ende desconoce el trasfondo de la llamada, por tal razón le solicita la anulación definitiva de dicha tarjeta indicándole que ella misma se iba a poner en contacto con su oficial de cuenta para poder analizar y dilucidar tal acontecimiento irregular, minutos después una persona con abonado N° +18607994903 procedió a llamarle de forma constante y debido a la rareza de la llamada decidió omitirlo y por consiguiente a bloquearle, segundos después la recurrente intenta ingresar a su cuenta de WhatsApp constatando de que la misma fue vulnerada totalmente por personas desconocidas, inescrupulosas y nefastas, motivo por el cual se apersona ante esta Sede Policial para dejar asentado sus manifestaciones pertinentes deslindándose de toda responsabilidad civil y penal que le pueda acarrear tal situación ilícita, recalcando que una vez que  se apoderaron de su cuenta de WhatsApp empezaron a solicitar a todos sus contactos transferencias de dinero en nombre de la misma.
Sigue relatando que teme que se pueda utilizar sus datos personales y confidenciales para la perpetración de hechos delictuosos relativo a la Estafa.

', 'CIUDAD DE ASUNCIÓN, EN LA UNIVERSIDAD UNIDA (UNIVERSIDAD DE LA INTERGRACION DE LAS AMERICAS), UBICADO SOBRE LA CALLE VENEZUELA CASI NICASIO INSAURRALDE DE LA CIUDAD DE ASUNCION, EN FRENTE MISMO DEL INERAN', NULL, NULL, 26, 203, 'Asunción', 'Suboficial Ayudante', 'PEDRO LUIS', 'MARTINEZ VEGA', NULL, NULL, '105846A26', NULL, 'completada', '2026-01-05T19:05:01.172Z', NULL, NULL),
(34, 25, '2026-01-05T00:00:00.000Z', '16:24', '2026-01-02T00:00:00.000Z', '11:44', 'OTRO', '', 'La misma manifiesta que, es cliente de la entidad bancaria Banco Continental con cuenta Nº 010013958806, y en fecha 02/01/2026 siendo las 11:44 hs A.M, la denunciante queriendo realizar un pago por servicio de un credito a la entidad bancaria de TU FINANCIERA S.A, realiza una transferencia por el valor de guaranies 1.132.196 GS (un millon ciento treinta y dos mil ciento noventa y seis mil guaranies), al realizar dicha transferencia la misma se percata que envìo el dinero erròneamente a otra cuenta bancaria y se percata de dicho error involuntario, la suma de guaranies mencionada anteriormente que fuera enviada erròneamente fue a parar a la cuenta del Señor HEBER MARCIAL ARIAS ROMERO CON C.I Nº 4.426.604 con cuenta Nº 21184367 cargo banco TU FINANCIERA S.A., la misma realiza la denuncia para los fines que hubiere lugar.

 ', 'CIUDAD DE ASUNCIÓN, ESTANDO EN SU DOMICILIO', NULL, NULL, 27, 204, 'Asunción', 'Suboficial Ayudante', 'DANNA ARAMI', 'RODRIGUEZ FERNÁNDEZ', NULL, NULL, 'FA5A16A26', NULL, 'completada', '2026-01-05T19:55:52.142Z', NULL, NULL),
(35, 26, '2026-01-05T00:00:00.000Z', '17:49', '2025-12-31T00:00:00.000Z', '13:56', 'OTRO', '', 'El mismo manifiesta que en fecha 31/12/2025 recibe un mensaje vía WhatsApp desde el celular N° 0981 246 690, que seria el numero de su padre el señor VICTOR GONZA ALEZ, en dichos mensajes vía WhatsApp le solicita dinero ya que estaría necesitando y el denunciante quien es su hijo no duda en realizar la transferencia a pedido de su padre, dicha transferencia fue realizada a la cuenta N° 81-6855145, A cargo del Banco Familiar ( CUENTA EKO), a nombre de MARIA ASUNCION ENCISO FERNANDEZ, N° de comprobante 79354938, por el valor de 350.000 GS ( trecientos cincuenta mil guaraníes), posteriormente tras realizar el primer envió minutos después le vuelve a solicitar la misma cantidad a la misma cuenta, totalizando así la suma de 700.000 GS (Setecientos mil guaraníes), comprobante N° de la segunda transferencia 79352164, sigue manifestando el recurrente que dicho pedido de dinero por parte de quien seria su padre no le fue extraño, en horas de la tarde el denunciante se percata que su padre habría sufrido una vulneración en su cuenta de mensajería instantánea WhatsApp ya que visualiza el estado de su padre que da aviso que desde su cuenta de WhatsApp se estaba pidiendo dinero ya que fue victima de un hackeo, por todo lo acontecido el mismo viene a poner a conocimiento de la autoridad competente', 'DEPARTAMENTO CENTRAL, CIUDAD DE LAMBARÉ, PUERTO PABLA ', NULL, NULL, 28, 204, 'Asunción', 'Suboficial Ayudante', 'DANNA ARAMI', 'RODRIGUEZ FERNÁNDEZ', NULL, NULL, '704CF3A26', NULL, 'completada', '2026-01-05T21:14:15.415Z', NULL, NULL),
(22, 15, '2026-01-05T00:00:00.000Z', '09:08', '2025-06-02T00:00:00.000Z', '16:47', 'HECHO PUNIBLE A DETERMINAR', NULL, 'El dia y la fecha mencionada mas arriba la denunciante manifiesta haber hecho dos transferencias de forma erronea a la cuenta Nº 800001648 Titular Gino Paolo Cagnoli Rusconi a cargo del Banco ITAU monto 2.000.000 y 490.000 respectivamente seguidamente se puso en comunicacion con su Banco para informar lo acontecido, pero no le fue proporcionado ningun dato a fin de contactarse con la persona y hasta el dia de la fecha no recibio retorno por las opeciones realizadas por lo que se presenta a esta dependecia policial a realizar su denuncia para los fines correspondiente.', 'DEPARTAMENTO CENTRAL', NULL, NULL, 15, 190, 'Asunción', 'Suboficial Ayudante', 'MATIAS SEBASTIAN', 'SOSA ALVAREZ', NULL, NULL, 'EE71C2A26', NULL, 'completada', '2026-01-05T12:24:19.600Z', NULL, NULL),
(40, 33, '2026-01-05T00:00:00.000Z', '23:50', '2025-12-24T00:00:00.000Z', '13:47', 'OTRO', '', 'El denunciante manifiesta, que estando en su lugar de trabajo iba a realizar una compra de un aparato celular de un amigo por la suma de 9.960.000 gs( nueve millones novecientos sesenta mil guaraníes), al momento de hacer dicha transferencia, atiende a un cliente y por equivocación trasfiere a otra cuenta dicha suma, la cuenta beneficiaria seria de la entidad del Banco Ueno con numero de cuenta: 6192091340 con numero de comprobante: 7194579, el denunciante también menciona que acudió al banco inmediatamente al percatarse de la equivocación, recibiendo respuestas del mencionado banco que bloquearían la cuenta del beneficiario y que tratarían de contactarlo, pasado 12 días, el banco se pone en contacto con la victima nuevamente, a los efecto de informar de que no pudieron contactarse con el beneficiario de manera exitosa y recomendaron que proceda a hacer una denuncia formal y que pase a judicializar el caso', 'DEPARTAMENTO CENTRAL, CIUDAD DE FERNANDO DE LA MORA, EN EL TRABAJO', NULL, NULL, 17, 202, 'Asunción', 'Suboficial Ayudante', 'DERLIS THOMAS', 'CONCHA PIRIS', NULL, NULL, '3A2EF3A26', NULL, 'completada', '2026-01-06T03:19:12.493Z', NULL, NULL),
(41, 35, '2026-01-06T00:00:00.000Z', '10:41', '2026-01-03T00:00:00.000Z', '14:03', 'Violación de la intimidad', NULL, 'Que, en fecha y hora indicada, la denunciante recibe mensajes en su cuenta de Instagram, de parte de dos usuarios, uno denominado "riveros292", (https://www.instagram.com/riveros292) y otro denominado "ericksama93" (https://www.instagram.com/ericksama93); ambos usuarios informaron a la recurrente que existen dos paginas webs en el que se visualizan imágenes de la denunciante en los que aparece en traje de baño o hasta inclusive desnuda. Que, procede a verificar la situación y confirma la existencia de dos foros webs que exhiben los contenidos descriptos anteriormente: 1- https://www.hispasexy.org/py/res/148158.html y 2- https://archivohot.com/py/res/148158.html. Que, en ambas páginas se visualizan publicaciones que promociona la difusión de imágenes eróticas y los usuarios realizan comentarios sobre dicho contenido. Así mismo, la denunciante toma conocimiento sobre la existencia de un grupo o un canal privado de la plataforma Telegram, cuya URL sería https://t.me/c/1526894144/175463, en el que participan varios usuarios e intercambian imágenes de similar característica. Que, en el grupo se accede mediante una solicitud y que los requisitos para integrarlo es que se comparta imágenes eróticas de mujeres paraguayas y de acuerdo a las versiones de las personas que informaron de eso, el posible creador de del canal de telegram sería un usuario denominado @joseafleitasagmailcom (https://t.me/joseafleitasagmailcom). Manifiesta por último la denunciante que, desconoce totalmente las circunstancias por las cuales pudieron haber obtenido y difundido las imágenes en las que aparece desnuda; que, esta situación genera un gran impacto negativo en la salud emocional de la recurrente y en su entorno familiar y teme por las repercusiones que esto pueda generar para su entorno profesional y su imagen pública.', 'CIUDAD DE ASUNCIÓN, AVDA KUBITSCHEK CASI HERMINIO GIMENEZ, EDIFICIO TRIANGULO 926', NULL, NULL, 18, 8, 'Asunción', 'Oficial Inspector', 'DAVID RICARDO', 'ROLDÁN ECHEVERRÍA', NULL, NULL, '675199A26', NULL, 'completada', '2026-01-06T14:37:04.898Z', NULL, NULL),
(42, 36, '2026-01-06T00:00:00.000Z', '10:44', '2025-12-25T00:00:00.000Z', '17:30', 'Estafa mediante sistemas informáticos', NULL, 'Manifiesta el denunciante que el mismo es funcionario publico y que en sus días libres se dedica a la venta  de productos varios, en el mes de noviembre el mismo se acerca en la farmacia (del cual no recuerda la ubicación exacta) en ese lugar  ofrece su producto y logra la venta de un auricular de color blanco (cuyos mas datos desconoce), por el monto de 40.000gs (cuarenta mil guaraníes), al señor ALEX, con abonado N°0972260086, quien le debía pagar el monto acordado  a los 8 días después de la compra a través de transferencia; en fecha 01/01/2026 recibe un  mensaje del señor ALEX, quien le solicita la foto de su tarjeta y los 4 últimos dígitos de la tarjeta, minutos después esta persona le envía el comprobante de la transferencia de 40.000gs, ese mismo día el denunciante se acerca aun cajero para retirar el monto requerido de 1.548.000gs, percatándose en ese momento que ya no contaba con esa cantidad de dinero y  solo encontró el monto de 500.000gs. en fecha 02/01/2026 se a persona hasta la sucursal del BANCO GNB, ubicado en la ciudad de Mariano Roque Alonso , donde le entregan su extracto y se percata de que se extrajo la suma total de 900.000gs ,en fecha 01/12/2025 Ext. Atm ATLAS-ATM; desconociendo totalmente dicha extracción    ', 'CIUDAD DE ASUNCIÓN', NULL, NULL, 29, 213, 'Asunción', 'Suboficial Ayudante', 'GUSTAVO ESEQUIEL', 'BAREIRO FERREIRA', NULL, NULL, '08D0ABA26', NULL, 'completada', '2026-01-06T15:02:39.551Z', '2025-01-01T00:00:00.000Z', '18:42'),
(62, 55, '2026-01-07T00:00:00.000Z', '13:36', '2025-12-12T00:00:00.000Z', '16:00', 'EXTRAVÍO DE OBJETOS Y/O DOCUMENTOS', NULL, 'MANIFIESTA LA RECURRRENTE QUE SE ENCONTRABA EN SU LUGAR DE TRABAJO HOTEL GUARANI (EN SU OFICINA),  EN LA HORA Y FECHA MENCIONADO MAS ARRIBA Y SE PERCATO DEL EXTRAVIO DE UNA HOJA DE CHEQUE EN CONCEPTO DE PAGO DE FACTURA  CON N° 4523581, CUENTA CORRIENTE N°00080948-3, CON NOMBRE DEL TITULAR DE LA CUENTA SANATRIO MIGONE BATTILANA  S.A, A LA ORDEN DE LA GLORIA HOTELERIA S.A CON MONTO DE 1.823.280.( UN MILLON OCHOCIENTOS VEINTITRES MIL DOCIENTOS OCHENTA GS.)MENCIONA QUE  NO RECUERDA FECHA DE PAGO Y QUE ES EXPEDIDO DE LA ENTIDAD CARGO BANCO ITAU, FIRMADO POR EL  TITULAR DE LA EMPRESA MENCIONADA.   ', 'CIUDAD DE ASUNCIÓN, GRAL DIAZ Y INDEPENDENCIA NACIONAL, NUESTRA SEÑORA DE LA ASUNCION ', NULL, NULL, 44, 226, 'Asunción', 'Suboficial Segundo', 'LIZANDRY CAMILA', 'PANIAGUA BERNAL', NULL, NULL, 'BAAD19A26', NULL, 'completada', '2026-01-07T17:15:10.137Z', NULL, NULL),
(112, 104, '2026-01-08T00:00:00.000Z', '13:32', '2026-01-08T00:00:00.000Z', '09:30', 'OTRO', 'SUPUESTO HECHO DE ACCESO NO AUTORIZADO', 'QUE, POR LA PRESENTE MANIFIESTA QUE FUE VICTIMA DE UN SUPUESTO HECHO DE ACCESO NO AUTORIZADO, OCURRIDO EN FECHA Y HORA EN MENCION MÁS ARRIBA Y RELAA QUE RECIBIÓ UNA LLAMADA TELEFÓNICA DE UN NUMERO CUYO DATOS DESCONOCE HACIENDOSE PASAR POR FUNCIONARIO DE LA EMPRESA TELEFÓNICA TIGO QUIEN LE MANIFIESTA QUE SUPUESTAMENTE LA LINEA SE ENCONTRABA DESACTUALIZADA Y QUE NECESITABA SER ACTUALIZADA. SEGUIDAMENTE AGREGA TAMBIEN QUE RECIBIO COMO MENSAJE DE TEXTO VARIOS MENSAJES DE SOLICITUD DE ACCESO, POSTERIORMENTE YA NO PUDO ACCEDERE A SU PLATAFORMA WHATSAPP, AGREGA QUE LUEGO DE LO OCURRIDO SUS CONTACTOS EMPEZARON A RECIBIR MENSAJE DE PEDIDO DE DINERO HACIENDOSE PASAR POR EL CIUDADANO, MANIFIESTANDO QUE EL NO REALIZÓ TAL HECHO. ', 'CIUDAD DE ASUNCIÓN, EN SU DOMICILIO ', NULL, NULL, 61, 159, 'Asunción', 'Oficial Segundo', 'NICOLAS', 'ESCOBAR GARCÍA', NULL, NULL, '6C2815A26', NULL, 'completada', '2026-01-08T16:50:26.329Z', NULL, NULL),
