(43, 37, '2026-01-06T00:00:00.000Z', '11:05', '2026-01-05T00:00:00.000Z', '08:33', 'Estafa mediante sistemas informáticos', NULL, 'Manifiesta la denunciante que en fecha cinco de enero del año dos mil veintiseis, la misma sufrio de un robo agravado de su aparato celular posterior se dirigio a la comisaria 16 Central para realizar la denuncia correspondiente; en fecha seis de enero del dos mil veintiseis la misma  ingresa a su correo electronico en otro aparato celular percatandose que se realizaron movimientos desde su cuenta bancaria los cuales ella desconoce por el monto total de 1.000.000 GS. (un millon de guaranies); las mismas se detallan como siguen:
- Monto de 200.000 Gs., Entidad beneficiaria: BANCO  ITAU, Titular de la Cuenta: JOSE SANTANDER DAVID BOBADILLA, Nro. de Cuenta beneficiario:0000000320508190, en Fecha: 05/01/2026, siendo las 08:37 horas con Nro. de operacion: 136615269
-Monto de 800.000 Gs., Entidad beneficiaria: BANCO  ITAU, Titular de la Cuenta: JOSE SANTANDER DAVID BOBADILLA, Nro. de Cuenta beneficiario:0000000320508190, en fecha 05/01/2026 siendo las 08:33 horas con Nro. de operacion: 136614070
