(44, 38, '2026-01-06T00:00:00.000Z', '12:35', '2026-01-05T00:00:00.000Z', '06:30', 'Estafa mediante sistemas informáticos', NULL, 'La denunciante manifiesta que, en fecha 05 de enero de 2026, siendo aproximadamente las 06:54 horas, recibió una llamada telefónica proveniente del abonado N.º 0984 659 519, cuyo interlocutor se identificó como funcionario del Banco Familiar. En dicha comunicación, el mismo le consultó si se encontraba realizando compras en línea con su tarjeta de crédito VISA, N.º 4331 8101 0128 5686, a nombre de la recurrente.
Ante ello, la denunciante respondió que no se encontraba realizando ninguna compra, solicitando de manera inmediata el bloqueo de la mencionada tarjeta.
Asimismo, manifiesta que, siendo aproximadamente las 08:00 horas del mismo día, ingresa a su App del BANCO FAMILIAR vinculada a la mencionada tarjeta, percatándose que se habría concretado una compra no autorizada por un monto total de Gs. 680.634 (seiscientos ochenta mil seiscientos treinta y cuatro guaraníes), correspondiente a contenido y servicios para adultos, realizada a las 03:47 horas, manifestando la denunciante que desconoce totalmente la  transacción, por dicha situación  se apersonó hasta la sucursal del Banco Familiar, ubicada sobre la calle Julia Miranda Cueto esquina Saturio Ríos, de la ciudad de San Lorenzo, a fin de realizar el reclamo correspondiente. Por lo que viene a poner a conocimiento de las Autoridades para los fines que hubiere lugar.
