(46, 39, '2026-01-06T00:00:00.000Z', '13:20', '2026-01-02T00:00:00.000Z', '19:04', 'OTRO', 'TRANSACCION NO RECONOCIDA', 'Menciona  el recurrente que es el titular de la tarjeta de debito del banco familiar  con numero de tarjeta 60069116030720987, con cuenta corriente n° 16-3072098 y el dia viernes 02 del corriente año recibio una transferencia de 825.000 gs en concepto de servicio de hosting, y el sábado en horas de la mañana al querer realizar unos pagos a traves de su banca web se percato que le le faltaba las suma de 572.000 gs, dicho faltante es por un pago a casa grutter, el recurrente menciona que en ningun momento realizo algun tipo de compras en ese lugar, y tampoco perdio su tarjeta de debito. por lo que viene a poner a conocimiento de las autoridades competentes para los fines pertinentes.', 'CIUDAD DE ASUNCIÓN, MEXICO 3093 DEL BARRIO OBRERO', NULL, NULL, 32, 216, 'Asunción', 'Oficial Segundo', 'BRUNO AMALIO', 'GIMÉNEZ GONZÁLEZ', NULL, NULL, '402BF4A26', NULL, 'completada', '2026-01-06T16:37:24.180Z', NULL, NULL),
(47, 40, '2026-01-06T00:00:00.000Z', '13:50', '2026-01-06T00:00:00.000Z', '11:30', 'OTRO', 'VULNERACION DE WHATSAPP', 'Menciona la recurrente que tiene un aparato celular de la marca Redmi note 13 y es la titular del numero 0982075894 y en horas de la mañana le empezo a llegar el codigo de verificacion del whatsapp varias veces y en todo momento la denunciante le daba la opcion de "atras" y luego de unos minutos ya no pudo ingresar a su WhatsApp y asi tambien menciona que quiso recuperar nuevamente pero le aparecia que dicho numero de ya estaba vinculado con un aparato celular de marca samsung galaxy A04 por lo que viene a poner a conocimiento de las autoridades competentes para los fines que hubiere lugar', 'LOMA PYTA BARRIO SAN MIGUEL', NULL, NULL, 33, 216, 'Asunción', 'Oficial Segundo', 'BRUNO AMALIO', 'GIMÉNEZ GONZÁLEZ', NULL, NULL, '0EA7ABA26', NULL, 'completada', '2026-01-06T17:09:24.761Z', NULL, NULL),
(48, 41, '2026-01-06T00:00:00.000Z', '14:13', '2026-01-03T00:00:00.000Z', '10:00', 'Extorsión', NULL, 'Menciona el recurrente que en la fecha mencionada mas arriba se encontraba navegando en sus redes sociales específicamente en Facebook y recibió una solicitud de amistad de una supuesta mujer de nombre celeste Abigail Balmaceda el recurrente acepta dicha solicitud, e inmediatamente recibe un mensaje por la aplicación Messenger, donde la supuesta mujer le facilita el numero de teléfono  N° 0981626219 y le dice que quiere entablar una conversación con el , la conversación se traslado al WhatsApp, donde la supuesta mujer  empieza a enviar fotos y videos en paños menores el recurrente al percatarse de que todo esto podría tratarse de un perfil falso hizo caso  omiso a dicho mensaje. El día domingo 04 del corriente mes y año en hora de la mañana le volvió a escribir la supuesta mujer preguntándole el porque no le responde sus mensajes y si podrían encontrarse El denunciante le dijo que si podrían encontrarse que le diga donde y que hora a lo que le responde la mujer que se encontrarían frente al club cerro porteño a las 17:00hs, llegada la hora mencionada el recurrente no apareció en el lugar e  inmediatamente le escribe la mujer preguntandole por que no asistio al lugar y el denunciante le responde de que no pudo quedando la cita para el dia de hoy martes 06 del corriente mes y año a las 10 de la mañana, el ciudadano nelson benitez no volvio a asisitir a la cita pactada para hoy y minutos despues ya recibio un mensaje de esta mujer diciendole que ella es menor de edad y le solicito la suma de 1000.000 de gs para no denunciarle el recurrente le menciona que solo tiene la suma de 300.000 y la mujer le facilito el numero 0986266840 para realizar el giro de dinero, luego de unos minutos le vuelve a escribir esta mujer solicitandole mas dinero a lo que le responde el denunciante que ya no tiene, luego recibe un mensaje de texto por parte del numero de telefono 0994894229 se hizo pasar por la prima del denunciante de nombre lourdes miro y le pasa un screen de una publicacion en facebook donde supuestamente estan escrachando al denunciante y le menciona que solucione con la supuesta menor que pague lo que pida asi para que borre la publicacion, en ese entonces el recurrente se fija bien en el contacto y dicho numero no le pertenece  a su prima solo que estan utilizando su foto por lo que se percata que todo esto podria tratarse de una extorsion, asi tambien menciona que le escribio el numero 0986250487 y se hizo pasar por un supuesto abogado mencionadonle que hay una denuncia en contra del recurrente por acoso en la comisaria 4ta de asuncion, asi tambien en todo momento recibio amenazas por parte de la supuesta menor de edad', 'DOMICILIO', NULL, NULL, 34, 216, 'Asunción', 'Oficial Segundo', 'BRUNO AMALIO', 'GIMÉNEZ GONZÁLEZ', NULL, NULL, 'CAFAAAA26', NULL, 'completada', '2026-01-06T17:55:52.013Z', NULL, NULL),
