(49, 42, '2026-01-06T00:00:00.000Z', '15:21', '2026-01-06T00:00:00.000Z', '13:38', 'Estafa mediante sistemas informáticos', NULL, 'La recurrente manifiesta que, en fecha 05/01/2026, visualizó una publicación en la aplicación Facebook, en el perfil denominado “ELENA” (sin contar con mayores datos de identificación), en la cual se ofrecía a la venta un teléfono celular de la marca iPhone, modelo 15 Pro, con capacidad de 128 GB, color azul, por el monto de Gs. 4.800.000 (cuatro millones ochocientos mil guaraníes).

A raíz de dicha publicación, inició una conversación a través de la mencionada aplicación, la cual posteriormente fue derivada a WhatsApp, manteniendo contacto mediante el número (0981) 421 646, registrado con el nombre “IMPORTADO CELLSHOP PY”. En dicha comunicación, el supuesto vendedor le brindó información sobre las promociones disponibles, llegando ambas partes a un acuerdo de compra-venta del referido aparato.

Posteriormente, el supuesto vendedor solicitó los datos personales de la recurrente para la emisión de la factura, así como la ubicación para realizar el envío del producto, datos que fueron debidamente proporcionados.

La denunciante continúa manifestando que realizó una transferencia como parte del pago, comprometiéndose a completar el monto restante al momento de retirar el aparato. Dicha transferencia se efectuó por la suma de Gs. 3.800.000 (tres millones ochocientos mil guaraníes), a la cuenta bancaria del titular OSCAR LUIS MACHUCA BRIZUELA, Cuenta N.º 81-16603433, del Banco Familiar, en fecha 06/01/2026, siendo aproximadamente las 13:37 horas.

Luego de realizada la transferencia, el supuesto vendedor le manifestó que el producto sería entregado en el transcurso de la tarde del mismo día. Sin embargo, hasta el momento, la recurrente no ha recibido el aparato ni ha obtenido respuesta favorable por parte del mencionado vendedor, percatándose así de que habría sido víctima de una estafa.

Así mismo, refiere que fue bloqueada por dicha persona tanto en la aplicación WhatsApp como en Facebook.
Por lo que viene a poner a conocimiento de las autoridades para los fines que hubiere lugar.', 'CIUDAD DE ASUNCIÓN, SILVIO PETTIROSI CASI MAYOR FLEITAS', NULL, NULL, 35, 213, 'Asunción', 'Suboficial Ayudante', 'GUSTAVO ESEQUIEL', 'BAREIRO FERREIRA', NULL, NULL, 'E1F797A26', NULL, 'completada', '2026-01-06T19:13:43.998Z', NULL, NULL),
(52, 45, '2026-01-06T00:00:00.000Z', '17:29', '2026-01-05T00:00:00.000Z', '10:00', 'Estafa', NULL, 'Que, el mismo se presenta a fin de realizar una denuncia y manifiesta como sigue: el mismo se encontraba navegando en la red social Facebook específicamente en Marquet place en busca de un aire acondicionado en fecha 05/01/2026, cuando el mismo visualiza en un perfil con nombre Araceli Martínez con URL https://www.facebook.com/marketplace/profile/61585470674983/?ref=permalink&mibextid=dXMIcH. un aire acondicionado de su agrado el mismo procede a entablar una conversación con dicho perfil, preguntando precios y modelos de aire, cuando dicho perfil proporciona el abonado numero 0985794384, por lo que el recurrente procede a entablar con dicho numero vía plataforma de mensajería instantánea WhatsApp, dicho numero se identifica como la persona Fernando Olivera asesor de ventas del comercial san José, pasándole así también fotografías del aire acondicionado marca Tokio de 12.000 BTU y el precio de Guaraníes 1.000.000, mencionándole también que deberá hacer un pago del 30% del total para poder apartar dicho aire, pasándole  el n° de cuenta 2009057601 del banco TU FINACIERA de titular Jorge Ariel Arzamendia Seco con C.I. N°5571933, por lo que el recurrente procede a enviar la suma de guaraníes 300.000 al n° de cuenta 2009057601 del banco TU FINACIERA de titular Jorge Ariel Arzamendia Seco con C.I. N°5571933 en fecha 06/01/2026 a las 16:00 hs aproximadamente, tiempo después la persona Fernando Olivera menciona al recurrente que su pedido le estaría llegando en fecha 06/01/2026 en horas de la mañana y que  se estaría comunicando su delivery con el mismo, en fecha 06/01/2026 siendo las 10:00 hs aproximadamente se comunica el delivery con el recurrente desde el abonado numero 0986288049 identificándose como Oscar Emanuel Escurra Benítez pidiéndole su ubicación como también enviándole una factura del aire acondicionado mencionándole que deberá pagar la totalidad del aire para poder entregar dicho aire, menciona el recurrente que iba a pasar al local a retirar el mismo y que pagaría en efectivo a la entrega de dicho aire momento en el cual el mismo fue bloqueado, Por todo lo expuesto viene a poner a conocimiento de la autoridad policial para los fines que hubiere lugar', 'DEPARTAMENTO CENTRAL, CIUDAD DE YPANÉ, SAN PABLO 262 B° VIRGEN DEL CARMEN', NULL, NULL, 36, 210, 'Asunción', 'Suboficial Ayudante', 'FABRIZZIO MIGUEL ANGEL', 'ORREGO ARCE', NULL, NULL, 'A872C2A26', NULL, 'completada', '2026-01-06T21:10:14.413Z', NULL, NULL),
