(54, 47, '2026-01-06T00:00:00.000Z', '20:11', '2025-12-29T00:00:00.000Z', '13:30', 'Estafa mediante sistemas informáticos', NULL, 'Que en fecha y hora mencionada mas arriba contacta con una persona al numero 0975-381-800 quien le ofrecía prestamos supuestamente del Banco SOLAR, y ya que la recurrente necesitaba de dicho préstamo solicito el monto de 5.000.000 GS., momento en que el supuesto agente le solicita dinero para agilizar el tramite, pidiéndole la suma de 450.000 GS. para iniciar el procedimiento a lo que la recurrente accedió y envío dicho monto a la cuenta de TATIANA MONSERRATH MARECOS, CON ALIAS N° 0983-509-760, BANCO SOLAR, posterior la misma le envió el comprobante y este le promete que le ayudaría a conseguir el préstamo ya que la misma tiene baja calificación para un préstamo, momento mas tarde le vuelve a solicitar un monto de dinero por que había otro documento que gestionar lo cual la misma le vuelve a realizar una transferencia a la cuenta FRANCISCO JAVIER LOPEZ TORRES, ALIAS N° 0994-949-274, CON C.I. N° 2.084.593, MONTO 600.000 GS., enviadas todas la transferencias le promete que cuando tenga noticias le avisaría. En fecha 30-12-2025 vuelve a recibir mensaje del mismo numero solicitándole que le envié mas dinero a lo que la recurrente le solicita el dinero que había envido en la transacciones anteriores desde su cuenta  RITA MARTINEZ, C.I. N° 3.629.869, NUMERO DE CUENTA CAJA DE AHORRO 13016125002, BANCO GNB, donde le dice el supuesto asesor que le harían una devolución de su dinero, donde la recurrente envió todos sus datos y nunca recibió la devolución de su dinero, el día de la fecha 06-01-2026 recibe llamada del 0992-119-969 solicitándole que descargue la aplicación del banco SOLAR para recibir la devolución de su dinero de 1.050.000 GS., y la misma realiza los pasos que le indica el supuesto asesor dictándole un correo electrónico lo cual la misma ingreso a su aplicación, momento después se percata que su aplicación ya estaba vinculada a otro dispositivo con cuyos datos no cuenta, seguía la instrucción de la persona llamadora quien posterior le dijo que desinstale la aplicación momento en que la misma ya dudo y elimino la aplicación, lo cual volvió a descargar, ingreso sus datos, cambio la contraseña y ya se encontraba bloqueada su cuenta del banco SOLAR con cuyos mas datos ya no cuenta, percatándose así que estaría siendo victima de un supuesto hecho de estafa.   ', 'DEPARTAMENTO CENTRAL, CIUDAD DE LAMBARÉ, CERRO LAMBARE CASI SAGRADA FAMILIA', NULL, NULL, 38, 223, 'Asunción', 'Suboficial Primero', 'NELLY DE LOS ANGELES', 'GODOY GALEANO', NULL, NULL, '7484A5A26', NULL, 'completada', '2026-01-06T23:50:09.929Z', NULL, NULL),
