(57, 51, '2026-01-07T00:00:00.000Z', '09:22', '2025-12-16T00:00:00.000Z', '09:30', 'OTRO', 'VULNERACION DE DATOS ', 'MANIFIESTA LA RECURRENTE QUE EN FECHA 16 DE DICIEMBRE DEL AÑO  2025, SE APERSONA  EN LA COOPERATIVA MULTIACTIVA MERCADO  N°4 LTDA UBICADO EN LAS CALLES EUSEBIO AYALA N°286 C/GONZALEZ RIOBOO,DE LA CIUDAD DE ASUNCION SUCURSAL N°1 ACOMPAÑADO POR EL SEÑOR ROGELIO NETTO CON C.I.N 1225397 QUIENES FUERON ATENDIDOS POR UNA FUNCIONARIA DE LA COOPERATIVA CUYO NOMBRE NO RECONOCE., PARA RETIRAR EL INTERES DE UN PLAZO FIJO QUE TENIA EN SU CUENTA CORRIENTE N° 69.617 DE DICHA COOPERATIVA, LE MENCIONAN QUE YA NO CUENTA CON EL MONTO QUE HABIA SOLICITADO YA QUE LA MISMA CONTABA CON UN AHORRO DE APROXIMADAMENTE 600.000.000 (SEISCIENTOS MILLONES) DEL  CUAL SOLO TENIA EL SALDO DE  95.000.000 GS (NOVENTA Y CINCO MILLONES ) DE ESE MONTO RETIRO ESE DIA 50.000.000, SEGUIDAMENTE SE RERTIRA Y SE DIRIGE AL BANCO CARGO UENO BANK CON INTENCION DE ABRIR UNA CUENTA NUEVA EN EL LUGAR LE MENCIONAN QUE YA HABIA UNA CUENTA CON SU NOMBRE (DESCONOCIENDO HABER SOLICITADO ESA CUENTA ) SIGUE RELATANDO QUE ESTA CUENTA SE HABRIO PERO SIN NINGUN MOVIMIENTO Y  SIN SU CONSENTIMIENTO SINDICANDO QUE UNA PERSONA DE NOMBRE Y APELLIDO MARIA LINA FLEITAS LOPEZ COINCIDE CON UNA ALLEGADA DE LA FAMILIA DE NOMBRE LINA IBAÑEZ QUIEN SERIA LA SUPUESTA BENEFICIADA DE LA CUENTA., CABE RECALCAR QUE LA MISMA TIENE UNA CUENTA CORRRIENTE  COMPARTIDA N° 67.627 CON SU HIJO DE NOMBRE LUIS ALBERTO MOLINIER ARZAMENDIA CON NUMERO DE CEDULA 1.557.213 EL CUAL FALLECIO EN FECHA 26 DE SEPTIEMBRE DEL 2025 PRESUMIENTO QUE EL MISMO HABIA EXTRAIDO GRANDE CANTIDAD DE DINERO , ADJUNTANDO EL EXTRACTO DE AHORROS DE LA CUENTA N°67.627, EXTRACTO DE AHORRO  DE LA CUENTA  N° 69.617  Y FOTOGRAFIA DE LA SINDICADA SOLICITANDO QUE SE INVESTIGUE Y SE TOMEN LAS MEDIDAS CORRESPONDIENTES ', 'CIUDAD DE ASUNCIÓN, AVDA EUSEBIO AYALA 286 C/GONZALEZ RIOBOO', NULL, NULL, 40, 226, 'Asunción', 'Suboficial Segundo', 'LIZANDRY CAMILA', 'PANIAGUA BERNAL',