(58, 52, '2026-01-07T00:00:00.000Z', '11:38', '2026-01-05T00:00:00.000Z', '19:00', 'OTRO', 'ACCESO INDEBIDO A DATOS ', 'Se presenta ante esta dependencia policial, a fin de realizar denuncia y manifiesta cuando sigue; que en  fecha 05 de enero del corriente año en horas de las tarde recibió una llamada telefónica, cuyo numero no recuerda la recurrente, mencionando que eran del canal Telefuturo y que la misma había ganado un premio de un sorteo realizado por la empresa Tigo consistente en una motocicleta y dinero en efectivo . Sigue mencionando la victima que le solicitaron sus datos personales y que le iban a llegar unos cuantos números por mensajes de texto normal para así poder retirar el sorteo ganado, a lo cual la misma accedió a realizar el pedido facilitando sus datos personales del Banco Nacional de Fomento y Ueno Bank  y unos dígitos de números que le llegaron por mensajes normal en su abonado numero. Seguidamente en horas de la noche se percato que su de aparato celular aparentemente fue hackeado ya que no pudo mas ingresar en su dispositivo. ', 'DEPARTAMENTO CENTRAL, CIUDAD DE ÑEMBY, AVENIDA PARAGUAY / ÑEMBUCU BARRIO CERRITO', NULL, NULL, 41, 217, 'Asunción', 'Suboficial Inspector', 'MARIANO', 'ESPINOLA SACHELARIDI', NULL, NULL, 'E65379A26', NULL, 'completada', '2026-01-07T14:51:59.334Z', NULL, NULL),
(399, 324, '2026-01-22T00:00:00.000Z', '12:58', '2026-12-15T00:00:00.000Z', '11:30', 'Daño con fines de estafa de seguro', NULL, 'Que se presenta ante esta dependencia especializada a finde formular su denuncia sobre un supuesto hecho de INTENTO DE ESTAFA, relata la recurrente que en fecha mencionada mas arriba se encontraba navegando en la red social FACEBOOK en busca de alquiler de casa en donde encuentra una opción que le interesaba y que contacto con el mismo que le facilito en donde contacto con el supuesto dueño de nombre JORGE LEIVA al abonado N°0971283489 en el que empezaron a coordinar el trato referente al alquiler en donde el supuesto dueño le facilita un abonado N°0974991584 de un supuesto escribano con el nombre de JORGE AUGUSTO MILLER DONNA para que pueda hacer todo el tramite del contrato del alquiler y la misma se contacta con el supuesto escribano en el que el mismo le pide algunos requisitos como sus documentos de identidad y demás documentos personales además también que realice un pago por el monto total del alquiler y la garantía que seria el monto total de 7.600.000 guaraníes, en donde le facilito una cuenta N°13309190001 a nombre de FABIO MARCIAL GARCETE LEIVA con C.I N°4.323.833 cargo BANCO GNB  días después la recurrente acudió a una reunión que tenia en el que coincidentemente se encontró con una persona que conocía la dueña real del inmueble y que se estaban haciendo pasar por dueños, momento en el que se percata que estarían tratando de estafarla y hasta el día de la fecha el supuesto escribano le sigue insistiendo para que abone el monto requerido del alquiler, por lo que viene a realizar su denuncia en esta dependencia para los fines que hubiere lugar.', 'CIUDAD DE ASUNCIÓN, BARRIO SAN ROQUE, ANTEQUERA652', NULL, NULL, 211, 225, 'Asunción', 'Suboficial Ayudante', 'CESAR', 'FERREIRA BARRETO', NULL, NULL, 'DEEE4EA26', NULL, 'completada', '2026-01-22T16:37:27.123Z', NULL, NULL),
