(106, 98, '2026-01-07T00:00:00.000Z', '22:33', '2026-01-07T00:00:00.000Z', '14:22', 'Estafa', NULL, 'El mismo manifiesta que, en la fecha y hora anteriormente citadas, visualizó una publicación en la plataforma Marketplace, a través de la red social Facebook, donde un perfil identificado con la URL: https://www.facebook.com/share/16YTHCBRgx/mibextid=wwXIfr, registrado a nombre de “JUAN DÍAZ”, ofrecía a la venta un aire acondicionado portátil por el monto de 700.000 Gs. (setecientos mil guaraníes), lo cual llamó la atención del denunciante. En consecuencia, el denunciante procedió a comunicarse con el supuesto vendedor mediante la aplicación Messenger, y posteriormente continuó la conversación vía WhatsApp, con el abonado N.º 0985900359, número desde el cual se le proporcionó la cuenta bancaria N.º 301017038, con cargo al Banco Solar, registrada a nombre de PEDRO RAMÓN ROJAS BRIZUELA, con C.I. N.º 7.595.230. Acto seguido, el denunciante realizó el pago correspondiente, recibiendo como comprobante una fotografía de una factura a nombre de “CELTA ELECTRODOMÉSTICOS”, con Timbrado N.º 18247925, RUC N.º 5239646-0, y número de celular 0985900359. Posteriormente, el denunciante recibió un mensaje proveniente del abonado N.º 0975936170, cuyo titular manifestó ser el delivery del electrodoméstico, solicitándole la suma de 80.000 Gs. (ochenta mil guaraníes) en concepto de costo de entrega hasta su domicilio, debiendo ser enviado el comprobante de la transferencia al abonado Nº 0987110677, quien era supuestamente el gerente de la empresa, a lo cual el denunciante accede nuevamente. Seguidamente, el supuesto delivery, le realiza una llamada telefónica, identificándose como COMISARIO HUGO CANTERO, amenazándolo con ir a su lugar de trabajo, por comprar articulos robados, y mantener contacto con delincuentes. ', 'DEPARTAMENTO CENTRAL, CIUDAD DE LUQUE, CALLE NIVACLE CASI LAS PERLAS', NULL, NULL, 56, 166, 'Asunción', 'Oficial Ayudante', 'MARÍA SOLEDAD', 'MIRANDA AMARILLA', NULL, NULL, '9D65CBA26', NULL, 'completada', '2026-01-08T02:03:03.506Z', NULL, NULL),
(107, 99, '2026-01-07T00:00:00.000Z', '23:06', '2026-01-07T00:00:00.000Z', '19:36', 'OTRO', 'USURPACION DE DATOS ', 'MANIFIESTA LA RECURRENTE QUE EL DIA DE HOY EN LA HORA MENCIONADA MAS ARRIBA SE ENCONTRABA EN SU DOMICILIO PARTICULAR, CUANDO SU MADRE  RECIBE UNA LLAMADA TELFONICA DEL NUMERO 0992359212 IDENTIFICANDOSE COMO MAURA, PERSONAL ENCARGADA DE LA PIZZERIA DENOMINADO  ¨A LO DE TORETTO PIZZERIA SAJONIA¨, SOLICITANDO SOBRE EL PAGO DE UN SUPUESTO PEDIDO DE COMIDA RAPIDA (PIZZA), POR EL MONTO DE 149.000 (CIENTO CUARENTA Y NUEVE MIL GS) QUE HABIA SOLICITADO SUPUESTAMENTE EN FECHA 25 DE DICIEMBRE DEL 2025 A LAS 20:11 HS COMO ASI TAMBIEN LE ENVIA FOTOS DEL COMPROBANTE DE PAGOS POR EL PEDIDO REALIZADO VIA TRANSFERENCIA DESDE LA CUENTA N° 409607 A NOMBRE DE CABRERA ARCE WENDY RACHEL DE LA COOPERATIVA UNIVERSITARIA, POR EL MONTO DE 107.000 (CIENTO SIETE MIL GS) Y OTRO MONTO DESDE LA MISMA CUENTA DE 42.000 (CUARENTA Y DOS MIL GS )  A LO CUAL MANIFIESTA LA SUPUESTA ENCARGADA  DE LA PIZZERIA QUE NO RECIBIO NINGUNA ACREDITACION DE LA SUPUESTA TRANSFERENCIA  MENCIONADA MAS ARRIBA., SIGUE RELATANDO QUE LA MISMA NO REALIZO NINGUN PEDIDO Y TRANSFERENCIA AL HECHO EN MENCION, CABE RECALCAR QUE EL PEDIDO SE REALIZO A TRAVEZ DEL ABONADO NUMERO 0976911127  POR ESTA RAZON VIENE A PONER A CONOCIMIENTO Y SOLICITA LA INVESTIGACION CORRESPONDIENTE ', 'CIUDAD DE ASUNCIÓN, EUSEBIO LILLO 1761 CASI CAPITAN DIMAS MOTTA', NULL, NULL, 57, 226, 'Asunción', 'Suboficial Segundo', 'LIZANDRY CAMILA', 'PANIAGUA BERNAL', NULL, NULL, '523B70A26', NULL, 'completada', '2026-01-08T03:07:49.766Z', NULL, NULL),
(108, 101, '2026-01-08T00:00:00.000Z', '09:21', '2025-12-30T00:00:00.000Z', '09:20', 'Estafa', NULL, 'Durante este acto se presenta la denunciante en mención y presenta el acta de denuncia N° 3962/2025 de fecha 30/12/2025 formulada en esta Dependencia la cual fue remitida a cargo del Ministerio Publico en sede de la Fiscalía zonal de Mariano R. Alonso en la causa N° 35/26 designándose en la unidad penal N° 3 a cargo de la Agente Fiscal Abog. Gladys Paredes. Así mismo agrega y solicita en esta ampliación de denuncia el traslado de su causa en sede del Ministerio Publico perteneciente al área de Asunción. Por ultimo manifiesta que sindica como supuesto autor del hecho de supuesta estafa al ciudadano DIEGO GONZALEZ, quien estaría implicado con el Sr. JOSE MATHIAS GONZALEZ MAIDANA denunciado en el acta denuncia anterior.', 'CIUDAD DE ASUNCIÓN, SMA. TRINIDAD', NULL, NULL, 58, 159, 'Asunción', 'Oficial Segundo', 'NICOLAS', 'ESCOBAR GARCÍA', NULL, NULL, '3CDEA5A26', NULL, 'completada', '2026-01-08T13:13:43.317Z', NULL, NULL),
