(111, 103, '2026-01-08T00:00:00.000Z', '11:10', '2026-01-08T00:00:00.000Z', '08:30', 'OTRO', '', 'Menciona que mantuvo una conversación con el usuario de la plataforma facebook denominada Magalid, posteriormente facilitó un número de teléfono para continuar la conversación en el abonado Nº 0986.617.553 a través de la plataforma WhatsApp. Continua relatando que la conversación comenzó a subir de tono, momento dado en que la misma solicitó al recurrente un giro de dinero por el monto de Gs. 1.500.000 (un millón quinientos mil) al Nº 0974805914 con el fin de no divulgar una fotografía que el denunciante había enviado al número en mención, utilizando varias excusas con el fin de causar miedo o sosobra. Manifiesta por ultimo  el denunciante que no accedió al pedido de dicha persona procediéndo al bloqueo de esta en todas las plataformas.  ', 'CIUDAD DE ASUNCIÓN, DR. MAZZEI Y DR. MONTERO BARRIO SAJONIA', NULL, NULL, 60, 159, 'Asunción', 'Oficial Segundo', 'NICOLAS', 'ESCOBAR GARCÍA', NULL, NULL, 'A86DC1A26', NULL, 'completada', '2026-01-08T14:31:52.598Z', NULL, NULL),
(113, 105, '2026-01-08T00:00:00.000Z', '14:57', '2026-01-07T00:00:00.000Z', '08:00', 'OTRO', '', 'Manifiesta que, la misma tenia un boleto de ida a Italia el cual le fue obsequiado por su novio, al llegar al aeropuerto internacional Silvio Petirossi funcionarios de la aerolínea AIR EUROPA  le manifestaron que debía adquirir un boleto de regreso, motivo por el cual sin ningún inconveniente accedió y realizo la compra a través de la web, por el monto de Usd 752,80 ( setecientos cincuenta y dos dólares americanos con ochenta centavos). Agrega además que el boleto comprado tenia fecha de regreso el 22/02/2026, pero que por motivos particulares la misma debía de regresar en fecha 14/12/2025 hecho que fue comunicado a la aerolínea mencionada para una modificación de fecha del boleto inicial, por lo que fue informada de que debían de abonar una multa por dicha modificación por el valor de Usd 160 ( dólares americanos) monto que fue abonado por la misma a través de su tarjeta de crédito Master Card N 5358 7401 0251 7552 cuyo ente emisor es la Cooperativa Universitaria. Días después la recurrente se acerca a la sede de la cooperativa a fin de verificar el extracto de su cuenta, donde se percata del monto desconocido por la misma, por el valor de Usd 1578,86 (dólares americanos) de fecha 12/12/2025, coincidentemente con la fecha de cambio de vuelo. Por ultimo manifiesta de que desconoce dicha transacción ya que esta no fue autorizada', 'CIUDAD DE ASUNCIÓN, HOLANDA 1033 Y COLON BARRIO SAJONIA ', NULL, NULL, 62, 159, 'Asunción', 'Oficial Segundo', 'NICOLAS', 'ESCOBAR GARCÍA', NULL, NULL, '856864A26', NULL, 'completada', '2026-01-08T18:30:14.248Z', NULL, NULL),
(114, 106, '2026-01-08T00:00:00.000Z', '15:36', '2025-09-20T00:00:00.000Z', '08:00', 'OTRO', '', 'Manifiesta que realizaron la venta de un inmueble a dicha persona mencionada, pero que dicho inmueble sigue figurando bajo su nombre ( CHRISTIAN TOEWS), sigue manifestando que se dirigió hasta la SENACSA específicamente en la sede de Mcal. Estigarribia, funcionarios de dicha entidad informaron al recurrente que dicho inmueble no fue pasado al SR. FRIEDRICH, acudiendo entonces hasta la Asociación Civil Chortitzer Komite, entidad encargada de realizar dichos tramites. Posteriormente informa que el Sr. Friedrich aparece como arrendatario de este inmueble y el Sr. Christian Toews como propietario, cosa que el recurrente niega rotundamente ya que el vendió dicho este inmueble y posee el contrato de venta.', 'DEPARTAMENTO DE BOQUERÓN, CIUDAD DE LOMA PLATA, AVENIDA CENTRAL N° 926', NULL, NULL, 63, 159, 'Asunción', 'Oficial Segundo', 'NICOLAS', 'ESCOBAR GARCÍA', NULL, NULL, 'CADF7AA26', NULL, 'completada', '2026-01-08T19:21:40.381Z', '2025-09-24T00:00:00.000Z', '21:00'),
(116, 107, '2026-01-08T00:00:00.000Z', '15:05', '2026-01-08T00:00:00.000Z', '13:42', 'OTRO', 'ACCESO INDEBIDO A DATOS ', 'El dia y la fecha mencionada mas arriba, la denunciante manifiesta que recibe una llamada telefonica del abonado Nº 0982 755 806 quien indicó ser funcionario de la empresa de telefonia Tigo, y que en esta ocasión queria ofrecerle un paquete por ser cliente, consistente en un dispositivo celular y un plan por un precio promocional, negandose la misma a adquirir el servicio, el sindicado insiste en que la recurrente facilite un codigo de  seis digitos que le estaria llegando atraves de Whatsapp que serviria como confirmación de registro sobre la llamada realizada, accediendo de esta manera bajo el engaño a otorgar la clave de acceso a su cuenta de whatsapp, registrada al abonado Nº 0981 413 887 y sin darse cuenta perdiendo el acceso total del dominio por un tiempo indeterminado. Posteriormente al trasladarse desde su domicilio hasta su negocio ya no tocó su dispositivo, luego, sin recordar horario, ingresa a su aplicacion de whatsapp y recibe mensajes de contactos suyos comunicando que de su mismo numero recibieron solicitudes de ayuda consistente en pedido de dinero via transferencia a una cuenta bancaria Nº 6192545213, entidad UENO BANK, titular EVELIN TAMARA BOGADO GONZALEZ, con C.I Nº 5613506, Alias 0985 752 395.', 'CIUDAD DE ASUNCIÓN, LUIS MORALES 706', NULL, NULL, 64, 180, 'Asunción', 'Oficial Segundo', 'EMMANUEL', 'FERNÁNDEZ VEGA', NULL, NULL, '053428A26', NULL, 'completada', '2026-01-08T19:34:29.534Z', NULL, NULL),
(117, 108, '2026-01-08T00:00:00.000Z', '16:29', '2026-01-08T00:00:00.000Z', '12:04', 'OTRO', '', 'menciona la recurrente que su madre ROSA ISABEL MONTI DE BARRIOCANAL Con CI N° 296831 recibió un mensaje del abonado numero 0972 743 906 la  cual se hacia pasar por la denunciante, solicitando una transferencia bancaria a la cuenta nro. 0131025104 perteneciente a la entidad bancaria FINANCIERA FIC S.A a nombre de ANDREA SOLEDAD REYES LOPEZ con CI N° 5.114.465 por valor de Guaraníes 7.600.000 (SIETE MILLONES SEISCIENTOS MIL), dicha operación fue solicitada por llamada en presencia de un familiar suyo debido a no poder familiarizarse en la forma de transferencias bancarias, siendo el familiar un tío de la concurrente de nombre PRIMO MONTI, que al percatarse de que podría tratarse de una estafa envía un mensaje atraves de WhatsApp al abonado N°  0981 227 182  perteneciente a la recurrente, Reclamando le el pedido de dinero solicitado a su madre indicando en ese momento que efectivamente no se trataría de la misma persona ', 'CIUDAD DE ASUNCIÓN, EN SU DOMICILIO', NULL, NULL, 65, 159, 'Asunción', 'Oficial Segundo', 'NICOLAS', 'ESCOBAR GARCÍA', NULL, NULL, 'C2B341A26', NULL, 'completada', '2026-01-08T20:08:59.094Z', NULL, NULL),
(123, 114, '2026-01-09T00:00:00.000Z', '08:31', '2026-01-08T00:00:00.000Z', '14:30', 'OTRO', 'SUPUESTO HECHO DE VULNERACIÓN DE CUENTA DE RED SOCIAL', 'La recurrente manifiesta que en la fecha 08/01/2025 siendo las 14:30 hs recibe la llamada del abonado nº +595984257920 en la cual le manifiesta a la presente de que la comunicación se trataria de una encuesta realizada sobre la utilidad de la telefonia claro py, a lo cual le solicita la confirmaciòn de sus datos personales,  la misma accede a lo solicitado y posteriormente se percata de que su aparato telefónico dejo de funcionar con normalidad,ulteriormente una conocida suya se apersona a la misma para confirmar sobre un préstamo que la demandante había solicitado, seguidamente la misma menciona que no solicito lo indicado más arriba. La afectada sigue pronunciando que desconoce plenamente quien o quiénes pudieron acceder a la vulneración de su aparato celular y que no está realizando ninguna solicitud de dinero a persona alguna, la misma aclara que no posee ninguna cuenta activa con ningún ente financiero y/o bancario, sigue manifestando que el dia de la fecha apartir de las 02:49 hs recibe llamadas telefónicas desde los números 0986-915-502,0987-336-375 y +1-272-277-9808 mismo número que la recurrente indica desconocer.', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, CALLE MARIA AUXILIADORA CASI GUYRA CAMPANA', NULL, NULL, 71, 215, 'Asunción', 'Suboficial Ayudante', 'JAIDY YAMILA', 'FERNANDEZ GAMARRA', NULL, NULL, '64299FA26', NULL, 'completada', '2026-01-09T12:32:01.754Z', NULL, NULL),
(416, 342, '2026-01-23T00:00:00.000Z', '10:54', '2026-01-21T00:00:00.000Z', '12:00', 'Estafa', NULL, 'Que, se presenta ante esta Dependencia Especializada a fin de formular una denuncia sobre un supuesto hecho ocurrido el día 21/01/2026, el mismo refiere que en la mencionada fecha se encontraba en su domicilio particular mencionado con antelación, específicamente navegando en la red social de Facebook-Marketplace en ese ínterin visualiza una publicación referente a la venta de ladrillos a un costo muy accesible, tal divulgación fue realizada por una persona con perfil denominado Delsi Ortiz con URL https://www.facebook.com/profile.php?id=61576388253066, subsiguientemente el afectado se contacta con el responsable de la publicación a los efectos de solicitarle la cantidad de 2.000  ladrillos comunes para poder terminar una construcción de muralla que estaba realizando, minutos después una persona con abonado (0985)472-185 le escribe en la mensajería instantánea de WhatsApp identificándose como Rigoberto González y a la vez pasándole el presupuesto total de dicha carga que consistiría en la suma de guaraníes 1.160.000, seguidamente el recurrente acepta todos los términos y condiciones propuesto por el individuo y por consecuente le indica para que puedan acercarle los ladrillos hasta un domicilio particular ubicado sobre la calle Emilio Gabriaguéz de la Ciudad de Capiatá (lugar de trabajo del recurrente). Siendo las 11:50 horas de la fecha 21/01/2026 llego hasta el mencionado lugar 3 personas abordo de un camión de carga  en cuyo interior se encontraba los ladrillos en cuestión, posteriormente proceden a bajar la carga y en ese lapso la persona de nombre Rigoberto González  le vuelve a escribir manifestándole que sus personales ya estaban el lugar y que ya precisaba la transferencia correspondiente, para el efecto la persona le facilita una cuenta bancaria N° 619528336 con cargo Banco Ueno Bank S.A. a nombre de DIANA CAROLINA FERREIRA FIGUEREDO con C.I.N° 6.525.322 con alias N°6.525.322, el denunciante pensando que se trataba del propietario de la carga acepta y procede a realizar la transferencia de guaraníes 1.160.000( un millón ciento sesenta mil guaraníes) a la cuenta de la Sra. DIANA CAROLINA FERREIRA FIGUEREDO, una vez puesto en el lugar los ladrillos supuestamente adquiridos los personales le pidieron el pago pertinente de la carga, asombrado por lo escuchado el afectado le menciona a los personales que ya realizo la transferencia por el monto indicado más arriba, a raíz de lo que estaba aconteciendo el encargado de la carga se contacto con el propietario de la Olería teniendo como menester principal la confirmación de la transferencia, ulteriormente el propietario le explica que no le llego ninguna transferencia por parte del afectado deduciéndole que lo más probable la persona de nombre Rigoberto González actuó como un supuesto intermediario para la compra del material ut supra mencionado teniendo como finalidad principal la concretación de Supuesto Hechos Punibles Contra el Patrimonio-Estafa, de la cual fue victima.
Resalta que para la transferencia utilizo su banca web del Banco UENO BANK S.A. con cuenta N° 14989925, alega también que en el transcurso de los días acercara hasta el Ministerio Público todos los elementos materiales probatorios que pueda ayudar a conducir a su comprobación y calificación legal.', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, BARRIO VIRGEN DE LOS REMEDIOS, EN SU DOMICILIO PARTICULAR, SITO SOBRE LA CALLE LOS TUCANES CASI LOS ARANDANOS, A 6 CUDRAS DE LA PARADA DE OMNIBUS DE LA LINEA 6', NULL, NULL, 228, 181, 'Asunción', 'Suboficial Segundo', 'JOSÉ GERÓNIMO', 'BENÍTEZ BENÍTEZ', NULL, NULL, 'DEA6CAA26', NULL, 'completada', '2026-01-23T15:29:24.111Z', NULL, NULL),
(419, 345, '2026-01-23T00:00:00.000Z', '13:14', '2025-10-17T00:00:00.000Z', '12:20', 'Estafa', NULL, 'Que, se presenta ante esta Dependencia Especializada a fin de formular una denuncia sobre un supuesto hecho ocurrido a partir del día 17 de octubre del 2025, el mismo refiere que en la mencionada fecha se encontraba en su domicilio particular citado con antelación, específicamente navegando en la red social de FACEBOOK - MARKETPLACE momento en que visualiza una publicación referente a la venta de un vehículo de la marca TOYOTA, modelo NOAH de color NEGRO por el valor de guaraníes 38.000.000 millones, dicha viralización fue realizado  por una persona de cuyos mas datos desconoce, seguidamente el afectado se contacta con el responsable de la publicación a través del numero indicado para contacto con abonado N° 0994389964, minutos después fue atendido por una persona quien se identifico como MAYTÉ supuesta vendedora de BENJI MOTOR´S quien le indico acercarse hasta la playa de vehículos con todos los requisitos como ser, cedula de identidad, certificado de ingreso, factura de ande y el monto de guaraníes 3.000.000 millones; en fecha 17 de noviembre del 2025 se apersono hasta la playa BENJI MOTOR´S ubicado sobre la calle Curuzú Ñanduti Avda. Luque c/ Capiatá, Barrio Cañada San Rafael de la Ciudad de Luque a tres cuadras de la Iglesia Curuzú Ñuati, a los efectos de poder tramitar todas las documentaciones concernientes al vehículo detallado mas arriba, una vez en el lugar fue atendido por una persona con nombre MAYTÉ quien le explico los términos y condiciones para adquirir el vehículo que comprendía en carácter de crédito corrido a sola firma por valor mensual de guaraníes 1.000.000 millón, posteriormente la persona le emite una factura N° 0000506 con timbrado N°18269575 perteneciente a BENJI MOTOR´S de ORLANDO ISIDORA BARBOZA a nombre del recurrente por el valor de guaraníes 3.000.000 (tres millones de guaraníes) en concepto de "Gastos administrativos por procesos de créditos para adquisición de vehículo", finalizado con el pago pertinente la Sra. le comenta que dentro del plazo de 48 horas le iban a entregar el rodado detallado debido a que tenían que realizar algunas limpiezas profundas en el habitáculo del vehículo para así poder entregar en optimas condiciones mas la cedula verde del vehículo a nombre del mismo, en fecha 18 de noviembre de 2025 una persona de sexo femenino se acerco hasta el domicilio del recurrente en representación de la ut supra mencionada playa de vehículos, en el lugar procedieron a firmar un contrato privado de garantía para compra de vehículo celebrado entre BENJI MOTOR´S AUTOMOVILES CON RUC N°3.494.403-6, REPRESENTADO POR SR. ORLANDO ISIDORO BENITEZ BARBOZA CON C.I. N° 3.494.403, TEL. 0987253180 (Vendedor) y el afectado (Comprador), en donde se detalla todas las clausulas relativo a la adquisición del vehículo, cumplido los 48 horas de plazo para la entrega de dicho vehículo el denunciante se comunico nuevamente con la persona a fin de exigir la entrega inmediata del rodado o en su defecto el desembolso total del monto entregado, acto que no fue fructuoso debido a que la responsable de la playa le omitían todos los mensajes. A raíz de lo sucedido el denunciante empezó a realizar una pequeña investigación personal referente a la playa de vehículo BENJI MOTOR´S constatando que supuestamente el dueño de tal playa,  SR. ORLANDO ISIDORO BENITEZ BARBOZA con C.I. N° 3.494.403 contaría con frondosos y sinuosos antecedentes penales relacionados a hechos de estafas y robos, así mismo pudo constatar varias denuncias realizadas a través de las distintas redes sociales y medios periodísticos digitales en contra de la playa BENJI MOTOR´S. 
Sigue manifestando que el transcurso de los días acercara hasta el Ministerio Publico todos los elementos materiales probatorios que puede ayudar a conducir a su comprobación y calificación legal.
Se adjunta copia simple del contrato privado celebrado entre el denunciante y Benji Motor´s, y copia simpre del recibo de dinero de fecha 17/11/2025.   ', 'DEPARTAMENTO CENTRAL, CIUDAD DE LUQUE, BARRIO CAÑADA SAN RAFAEL, EN LA PLAYA DE VEHICULOS BENJI MOTOR´S, UBICADO SOBRE LAS CALLE CURUZU ÑANDUTI AVDA. LUQUE C/ CAPIATA BARRIO CAÑADA SAN RAFAEL DE LA CIUDAD DE LUQUE ', NULL, NULL, 231, 181, 'Asunción', 'Suboficial Segundo', 'JOSÉ GERÓNIMO', 'BENÍTEZ BENÍTEZ', NULL, NULL, 'A5A588A26', NULL, 'completada', '2026-01-23T18:31:39.548Z', NULL, NULL),
(118, 109, '2026-01-08T00:00:00.000Z', '16:41', '2026-01-08T00:00:00.000Z', '13:05', 'Estafa', NULL, 'Menciona que realizando búsqueda en la plataforma marketplace de facebook sobre materiales de construcción específicamente cemento, contactó con una persona cuyos datos ya no posee a través de Messenger a quien facilitó su número de teléfono para una mejor comunicación, posteriormente en la plataforma WhatsApp, esta persona se comunicó con el recurrente desde el abonado Nº 0985848148 haciéndose pasar como la persona mencionada mas arriba, acordando la entrega de dicha mercaderia en fecha 08/01/2025 a las 13:00 horas aproximadamente, esta persona solicita al recurrente realizar una transferencia bancaria por el monto total de la mercadería Gs. 11.000.000 ( once millones) a la cuenta Nº 6192202085 perteneciente a la entidad UENO BANK, titular Pablo Fabian Insfran Insfran con Ci. Nº 5867534,especificando que  preferiblemente se haga el pago por ese medio, por ser un monto elevado para resguardar la seguridad de sus empleados e indicando que el personal no podia manejar una suma alta de dinero y que posterior a esta transferencia iba a autorizar la descarga del camión. Seguidamente tras corroborar la presencia de un tractocamion tipo tumba de color azul, de similares características mencionadas por el sindicado procedió directamente a realizar la transferencia desde su cuenta bancaria Nº 6191662981, de la entidad UENO BANK, identificado con el comprobante Nº 1900752 a las 13:05 horas del dia de la fecha; mencionado comprobante fue exhibido al encargado del camión quien en ese momento le confirmó que dicha cuenta no le pertenecía y que probablemente ambos fueron engañados.', 'CIUDAD DE ASUNCIÓN, CALLE PATRICIOS Y COMANDANTE GAMARRA', NULL, NULL, 66, 180, 'Asunción', 'Oficial Segundo', 'EMMANUEL', 'FERNÁNDEZ VEGA', NULL, NULL, '6B1B49A26', NULL, 'completada', '2026-01-08T20:34:45.879Z', NULL, NULL),
(119, 110, '2026-01-08T00:00:00.000Z', '17:12', '2026-01-06T00:00:00.000Z', '09:23', 'OTRO', '', 'menciona el recurrente que en fecha mencionada mas arriba el mismo recibió un mensaje a través de la plataforma Facebook - Marketplace ya que el mismo se dedica a la venta de materiales de construcción. Agrega el recurrente que facilito su numero de contacto para coordinar al usuario denominado J.A CONSTRUCCIONES a fin de concretar el pedido. Refiere que el usuario en mención recibió un mensaje del abonado N° 0985762217 quien consulto el valor de total con el traslado de 200 bolsas de cemento hasta la avenida Artigas, Este le manifiesta que por el monto de 12.200.000 (doce millones doscientos mil). una vez confirmado el envió el recurrente se dirige a la ubicación sugerida por el solicitante, ya en el lugar el recurrente le entrega la boleta de compra de lo solicitado y el señor Miguel quien seria la persona que reseccionaria los productos, autorizo la descarga de las bolsas de cemento, y una vez culminado, el Señor Miguel le manifiesta al denunciante que ya había realizado la transferencia, en donde el recurrente verifica y se percata que no se trata de su cuenta bancaria ya que en ningún momento facilito los datos para la transacción. La cual el recurrente procede a trasladar nuevamente las bolsas a su domicilio ', 'CIUDAD DE ASUNCIÓN, COMANDANTE MANUEL GAMARRA Y PATRICIOS ', NULL, NULL, 67, 159, 'Asunción', 'Oficial Segundo', 'NICOLAS', 'ESCOBAR GARCÍA', NULL, NULL, 'CE73C8A26', NULL, 'completada', '2026-01-08T20:48:31.047Z', '2026-01-08T00:00:00.000Z', '15:09'),
(120, 111, '2026-01-08T00:00:00.000Z', '17:53', '2026-01-08T00:00:00.000Z', '15:30', 'OTRO', '', 'La recurrente manifiesta que en hora y fecha ya mencionada, la misma intento realizar una transferencia bancaria a su pareja en la cuenta corriente N° 619632815 de la entidad UENO Bank correspondiente al titular Rey David Samuel Villalba Ayala con C.I N° 4.018.411 La cual la recurrente manifiesta que realizo una transferencia por equivocación por valor de Guaraníes 1.220.000 (Un millón doscientos veinte mil) a la cuenta corriente N°  619705286 de la entidad UENO Bank correspondiente al titular Rubén Balbuena. por ultimo agregar que solicito la reversión a la cuenta que había realizado la transferencia la cual no recibió respuesta.   ', 'CIUDAD DE ASUNCIÓN, ZONA MERCADO 4', NULL, NULL, 68, 159, 'Asunción', 'Oficial Segundo', 'NICOLAS', 'ESCOBAR GARCÍA', NULL, NULL, '33F6F4A26', NULL, 'completada', '2026-01-08T21:16:06.123Z', NULL, NULL),
(121, 112, '2026-01-08T00:00:00.000Z', '20:37', '2026-01-06T00:00:00.000Z', '05:30', 'OTRO', '', 'Recurre ante esta Dependencia Especializada a fin de denunciar un supuesto hecho, la recurrente menciona que el dia 06 de enero del 2026 a las 05:30 hs aproximadamente realizó una transacción erronea a la cuenta Nº 619175855 de la entidad bancaria UENO BANK a nombre de la titular DEISY MARCELA GIMENEZ ROMERO con CI Nº 3646067 desde la cuenta Nº 619345477 de la entidad bancaria UENO BANK a nombre de la denunciante, la misma menciona que ya realizo su pedido de devolucion a su banco de origen y la misma no recibe respuesta hasta el día de la fecha. Asimismo refiere que acudio a la entidad UENO BANK  a fin de realizar su reclamo correspondiente y estos le indican que no pueden realizar ninguna operación antes de un plazo minimo de 72 horas una vez realizado el pedido de devolución.', 'CIUDAD DE ASUNCIÓN, EN SU DOMICILIO', NULL, NULL, 69, 193, 'Asunción', 'Suboficial Ayudante', 'DAISY NOEMI', 'AGUILAR CABAÑAS', NULL, NULL, '0AB33FA26', NULL, 'completada', '2026-01-09T00:28:42.361Z', NULL, NULL),
(122, 113, '2026-01-09T00:00:00.000Z', '08:17', '2026-01-08T00:00:00.000Z', '14:00', 'Estafa', NULL, 'Que, se presenta ante esta Dependencia Especializada a fin de formular una denuncia sobre un supuesto hecho ocurrido en fecha y hora ya mencionados, el mismo se encontraba en su lugar de trabajo donde el mismo solicita a dicha empresa de materiales de obra de construcción por la aplicación de mensajería Facebook en el apartado Marketplace, donde visualiza una publicación de ventas de ladrillos y poniéndose en contacto con el supuesto vendedor el mismo procede a enviar su numero de teléfono para contactarse para dichas compras de dicha persona  con el alias (0985134690)coordinando la entrega de 2500 ladrillos huecos, 600 ladrillos comunes, siendo el total de estas compras de (2.598.000 mil guaraníes), llegando a su lugar de trabajo se descarga lo mencionado al momento el supuesto vendedor solicita el pago, realizándose así dicha transferencia a Pedro Sebastián Caballero Ruiz perteneciente al (BANCO FAMILIAR) con numero de cuenta (8116423646) con número de comprobante (2208357)con el alias número de celular (0981134690) una vez realizado dicha transacción esta persona de nombre Pedro Sebastián Caballero Ruiz comienza a dar por apagado su celular y bloquear a la victima, en el lugar del hecho el vendedor niega a haber recibido dicha transferencia, por tanto el afectado menciona que una persona desconocida se estuvo haciendo se pasar por la victima para realizar dichas compras utilizando su nombre como referencia para las compras mencionadas con el número de teléfono el cual se estuvo haciendo el pedido de compras a este número (0994809551) el cual manifiesta que desconoce de dicho número a su nombre a efectuarse.', 'CIUDAD DE ASUNCIÓN, ALFREDO SEIFERHELD Y CRUZ DEL DEFENSORES', NULL, NULL, 70, 206, 'Asunción', 'Suboficial Ayudante', 'ARACELI LUJAN', 'FRANCO DELGADILLO', NULL, NULL, '703C96A26', NULL, 'completada', '2026-01-09T12:24:31.892Z', NULL, NULL),
