(126, 117, '2026-01-09T00:00:00.000Z', '10:19', '2025-12-25T00:00:00.000Z', '09:00', 'OTRO', 'FRAUDE ', 'Que se presenta a esta dependencia especializada a formular denuncia de un supuesto hecho de fraude ocurrido en fecha y hora mencionada, manifiesta que el mismo se encontraba vacacionando en Republica federativa del Brasil específicamente en la ciudad de Sao Paulo donde realizo un alquiler a través de su tarjeta de crédito N°4518 6542 0505 FIN LATINA perteneciente a la financiera TOYOTOSHI S.A, un vehículo de marca FIAT STRADA para la movilidad del mismo durante el transcurso de las vacaciones  por la suma de 1.024.000 (un millón veinticuatro mil) monto  que pago conscientemente, una vez terminada las vacaciones vuelve al su residencia en fecha 03/01/2026, posteriormente en fecha 08/01/2026 a horas de la mañana se percata en su extracto habilitado por el banco FIN LATINA  de una operación que el mismo desconoce por completo, a continuación se detalla la operación denunciada,  fecha de proceso 29/12/2025, N° de cupón 957754 detalle COA ONETRAVE.COM.AIR monto  2.589.475 guaraníes  (dos millones quinientos ochenta y nueve mi cuatrocientos setenta y cinco mil), a continuación se adjuntan extracto recibido. ', 'CIUDAD DE ASUNCIÓN', NULL, NULL, 74, 195, 'Asunción', 'Suboficial Ayudante', 'ANGEL GABRIEL', 'CARVALLO FLORENTIN', NULL, NULL, '9104FBA26', NULL, 'completada', '2026-01-09T14:01:49.475Z', '2026-01-08T00:00:00.000Z', '10:00'),
(127, 118, '2026-01-09T00:00:00.000Z', '10:37', '2026-01-06T00:00:00.000Z', '17:17', 'OTRO', 'SUPUESTA ESTAFA', 'La denunciante relata que en fecha y hora ya mencionada mas arriba se encontraba navegando por la red social Facebook, donde vizualiza una publicacion acerca de un automóvil la cual le llama la atencion poniendose en contacto con el vendedor de nombre MARCOS GÓMEZ con URL:https://www.facebook.com/share/1A1ptXDHur/?mibextid=wwXIfr , donde le facilita el abonado número 0982-039-683, cordinando asi el lugar (SAGITARIO MOTOS) donde realizaría la compra de un automóvil de la marca toyota, modelo auris, color negro, una vez en lugar procede a la verificación del rodado como asi tambien a la documentacion correspondiente para la compra, la cual seria una entrega de 2.250.000. con cuotas de 890.000 gs. donde la misma accede a realizar la compra tranfiriendolo la suma de 2.250.000 gs, a la entidad bancaria de Banco Familiar con comprobante nº 710861 a nombre de MARCOS DANIEL BERNAL GÓMEZ, ademas de eso le menciona que el auto seria entregado en el transcurso de la semana, pasado los dias la misma visualiza en las noticias el lugar en donde realizo la compra que se estaria utilizando el mismo modo operandi para la realización de supuestas estafas, además de eso menciona que verbalmente le propusieron intrato favorable de la cual ella accedió, contradictoriamente en el contrato figuraba otros detalles la cual no lo mencionaron (Se adjunta datos, contrato, factura y rescisión de contrato). ', 'DEPARTAMENTO CENTRAL, CIUDAD DE VILLA ELISA, AVENIDA DEFENSORES DEL CHACO ESQUINA VIRGILIO ENCISO', NULL, NULL, 75, 215, 'Asunción', 'Suboficial Ayudante', 'JAIDY YAMILA', 'FERNANDEZ GAMARRA', NULL, NULL, '07268EA26', NULL, 'completada', '2026-01-09T14:18:36.688Z', NULL, NULL),
(128, 119, '2026-01-09T00:00:00.000Z', '11:09', '2026-01-06T00:00:00.000Z', '01:00', 'OTRO', 'EXTRACIONES DESCONOCIDAS NO AUTORIZADAS', 'Que, se presenta a esta Dependencia Especializada a realizar una denuncia sobre un supuesto hecho de vulnerabilidad de cuenta bancaria, la misma se encontraba en su domicilio la cual recibe un mensaje atrás ves de su correo electrónico por parte de del Banco ITAU comunicándole sobre una transacción fallida de una suma de 464.303 mil guaraníes( cuatrocientos sesenta y cuatro mil trescientos tres mil guaraníes), a lo que esto recibe ocho notificaciones de transacciones desconocidas desde su cuenta de banco perteneciente a la entidad de ITAU con N° de cuenta 5421 1690 0903 2338 por las sumas de:
 1- 269.848 gs,  2- 26.885gs , 3- 188873gs, 4- 18.887gs, 5- 330579 gs, 6- 33058 gs, 7- 135565 gs, 8- 13557gs sumando así un total 1.017.352 gs. ( un millón diecisiete mil trescientos cincuenta y dos guaraníes, la misma no haber facilitado a nadie ningún tipo de contraseña o algún tipo de datos que puedan utilizarse para la vulneración de su banca web.', 'CIUDAD DE ASUNCIÓN', NULL, NULL, 76, 206, 'Asunción', 'Suboficial Ayudante', 'ARACELI LUJAN', 'FRANCO DELGADILLO', NULL, NULL, '5CBDD9A26', NULL, 'completada', '2026-01-09T14:43:19.288Z', NULL, NULL),
(129, 120, '2026-01-09T00:00:00.000Z', '11:45', '2026-01-09T00:00:00.000Z', '08:00', 'OTRO', 'SUPUESTO HECHO DE SUPLANTACION DE IDENTIDAD', 'La denunciante menciona que el dia de la fecha se percata que el número de celular de su señor marido de nombre JUAN RAMON PAREDES OBREGON con C.I Nº 2.853.221, celular nº 0992-440-501 fue vulnerado, además de eso se menciona que se estaria utilizando para supuesto hecho de estafa sige relatando que aùn sigue activo realizando pedidos de dinero a parientes y desconocido suyos a nombre de la cuenta EVELIN TAMARA BOGADO GONZALEZ con C.I Nº 5.613.506 entidad bancaria de UENO BANK, Sigue relatando que tambièn es utilizado para GIROS TIGO el numero de celular 0985-523-117. El afectado no pudo asistir por motivo de salud, se encuentra internado en el hospital de "TRAUMAS", DX: Fractura de Perone. La misma se presenta ante esta unidad especializada a poner a conocimiento de lo
acontecido.', 'CIUDAD DE ASUNCIÓN, AVENIDA GENERAL M. SANTOS ESQUINA TEODORO S. MONGELOS', NULL, NULL, 77, 215, 'Asunción', 'Suboficial Ayudante', 'JAIDY YAMILA', 'FERNANDEZ GAMARRA', NULL, NULL, 'ABA166A26', NULL, 'completada', '2026-01-09T15:27:58.347Z', NULL, NULL),
(130, 121, '2026-01-09T00:00:00.000Z', '12:38', '2026-01-09T00:00:00.000Z', '07:00', 'OTRO', 'VULNERAVILIDAD DE WHATSAPP', 'Que se presenta ante esta dirección especializada a fin de formular denuncia de un supuesto hecho de vulnerabilidad de cuenta de WhatsApp, la misma menciona que en fecha 09/01/2026 recibió una llamada telefónica atraves del abonado numero 0987417470 simulando ser funcionario de la empresa telefónica TIGO ofreciéndole nuevas ofertas y regalos que estaba contando su lineal, indicándole que en su WhatsApp recibiría un código que debía de proporcionarle al supuesto funcionario de dicha empresa a lo cual la recurrente recibió y reenvió dicho código momento en el que cobra conciencia de que podrían tratarse de una estafa inmediatamente procedió a cortar la llamada, posteriormente intento acceder a su aplicación de WhatsApp percatándose de que dicha cuenta ya no funcionaba quedando bloqueada, razón por la cual se apersona a esta dirección a poner en conocimiento de que a partir de la fecha ya no posee acceso a dicha cuenta de WhatsApp ', 'DEPARTAMENTO CENTRAL, CIUDAD DE CAPIATÁ', NULL, NULL, 78, 208, 'Asunción', 'Suboficial Ayudante', 'ULISES GABRIEL', 'TORRES ROA', NULL, NULL, '748483A26', NULL, 'completada', '2026-01-09T16:02:08.096Z', NULL, NULL),
(134, 125, '2026-01-09T00:00:00.000Z', '12:32', '2023-06-19T00:00:00.000Z', '07:00', 'OTRO', 'SUPUESTO HECHO DE USURPACIÓN DE IDENTIDAD', 'La denunciante se presenta a esta depencia a formular denuncia sobre el supuesto hecho manifestado, relata la presente que desde la fecha 19/06/2023 tiene inconveniente para poder acceder a su Haber jubilatorio que percibe a través del Instituto de previsión social IPS  en caracter de heredera (viuda) del señor Eusebio López con C.I nº 820439 (fallecido), desde la fecha mencionada la recurrente se apersono ante el mencionado instituto presentando documentaciones donde acredita con su hija de nombre Rocio Consuelo López Orihuela en la cual ambas según su manifiestos figuran como herederas y que desde el mes de julio del 2021 hasta el mes de junio del 2023 la misma no recibió en concepto de pago Haber alguno, los reclamos realizados ante el IPS sobre lo manifestado obtuvo respuesta de que los haberes reclamados fueron retirados mensualmente en el tiempo declarado la cual la misma relata no haber recibido dinero alguno de lo mencionado, sigue manifestando la afectada de que en el mes de  junio aproximadamente del 2023 recibe una tarjeta (Débito Nº 600691 0012957894 4) de la entidad bancaria GNB, consultado en su momento ante el instituto mencionado se le manifestó a la presente de que en el tiempo transcurrido del cobro solicitado  se habría realizado extracciones de los Haberes reclamado con una tarjeta de débito de la cual la misma desconoce plena y totalmente del mismo y que desconoce quién o quiénes  utilizaron de manera inescrupulosa y sin autorización la mencionada tarjeta de cobro la cual los datos del mismo la misma desconoce plenamente, la afectada al realizar las diligencia para obtener las extracciones de movimientos de Divisa solo le manifestaron en forma verbal que los movimientos fueron realizado en el tiempo en la cúal figura en la presenta acta, motivo por el cual se estaría apersonando nuevamente a solicitar el detalle de sus Haberes de forma impreso.', 'DEPARTAMENTO CENTRAL, CIUDAD DE FERNANDO DE LA MORA, AVENIDA 11 DE SEPTIEMBRE  CASI SATURIO RIOS  ', NULL, NULL, 79, 215, 'Asunción', 'Suboficial Ayudante', 'JAIDY YAMILA', 'FERNANDEZ GAMARRA', NULL, NULL, 'F5C24AA26', NULL, 'completada', '2026-01-09T16:38:01.300Z', NULL, NULL),
(135, 126, '2026-01-09T00:00:00.000Z', '13:24', '2026-01-05T00:00:00.000Z', '17:00', 'Estafa', NULL, 'Que, en fecha y hora a ser consignadas, se presenta el denunciante ante esta Dependencia Especializada, a fin de formular denuncia por un supuesto hecho punible de estafa.
Manifiesta que se encontraba en su domicilio cuando, a través de la red social Instagram, mantuvo comunicación con un perfil denominado “Patricia Morales”, quien posteriormente le facilitó su contacto en la aplicación de mensajería Telegram.
Seguidamente, dicha persona le solicitó la suma de Gs. 1.000.000 (un millón de guaraníes), bajo el argumento de que dicho monto era necesario para poder realizar trabajos vía web relacionados con operaciones de trading.
Confiando en lo manifestado, el denunciante procedió a realizar una transferencia bancaria, conforme a las instrucciones recibidas. La persona se identificó como Patricia Nilsa Cristina Morales y proporcionó los siguientes datos para la transacción: cuenta bancaria a nombre de RAMONA IGNACIA PORTILLO BENÍTEZ, correspondiente al Banco Atlas, cuenta de crédito N° 1755390, con cédula de identidad N° 8.557.747.
Posteriormente a la transferencia, la mencionada persona dejó de responder los mensajes, de la red social de Instagram procediendo a bloquear al denunciante no así su cuenta de Telegram sigue estando activo, la cuenta de Instagram utilizada desapareció de la red social, por lo que el denunciante presume haber sido víctima de un hecho de estafa.', 'DEPARTAMENTO CENTRAL, CIUDAD DE FERNANDO DE LA MORA', NULL, NULL, 80, 206, 'Asunción', 'Suboficial Ayudante', 'ARACELI LUJAN', 'FRANCO DELGADILLO', NULL, NULL, 'D335CBA26', NULL, 'completada', '2026-01-09T17:31:08.926Z', NULL, NULL),
