(160, 159, '2026-01-10T00:00:00.000Z', '17:18', '2026-01-10T00:00:00.000Z', '09:59', 'Estafa', NULL, 'Que el día de la fecha y hora mencionada  mas arriba visualiza una publicación en la plataforma de la red social denominada TIK TOK a través de un perfil calzados todo por 50.000 mil guaraníes en donde le proporciona un numero de teléfono abonado al 0987355143 para seguir con la compra de los productos. Una vez en la plataforma de mensajería instantánea WhatsApp la supuesta vendedora le manifiesta a la recurrente que disponía de calzados de la marca NIKE,ADIDAS, replicas perfectas que fueron traídas de Ciudad del Este y que cada Champions tenia un costo de 50.000 mil guaraníes a partir de 4 unidades y que el envió seria gratuito ya que el local se encontraba en la ciudad de ITA. Sigue manifestando la recurrente que una vez completado dicho pedido de 5 calzados alcanzando la totalidad de 250.000 mil guaraníes en donde la supuesta vendedora le proporciona un numero de teléfono abonado al 0987414022 para realizar el pago a través de Giros Tigo Money supuestamente correspondiente a la señora AURORA ALEGRE con ci N 4.620.811 .Sigue manifestando que consulta nuevamente a la supuesta vendedora como realizaría la entrega en donde la misma le manifiesta de manera burlona que "vendría en un avioncito,airbuss360 que era de maduro" por lo que se percata de lo ocurrido que seria una estafa. Por ultimo manifiesta la recurrente que la transferencia fue realizada desde la cuenta de su marido cargo Banco Continental y que la misma realizo captura de pantalla y compartió con los datos del mismo. Por lo que viene a poner a conocimiento de la autoridad policial y para el esclarecimiento del hecho.', 'CIUDAD DE ASUNCIÓN, BARRIO TTE. SILVIO PETTIROSSI, AVDA RODRIGUEZ DE FRANCIA C/ CAPITAN FIGARI 1310', NULL, NULL, 93, 158, 'Asunción', 'Oficial Ayudante', 'FRANCISCO NICOLAS', 'GALEANO BRITEZ', NULL, NULL, 'FBE074A26', NULL, 'completada', '2026-01-10T20:59:35.839Z', NULL, NULL),
(161, 160, '2026-01-10T00:00:00.000Z', '17:58', '2025-10-05T00:00:00.000Z', '15:00', 'Estafa', NULL, 'Que se presenta ante esta dependencia policial a fin de formular una denuncia de un supuesto hecho de Estafa, sigue relatando que en fecha mencionado mas arriba se contacto con un supuesto prestamista al abonado Nº 0972457000 con nombre Christian Caceres y tambien el abonado Nº 0987119048 perteneciente tambien al mencionado, donde le ofrece un credito de 90.000.000gs, de los cuales el recurrente le tendria que dar el 30% del credito, en dias anteriores el denunciante ya habia solicitado un credito por el monto de 4.500.000gs de los cuales le dio el 50% del mencionado monto al supuesto prestamista, en donde el mismo realizo una transaccion a la cuenta Nº 38577558  a nombre del titular Christian Caceres, con C.I Nº 4487339, domiciliado sobre la c/ iturbe 2290 e/ ita piru de referencia de su casa color amarillo, cargo BANCO FAMILIAR, pasando una semana de tiempo el recurrente volvio a solicitar un credito a la entidad financiera CREDITO VERDE, donde el supuesto prestamista le acompaño hasta la mencionada financiera para retirar el credito solicitado por el denunciante donde nuevamente le volvio a dar el 50% de su credito, con la esperanza de que el supuesto prestamista le facilitara un credito mayor que seria de 90.000.000gs, pasado un tiempo se contacto con la hermana del afectado manifestandole que le convensa a su hermano de volver a solicitar otro credito con monto de 5.000.000gs, y que ese mismo monto de dinero le tendria que dar devuelta en su totalidad, para asi hacer trabajar el dinero a traves de un traficante, para poder solventar todas las deudas anteriores del afectado para asi poder continuar con el credito de los 90.000.000gs, que prometio facilitarle al denunciante, pasaron los dias y como que no habia respuesta del supuesto prestamista intento contactar con el , y como no recibio ninguna respuesta del mismo, sospecha que estaria siendo victima de una estafa, por lo que viene a poner a conocimiento de la autoridad policial para los fines que hubiere lugar.', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, BARRIO SAN MIGUEL, MERCADO DE SAN LORENZO ', NULL, NULL, 94, 185, 'Asunción', 'Suboficial Ayudante', 'TIAGO JOSE', 'FRANCO AMARILLAS', NULL, NULL, '9E5519A26', NULL, 'completada', '2026-01-10T21:37:44.764Z', NULL, NULL),
(162, 161, '2026-01-10T00:00:00.000Z', '20:12', '2026-01-10T00:00:00.000Z', '18:05', 'Estafa', NULL, 'Que se presenta ante esta Dependencia Especializada a fin de realizar una denuncia, menciona el recurrente que el día de la fecha en horas de la tarde visualizo una oferta de venta de una motocicleta por valor de 1.500.000 Gs. (un millón quinientos mil guaraníes), publicado atraves de la plataforma Marketplace, con un numero de contacto 0983 769 302 para el interesado, el denunciante decidió contactar al numero mencionado, iniciando así una conversación y posterior negociación para adquirir la motocicleta, acordando que el recurrente debía abonar la suma inicial de 200.000 (doscientos mil guaraníes) para la confección del contrato privado a lo que el mismo accede mediante una transferencia bancaria que realizo a la cuenta n 192181 a nombre de  TAMARA ESTEFANIA PARRA CRISTALDO, cuenta cargo FINLATINA S.A de finanzas, comprobante n 2568070 proporcionado por el supuesto vendedor. Una vez que el denunciante realizo la transferencia el supuesto vendedor le confirmo que ya había recibido la transferencia solicitada, y que en minutos se iba dirigir al lugar acordado para la entrega de la motocicleta; minutos mas tarde vuelve a recibir un mensaje de parte del supuesto vendedor en donde le solicitaba el valor restante de la motocicleta la suma de 1.300.000 guaraníes ( un millón trescientos mil guaraníes), suma solicitada supuestamente para el pago al departamento de Automotores para los tramites correspondientes, como el acuerdo inicial fue que el pago restante se efectuaría al momento de la entrega de la motocicleta, el recurrente se niega a efectuar el pago restante, ya que empieza a sospechar que se trataría de un supuesto hecho de estafa, también relata que recibió varios mensajes del numero 0994 927 004, identificándose como LURDES DURE con registro notarial numero 490 supuesta escribana quien le solicitaba el pago restante de la motocicleta y de no dar cumplimiento amenazo al recurrente que realizaría una denuncia por incumplimiento del contrato, el denunciante también menciona que el mismo no realizo la firma de ningún contrato,  pero que proporciono la fotografía de su cedula de identidad y la dirección de su domicilio particular. Por lo expuesto viene a poner a conocimiento de la autoridad competente para los fines que hubiere lugar.', 'CIUDAD DE ASUNCIÓN, BARRIO VIRGEN DEL HUERTO, LUIS MORALES Y TTE. BENIGNO VILLAMAYOR', NULL, NULL, 95, 167, 'Asunción', 'Suboficial Ayudante', 'FATIMA', 'BERNAL FARIÑA', NULL, NULL, '81B862A26', NULL, 'completada', '2026-01-10T23:56:24.908Z', NULL, NULL),
(163, 162, '2026-01-11T00:00:00.000Z', '14:24', '2026-01-07T00:00:00.000Z', '14:30', 'Estafa', NULL, 'El recurrente manifiesta que estando en su domicilio, recibió un mensaje de texto vía WhatsApp, desde el abonado numero +447529742145, el cual le menciona que le habría llegado un paquete de encomienda a su nombre en el aeropuerto internacional Silvio Pettirossi, y que debía abonar un impuesto de 8.500.000 gs (ocho millones quinientos mil guaraníes),para que sea despachado por la aduana, facilitándole los datos para realizar el pago vía transferencia, cuenta corriente numero 1718244 cargo Banco Atlas a nombre de Marcelo Cáceres con CI: 4046894, el recurrente sigue manifestando que procedió a realizar la trasferencia por Alias utilizando el numero de cedula facilitado, el cual lo derivo a una cuenta de Tu Financiera Numero 26432562 a nombre de Marcelo Alexis Cáceres Cáceres, realizando la transferencia del monto solicitado desde su cuenta Numero 0-12772575 del Banco Familiar. Agrega además que mediante algunas averiguaciones que realizo el denunciante consiguió el abonado numero de  Marcelo Alexis Cáceres Cáceres, que es 0986865892 al cual procedió a ponerse en contacto no logrando obtener respuestas de parte de esa persona incluso siendo bloqueado, motivo por el cual se acerca a realizar la denuncia correspondiente.', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, BARRIO ANAHI, RIO AQUIDABAN', NULL, NULL, 96, 165, 'Asunción', 'Suboficial Segundo', 'CAROLINA NOEMI', 'SARABIA GONZALEZ', NULL, NULL, 'EA2536A26', NULL, 'completada', '2026-01-11T17:52:11.622Z', NULL, NULL),
(164, 163, '2026-01-11T00:00:00.000Z', '23:59', '2026-01-11T00:00:00.000Z', '21:53', 'Extorsión', NULL, 'Que, el compareciente se presenta ante esta Dependencia Especializada, a fin de formular denuncia por un supuesto hecho punible de EXTORSIÓN. Refiere que en fecha 09/01/2026 recibió un mensaje a través de la red social Facebook por parte de la supuesta ciudadana Danna López, quien inició conversación manifestando su interés en conocerlo más.
Que, luego de varios intercambios de mensajes, la mencionada le facilitó su supuesto número telefónico 0983 009765, con el objetivo de continuar la comunicación por medio de la aplicación de mensajería WhatsApp. Una vez iniciada la conversación por dicha plataforma, la supuesta Danna López remitió una imagen de carácter provocativo al afectado, instándolo a que éste le reenviara una fotografía de similar naturaleza, elevando progresivamente el tono de la conversación.
Sigue manifestando que, en fecha 11/01/2026, a las 21:41 horas, un supuesto personal policial de nombre Junior Garayo, quien se habría identificado con el grado de S/O Ayudante, utilizando el número telefónico 0972 170160, se comunicó vía WhatsApp con la víctima, advirtiéndole que la supuesta Danna López habría publicado en la red social Facebook capturas de pantalla de la conversación y fotografías, exponiéndolo públicamente como un acosador.
Que, posteriormente, la referida Danna López volvió a comunicarse con el recurrente, pidiéndole disculpas por haber realizado dichas publicaciones y exigiéndole la suma de 1.000.000 de guaraníes (un millón) a cambio de proceder a la eliminación del contenido publicado.
Por lo que por todo lo todo lo acontecido se acerca hasta esta dependencia policial para los fines que hubiere lugar. -------', '', NULL, NULL, 97, 189, 'Asunción', 'Oficial Ayudante', 'MATIAS RAMÓN', 'ORTIGOZA GÓMEZ', NULL, NULL, 'CA518EA26', NULL, 'completada', '2026-01-12T03:51:12.885Z', NULL, NULL),
(165, 164, '2026-01-12T00:00:00.000Z', '08:05', '2026-01-11T00:00:00.000Z', '16:44', 'Estafa mediante sistemas informáticos', NULL, 'Manifiesta la denunciante que, en fecha 11/01/2026, siendo aproximadamente las 19:30 horas, al revisar su aparato celular, se percato la existencia de varias notificaciones provenientes de la aplicación de su entidad financiera “TU FINANCIERA”, en la cual posee activa una billetera virtual.

Dicha circunstancia le resultó llamativa, atento a que en ese momento se encontraba desempeñando sus labores de enfermera. En razón de ello, ingresó a la aplicación a fin de verificar los movimientos, constatando que se habrían efectuado múltiples transacciones a una misma cuenta, así como también la solicitud y otorgamiento de un préstamo a su nombre, sin su consentimiento.

Como consecuencia de dichas maniobras, se produjo el vaciado total de sus fondos, quedando además con una deuda pendiente. Los movimientos referidos se detallan a continuación:  
- Préstamo: Monto 1.300.000 GS. (un millón trescientos mil guaraníes), en fecha 11/01/2026, siendo las 16:17 horas, numero de transacción #6963f7463a9428da38426529, ID del préstamo #5761502.
-Primera Transacción: Monto 1.200.000 GS. (un millón doscientos mil guaraníes), en fecha 11/01/2026, siendo las 16:44 horas, cuenta N° 186031, FINLATINA S.A DE FINANZAS, a nombre de NOELIA BENITEZ, transacción N° #89449068.
-Segunda Transacción: Monto 1.200.000 GS. (un millón doscientos mil guaraníes), en fecha 11/01/2026, siendo las 17:13 horas, cuenta N° 186031, FINLATINA S.A DE FINANZAS, a nombre de NOELIA BENITEZ, transacción N° #89467047.
-Tercera Transacción: Monto 1.000.000 GS. (un millón de guaraníes), en fecha 11/01/2026, siendo las 17:14 horas, cuenta N° 186031, FINLATINA S.A DE FINANZAS, a nombre de NOELIA BENITEZ, transacción N° #89468178.
-Cuarta Transacción: Monto 1.00.000 GS. (cien mil guaraníes), en fecha 11/01/2026, siendo las 17:17 horas, cuenta N° 186031, FINLATINA S.A DE FINANZAS, a nombre de NOELIA BENITEZ, transacción N° #89470130.

Sigue manifestando la denunciante que, en ese mismo día, con anterioridad a los hechos relatados, recibió una videollamada proveniente del abonado N.° 0974 559 192, en la cual un masculino manifestó ser integrante del Soporte Técnico del Banco UENO BANK. El mismo le solicitó que compartiera la pantalla de su aparato celular, a lo cual la denunciante accedió, confiando en la veracidad del contacto, ya que se encontraba gestionando la activación de una cuenta con dicha entidad bancaria. Asimismo, el supuesto operador le requirió que ingresara a la billetera virtual de la entidad “TU FINANCIERA”, lo cual le resultó llamativo; no obstante, de igual manera accedió al pedido.

En virtud de lo expuesto, la recurrente presume que la persona que realizó la videollamada podría estar vinculada con el hecho denunciado, dejando constancia que desconoce totalmente dichos movimientos, pareciéndole raro también que la cuenta utilizada tenga su nombre ya que la misma no tiene una cuenta con la entidad que recibió las transferencias . Por lo viene a poner a conocimiento de las autoridades para los fines que hubiere lugar. ', '', NULL, NULL, 98, 224, 'Asunción', 'Suboficial Ayudante', 'MELANY MONSERRAT', 'MALDONADO CASTRO', NULL, NULL, '5D315AA26', NULL, 'completada', '2026-01-12T11:56:28.502Z', NULL, NULL),
(166, 165, '2026-01-12T00:00:00.000Z', '09:19', '2026-01-09T00:00:00.000Z', '15:16', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Menciona la recurrente que es la titular de la tarjeta de credito del banco Ueno, con terminacion numero 6181 y el dia viernes pago una suma de dinero a las 11 de la mañana aproximadamente y el dia de ayer 11 de enero del año en curso ingreso a su banca web y se percato que se realizo varios pagos que se detallan a continuacion:
