(167, 166, '2026-01-12T00:00:00.000Z', '09:42', '2025-08-14T00:00:00.000Z', '11:00', 'Extorsión', NULL, 'Menciona la recurrente que tenia una relacion sentimental con el ciudadano Leonardo Martinez y durante dicha relacion este sujeto empezaba a sacarle fotos desnudas a la denunciante y le solicitaba dinero a cambio de no publicar las fotos, hace 4 meses aproximadamente termino la relacion y este sujeto sigue pidiendole dinero a la recurrente, la misma menciona que en total ya envio la suma de 5.550.000 gs a la cuenta n° 61965058 a nombre de Leonardo Javier Martinez entidad: Ueno Bank S.A.
Sigue relatando la recurrente que teme por su vida ya que constantemente recibe hasta amenazas de muerte por parte de este sujeto si es que no le envia dinero y que cualquier cosa que le pase el ciudadano Leonardo Martinez es el responsable.', 'DEPARTAMENTO CENTRAL, CIUDAD DE LAMBARÉ, BARRIO VALLE APU''A I', NULL, NULL, 100, 216, 'Asunción', 'Oficial Segundo', 'BRUNO AMALIO', 'GIMÉNEZ GONZÁLEZ', NULL, NULL, 'DD7533A26', NULL, 'completada', '2026-01-12T13:09:38.746Z', '2026-01-12T00:00:00.000Z', '07:00'),
(168, 167, '2026-01-12T00:00:00.000Z', '10:06', '2025-12-29T00:00:00.000Z', '13:10', 'Estafa', NULL, 'Manifiesta la denunciante que, en fecha 27/12/2025, en horas de la mañana, visualizó una publicación sobre la venta de una consola PlayStation 5, color blanco, por el monto de Gs. 2.500.000 (dos millones quinientos mil guaraníes), a través de la aplicación TikTok. Señala que actualmente ya no cuenta con dicho perfil, debido a que la  misma fue bloqueada.

En esa misma fecha, inició contacto a través de la aplicación WhatsApp con el abonado N° 0993 400 612, quien se presentó como supuesto vendedor de la tienda denominada “Capitán Store Py”, con quien llegó a un acuerdo de compra-venta por el monto mencionado.

Refiere que el supuesto vendedor le facilitó los datos de una cuenta bancaria para recibir el pago total del producto, indicando que la entrega se realizaría una vez efectuada la transferencia. En consecuencia, la denunciante accedió y realizó la siguiente transferencia:

• N° de comprobante: 2512291985216
