Continúa manifestando la recurrente que el producto debía ser entregado dentro de las 24 horas posteriores a la realización de la transferencia; sin embargo, hasta la fecha no ha recibido el producto ni respuesta favorable alguna por parte del supuesto vendedor. Por lo viene a poner a conocimiento de las autoridades competentes para los fines que hubiere lugar.', 'DEPARTAMENTO CENTRAL, CIUDAD DE MARIANO ROQUE ALONSO, REPUBLICA DE COLOMBIA', NULL, NULL, 101, 224, 'Asunción', 'Suboficial Ayudante', 'MELANY MONSERRAT', 'MALDONADO CASTRO', NULL, NULL, 'A3801FA26', NULL, 'completada', '2026-01-12T13:09:45.849Z', NULL, NULL),
(400, 325, '2026-01-22T00:00:00.000Z', '13:35', '2026-01-19T00:00:00.000Z', '12:43', 'Estafa mediante sistemas informáticos', NULL, 'Que se presenta ante esta Dependencia Especializada a fin de realizar una denuncia de un supuesto hecho de estafa, menciona la recurrente que en fecha 19 de enero del  presente año, visualizo en la pagina de FACEBOOK, desde el perfil denominado Finanza Click con direccion de URL https://www.facebook.com/share/1BzwRsjHXT/, anuncios y requisitos simples para acceder a prestamos en efectivo, como la misma estaba interesada decidio contactar al numero 0994 635 171 proporcionado en el perfil, iniciando una conversacion con la supuesta acesora de creditos, seguidamente le solicita sus datos personales para una supuesta evaluacion economica para determinar las condiciones y los montos para la solicitud de credito, interesada decide enviar todos los datos requeridos como nombre completo, numero de cedula de identidad entre otros, una vez que reciben estos datos le indican que el prestamo minimo a ser solicitado era la suma de 10.000.000 Gs. (Diez millones de guaranies), ante lo mencionado la denunciante consulto el monto de la cuota por el valor descrito con anterioridad, a lo cual le indicaron que el monto de la cuota seria por valor de 194.000 Gs. (Ciento noventa y cuatro mil guaranies), en 60 cuotas, accediendo a la solicitud por lo que procedio al envio de la fotografia de su cedula de identidad para iniciar el proceso para acceder al credito, posterior al envio le indica que la solicitud cuenta con un costo administrativo por valor de 1.400.000 Gs. (Un millon cutrocientos mil guaranies), que a su vez serviria como seguro para evitar presentar tercero como garante, realizando asi el envio de lo solicitado a traves de una transferencia bancaria a la cuenta numero 6192578200,cargo UENO BANK,  a nombre de PAOLA BAEZ BENITEZ, con C.i. numero 7.773.094. Una vez que realizo el envio la supuesta acesora le menciona que surgio un gasto extra que asciende a la suma de 1.600.000 Gs. (Un millon seiscientos mil guaranies), mas aparte del monto anterior ya abonado, como la misma ya no podia realizar dicho pago iniciaron con constantes excusas para no finalizar la solicitud ni proceder a la entrega del monto solicitado. Por todo lo expuesto la recurrente menciona ser victima de un supuesto hecho de estafa ya que hasta el momento no recibe respuestas positivas por parte de la supuesta acesora de creditos, solo continua solicitando mas suma de dinero siempre alegando que se trataria para gasto administrativo con el fin de finalizar la solicitud. Por lo que viene a poner a conocimiento de la autoridad competente para los fines que hubiere lugar conforme a derecho.', 'CIUDAD DE ASUNCIÓN, BARRIO LA ENCARNACION, GRAL. DIAZ C/ 15 DE AGOSTO 555', NULL, NULL, 212, 182, 'Asunción', 'Suboficial Ayudante', 'GERMAN EMANUEL', 'RUIZ DÍAZ', NULL, NULL, '2EBDC9A26', NULL, 'completada', '2026-01-22T16:53:43.414Z', NULL, NULL),
