(183, 173, '2026-01-12T00:00:00.000Z', '14:01', '2026-01-09T00:00:00.000Z', '15:30', 'EXTRAVÍO DE OBJETOS Y/O DOCUMENTOS', NULL, 'Manifiesta el denunciante que, en fecha 09 de enero de 2026, siendo aproximadamente las 12:30 horas, se apersonó a la sede central del Banco ITAÚ, ubicada sobre la calle Oliva casi Chile, de la ciudad de Asunción, con el fin de realizar una inversión por la suma de Gs. 100.000.000 (cien millones de guaraníes), en dicha oportunidad, le fue entregado un Certificado de Depósito de Ahorro (CDA), serie BE, número 8919, por el monto mencionado.

Posteriormente, al retirarse de la entidad bancaria, se dirigió hasta el cajero automático del Banco ITAÚ, ubicado en las calles Herrera y Antequera, donde realizó una extracción de Gs. 300.000 (trescientos mil guaraníes), dejando el referido documento dentro de una carpeta de color verde musgo apoyada sobre el cajero según manifestaciones del denunciante.

Seguidamente, el denunciante se dirigió a la Farmacia PUNTOFARMA y, posteriormente, se dirigió al local de CASA PARANA para realizar compras y al salir de dicho local se percata de que ya no tenía consigo la carpeta que contenía el CDA. Ante esta situación, regresó a los lugares que había visitado para verificar si había dejado allí el documento, sin lograr localizarlo, desconociendo el lugar exacto de su extravío.

En fecha sábado 10 de enero de 2026, volvió a consultar en los locales aledaños al cajero automático, siendo informado por una persona que trabaja en un Aquí Pago, ubicado frente al cajero del Banco ITAÚ, que habría visualizado la carpeta mencionada sobre el cajero automático. Con dicha información, el denunciante confirma que dejó allí el documento y presume que una tercera persona lo encontró y se apropió del mismo, comunicándose de inmediato al CALL CENTER del Banco ITAU para solicitar el CCTV (circuito cerrado de televisión), de dicho cajero para identificar a  esta persona recibiendo como respuesta que realizaran el monitoreo correspondiente y obtendrá mas información dentro de las 72 horas. Por lo que viene a poner a conocimiento de las autoridades para los fines que hubiere lugar.', 'CIUDAD DE ASUNCIÓN, HERRERA Y ANTEQUERA', NULL, NULL, 103, 224, 'Asunción', 'Suboficial Ayudante', 'MELANY MONSERRAT', 'MALDONADO CASTRO', NULL, NULL, '448235A26', NULL, 'completada', '2026-01-12T17:57:45.761Z', NULL, NULL),
