(188, 178, '2026-01-12T00:00:00.000Z', '17:37', '2026-01-12T00:00:00.000Z', '17:00', 'Estafa', NULL, 'Menciona el recurrente que se encontraba navegando en la red social Facebook, donde visualizó un anuncio referente a un préstamo. El denunciante ingresó al enlace, el cual lo derivó a una conversación en WhatsApp con el número 0973962545, que se identificó como Alexis Fleitas, quien sería un supuesto asesor de créditos.

El recurrente le manifestó que necesitaba una suma elevada de dinero y consultó hasta qué monto podrían otorgarle. El supuesto asesor le indicó que podrían facilitarle hasta Gs. 25.000.000, en 36 a 48 cuotas, y le mencionó que debía contar con la aplicación de Ueno Bank o billetera Mango. El denunciante le informó que poseía la aplicación de Mango, ante lo cual el supuesto asesor le consultó si contaba con una línea de crédito disponible, respondiendo el recurrente que disponía de la suma de Gs. 925.149.

