Posteriormente, el denunciante volvió a comunicarse con el supuesto asesor, sin obtener respuesta, percatándose en ese momento de que fue víctima de una estafa.', 'CIUDAD DE ASUNCIÓN, BARRIO SAJONIA, MANZANA LA RIVERA', NULL, NULL, 108, 174, 'Asunción', 'Suboficial Ayudante', 'JEREMÍAS JOSÉ', 'ARMOA ESCOBAR', NULL, NULL, '276AD7A26', NULL, 'completada', '2026-01-12T21:15:03.056Z', NULL, NULL),
(189, 179, '2026-01-12T00:00:00.000Z', '17:26', '2025-07-07T00:00:00.000Z', '22:27', 'Estafa', NULL, 'Manifiesta la denunciante que, en fecha 07/07/2025, visualizó un anuncio a través de la aplicación Instagram, el cual contenía un enlace que la derivaba a la aplicación WhatsApp, sin que se visualizara el número telefónico correspondiente. Refiere que, mediante dicha comunicación, una persona le manifestó que sería derivada a la aplicación Telegram para iniciar la realización de supuestas inversiones en el casino V-BET, con enlace https://v-bet.info/#login. 
