(202, 185, '2026-01-13T00:00:00.000Z', '12:06', '2025-08-16T00:00:00.000Z', '21:00', 'Estafa', NULL, 'Que se presenta a esta dependencia especializada a formular denuncia sobre un supuesto hecho de estafa, menciona la recurrente, que en el mes de julio de año 2025 entabla una conversacion amorosa con bryan woodsman lorenzo, italiano de turin, de profesion arquitecto obrando supuestamente en malina filippina, a quien conocio a travez de la plataforma TINDER, en donde la recurrente menciona que el tal Bryan le pedia dinero por transfencia de la app PAYBIS.COM con cuenta N bc1qvgcz5vuakvf7nswl3q9a4q9-krleq9kufm5p7a9  y de PAYBIS a la compañia de criptomonedas Alianza Investment Company@gmail.com , con el fin de invertir en criptomonedas, en reiteradas ocaciones exigiendo a la victima la transferencia del dinero llegando a la suma general de 11.000$ ONCE MIL DOLARES AMERICANOS, en donde el tal Bryan mencionaba a la supuesta que tendria una ganancia de 45.000$CUARENTA Y CINCO MIL DOLARES AMERICANOS, por la inversion hecha, y que el 01/01/2026 habia llegado un supuesto mensajero de la empresa mecionada mas arriba de supuesto nombre Eddie contactandose con la recurrente con el  numero de telefono +447462856226/ +447533211945 que portaba el paquete de dinero mecionado mas arriba en el aeropuerto, diciendole asi tambien que lo detuvieron en el aeropuerto y pidiendole mas dinero a la recurrente para que envie en Paybis a los efectos con el fin de pagar el despacho. ', 'CIUDAD DE ASUNCIÓN, BARRIO LAS MERCEDES, JUAN DE SALAZAR 492 ESQUINA BOQUERON ', NULL, NULL, 120, 176, 'Asunción', 'Suboficial Ayudante', 'ALEXIS MIGUEL', 'AGÜERO GIMÉNEZ', NULL, NULL, 'A6C9D7A26', NULL, 'completada', '2026-01-13T16:11:47.872Z', NULL, NULL),
(402, 327, '2026-01-22T00:00:00.000Z', '14:34', '2026-01-22T00:00:00.000Z', '09:15', 'Estafa', NULL, 'Que se presenta ante esta dependencia especializada a fin de formular una denuncia sobre un supuesto hecho de estafa, relata el recurrente que el dia de la fecha se encontraba navegando en la red social FACEBOOK en la pagina MARKETPLACE interesado en adquirir una PLAYSTATION 5 en donde encontro una pagina en el cual encontro lo que estaba buscando en una empresa denominada RED STORE en el abonado Nº 0992 154 071, identificandose como el supuesto vendedor del producto quien le explica al recurrente los pasos a seguir para poder adquirir el producto entre ellos le debia facilitar sus datos personales como la ubicacion de su domicilio para hacer la supuesta entrega del pedido quien le pidio que realize una transferencia para pagar el costo del delivery al cual accedio realizando una transferencia a la cuenta Nº619389917 con monto de 100.000 Gs. cargo UENO BANK a nombre de la beneficiada Maria Lujan Lopez Toledo con c.i. nº 5.498.572, una vez realizada la transferencia el supuesto vendedor  le pide abonar una seña del 25% del costo del producto en donde nuevamente el denunciante realiza otra transaccion a la misma cuenta detallada mas arriba con el monto de 750.000 Gs. interin en el que le envia una ubicacion en tiempo real que supuestamente el delivery estaba en camino con su pedido, momento mas tarde recibe un mensaje del abonado Nº 0991 869 652, quien le manifiesta ser el delivery el cual tambien le pide abonar el 25% restante del 50% del valor del producto y que si no abonaba eso no le iban poder entregar el pedido en el que nuevamente el denunciante accede a dicho pedido realizando la ultima transaccion a la misma cuenta detallada mas arriba, mas tarde le volvieron a insistir tanto el supuesto vendedor como el delivery que debia abonar el 100% del valor del producto que de otra manera no le iban a entregar su pedido momento en el que se percata que estaria siendo victima de una estafa, por lo que viene a realizar su denuncia a esta dependencia para los fines correspondientes.', 'DEPARTAMENTO CENTRAL, CIUDAD DE FERNANDO DE LA MORA, BARRIO PITIANTUTA, SATURIO RIOS C/ PALMA', NULL, NULL, 214, 182, 'Asunción', 'Suboficial Ayudante', 'GERMAN EMANUEL', 'RUIZ DÍAZ', NULL, NULL, '36D6DAA26', NULL, 'completada', '2026-01-22T18:16:22.859Z', NULL, NULL),
(207, 187, '2026-01-13T00:00:00.000Z', '13:02', '2026-01-12T00:00:00.000Z', '13:17', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que en fecha de ayer recibió una llamada telefónica desde el abonado N° 0986290172 ,de parte de una persona de sexo masculino, quien se identifico como supuesto asesor técnico de la empresa telefónica TIGO , quien le consulto el funcionamiento de internet de su linea telefónica en donde la recurrente le menciona que tenia algunos inconvenientes con la señal de internet en algunos lugares, sigue manifestando que el supuesto asesor le menciona algunos pasos a seguir para configurar su teléfono y le brindo un código de verificación al cual tenia que realizar una llamada, asi mismo le menciona que dicha llamada no seria atendida por nadie, posterior a eso le menciona que apague su teléfono por un periodo de 10 minutos lo cual realiza y al volver a encender su teléfono se percata que su aplicación de mensajería WHATSAPP habría sido Hackeado .Por ultimo menciona que recibió llamadas y mensajes por parte de familiares específicamente de su hermana MARIA ELENA MARTINEZ mencionándole que se estaba solicitando dinero como préstamo desde el perfil de WHATSAPP de la recurrente, facilitando una cuenta bancaria N°6043512001307156, entidad bancaria DINO CABAL, titular de la cuenta MARIA ELIZABETH GIMENEZ con cedula N°5.620.741 para realizar los envíos de dinero.', 'CIUDAD DE ASUNCIÓN, BARRIO GENERAL JOSE EDUVIGIS DIAZ, ALBERDI 1489 ESQ SICILIA ', NULL, NULL, 121, 158, 'Asunción', 'Oficial Ayudante', 'FRANCISCO NICOLAS', 'GALEANO BRITEZ', NULL, NULL, '74D2F5A26', NULL, 'completada', '2026-01-13T16:51:49.048Z', NULL, NULL),
