(209, 188, '2026-01-13T00:00:00.000Z', '14:31', '2026-01-13T00:00:00.000Z', '12:20', 'Estafa mediante sistemas informáticos', NULL, 'MANIFIESTA EL RECURRENTE QUE EN FECHA Y HORA MENCIONADO MAS ARRIBA SE ENCONTRABA EN SU LUGAR DE TRABAJO Y RECIBE UNA LLAMADA DEL NUMERO 0976190324 IDENTIFICANDOSE COMO PERSONAL DE LA EMPRESA NETEL,  SIN DARLE NOMBRE NI MAS DATOS, MENCIONA QUE LE SOLICITA EL ACCESO A SU COMPUTADORA PARA UNA SUPUESTA ACTUALIZACION DE SISTEMA,YA QUE EL MISMO CUENTA CON UN LOCAL COMERCIAL DENOMINADO ¨MOTO CARS REPUESTOS¨QUE CUENTA CON BOCA DE COBRANZAS CUMPLIENDO PAGO ESPRESS, AQUI PAGO ,PRACTI PAGO, IFONET COBRANZAS., EL MISMO LE REFIERE QUE NO SE ENCUENTRA EN EL LOCAL Y POR ESA RAZON LE DERIVA A SU ENCARGADA ANDREA NATHALIA ORREGO FLOR QUIEN SE ENCONTRABA TRABAJANDO  EN EL LOCAL COMERCIAL, DENOMINADO ¨MOTO CARS REPUESTOS¨., SEGUIDAMENTE SE PONEN EN  CONTACTO CON LA MISMA DEL NUMERO 0976190324 Y UNA VIDEO LLAMADA POR EL NUMERO +1(67222-0259) Y LE VUELVE A SOLICITAR EL ACCESO A SU COMPUTADORA PARA REALIZAR LA ACTUALIZACION, LA MISMA LE FACILITA Y INGRESAN A TRAVEZ DE UN   ENLACE DE INVITACION UTILIZANDO ´ANYDESK¨ EL CUAL LE PERMITIO COMPARTIR DATOS DE SU DISPOSITIVO, UNA VEZ TENIENDO EL ACCESO ENTRA DIRECTAMENTE EN EL PORTAL DE AQUI PAGO, INTERIN QUE LA VICTIMA LE RECLAMA EL POR QUE INGRESA EN LA PESTAÑA DE SU PORTAL DE AQUI PAGO Y EL MISMO EN ESE MOMENTO CORTA LA LLAMADA, POSTERIOR A ESO LA RECURENTE  LLAMA A LA LINEA BAJA DE NETEL AL NUMERO 021195000 CONFIRMANDO QUE NO SE TRATA DE LA MISMA EMPRESA, COMPROBANDO QUE SERIA UNA SUPUESTA ESTAFA SEGUIDAMENTE INGRESA A SU LISTA DE TRANSACCIONES DE AQUI  PAGO Y SE PERCATA QUE SE HABIA HECHO UNA RECARGA DE BILLETERA AL  NUMERO 0974219811 A NOMBRE DE SERGIO DANIAL VILLAMAYOR CON C.I.Nº 2775654 POR EL MONTO DE 2.000.000 (DOS MILLONES GS) Y OTRO AL MISMO NUMERO POR EL MONTO DE 1.100.000 (UN MILLON CIEN MIL GS), Y OTRO MONTO AL MISMO DESTINO DE 400.000 (CUATROCIENTOS MIL GS).POR ESTA RAZON VIENE A PONER A CONOCIMIENTO DE LAS AUTORIDADES DESCONOCIENDO HABER HECHO  ESAS TRANSACCIONES SOLICITANDO LA INVESTIGACION DE TAL HECHO PARA LO QUE HUBIERE LUGAR.', 'DEPARTAMENTO CENTRAL, CIUDAD DE LUQUE, BARRIO YKA''A, BERGEL LUQUEÑO ENTRE WILIAM LAURENT Y MARIA BLANCA ', NULL, NULL, 122, 226, 'Asunción', 'Suboficial Segundo', 'LIZANDRY CAMILA', 'PANIAGUA BERNAL', NULL, NULL, '1FE8FDA26', NULL, 'completada', '2026-01-13T18:51:37.300Z', NULL, NULL),
(404, 329, '2026-01-22T00:00:00.000Z', '16:47', '2026-01-22T00:00:00.000Z', '14:00', 'Lesión de la comunicación y la imagen', NULL, 'Que se presenta ante esta dependencia especializada a fin de formular una denuncia de un supuesto hecho de usurpación de identidad, relata que en día de la fecha encontrándose  en su domicilio particular recibe una llamada del abonado N° 0982755806 haciéndose pasar por un supuesto funcionario de la empresa de la linea personal manifestándole que le va a llegar un código de seis dígitos y que le tenia que facilitar ese código para una mejor función de la cobertura de dicha linea telefónica en el que la recurrente recibe un código                       N°773622,592192las cuales le facilito a la persona que se encontraba en la llamada y de esa manera pudieron crear una cuenta de WhatsApp con el numero de teléfono de la afectada para así poder suplantar su identidad y de esa forma pedían dinero a conocidos que la denunciante tenia entre sus contactos facilitando una cuenta bancaria para que realicen el deposito a la cuenta N°6191962144 entidad UENO BANK a nombre de la titular SILIVIA DIAZ CAÑLZA, sigue manifestando la recurrente que hasta el momento no recibió ninguna noticia de que alguien de sus contactos haya caído al engaño, por lo que viene a formular su denuncia para los fines que hubiere lugar.', 'DEPARTAMENTO CENTRAL, CIUDAD DE LAMBARÉ, BARRIO FELICIDAD, FELICIDAD', NULL, NULL, 216, 225, 'Asunción', 'Suboficial Ayudante', 'CESAR', 'FERREIRA BARRETO', NULL, NULL, '9786A5A26', NULL, 'completada', '2026-01-22T20:25:42.506Z', NULL, NULL),
(475, 401, '2026-01-27T00:00:00.000Z', '17:39', '2026-01-16T00:00:00.000Z', '11:00', 'EXTRAVÍO DE OBJETOS Y/O DOCUMENTOS', NULL, 'Manifiesta el recurrente, que en fecha 16/01/2026 siendo las 18:00 aproximadamente recibe una notificacion del Banco Itaú, donde se le menciona de un rechazo de Cheque, la cual el no habria autorizado, contactandose con la entidad bancaria le menciona que seria la hoja de cheque Nº 4024230 con cuenta corriente Nº 1400685 de la entidad Bancaria Itaú por el monto de Gs. 5.900.000 ( cinco millones novecientos mil guaranies ) a nombre del mismo.', 'CIUDAD DE ASUNCIÓN, BARRIO SAN ROQUE, EEUU C/ HERRERA', NULL, NULL, 270, 169, 'Asunción', 'Suboficial Ayudante', 'WALTER DAVID', 'FRANCO CABRERA', NULL, NULL, 'D98C0DA26', NULL, 'completada', '2026-01-27T21:09:34.125Z', NULL, NULL),
(210, 189, '2026-01-13T00:00:00.000Z', '19:56', '2026-01-13T00:00:00.000Z', '12:28', 'Estafa', NULL, 'Que en fecha y hora mencionada mas arriba la misma se encontraba buscando una maleta organizadora en FACEBOOK específicamente en Marketplace por lo cual visualizó un producto el cual fue de su agrado, contacto con la Sr. MARI ACOSTA ,CON URL https://www.facebook.com/share/1BXYgx9vSF/ posterior a esto la mismo le facilito el abonado N°0986191206 la cual le facilito fotos del producto y la denunciante solicita una pagina de la empresa denominada IMPORTACIONESEXPORTACIONESMIA con url: https://www.instagram.com/importacionesexportacionesmia?igsh=MXdpcnl1OWxpc3dvOA , la misma consulta si podría ceñar el producto y una vez recibido el producto cancelar, la Sr. MARI ACOSTA le menciona que debería abonar el 50% para realizar la compra , la misma le indica que el precio total del producto seria 885.000mil guaraníes con el envió , por lo cual le facilita los siguientes datos para realizar la transacción, cargo banco FINANCIERA SOLAR , con cuenta N°301017805 , a nombre de ANGELINA SEGOVIA RODRIGUEZ con ci n°5.426.460 , alias N°0987296492 ,desde su cuenta cuyos datos se mencionan a continuación, cuenta N°816611916 cargo banco FAMILIAR atraves de la aplicación EKO del banco .la misma accede realizando el pago de 442.500 (CUATROCIENTOS CUARENTA Y DOS MIL QUINIENTOS GUARANIES).La Sr. María le menciona que el pago había rebotado entonces la misma verifico su cuenta percatándose que efectivamente el pago no se había realizado a lo cual le facilito otra cuenta para realizar la transferencia con cargo Banco ITAU a nombre de JONAS CATALINO BERNAL VIGO con cedula de identidad N°7.048.279 , cuenta N°321545562  a lo que la denunciante procedió a enviar 442.500 GS a la cuenta indicada luego esta persona le menciona que su Jefe le solicita abonar el 100% por el producto para poder realizar el envió. Por lo que MARIA  le solicita reiteradas veces abonar el 100% del producto aunque habían quedado en un acuerdo del 50% como seña, la denunciante solicita hablar con el dueño de la supuesta empresa a lo que MARIA responde que por  favor envié la totalidad. La denunciante solicita que le devuelvan el dinero, también realizo varias llamadas las cuales no fueron contestadas. Posterior a todo esto MARIA la bloqueo en WHATSAPP Y FACEBOOK por lo cual la denunciante supone que se trataría de una estafa. Se adjuntan fotos de las conversaciones en WHATSAPP Y FACEBOOK y del perfil de MARI ACOSTA en ambas redes sociales .', 'CIUDAD DE ASUNCIÓN, BARRIO YKUA SATI, JOSE OCAMPOS LANZONI 839 C/ EUSEBIO LILLO', NULL, NULL, 123, 158, 'Asunción', 'Oficial Ayudante', 'FRANCISCO NICOLAS', 'GALEANO BRITEZ', NULL, NULL, '06C753A26', NULL, 'completada', '2026-01-14T00:01:34.514Z', NULL, NULL),
(211, 190, '2026-01-13T00:00:00.000Z', '22:46', '2026-01-12T00:00:00.000Z', '10:00', 'Estafa', NULL, 'Que se presenta ante esta Dependencia Especializada a fin de formular una denuncia sobre un supuesto hecho punible de estafa, mencionando lo siguiente, que en fecha y hora relatado mas arriba se encontraba navegando en la red social Facebook 
específicamente en Marketplace donde visualiza un reloj de valor de 350.000 gs que esta en la venta por un usuario de nombre FLOR GIMENEZ, se comunicaron vía WhatsApp por el N 0986267902, llegando a un acuerdo en donde la victima se ofrece abonar un monto de 200.000 gs en la cuenta del supuesto NELSON JAVIER CORONEL CHAPARRO con CIN 5.557.026 numero de cuenta 6192319769 entidad UENO BANK  por el articulo y cuando le llegase cancelaria lo restante del monto total, el recurrente también menciona que Nelson llego a pedir sus datos personales para la encomienda del articulo que saldría de Caazapá por la trasportadora de la entidad SAN IGNACIO (TSI), que no llego a salir y reclamando por el articulo que no le había llegado, contactándose con la entidad UENO BANK por llamada telefónica comentando que había sido estafado por esta persona mencionado mas arriba y esta entidad bancaria bloqueo la cuenta de NELSON solicitándole a la victima que haga su denuncia correspondiente a las autoridades  ', 'CIUDAD DE ASUNCIÓN, BARRIO VILLA MORRA, MOISES BERTONI CON JOMEZ CASTRO ', NULL, NULL, 124, 214, 'Asunción', 'Suboficial Ayudante', 'IVAN JAVIER', 'BENITEZ CARRILLO', NULL, NULL, 'C550BBA26', NULL, 'completada', '2026-01-14T02:27:54.496Z', NULL, NULL),
(213, 192, '2026-01-14T00:00:00.000Z', '09:22', '2026-01-13T00:00:00.000Z', '17:19', 'Estafa', NULL, 'Recurre ante esta dependencia especializada a fin de realizar denuncia sobre un supuesto hecho punible de estafa, menciona que en fecha y hora mencionada mas arriba su hija menor de edad con la inicial E.A se encontraba navegando en la red social Facebook específicamente Marketplace, momento que visualiza  la publicación de unos zapatos de la marca Crocs, en la cual la misma estaba interesada por lo que procede a contactar con el usuario y le proporciona el abonado N° 0975547213, seguidamente la supuesta vendedora le manifiesta que el costo del producto sería de guaraníes 290.000 (Doscientos noventa mil) y que el envío se podría realizar por delivery, el pago por el producto fue realizado por transferencia bancaria a la cuenta N° 301017805, entidad SOLAR BANCO S.A.E a nombre del titular Angelina Segovia Rodriguez, seguidamente posterior al envío empieza a eliminar todas las conversaciones que tuvieron y a la vez bloqueado en la mensajería instantánea WhatsApp razon por la cual se apersona a formular su denuncia para los fines pertinentes.', 'CIUDAD DE ASUNCIÓN, BARRIO LA ENCARNACION, MONTEVIDEO 1089 ENTRE JEJUI Y MANDUVIRA', NULL, NULL, 125, 178, 'Asunción', 'Suboficial Segundo', 'ARNALDO ANDRÉS', 'AVALOS RUIZ DÍAZ', NULL, NULL, '7573D6A26', NULL, 'completada', '2026-01-14T12:53:47.923Z', NULL, NULL),
(238, 214, '2026-01-15T00:00:00.000Z', '15:03', '2026-01-14T00:00:00.000Z', '22:00', 'Extorsión', NULL, 'Se presenta a esta Dependencia Especializada a fin de realizar una denuncia sobre un supuesto hecho de extorsion en fecha y hiora mencionada mas arriba, relata que encontrandose en su domicilio recibe un mensaje por la red social Facebook de un perfil denominado MARIA BELEN, con URL: https://www.facebook.com/profile.php?id=61585349439872, donde comienzan una conversacion y por ultimo le solicita su numero de WhatsApp, donde recibe un mensaje del celular Nº 0987 117 592, pidiendole la suma de GS 1.000.000 (UN MILLON DE GUARANIES) atraves de GIROS TIGO con el celular  Nº 0987 224 317, pero el mismo le alega tener solo GS 200.000 (DOS CIENTOS MIL GUARANIES) monto el cual le envio y seguia insistiendo en que el mismo le mandara mas dinero o ella podria publicar por las redes que el es un acosador y que si le enviaba iba a borrar la publicacion , por ultimo el volvio a girarle GS 50.000 (CINCUENTA MIL GUARANIES) a traves de GIROS TIGO con el celular  Nº 0987 224 317, luego de eso ya no le vuelve a molestar.', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, BARRIO REDUCTO, SAN PEDRO Y ROSSWELL', NULL, NULL, 138, 229, 'Asunción', 'Suboficial Ayudante', 'JUAN HERNAN', 'MACIEL GALEANO', NULL, NULL, '1F306FA26', NULL, 'completada', '2026-01-15T18:38:57.708Z', NULL, NULL),
(266, 224, '2026-01-16T00:00:00.000Z', '12:33', '2026-07-12T00:00:00.000Z', '12:00', 'Acceso indebido a sistemas informáticos', NULL, 'Que se presenta ante esta dependencia especializada a fin de formular una denuncia de un supuesto HECHO A DETERMINAR, manifiesta que en fecha mencionada mas arriba procedió a verificar su extracto de cuenta de la entidad bancaria UENO BANK, y se percata que se realizaron algunas transacciones, primera transacción comprobante N°4659515182 pago en comercio por el monto de 136.800 guaraníes de fecha 13/01/2026, segunda transacción comprobante N°1039621908 pago por mantenimiento mensual por el monto de 13.360 guaraníes de fecha 13/01/2026, tercera transacción comprobante N°4660987696 pago en comercio por el monto 10.260 guaraníes de fecha 13/01/2026, sigue relatando el recurrente que desconoce estas transacciones, posterior a eso se apersono hasta la entidad bancaria UENO BANK ubicada sobre la avenida SANTA TERESA de la cuidad de ASUNCION, en donde le manifestaron que debía realizar su denuncia en esta dependencia para de esa forma le puedan reembolsar el monto perdido, por lo que viene a poner  a conocimiento de la autoridad policial para los fines que hubiere lugar .   ', 'CIUDAD DE ASUNCIÓN, BARRIO GENERAL BERNARDINO CABALLERO, AKA VERA 799', NULL, NULL, 146, 225, 'Asunción', 'Suboficial Ayudante', 'CESAR', 'FERREIRA BARRETO', NULL, NULL, '8C7B42A26', NULL, 'completada', '2026-01-16T16:00:34.242Z', NULL, NULL),
(405, 330, '2026-01-22T00:00:00.000Z', '17:06', '2024-09-01T00:00:00.000Z', '07:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'QUE LA MISMA ES JEFA ADMINISTRATIVA DE LA EMPRESA SEGEL  Y VIENE A FORMULAR DENUNCIA HECHO QUE ATENTA CONTRA EL PATRIMONIO DE LA EMPRESA, QUE SE ENCUENTRA INVOLUCRADO UN EMPLEADO DEL AREA DE TESORERIA. REFIERE LA DENUNCIANTE QUE EL DIA VIERNES 09/01/2026, RECIBE LA NOTICIA DE QUE EXISTIA INCONSISTENCIAS  EN LOS SALDOS Y DEPÓSITOS DE ACTIVOS DIARIOS DEPOSITADOS EN EFECTIVO, DETECTADOS GRACIAS AL CONTROL DIARIO DE COBRANZAS DE LA EMPRESA, MOTIVO POR EL CUAL LA RECURRENTE SUGIRIO QUE SE INICIE UN PROCESO DE CONTROL DE HISTORICOS, QUE HASTA LA FECHA FUERON VERIFACADOS HASTA  LA FECHA 01/09/2024 HASTA LA FECHA 31/12/2025 A FIN DE DETERMINAR EL NIVEL DE AFECTACION DEL HECHO EN EL AREA DE TESORERIA. ES ASI QUE DESCUBRIERON LA AUSENCIA DE DEPOSITOS DE COBRANZAS DE EFECTIVOS CORRESPONDIENTES A VARIAS FECHAS DE UN AÑO APROXIMADAMENTE ESPECIFICAMENTE EN EL BANCO CONTINETAL, CON NUMERO DE CUENTA  4423 794940-03 PERTENECIENTE A LA EMPRESA SEGEL S.A. RUC Nº 80026570-0, GENERANDO UNA PERDIDA PATRIMONIAL DE APROXIMADAMENTE 670.000.000 (SEISCIENTOS SETENTA MILLONES DE GUARANIES). DE ACUERDO A LOS REGISTROS ENCONTRADOS HASTA LA FECHA MENCIONADA. SIGUE MANIFESTANDO LA RECURRENTE QUE REALIZO CONSULTAS AL BANCO CONTINENTAL SOBRE ALGUNOS DEPOSITOS, QUIENES MENCIONARON QUE DICHOS DEPOSITO NO SE LLEGO A  REALIZAR. CABE MENCIONAR  QUE ALGUNAS DE LAS BOLETAS DE DEPOSITOS EN EFECTIVO NO FUERON ENCONTRADAS EL CUAL SE LE CONSULTO NUEVAMENTE AL SEÑOR ANDRES GUILLERMO ROJAS ESPINOLA QUIEN MANIFESTÓ DESCONOCER EL LUGAR DONDE ESTABAN LAS BOLETAS. CABE MENCIONAR QUE LA MISMA PRESENTO TODOS LOS DOCUMENTOS CORRESPONDIENTES AL PROCESO Y AL MANEJO DE TESORERIA DE LA EMPRESA.', 'CIUDAD DE ASUNCIÓN, BARRIO JARA, AV. GRAL ARTIGAS ESQUINA DAMAS ARGENTINAS ', NULL, NULL, 217, 225, 'Asunción', 'Suboficial Ayudante', 'CESAR', 'FERREIRA BARRETO', NULL, NULL, 'F8553FA26', NULL, 'completada', '2026-01-22T21:06:00.770Z', '2025-12-31T00:00:00.000Z', '00:00'),
(217, 195, '2026-01-14T00:00:00.000Z', '09:55', '2025-12-28T00:00:00.000Z', '07:53', 'Acceso indebido a sistemas informáticos', NULL, 'El dia de la fecha se dirigió hasta la Cooperativa Universitaria, ubicado sobre la calle Colon y 5ta avenida, barrio la Encarnación, de la ciudad de Asunción ya que su tarjeta de crédito Mastercard/Clásica, con Nº 5550 6400 0108 4367, de la Cooperativa Universitaria se encontraba bloqueado, debido a que se realizaron compras que la misma desconoce, dichas compras se detallan a continuación:
1. Fecha de operación 28/12/25, fecha de proceso 29/12/25, número de cupón 1902232, motivo DNH*GODADDY, por el monto de 1.037.361 guaraníes.
2. Fecha de operación 29/12/25, fecha de proceso 29/12/25, número de cupón 280001, motivo compras exterior por el monto de 20.747 guaraníes.
3. Fecha de operación 29/12/25, fecha de proceso 29/12/25, número de cupón 280001, motivo compras exterior por el monto de 1.597 guaraníes.
Sigue manifestando la recurrente que desconoce las compras mencionadas, ya que no ha faciltado datos de su tarjeta como así tambien no ingresó a ningún link, motivo por el cual se acerca hasta esta dependencia policial a poner a conocimiento de las autoridades competentes para los fines que hubiere lugar.', 'CIUDAD DE ASUNCIÓN, BARRIO LA ENCARNACION, CALLE COLON Y 5TA AVENIDA, COOPERATIVA UNIVERSITARIA', NULL, NULL, 126, 154, 'Asunción', 'Suboficial Ayudante', 'DILMA MARIA', 'ALVARENGA OJEDA', NULL, NULL, '81638AA26', NULL, 'completada', '2026-01-14T13:04:35.272Z', NULL, NULL),
(421, 347, '2026-01-23T00:00:00.000Z', '16:22', '2026-01-21T00:00:00.000Z', '09:34', 'Acceso indebido a sistemas informáticos', NULL, 'Que, antecede ante esta Dependencia Especializada y manifiesta que el día de la fecha se percata de que se había realizado un debitó la cual no reconoce, en el momento que entra a ver sus movimientos a través de su aplicación del Banco Familiar con cuenta N° 0-6537333 corrobora que se había realizado un pago por QR por el valor de 27.000 guaraníes en el Comercio Amandau Charles, procede a verificar sus mensajes del correo electrónico en donde se percata de la notificación recibida en fecha 21/01/2026 alegando desconocer dicho movimiento por lo que procede a comunicarse con la Entidad del Banco a manifestar lo ocurrido, donde los funcionarios del banco le comenta que el pago fue realizado vía Pos con tarjeta, sigue manifestando la concurrente que no es la primera vez que le ocurre dicho caso, ya que en años anteriores se había realizado un pago en el mismo comercio mencionado más arriba, por la cual procedió a cancelar su tarjeta y volver a adquirir uno nuevo   ', 'DEPARTAMENTO CENTRAL, CIUDAD DE LUQUE, BARRIO MARAMBURE, SOBRE LA CALLE LOS INMIGRANTES', NULL, NULL, 233, 165, 'Asunción', 'Suboficial Segundo', 'CAROLINA NOEMI', 'SARABIA GONZALEZ', NULL, NULL, '55B960A26', NULL, 'completada', '2026-01-23T19:59:34.241Z', NULL, NULL),
(221, 198, '2026-01-14T00:00:00.000Z', '11:00', '2025-12-05T00:00:00.000Z', '19:00', 'Estafa', NULL, 'El recurrente manifiesat que en el mes de Diciembre del 2025, a traves de la aplicación de TIKTOK, contactó con una persona de nombre JUAN OLAZAR, con usuario @juan.olazar8, URL https:/www.tiktok.com/@juan.olazar8?_r=1&_t=ZM-9348EBayQbj, con teléfono número 0982107637 quien le inivtó a formar parte de una empresa denominada INNOVA, que generaba ganancias monetarias a traves de inversiones, realizando marketing. Acto seguido, una vez echo la invitación el recurrente se mostro interesado y le asignaron con un señor de nombre MARCOS GÓMEZ GÓMEZ,   quien le explicó el método de trabajo que consistía primeramnete en visualizar tutoriales para poder realizar Tradding, para posterior realizar las inversiones. 
En fecha 05 de diciembre realizó una transferencia por el monto de 4.000.000 gs, que gabría enviado a la cuenta Nº 01250040041907, cargo banco Continental, Titular MARCOS ANTONIO GÓMEZ GÓMEZ, comprobante Nº 2512051086272, la suma de 1.000.000 gs, enviado a la cuenta Nº 619112315, cargo banco UENO BANK, Titular MARCOS ANTONIO GÓMEZ GÓMEZ, comprobante Nº 7385388. En fecha 06 de diciembre se efectuo otra transferencia por el monto de 2.000.000 gs. a la cuenta Nº 1250040041907, cargo banco Continental, Titular MARCOS ANTONIO GÓMEZ GÓMEZ, comprobante Nº 758746812, el recurrente manifiesta que las transferencias fueron realizadas para poder integrar el grupo de INNOVA y realizar Trading, Marketing, Dropshipping, etc.
Sigue manifestando el recurrente que siempre recibe invitaciones para participar de las reuniones realizadas por el grupo de INNOVA, el recurrente habría realizado otra transferencia en concepto de entradas para dichas reuniones, que fue enviado a la cuenta cargo banco CONTINENTAL, cuenta Nº 01250040041907, Titular MARCOS ANTONIO GÓMEZ GÓMEZ, comprobante Nº 2512171631409, pero que una vez que fue realizada las transferencias no recibió ninguna ganancia hasta la fecha, motivo por el cual se acerca hasta esta dependencia policial a poner a conocimiento de las autoridades competentes para los fines que hubiere lugar. 
', 'DEPARTAMENTO CENTRAL, CIUDAD DE LUQUE, BARRIO MARAMBURE, DEPARTAMENTO CENTRAL, CIUDAD DE LUQUE, BARRIO MARAMBURE, CALLE GAUAYAIBI CASI DR. FLORENCIO MEZA SOSA Nº 50', NULL, NULL, 127, 154, 'Asunción', 'Suboficial Ayudante', 'DILMA MARIA', 'ALVARENGA OJEDA', NULL, NULL, '203D1BA26', NULL, 'completada', '2026-01-14T14:04:17.592Z', NULL, NULL),
(437, 362, '2026-01-24T00:00:00.000Z', '09:43', '2025-04-01T00:00:00.000Z', '17:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'La denunciante manifiesta que tiene una hija menor de edad, de 16 años (C.A.B.S.), quien es estudiante del Colegio Politécnico Cooperativa Capiatá. Señala que, desde el mes de abril del  año 2025 (sin recordar la fecha exacta), la menor viene recibiendo mensajes a través de la aplicación Instagram, provenientes de distintos perfiles falsos creados a nombre de la misma, mediante los cuales es objeto de hostigamiento, solicitándole el envío de fotos y videos en los que la menor se vea expuesta.

Asimismo, la denunciante refiere que la persona detrás de dichos perfiles manifestaba poseer fotos de la menor, razón por la cual la acosaba y exigía el envío de más contenido audiovisual, bajo la amenaza de divulgar el material que ya tenía en su poder. Agrega que los perfiles falsos utilizados para el hostigamiento fueron eliminados, y que la mayoría de ellos utilizaban el nombre de la menor, a excepción del último perfil identificado como “el_primero_del_mes1”, cuyo enlace es: https://www.instagram.com/el_primero_del_mes1. Continúa manifestando la denunciante que el correo electrónico de su hija, C.A.B.S., habría sido vulnerado (hackeado) en el mes de abril, presumiendo que a través de dicho acceso indebido se obtuvo el contenido perteneciente a la menor.
Por lo que viene a poner a conocimiento de las autoridades para los fines que hubiere lugar. Se adjuntan capturas de pantalla de los mensajes proveídos por la mamá de la menor.
', '', NULL, NULL, 236, 224, 'Asunción', 'Suboficial Ayudante', 'MELANY MONSERRAT', 'MALDONADO CASTRO', NULL, NULL, 'CE81A4A26', NULL, 'completada', '2026-01-24T14:10:57.935Z', NULL, NULL),
(223, 199, '2026-01-14T00:00:00.000Z', '11:26', '2026-01-12T00:00:00.000Z', '11:30', 'Estafa', NULL, 'Refiere el recurrente que en fecha y hora mencionado mas arriba se encontraba en su lugar de trabajo en la dirección mencionado mas arriba, y que; a había integrado en un grupo de trabajo en el aplicativo TELEGRAM  con el fin de realizar trabajo que consiste en reseña y a su vez genarar una ganancia de guaranies 4.000 (cuatro mil) por cada reseña realizada, por ese trabajo realizado el mismo recibe su ganancia respectivo en su cuenta Bancaria, consecuentemente ingresa dentro de un grupo y un aplicativo denominado CRIPTO CLUB  que consiste en realizar inversiones en linea y generar ganancia, primeramente realizo una inversión de guaranies 100.000 (cienl mil) y recibe una ganancia de 40.000(cuarenta mil) seguidamente realiza otra inversión mas alta de guaranies 250.000 (doscientos cincuenta mil) la ganancia de esa inversión ya no recibe mas, y segun refiere le seguían pidiendo invertir mas para poder retirar la supuesta ganancia, tal asi que el total logro enviar una suma exorbitante suma de guaranies 19.280.000 (diez y nueve millones doscientos ochenta mil) dichos montos de dineros fue transferido a varias cuentas Bancarias, todo con el fin de poder recuperar su dinero invertido y retirar la supuesta ganancia, al no poder conseguir retirar su dinero invertido el mismo sospecha que podria tratarse de una modalidad de ESTAFA, por lo que se apersona hasta esta Dependencia  a formular su denuncia pertinentes.
Se adjunta imágenes proveída por la victima.', 'DEPARTAMENTO CENTRAL, CIUDAD DE ITÁ, BARRIO HUGUA ÑARO, RUTA PY 01, ESTADNO EN EL ESTACION DE SERVICIO INTEGRAL', NULL, NULL, 129, 178, 'Asunción', 'Suboficial Segundo', 'ARNALDO ANDRÉS', 'AVALOS RUIZ DÍAZ', NULL, NULL, 'EED655A26', NULL, 'completada', '2026-01-14T14:30:17.978Z', NULL, NULL),
(224, 200, '2026-01-14T00:00:00.000Z', '12:52', '2025-12-16T00:00:00.000Z', '18:00', 'Estafa', NULL, 'Manifiesta la recurrente que en fecha 16 de diciembre del 2025 recibió un regalo consistente en un pasaje de vuelo con destino final Barcelona, con escala en sao pablo y Roma, con fecha de salida el 13 de enero del 2026 a las 13:20 horas, en el vuelo la 1305, de la aerolínea LATAM AIRLINES GROUP, el cual le había llevado hasta su domicilio por el señor HUGO ALBERTO RUIZ NÚÑEZ, con C.I. N° 1094931, teléfono N° 0981675888 y N° 0986502133, asesor de ventas de la agencia de viajes "OSER/CONSULTORES DE VIAJES", por el monto de 8.000.000, dicha pago fue realizado a través de  por su pareja sentimental de nombre PELAGIO GARAY, quien actualmente reside en Barcelona, a través de Western Unión, cuyos detalles del depósito se detalla a continuación:
* Pago realizado a través de Western Unión, beneficiario el Sr. HUGO ALBERTO RUIZ NÚÑEZ, cargo banco FAMILIAR,  PIN N° 12465133884, N°  de orden ES1024095678.
Sigue manifestando la recurrente que en fecha 13/01/2026 la recurrente se dirigió hasta el Aeropuerto Internacional Silvio Pettirossi y recibió una llamada telefónica del Sr. HUGO RUIZ, quien le menciono que su vuelo se había cancelado por motivo de que la aerolínea tuvo un percance y que le iban a trasladar en un micro hasta Foz de Yguazú y posterior a Sao Pablo para que pueda abordar con una aerolínea, la recurrente confiada acepto lo manifestado y se dirigió a su domicilio a esperar, cabe destacar que el gasto generado del traslado, fue cubierto por el sindicado mas arriba, el monto de 300.000 gs., que fue depositado en la cuenta de la recurrente cargo BANCO FAMILIAR, desde la cuenta cargo UENO BANK, titular MARIO PIAVA, C.I N° 2406907, cuenta N° 1665247. Acto seguido, siendo las 15:00 horas aproximadamente la recurrente recibe un mensaje de texto de parte de una conocida suya que su vuelo tenia como destino final MILÁN, pero que sería sin retorno, por lo que la recurrente decide no realizar dicho viaje.
El día de la fecha la recurrente nuevamente se acercó hasta el Aeropuerto Internacional Silvio Pettirossi a fin de verificar si su vuelo fue cargado, donde fue atendida con una funcionaria quien le explicó que su viaje se había cargo el día de ayer 13/01/2026 pero que posteriormente solicitaron la cancelación, dicho viaje tenía como destino final MILÁN, no así Barcelona, por lo que sospecha que podría tratarse de una Estafa, ya que según la aerolínea nunca existió el pasaje que supuestamente se compró. Motivo por el cual se acerca hasta esta Dependencia Policial a poner a conocimiento de la autoridad competente para los fines que hubiere lugar.', 'DEPARTAMENTO CENTRAL, CIUDAD DE LUQUE, BARRIO ZARATE ISLA, AEROPUERTO SILVIO PETTIROSSI, RUTA DEPARTAMENTAL D025, ALEDAÑO AL BARRIO ZARATE ISLA.', NULL, NULL, 130, 154, 'Asunción', 'Suboficial Ayudante', 'DILMA MARIA', 'ALVARENGA OJEDA', NULL, NULL, '2A50CDA26', NULL, 'completada', '2026-01-14T16:46:43.781Z', NULL, NULL),
(225, 201, '2026-01-14T00:00:00.000Z', '14:36', '2026-01-14T00:00:00.000Z', '12:00', 'Extorsión', NULL, 'Menciona que, en horas de la mañana a través de la red social Facebook recibe una solicitud de amistad de un usuario que ya desconoce, al aceptar dicha solicitud empiezan a interactuar vía Messenger, posteriormente le proporciona el abonado numero 0991872191 y dice ser llamada Ailén, para continuar la conversación a través del WhatsApp, seguidamente cuando la conversación estaba bien fluida la señorita Ailén, sale y dice que la misma hizo una publicación en el Medio ABC Color sobre su persona por supuestamente meterse con menores de edad y le solicita el monto de Gs. 500.000 (quinientos mil) para que dicha publicación sea eliminada, y le proporciona el abonado numero 0986707487 para el giro de dinero a esta linea, también deja constar que recibió un mensaje del abonado numero 0975344132 haciéndose pasar por un conocido suyo de nombre David Aquino. Por todo los expuesto viene a formular denuncia para los fines pertinentes.', 'CIUDAD DE ASUNCIÓN, BARRIO RICARDO BRUGADA, FULGENCIO VILLAMAYOR ', NULL, NULL, 128, 178, 'Asunción', 'Suboficial Segundo', 'ARNALDO ANDRÉS', 'AVALOS RUIZ DÍAZ', NULL, NULL, '84C8E2A26', NULL, 'completada', '2026-01-14T18:04:57.743Z', NULL, NULL),
(226, 202, '2026-01-14T00:00:00.000Z', '15:11', '2025-07-15T00:00:00.000Z', '14:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Manifiesta la recurrente que contactó con un señor de nombre FABRICIO (cuyos mas datos no posee), con abonado número 0981764828, ya que la misma buscaba un CO-DEUDOR por una deuda que poseía, quien le derivó con otras personas, y en fecha 16 de julio del 2025 la misma había firmado un contrato privado de préstamo, compromiso de pago con la empresa ASIF (Asistencia Integral Financiera) a través de dos gestores, Alberto Martínez, con numero de teléfono 0974757945 y la señora Daryll Domecq numero de teléfono 0974757947, ya que la recurrente poseía una deuda aproximada de 60.000.000 millones de guaraníes para lo cual firmó dos hojas de pagaré a la orden Numero 0001529 y N° 0001528, sin fecha de vencimiento, ambos por el monto de 86.800.000 gs cada uno, para subsanar una situación crediticia que la misma poseía ene se momento, dichas hojas de pagares no se llego a concretar ya que la misma se dirigió hasta una sucursal de BNF  con la gestora Daryll Domecq a solicitar un crédito para poder seguir con la asesora financiera, pero no pudo acceder al préstamo debido a la deuda que poseía en ese momento.
En el mes de diciembre el Sr. Alberto Martínez le vuelve a contactar a la recurrente para reanudar la compra de la deuda y volver a probar el crédito con el banco Nacional de Fomento, en ese momento la recurrente no le prestó atención debido a que tenía algunas dudas y decidió no seguir con el proceso.
Sigue manifestando el recurrente que el día de la fecha estando en su domicilio particular a través de su correo electrónico solicito el informe de su estado de cuenta a la entidad de EQUIFAX PARAGUAY, una vez que le facilitaron el pedido, la recurrente se percata que tenía una deuda de 86.800.000 gs., teniendo como CO-DEUDOR a MANAGER SRL, mismo monto de las hojas de pagarés firmados en el mes de julio del 2025, pero distinta empresa como así también manifiesta que en ese mes no llegó a concretar la cancelación de la deuda que poseía en ese entonces, motivo por el cual se acerca hasta esta Dependencia Policial a poner a conocimiento de la autoridad competente para los fines que hubiere lugar. - ', 'CIUDAD DE ASUNCIÓN, BARRIO LAS MERCEDES, GRAL SANTOS ENTRE DEFENSA NACIONAL Y TENIENTE RUIZ', NULL, NULL, 131, 154, 'Asunción', 'Suboficial Ayudante', 'DILMA MARIA', 'ALVARENGA OJEDA', NULL, NULL, 'FD6659A26', NULL, 'completada', '2026-01-14T19:00:19.420Z', '2026-01-10T00:00:00.000Z', '10:00'),
(232, 208, '2026-01-15T00:00:00.000Z', '10:13', '2025-01-01T00:00:00.000Z', '07:00', 'Hurto', NULL, 'Que se presenta ante esta dirección especializada a fin de formular denuncia de un supuesto hecho de hurto ocurrido en fecha y hora  mencionada, el mismo manifiesta que es el asesor jurídico de la Asociación Mutual de Funcionarios de la Ande Jubilados Y Pensionados Y Funcionarios de la Caja de Jubilación y Pensión del Personal de la Administración Nacional de Electricidad, sigue relatando que desde fecha Enero a Octubre del 2025, se estuvieron malversando fondos de esta Asociación para fines personales, sindicando a los supuestos responsables a los señores, Carmelo Dejesus Castillo Espínola  con CI N° 3.334.584 (administrador), y Elva María Vera Morel, con CI N° 4.212.188 (Asistente Social), de un aproximado de 100.000.000 gs. (cien millones de guaraníes), el mismo menciona que les habría solicitado los documentos de gastos correspondientes donde los mencionados hasta la fecha se negaron a proporcionas dichas informaciones,  menciona además que los mencionados son personas  hostiles tratando siempre de poner dificultades en cuanto a la transparencia de dichas gestiones.', 'CIUDAD DE ASUNCIÓN, BARRIO LAS MERCEDES, MARILIONS ESQUINA DE LAS RECIDENTAS ', NULL, NULL, 132, 195, 'Asunción', 'Suboficial Ayudante', 'ANGEL GABRIEL', 'CARVALLO FLORENTIN', NULL, NULL, '6C16BEA26', NULL, 'completada', '2026-01-15T14:00:15.560Z', '2026-01-15T00:00:00.000Z', '11:00'),
(406, 331, '2026-01-22T00:00:00.000Z', '20:24', '2026-01-22T00:00:00.000Z', '14:30', 'Acceso indebido a sistemas informáticos', NULL, 'Manifiesta cuanto sigue: que, en fecha 22/01/2026 recibió una llamada telefónica de los números 0982755806; 0975781130 fingiendo ser funcionarios de TIGO, y que la llamada se debía a una actualización de datos personales, que posterior recibiría unos dígitos (códigos) relacionadas a la supuesta actualización, minutos después a lo mencionado el recurrente intento ingresar a su cuenta de WhatsApp , ya no logrando tener acceso al mismo. Ante lo expuesto cree que durante la llamada recibida manipularon su cuenta para posibles hechos ilícitos. Por lo que viene a poner a conocimiento de la autoridad competente para los fines que hubiere lugar.', 'CIUDAD DE ASUNCIÓN, BARRIO SAN ROQUE, HERRERA 1223', NULL, NULL, 218, 167, 'Asunción', 'Suboficial Ayudante', 'FATIMA', 'BERNAL FARIÑA', NULL, NULL, 'F8920AA26', NULL, 'completada', '2026-01-22T23:48:09.440Z', NULL, NULL),
(466, 392, '2026-01-27T00:00:00.000Z', '11:38', '2026-01-25T00:00:00.000Z', '21:30', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que se presenta a esta dirección especializada a modo de formular una denuncia de un supuesto hecho, ocurrido en fecha y hora ya mencionada, la recurrente menciona que realizo una transferencia erróneamente a la cuenta bancaria N° 619694149 con C.I N° 4-564-569, con transacción  N° 101891965  de la entidad bancaria UENO BANK, el monto total de 150.000 (ciento cincuenta mil guaraníes ), la misma menciona que dicha transferencia debía destinarse a la casera de la mencionada. ', 'CIUDAD DE ASUNCIÓN, BARRIO LA ENCARNACION, 15 DE AGOSTO Y HUMAITA ', NULL, NULL, 263, 208, 'Asunción', 'Suboficial Ayudante', 'ULISES GABRIEL', 'TORRES ROA', NULL, NULL, 'B04B09A26', NULL, 'completada', '2026-01-27T14:57:27.218Z', NULL, NULL),
(233, 209, '2026-01-15T00:00:00.000Z', '11:07', '2026-01-10T00:00:00.000Z', '18:00', 'Acceso indebido a sistemas informáticos', NULL, 'Se presenta a esta dependencia especializada a fin de realizar una denuncia de un supuesto hecho de acceso indebido a su linea telefonica N° 0981 542 755, la misma menciona que en fecha y hora mencionada mas arriba recibió una llamada telefónica atraves del abonado número 0981 610 445 y del N° 0983 257 261, simulando ser supuestos funcionarios de la empresa TIGO, ofreciéndole 3 meses de Tv y telefonía gratis sin abonar nada por ser buena clienta,  proporcionándole un código donde ella podría ir a abonar su mensualidad y en el sistema saltaría que estaría exonerada, sigue relatando que continuando la llamada a la misma le indicaban introducir algunos códigos atraves del teclado a lo cual la recurrente llego a realizar dicho acto, alega también que una sobrina suya le menciono que recibió un mensaje vía whatsApp atraves del mismo numero de la recurrente, pidiendo el monto de 400.000 Gs (cuatrocientos mil guaraníes), la misma le alega tener solo 150.000 Gs ( ciento cincuenta mil guaraníes), monto el cual aceptaron y le pasaron un numero de teléfono para GIROS TIGO N° 0985 523 117, el cual llego a enviar. Menciona también que varios familiares y conocidos se contactaron con ella comentándole que están recibiendo pedidos de dinero a nombre de ella atraves de la red social Facebook, vía WhatsApp y mensajería instantánea. También alega poder hacer llamadas desde su celular, pero el de ella se desvía y en una de las ocasiones le comenta su nuera que le atendió una persona de sexo masculino alegando en la primera llamada que supuestamente era numero equivocado y en la segunda llamada le solicitaron dinero para solucionar su teléfono. ', 'DEPARTAMENTO CENTRAL, CIUDAD DE ITAUGUÁ, BARRIO 6 DE ENERO, PAI PEREZ', NULL, NULL, 133, 204, 'Asunción', 'Suboficial Ayudante', 'DANNA ARAMI', 'RODRIGUEZ FERNÁNDEZ', NULL, NULL, 'B72166A26', NULL, 'completada', '2026-01-15T14:59:36.714Z', NULL, NULL),
(234, 210, '2026-01-15T00:00:00.000Z', '12:05', '2026-01-14T00:00:00.000Z', '08:34', 'Estafa', NULL, 'Que se presenta a esta direccion especializada a modo de formular denuncia por un supuesto hecho de estafa ocurrido en fecha y hora ya mencionada, el mismo manifiesta que se encontraba navegando en la plataforma dela red social  TIKTOK, donde visualiza un producto en la cual esta interesado (Alambre), poniendonse en contacto con el usuario de nombre EMPEÑOS LA SOLUCION con URL: https://vm.tiktok.com/ZMDkVyesw/, donde le consulta el precio del producto al numero 0985 66 75 64 que dejo de referencia, en el flayer de la mencionada publicacion,  poniendose en contacto con el supuesto vendedor, donde le menciona que el precio serian 10.000.000 (diez millones de guaranies) mencionandole que para la adquisicion de dicho producto debia abonar el monto total, a lo cual el recurrente no accedio a la condicion impuesta por el supuesto vendedor, donde el accede a enviar la suma de 3.000.000 (tres millones de guaranies) a la cuenta Nº321523563 entidad  BANCO ITAU,  que figura a nombre de Gustavo Miguel Ortega Noguera, el mismo menciona que le solicito el comprobante de envio para posterior vuelve a contactar con el supuesto vendedor no recibiendo retorno del mismo, percatandose de que fue victima de una estafa, sigue relatando que el dia de la fecha se percata de que se habria creado una cuenta bancaria sin su concentimientio de la entidad bancaria UENO BANK con cuenta Nº619370955, la cual el mismo desconoce la manera y fecha en que se creo temiendo asi de que se este utilizando para fines fradulentos ', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, BARRIO VILLA UNIVERSITARIA, YVAPURUNDY ESQUINA DE LA AMISTAD ', NULL, NULL, 134, 229, 'Asunción', 'Suboficial Ayudante', 'JUAN HERNAN', 'MACIEL GALEANO', NULL, NULL, '7A8F6CA26', NULL, 'completada', '2026-01-15T15:53:48.018Z', '2026-01-05T00:00:00.000Z', '12:13'),
(235, 211, '2026-01-15T00:00:00.000Z', '12:08', '2026-01-14T00:00:00.000Z', '13:39', 'Acceso indebido a sistemas informáticos', NULL, 'Que, se presenta ante esta Dependencia Especializada a fin de formular denuncia por un supuesto hecho de acceso indebido a sistemas informáticos, ocurrido en la fecha y hora indicada, La denunciante manifiesta que se encontraba en su domicilio cuando procedió a ingresar a su cuenta bancaria perteneciente a la entidad Banco Nacional de Fomento, cuenta N.° 000 09 4738158, a nombre de LETIZIA BEATRIZ FERREIRA BENÍTEZ, ocasión en la que se percató de la existencia de varias transacciones no reconocidas, específicamente ocho (8), las cuales se detallan a continuación:
