(236, 212, '2026-01-15T00:00:00.000Z', '13:14', '2026-01-02T00:00:00.000Z', '11:00', 'Estafa', NULL, 'Se presenta ante esta dependencia especializada a fin de realizar una denuncia de un supuesto hecho de estafa, ocurrido en la fecha y hora indicada mas arriba. El denunciante manifiesta que buscando en internet le redirige a la pagina de MERCADO LIBRE, donde visualiza una publicación la cual le llama la atención de un producto de un parlante JBL PARTYBOX 110 con el URL : https://articulo.mercadolibre.com.py/MPY-624919524-jbl-partybox-110-altavoz-portatil-negro-para-fiestas-_JM#reco_item_pos=0&reco_backend=item_decorator&reco_backend_type=function&reco_client=home_items-decorator-legacy&reco_id=23cff421-ca9e-4dee-a428-f35f10097560&reco_model=&c_id=/home/navigation-recommendations-seed/element&c_uid=f5930b30-8f0a-4917-a463-556cad498b93&da_id=navigation&da_position=0&id_origin=/home/dynamic_access&da_sort_algorithm=static, verificando el precio inferior al mercado nacional donde tendría el precio de 1.530.000 gs ( UN MILLON QUINIENTO TREINTA MIL GUARANIES) que el mismo menciona que se puso en contacto con el supuesto vendedor con el código HGITE63523,  quien le manifiesta que debería abonar la mitad para recibir dicho producto, donde el accede a enviar la suma de  765.000 GS (SETECIENTOS SESENTA Y CINCO MIL GUARANIES), A la cuenta N°  8116080067 la entidad bancaria BANCO FAMILIAR S.A.E.C.A, A nombre de VICTOR DARIO SUAREZ LEZCANO, luego de eso le emociona que su producto tendría un problema y que debería  que abonar la otra mitad de 765.000 GS (SETECIENTOS SESENTA Y CINCO MIL GUARANIES),   A la cuenta N°  8116080067 la entidad bancaria BANCO FAMILIAR S.A.E.C.A, A nombre de VICTOR DARIO SUAREZ LEZCANO, abonando así el monto total. Sigue manifestando que luego recibe un mensaje vía WhatsApp desde el abonado numero +1 (920) 238-6392, donde le envía un enlace https://www.blueridgehaulages.com/ y el código BHS7386836PY, para el seguimiento de la trazabilidad del producto. Luego le menciona que debe abonar otra cantidad de dinero  GS 600.500 (SEISCIENTOS MIL QUINIENTOS GUARANIES)  Por un supuesto sello de verificación Aduanera SVA a la cuenta N° 301015756, cargo BANCO SOLAR, a nombre de VIOLETA BELEM  VELOZO, con N° de C.I 4.503.732. Luego el 08/01/2026 vuelve a pedir otro monto reembolsable de GS 790.000 (SETECIENTOS NOVENTA MIL GUARANIES), A la cuenta N° 58853525, cargo TU FINANCIERA, a nombre de CESAR RAMON PANIAGUA BRITEZ, con N° de C.I 6.842.99. En fecha 10/01/2026 vuelve a escribir al recurrente solicitando tarifa de IVA/IMPUESTOS para poder liberar el paquete de la aduana de Asunción de monto GS 600.250 (SEISCIENTOS MIL DOSCIENTOS CINCUENTA) a la cuenta N° 13311432001, cargo BANCO GNB PARAGUAY S.A.E.C.A, a nombre VELOZO VIOLETA BELEM, con N° de C.I 4.503.732, luego le envía un contacto del supuesto delivery con N° de Celular 0984 096 853, le vuelve a manifestar el mismo que debe abonar una tarifa de envió GS 800.000 GS (OCHOCIENTOS MIL GUARANIES) a la cuenta N° 13309317001, a cargo del  BANCO GNB PARAGUAY S.A.E.C.A, a nombre de SILVERA SILVA SONIA, con N° C.I 7.026.171, el mismo contacto luego vuelve a pedirle 700.000 GS , que ya el mismo no accede. Sumando así la cantidad total enviada de GS 4.320.750 (CUATRO MILLONES TRECIENTO VEINTE MIL SETECIENTO CINCUENTA).', 'CIUDAD DE ASUNCIÓN, BARRIO LA CATEDRAL, ITURBE C/ MANUEL DOMINGUEZ', NULL, NULL, 136, 229, 'Asunción', 'Suboficial Ayudante', 'JUAN HERNAN', 'MACIEL GALEANO', NULL, NULL, '62AA24A26', NULL, 'completada', '2026-01-15T17:35:50.862Z', NULL, NULL),
(237, 213, '2026-01-15T00:00:00.000Z', '13:42', '2026-01-11T00:00:00.000Z', '16:00', 'Estafa', NULL, 'Que, se presenta a esta Dependencia Especializada a fin de formular denuncia sobre un supuesto hecho de Estafa en la fecha y hora mencionada, relata que contacto con la tienda de ventas de aparatos electronicos denominada como PHONELAND, ubicado sobre la avenida Mariscal Lopez casi Dr Morra, amodo de adquirir un aparato celular de la marca IPHONE, Modelo 15 PRO MAX de 256 gb, color Azul, con imei 1- 354449441401404, imei 2- 354449441312080 por la suma de 5.590.000 (cinco millones quinientos noventa mil guranies), donde la vendedora de este local menciona que dichos dispositivos son importados desde los Estados Unidos e originales, el denunciante menciona que entrego como parte de pago su celular de la marca IPHONE, modelo 12 PRO de 256GB, entregando asi una suma de 3.990.000 en concepto del pago por el total del precio, una vez concretada la compra el recurrente menciona que en fecha 11/01/2026 se perca que su dispositivo movil estaria reportado como robado en fecha 13/11/2025, al verificar en el enlace https://imeicheck.com/imei-check#google_vignette, luego de percatarse sobre ello el denunciante hace dicho reclamos en dicha tienda IPONELAND de forma presencial y luego atraves de la mensajeria WhatsApp, donde la vendedora le menciona que la garantia ya abria expirado por el motivo de la reparacion del dispositivo la cual fue realizado en dicho local 12/01/2026 por la suma 250.000 guaraníes , ademas de eso menciona que su hermana de nombre VIVIAN AURORA RIZZI AGUERO, habria adquirido un dispositivo movil de la marca IPHONE, MODELO 15 PRO MAX, presentando los mismo problemas legales.', 'CIUDAD DE ASUNCIÓN, BARRIO VILLA MORRA, AVENIDA MARISCAL LOPEZ', NULL, NULL, 137, 229, 'Asunción', 'Suboficial Ayudante', 'JUAN HERNAN', 'MACIEL GALEANO', NULL, NULL, '53EFBEA26', NULL, 'completada', '2026-01-15T17:46:01.579Z', NULL, NULL),
(239, 215, '2026-01-15T00:00:00.000Z', '14:40', '2026-01-15T00:00:00.000Z', '08:30', 'Estafa', NULL, 'Que, se presenta ante esta Dependencia Especializada a fin de formular denuncia por un supuesto hecho de estafa, ocurrido en fecha y hora a ser precisadas. Manifiesta que, a través de una publicación realizada en la plataforma Marketplace de la red social Facebook, se encontraba visualizando avisos de alquiler de viviendas. En ese contexto, logró contactar, mediante dicha red social, con una persona a quien la víctima facilitó su número telefónico. Posteriormente, recibió una llamada proveniente del número telefónico 0971283489, correspondiente presuntamente a una persona identificada como Favio Leiva, la segunda llamada seria atraves del n° telefónico 0974991584 quien seria el supuesto escribano denominado como Miller Donna. El mencionado sujeto le expuso las condiciones del alquiler del inmueble y, seguidamente, a través de la aplicación de mensajería WhatsApp, le remitió imágenes de la vivienda ofrecida, la cual supuestamente se encontraría ubicada en la ciudad de Lambaré, barrio Valle Yvate, sobre la calle Avambaré N.° 808, casi San Mateo y Guayaquí. El monto solicitado por el alquiler sería de 3.000.000 (tres millones de guaraníes), más la suma de G. 1.000.000 (un millón de guaraníes) en concepto de contrato, a ser gestionado mediante una escribanía con un supuesto escribano de nombre Jorge Miller Donna, Que, posteriormente, el denunciante se constituyó en el lugar donde se encontraría el inmueble ofrecido y, en razón de lo acordado previamente, realizó la transferencia de un monto de 3.000.000 en concepto de garantía del alquiler y 1000.000 en concepto de contrato del alquiler esta transferencia fue realizada a la cuenta de FAVIO MARCIAL GARCETE LEIVA C.I N° 4.323.833 N° de cuenta 604 351 200 155 1340 a la entidad de DIMO/CABAL una vez realizada esta transferencia dicha persona le menciona que le volvería a contactar, siendo así el denunciante se puso en contacto con la inmobiliaria denominada REMAX, donde fue atendido por el Jefe, además de eso se contacto con la entidad bancaria de esta empresa inmobiliaria, quien le informó que la persona identificada como Favio Leiva no seria el dueño de dicha casa, para solicitar la  reversión del dinero enviado donde le contesta que seria imposible, por lo que se pone en contacto con la entidad DIMO/CABAL mencionándole que el dinero ya ha sido transferido a otra cuenta, sigue relatando que hasta el momento sigue en contacto con el supuesto vendedor quien le habría Solicitado la suma de 3.000.000( tres millones de guaraníes) en concepto del primer mes de alquiler, el mismo accede a abonar dicho monto en efectivo y de manera presencial en la fecha 15/01/2026, a la cual el supuesto vendedor accede apersonarse en la vivienda.', 'CIUDAD DE ASUNCIÓN, BARRIO YKUA SATI, AVIADORES 2050 EDIFICIO WOLDTRADE CENTER ', NULL, NULL, 139, 229, 'Asunción', 'Suboficial Ayudante', 'JUAN HERNAN', 'MACIEL GALEANO', NULL, NULL, '96BF41A26', NULL, 'completada', '2026-01-15T19:28:36.968Z', NULL, NULL),
(240, 216, '2026-01-15T00:00:00.000Z', '17:19', '2026-01-14T00:00:00.000Z', '10:55', 'Estafa', NULL, 'Se presenta ante esta Dependecia Especializada a fin de formular una denuncia por un supuesto Hecho de Estafa ocurrido en fecha y hora mencionado mas arriba, el recurrente manifiesta que a travez de la red social FACEBOOK especificamente en MARKETPLACE encontro una publicidad de venta de AIRE ACONDICIONADO, en lo cual estaba interesado, menciona que procedio a comunicarse con la vendedora denominada en dicha pagina como GIANINA MUEBLES donde el recurrente le facilita su numero de Whatsapp, minutos despues la vendedora se pone en contracto con el,  desde el numero 0981722872 donde le indica el precio del AIRE TOKYO 12.000 btu con el valor de Gs. 700.000 ( setecientos mil guaranies ) el recurrente menciona que acepto el precio cerrando la compra de dicho producto, momento en donde la vendedora le facilita un Alias Morelvera29@gmil.com para proceder al pago del mismo una vez que reciba el producto. El recurrente menciona que no recibio el producto en la fecha por el cual le vuelve a escribir el dia de la fecha 15/01/2026 a la vendedora agendando la entrega par el dia, menciona que siendo las 15:30 hs aproximadamente recibe el producto en su domicilio su esposa identificada como EUGENIA BEATRIZ BAEZ, donde procede a la verificacion del producto confirmando que era el pedido solicitado, momento donde el recurrente intenta realizar la transferencia y fue rechazada el ALIAS facilitado por la vendedora, el denunciante menciona que se pone en comunicacion nuevamente con la vendedora mencionandole el rechazo del Alias, momento donde la vendedora facilita un nuevo ALIAS josegayoso633@gmail.com, el recurrente menciona que procede a realizar la transferencia a la cuenta cargo Banco FAMILIAR S.A.E.C.A con Nº de comprobante 1552513 a nombre de JOSE ALFREDO GAYOSO ESCOBAR con Nº de cuenta 8115704496  la suma de Gs. 700.000 ( setecientos mil guaranies ). Menciona el recurrente una vez abonado el pago el delivery seguia aguardando por lo que procede a comuinicarle que ya realizo el pago y el mismo le menciona que el costo del AIRE ACONDICIONADO es de Gs. 2.200.000 ( dos millones doscientos mil guaranies ) momento donde procede a mostrarle los mensajes con la vendedora y la transferencia realizada, donde el delivery desconoce a dicha vendedora y le solicita nuevamente la entrega del producto a lo que la señora EUGENIA BEATRIZ BAEZ procede a devolver. El recurrente menciona que intento comunicarse nuevamente con la vendedora donde ya no obtuvo respuestas de la misma.', 'CIUDAD DE ASUNCIÓN, BARRIO PINOZA, GRECIA 123 C/ AVDA PROCERES DE MAYO', NULL, NULL, 140, 229, 'Asunción', 'Suboficial Ayudante', 'JUAN HERNAN', 'MACIEL GALEANO', NULL, NULL, '416960A26', NULL, 'completada', '2026-01-15T21:09:37.556Z', '2026-01-15T00:00:00.000Z', '16:05'),
(241, 217, '2026-01-16T00:00:00.000Z', '08:33', '2026-01-13T00:00:00.000Z', '19:11', 'Lesión de la comunicación y la imagen', NULL, 'que siendo en hora y fecha mencionada mas arriba la misma recibe mensajes a través de la aplicación de mensajería instantánea WhatsApp del numero de teléfono abanado al 0981 488 747,  quien le envió un video privado con un señor y que el mismo le menciona que le iba  a enviar al marido de la denunciante con la intensión de perjudicarla. Sigue mencionando la recurrente que dicho video le había enviado a la esposa del señor Víctor y que de ahí supuestamente saco el video sin autorización de las mismas con intensión de divulgar dicho video y por tal motivo le dice a la denunciante que si no se aleja de su señora esposa de nombre LIDIA CESPEDES, Iba a enviarle a sus familiares. Por ultimo manifiesta la recurrente que los mismos estarían teniendo problemas de pareja y que le culpan a la denunciante de cubrirle a su señora la supuesta infidelidad. Así también la misma teme por su seguridad y la de su familia ya que el señor Víctor se caracteriza por ser muy impulsivo. ', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, BARRIO SANTA ANA', NULL, NULL, 141, 200, 'Asunción', 'Oficial Inspector', 'OLGA MARIBEL', 'SERVIN RIVAS', NULL, NULL, 'BBFFE3A26', NULL, 'completada', '2026-01-16T11:56:59.549Z', NULL, NULL),
(407, 332, '2026-01-22T00:00:00.000Z', '21:35', '2026-01-14T00:00:00.000Z', '12:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'La misma manifiesta que el dia de la fecha mencionada mas arriba la misma queria realizar una transaccion bancaria al alias Nº5217587 perteneciente a TU FINANCIERA a nombre del señor FABIO ACOSTA en concepto de pago de mercaderias por valor de 1.730.000gs , y al realizar la transaccion la misma se equivoca de un digito la cual fue enviada al alias Nº5217581  perteneciente al señor ARTURO FEDERICO GAYOSO GODOY con C.I Nº 5217581, por la suma de 1.730.000 gs. Sigue manifestando la recurrente que se puso en contacto a traves de la red social FACEBOOK con la señora MARIA ORTIZ quien le proporciono el numero de telefono abonado al 0982319621, perteneciente al señor ARTURO GAYOSO, con quien la misma se puso en contacto quien le manifesto que habia retirado dicho dinero y que ahora mismo no cuenta con el dinero para hacer la devolucion del mismo, por lo mismo viene a poner a conocimiento de la autoridad policial para los fines pertinentes como asi tambien para la devolucion del mismo.', 'DEPARTAMENTO CENTRAL, CIUDAD DE FERNANDO DE LA MORA, BARRIO CENTRAL, CALLE SIN NOMBRE', NULL, NULL, 219, 185, 'Asunción', 'Suboficial Ayudante', 'TIAGO JOSE', 'FRANCO AMARILLAS', NULL, NULL, '550FCFA26', NULL, 'completada', '2026-01-23T01:04:58.424Z', NULL, NULL),
(303, 238, '2026-01-16T00:00:00.000Z', '17:43', '2025-12-13T00:00:00.000Z', '15:00', 'Lesión de la comunicación y la imagen', NULL, 'Que se presenta en esta dependencia especializada a fin de promulgar una denuncia  de un supuesto hecho de DAÑO A LA IMAGEN, relata que desde la fecha 15/12/2025  se percata que sus fotos estaban siendo publicadas  en un grupo de la red social FACEBOOK denominado LESVIANAS HOT, que la misma desconoce y que el dia de ayer su hija le mando otra imagen que se habia publicada en el mencionado grupo de la misma red social y la afectada  intento de varias formas  ingresar a su cuenta de FACEBOOK por lo tanto ya no puede aceder a la misma pero que dicha cuenta de la recurrente sigue activa por lo que tambien sospecha que su cuenta a sido vulnerada, y desesperada no sabiendo mas que hacer, viene a poner a conocimiento a la autoridad policial para los fines que hubiere lugar', 'DEPARTAMENTO CENTRAL, CIUDAD DE CAPIATÁ, BARRIO KENNEDY, A LADO DE UN TALLER MECANICO DM', NULL, NULL, 154, 225, 'Asunción', 'Suboficial Ayudante', 'CESAR', 'FERREIRA BARRETO', NULL, NULL, '2EF0C7A26', NULL, 'completada', '2026-01-16T21:04:07.759Z', NULL, NULL),
(481, 407, '2026-01-27T00:00:00.000Z', '22:33', '2026-01-26T00:00:00.000Z', '15:30', 'Acceso indebido a sistemas informáticos', NULL, 'Manifiesta el recurrente que en fecha y hora mencionada mas arriba, recibio una mensaje en la aplicacion de mensajeria de Messeger de una persona de nombre Jose Domingo con URL https://www.facebook.com/jose.domingo.54772728, el mismo le solicita su numero de telefono particular, a lo cual el recurrente accedio y le facilita su numero, posterior le vuelve a enviar un mensaje donde le menciona que realizo un acceso indebido y que le envio su contraseña y si le puede facilitar dicho codigo, el recurrente menciona que procedio a enviarle el codigo que le llego a su numero, posteriormente recibe varias llamadas de su contacto para preguntarle si el mismo le solicito dinero a traves de Whatsapp, lo cual el denunciante menciona no haber hecho. Sigue manifestando el recurrente que al tratar de ingresar a la aplicacion de Whatsapp, el mismo estaba bloqueado. ', 'CIUDAD DE ASUNCIÓN, BARRIO SAN ANTONIO, TESTANOVA Y CORONEL GRACIA', NULL, NULL, 275, 169, 'Asunción', 'Suboficial Ayudante', 'WALTER DAVID', 'FRANCO CABRERA', NULL, NULL, '0E8D37A26', NULL, 'completada', '2026-01-28T01:59:39.085Z', NULL, NULL),
