(254, 218, '2026-01-16T00:00:00.000Z', '10:02', '2025-12-06T00:00:00.000Z', '08:00', 'Estafa', NULL, 'Que se presenta en esta Dependencia Especializada a fin de realizar una denuncia sobre un supuesto hecho de Estafa, menciona que en fecha 27/11/2025, cuando navegaba en la plata forma de TikTok, visualizo un perfil denominado Daniel JD Construcciones, con dirección de URL  https://www.tiktok.com/@jd.construcciones?_r=1&_t=ZM-937Twyu7rxb, donde ofertaban promociones para el acceso a construcciones de vivienda (casa), con entrega inicial y posterior cuotas corridas por valor de 3.000.000 Gs. (Tres millones de guaranies), quincenales, el denunciante interesado decidió contactar al numero 0984 729 594, publicado como numero de contacto en el perfil mencionado, recibiendo una respuesta del mensaje enviado en fecha 01/12/2025, por parte del supuesto arquitecto quien se identifico como JORGE DANIEL AGUERO ROJAS, una vez que conversaron sobre el proyecto el supuesto arquitecto le menciona que la suma total del valor de la casa seria por la suma de 109.000.000 Gs. (Ciento nueve millones), con entrega de 30.000.000 Gs. (Treinta millones de guaraníes), para el inicio de la obra, como el recurrente tenia justo un viaje programado en el Departamento de Alto Paraná - Ciudad del Este, acordaron que aprovecharía la ocasión para acercarse hasta la oficina del local de construcciones para realizar su entrega, el supuesto arquitecto le envió la ubicación de su Empresa, presentándose en fecha 06/12/2025, en el local y realizando la entrega por valor de 30.000.000 Gs. (Treinta millones de guaraníes), en efectivo. Por el monto de la entrega le confeccionaron una factura emitida por la supuesta Empresa JD Construcciones, con RUC N° 6272562-9, continua relatando que en fecha 18/12/2025 a las 10:20 horas vuelve a entregar la suma de 10.000.000 Gs. (Diez millones de guaraníes), para que supuestamente inicien las obras con mayor rapidez, realizando así el envió de dinero mediante una transferencia bancaria a la cuenta N° 2006000652776, a nombre de JD Construcciones E.A.S., cargo Banco Nacional de Fomento. También relata que en fecha 12/01/2026, se presento hasta la ciudad de Limpio, sobre la calle San José entre Independencia, en la Loteadora CONFOR, donde se encuentra ubicado su Terreno, donde debían realizar la edificación, ya que supuestamente la obra ya estaba en proceso, una vez que llego en el lugar visualizo que solo iniciaron con excavaciones para el supuesto cimiento, en el lugar se encontró con 2 albañiles quienes le mencionaron que estaban aguardando los materiales pero que ya transcurrieron varias horas, sin que llegue nada, por todo expuesto el recurrente cree que es victima de un supuesto hecho de estafa ya que hasta la fecha la obra no continua y tampoco recibe mas respuesta alguna por parte del supuesto arquitecto. Por lo que viene a poner a conocimiento ante la autoridad competente para los fines que hubiere lugar conforme a derecho.', 'DEPARTAMENTO DE PRESIDENTE HAYES, CIUDAD DE VILLA HAYES, BARRIO GOLONDRINA, KM 31', NULL, NULL, 142, 188, 'Asunción', 'Suboficial Segundo', 'ROMINA GISELL', 'SÁNCHEZ SANABRIA', NULL, NULL, '5A422EA26', NULL, 'completada', '2026-01-16T13:46:21.646Z', NULL, NULL),
(255, 219, '2026-01-16T00:00:00.000Z', '11:08', '2025-12-11T00:00:00.000Z', '15:00', 'Estafa', NULL, 'Que se presenta ante esta dependencia especializada a fin de formular una denuncia de un supuesto hecho de ESTAFA, sigue relatando la recurrente qué en fecha y hora mencionado mas arriba se encontraba navegando en la red social Instagram cuando visualizó una pagina de tienda de uniformes denominado SINAPSIS STUDIO en la cual ingreso a un enlace y le derivo a la red de mensajería WhatsApp con el abonado N°0971.614.874, donde la recurrente hizo un pedido de uniforme, que tenia un valor de 2.152.000 guaraníes, momento en el que el supuesto vendedor le manifiesta que debía abonar un anticipo del 30% en donde le facilito una cuenta bancaria al cual la afectada procedió a realizar una trasferencia a la cuenta N°619512493 por el monto de 600.000 guaraníes cargo BANCO UENO BANK a nombre de la beneficiada LORENA SOLEDAD ARGUELLO GAONA con CI N° 4.336.683 de fecha 11/12/2025, momento mas tarde le pide que abone el 50% de costo de su pedido y la recurrente vuelve realizar la trasferencia a la misma cuenta por el monto de 456.000 guaraníes, una vez realizada las transacciones la denunciante le pide la factura de compra para asegurar su pedido en donde los supuestos vendedores le facilitan una factura en el que figura el pago realizado del 50% del pedido, después realizado  todo ese proceso la recurrente le pide la dirección de su local para que personalmente pase a retirar su pedido al paso que le facilito una dirección que la misma presume que es no existe dicha dirección, pasado un tiempo los supuestos vendedores la vuelven a contactar pidiéndole que le facilitara la dirección de su domicilio y la misma le facilita la dirección requerida detallada mas arriba, ínterin el que le pide que abone el 100% del valor de su pedido en el que la misma vuelve a acceder a realizar una transacción por la suma de 1.076.000 guaraníes a la misma cuenta detallada mas arriba, pasado un tiempo y como no recibió el pedido hasta el día de la fecha sospecha que estaría siendo victima de una estafa, por lo que viene a poner a conocimiento de la autoridad policial para los fines que hubiere lugar.', 'CIUDAD DE ASUNCIÓN, BARRIO LAS LOMAS, FELIPE MOLAS LOPEZ', NULL, NULL, 143, 225, 'Asunción', 'Suboficial Ayudante', 'CESAR', 'FERREIRA BARRETO', NULL, NULL, 'D97040A26', NULL, 'completada', '2026-01-16T14:56:43.892Z', NULL, NULL),
(256, 220, '2026-01-16T00:00:00.000Z', '11:21', '2026-01-16T00:00:00.000Z', '10:41', 'Acceso indebido a sistemas informáticos', NULL, 'que viene a formular denuncia por un supuesto hecho ocurrido en fecha y hora mencionada mas arriba, en donde su señora esposa de nombre TERESA MOREL LEZCANO DE RODRIGUEZ con C.I 1.718.185, con numero de telefono abonado al 0982 472 911 quien tiene una cuenta de la aplicacion de mensajeria instantanea Whatsapp vinculada al mismo numero en donde recibe una llamada telefonica por parte de un numero de telefono abonado al 0987 171 394, quien le manifiesta que le estaban llamando por la actualizacion del sistema de WhatsApp y que  le estaria llegando un codigo de verificacion para la actualizacion, como asi tambien le pregunta a la señora si es que tenia una cuenta bancaria vinculada al numero de telefono la cual le responde que no y que le manifiesta que le llame mas tarde ya que estaba conduciendo. Sigue manifestando el denunciante que siendo a las 10:41 horas recibe un mensaje de texto desde la aplicacion de mensajeria de WhatsApp de su señora esposa quien le dijo HOLA COMO ESTAS DISCULPAME POR LA MOLESTIA, en donde le parecio raro es ahi donde realiza una llamada en donde nadie le contesta y le envia otra vez un mensaje preguntandole QUE PASO, Por lo ocurrido llama a su esposa a traves de una llamada normal y le avisa de todo lo ocurrido y confirma que le habian vulnerado su cuenta de WhatsApp por lo ocurrido viene  a poner a conocimiento de la autoridad Policial. Por ultimo manifiesta el denunciante que personas allegadas a las mismas como asi tambien en el grupo del colegio  reciben mensajes en donde estan solicitando dineros en concepto de prestamo ya que supuestamente estaria necesitando.', 'CIUDAD DE ASUNCIÓN, BARRIO RECOLETA', NULL, NULL, 144, 200, 'Asunción', 'Oficial Inspector', 'OLGA MARIBEL', 'SERVIN RIVAS', NULL, NULL, '2D26C7A26', NULL, 'completada', '2026-01-16T14:59:17.874Z', NULL, NULL),
