Sigue relatando el recurrente que desconoce las circunstancias del hecho por lo que viene a poner a conocimiento de la autoridad policial para los fines que hubiere lugar. ', 'CIUDAD DE ASUNCIÓN, BARRIO VIRGEN DE FATIMA, SOLDADO PARAGUAYO1585', NULL, NULL, 145, 225, 'Asunción', 'Suboficial Ayudante', 'CESAR', 'FERREIRA BARRETO', NULL, NULL, '5A6C60A26', NULL, 'completada', '2026-01-16T15:27:56.409Z', NULL, NULL),
(408, 334, '2026-01-22T00:00:00.000Z', '22:06', '2026-01-22T00:00:00.000Z', '14:30', 'Acceso indebido a sistemas informáticos', NULL, 'Que se se presenta ante esta Dependencia Especializada a fin de realizar una denuncia, menciona el recurrente que el día de la fecha aproximadamente a las 14:30 horas, recibe un mensaje en el que le consultaron si había recibido un archivo en su aplicación de Facebook, denominado José Amarilla, con dirección de URL https://www.facebook.com/share/16xkfKY2ab/ e Instagram, según manifiesta el denunciante el no se había percatado ya que no recibió ninguna notificación de lo recibido, en ese momento ingresa y visualiza que efectivamente llego un archivo en su aplicación de Facebook como en Instagram, y que ambos archivos ya fueron visualizados con anterioridad, por lo que en ese momento se percata de que ambas cuentas estarían teniendo un acceso indebido a sus datos, verificando los detalles de la ubicación de ultimo acceso a las cuentas mencionadas, cree que se trata de parte de su ex pareja de nombre SOLEDAD RUGGERI. Por lo expuesto viene a poner a conocimiento de la autoridad competente para los fines que hubiere lugar conforme a derecho. ', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, BARRIO BARCEQUILLO, NICANOR RIOS ESQ. MBOKAJA POTY', NULL, NULL, 220, 188, 'Asunción', 'Suboficial Segundo', 'ROMINA GISELL', 'SÁNCHEZ SANABRIA', NULL, NULL, 'AAD3BCA26', NULL, 'completada', '2026-01-23T01:19:54.215Z', NULL, NULL),
(422, 348, '2026-01-23T00:00:00.000Z', '16:31', '2026-01-23T00:00:00.000Z', '15:45', 'Acceso indebido a sistemas informáticos', NULL, 'Que, se presenta ante esta Dependencia Especializada a fin de formular una denuncia sobre un supuesto hecho ocurrido el dia 23 de enero del 2026, la misma refiere que en la mencionada fecha se encontraba en su domicilio particular descripto con antelacion y en ese interin le llega un mensaje de texto en la mensajeria instantanea de MESSENGER de parte de una persona con perfil denominada GLORIA FRANCO DE OLMEDO con URL https://www.facebook.com/gloria.francodeolmedo, solicitandole su numero de telefono y a la vez manifestandole que sin querer le envio su clave de acceso y que precisaba de forma urgente de la misma, segundo despues recibio una llamada a traves de la detallada aplicacion de parte de una persona que se le identifico como una supuesta sobrina de la SRA. GLORIA FRANCO DE OLMEDO comentandole e indicandole para que le pueda dictar los codigos de seguridad que le habia llegado concerniente a seis digitos de seguridad, la denunciante pensando de que se trataba de su amiga y colega acepta y procede a facilitarle dichos codigos y ulterior a tal acto perdio totalmente el acceso a su cuenta de WHATSAPP, motivo por el cual se apersona ante esta sede policial para dejar asentado su manifestacion pertinente temiendo que personas inescrupulosas y nefastas lleguen a perpetrar con su cuenta varios hechos punibles tipificados en nuestro codigo penal paraguayo.', 'CIUDAD DE ASUNCIÓN, BARRIO RECOLETA, EN SU DOMICILIO PARTICULAR, SITO SOBRE LA CALLE PACHECO 5285 C/ CRUZ DEL DEFENSOR, BARRIO RECOLETA DE LA CIUDAD DE ASUNCION, A UNA CUADRA DEL HOSPITAL BAUTISTA', NULL, NULL, 234, 181, 'Asunción', 'Suboficial Segundo', 'JOSÉ GERÓNIMO', 'BENÍTEZ BENÍTEZ', NULL, NULL, 'C8AF07A26', NULL, 'completada', '2026-01-23T20:29:00.911Z', NULL, NULL),
(438, 363, '2026-01-24T00:00:00.000Z', '10:41', '2026-01-04T00:00:00.000Z', '12:11', 'Estafa', NULL, 'Concurre ante esta dependencia Policial a objeto de formular denuncia sobre un hecho donde menciona que en fecha 04 de enero del 2026 siendo las 12:11 horas aproximadamente se pone en contacto atravez del abonado 0972433463 con el ciudadano de nombre MATIN RICARDO SANTOS ROA con CI Nº 1.842.624, numeral proporcionado por un amigo de la recurrente extraido desde la pagina de ventas online Marketplace, quien supuestamente se dedica a realizar trabajos como detective privado, a lo que la denunciante le solicita que le realize algunos trabajos investigativos, en fecha 05 de enero del 2026 siendo las 11:58 horas este supuesto detective se reune con la recurente en su domicilio para poder coordinar el trabajo investigativo a ser realizado y el costo que conlleva dicho servicio, sigue manifestando que llegaron a un acuerdo por el monto de Gs. 2.000.000(guaranies dos millones) como pago inicial y de acuerdo al resultado el monto final seria de Gs.7.000.000(guaranies siete millones) por lo que la recurente procede a realizar una trasferencia por el monto de Gs. 2.000.000(guaranies dos millones) a la cuenta Alias Nº 1842624, cuyo titular de la cuenta seria el ciudadano MATIN RICARDO SANTOS ROA,  de la entidad Bancaria Itau comprobante Nº 1646015, el saldo se iba a cancelar una vez realizado el trabajo solicitado, sigue manifestando que acordaron que dicha informacion el supuesto detective le tenia que proporcionar en 8 dias, relata que paso dicho plazo y no tuvo respuesta oportuna en referencia al trabajo solicitado por lo que presume que fue victima de una Estafa.', 'DEPARTAMENTO CENTRAL, CIUDAD DE LUQUE, BARRIO CUARTO BARRIO, DOMICILIO PARTICULAR DE LA RECURRENTE', NULL, NULL, 237, 183, 'Asunción', 'Oficial Primero', 'EMILIANO', 'FLORENTIN BAREIRO', NULL, NULL, '9FE88AA26', NULL, 'completada', '2026-01-24T14:31:17.006Z', NULL, NULL),
(444, 371, '2026-01-25T00:00:00.000Z', '14:40', '2026-01-23T00:00:00.000Z', '10:30', 'Estafa mediante sistemas informáticos', NULL, 'Manifiesta el recurrente que en fecha 23/01/2026 siendo las 10:30 hs de la mañana ingreso  en la red social Facebook y navegando encontró una pagina denominado "LOCALIZA PARAGUAY"(Alquiler de vehículos), el cual lo derivo directamente en la plataforma de WhatsApp de la supuesta empresa del abonado numero 0974101628 identificándose como Fátima Belén Benítez Gaona, supuesta gerente de dicha empresa, posterior empiezan a interactuar solicitando precios y modelos de los vehículos a ser alquilado, El mismo  conforme con el HIUNDAI HB20 1.0 con el valor de alquiler  por tres días de  1.096.000gs (Un millón noventa y seis mil gs) le comenta la gerente  que deberá abonar el 50% del valor que seria 500.000gs(quinientos mil gs)., sigue relatando el denunciante que realizo la transacción por la suma de 500.000gs(quinientos mil gs) a la cuenta N° 155902190 cargo BANCO BASA a nombre de  Fátima Belén Benítez Gaona con N° de Operación 141902894, minutos después el mismo  solicita la factura legal momento que le responde solicitando la totalidad del monto acordado, ínterin que se percata que seria una estafa, por esta razón viene a poner a conocimiento de las autoridades competentes para su investigación correspondiente para lo que hubiere lugar. ', 'DEPARTAMENTO CENTRAL, CIUDAD DE FERNANDO DE LA MORA, BARRIO ITA KA''AGUY, AYOLAS CASI ISLA PO,I', NULL, NULL, 242, 172, 'Asunción', 'Suboficial Ayudante', 'JACQUELINE MONTSERRAT', 'ESTIGARRIBIA ORTIZ', NULL, NULL, '188E03A26', NULL, 'completada', '2026-01-25T18:19:11.351Z', NULL, NULL),
(445, 372, '2026-01-25T00:00:00.000Z', '16:03', '2026-01-25T00:00:00.000Z', '07:00', 'Daño', NULL, 'El recurrente manifiesta que, en la fecha y hora mencionadas más arriba, tomó conocimiento —a través de familiares y amigos— de que en la red social Facebook, específicamente en la página denominada “Escrache Paraguay” (enlace: https://www.facebook.com/share/p/1DzrC5VvCX/), un perfil identificado como “EXCITEINGDRAGON2061” realizó una publicación en la cual se encontraba adjunta su fotografía, acompañada de comentarios de carácter peyorativo y difamatorio, con la clara intención de menoscabar y dañar su imagen personal y su honor institucional como funcionario de la Policía Nacional, atendiendo a que la imagen utilizada corresponde a una fotografía en la que el recurrente viste uniforme policial.

En ese sentido, el recurrente solicita se disponga la pronta investigación del hecho, así como la trazabilidad del perfil responsable, a partir de la obtención de datos técnicos, tales como dirección IP, datos de registro, suscripción y cualquier otra información relevante que permita identificar a los responsables de la mencionada publicación.', 'DEPARTAMENTO CENTRAL, CIUDAD DE LUQUE, BARRIO ISLA BOGADO, DOMILICIO DE LA VICTIMA', NULL, NULL, 243, 172, 'Asunción', 'Suboficial Ayudante', 'JACQUELINE MONTSERRAT', 'ESTIGARRIBIA ORTIZ', NULL, NULL, '38C5D0A26', NULL, 'completada', '2026-01-25T19:02:17.756Z', NULL, NULL),
(273, 223, '2026-01-16T00:00:00.000Z', '12:42', '2026-01-15T00:00:00.000Z', '20:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que se presenta ante esta Dependencia Especializada a fin de realizar una denuncia, menciona la recurrente que en fecha 15/01/2026 aproximadamente a las 20:00 horas, mientras se encontraba en su domicilio ingreso a la Plata forma denominada Portal Paraguay, la misma menciona que estaba interesada en acceder a informaciones referente a las tarjetas de vacunacion de sus hijos, dicho tramite era con la intencion de presentar dichos documentos para un viaje al exterior, continua relatando que al ingresar en dicha plata forma visualizo mas portales que hacian referencia a acceso a informaciones como: Cedula de Identidad, Cedula Automotor, Licencia de conducir y Habilitacion vehicular, la recurrente aprovecho la ocacion y accedio a verificar las informaciones de cada una de las carpetas mencionadas, pero al verificar la carpeta de habilitacion vehicular se percata de que existen 6 (seis) vehiculos habilitados a nombre de la recurrente las cuales menciona desconocer ya que no fueron solicitadas por la misma, detaladas cuanto sigue: 
- AUTOMOVIL DE LA MARCA BMW, MODELO 118D, AÑO 2009, CON MATRICULA NRO. HCR454.
- AUTOMOVIL DE LA MARCA KIA, MODELO PICANTO, CON MATRICULA NRO. WSAC617.
- AUTOMOVIL DE LA MARCA MINI, MODELO COOPER, CON MATRICULA NRO. KIWI007.
- CAMIONETA DE LA MARCA MAZADA, MODELO BT50 D/C 4X4, CON MATRICULA NRO. SDB007.
- STATION WAGON DE LA MARCA JEEP, MODELO CHEROKEE, CON MATRICULA NRO. DIRK288.
- AUTOMOVIL DE LA MARCA ROLLS ROYCE, MODELO SILVER SHADOW, CON MATRICULA NRO. NEM0001.
Todas habilitadas por la Municipalidad de la ciudadad de Luque, por tanto cree que sus datos personales estan sinedo utilizassin conocimiento de la misma, y con posibles fines ilicitos. Por lo expuesto viene a poner a conocimeinto de la autoridad competente para los fines que hubiere lugar, conforme a derecho, ', 'DEPARTAMENTO CENTRAL, CIUDAD DE LAMBARÉ, BARRIO VILLA CERRO CORA, ITA YVATE C/ PATRICIO ESCOBAR', NULL, NULL, 147, 188, 'Asunción', 'Suboficial Segundo', 'ROMINA GISELL', 'SÁNCHEZ SANABRIA', NULL, NULL, '13B86FA26', NULL, 'completada', '2026-01-16T16:20:12.420Z', NULL, NULL),
(440, 365, '2026-01-24T00:00:00.000Z', '15:12', '2026-01-23T00:00:00.000Z', '10:00', 'Estafa', NULL, 'Manifiesta el recurrente que, en fecha 23 de enero de 2026, siendo aproximadamente las 10:00 horas, se encontraba navegando en la red social Facebook, específicamente en el apartado Marketplace, ocasión en la que visualizó una publicación referente a la venta de “Postes lisos de quebracho colorado” por el precio unitario de Gs. 90.000, publicada desde el perfil de SOTERO GONZÁLEZ, con URL: https://www.facebook.com/sotero.gonzalez.7583.

Seguidamente, el recurrente contactó con el supuesto vendedor a través de la aplicación Messenger, medio por el cual este le facilitó el número telefónico 0991 745 307, registrado bajo la denominación “VENTAS DE POSTES”, continuando la conversación mediante la aplicación WhatsApp. En dicha comunicación, ambas partes arribaron a un acuerdo de compra-venta consistente en 70 postes de 2,20 metros y 4 postes de 4,50 metros, por un monto total de Gs. 4.550.000 (cuatro millones quinientos cincuenta mil guaraníes).
El supuesto vendedor solicitó al denunciante la realización de una transferencia bancaria como pago de los postes, facilitándole para tal efecto los datos de la cuenta correspondiente. Asimismo, le manifestó que dejaría su teléfono para dirigirse a trabajar, indicándole que cualquier consulta sería atendida por su hija.

Posteriormente, el denunciante realizó una llamada telefónica, siendo atendido por quien se identificó como la hija del supuesto vendedor, a quien consultó la posibilidad de abonar inicialmente la mitad del monto acordado, comprometiéndose a pagar el saldo restante al momento de la entrega de la carga, a lo cual esta accedió sin objeciones. En consecuencia, el denunciante efectuó una primera transferencia por la suma de Gs. 2.500.000 (dos millones quinientos mil guaraníes), a la cuenta con titular JOSE GABRIEL SOSA ROMERO, C.I. N° 8.087.404, del Banco Itaú Paraguay S.A., cuenta N° 25293751, en fecha 23/01/2026, a las 14:13 horas, según comprobante N° 2601233350809.

En horas de la tarde del mismo día, el supuesto vendedor volvió a comunicarse con el denunciante, manifestándole que la carga ya se encontraba lista y solicitándole el pago del saldo restante para la emisión de la factura correspondiente. Atendiendo a dicha solicitud, el denunciante realizó una segunda transferencia por el monto de Gs. 2.050.000 (dos millones cincuenta mil guaraníes), a la misma cuenta bancaria, en fecha 23/01/2026, a las 16:51 horas, conforme comprobante N° 2601233510380.

Continúa manifestando el denunciante que el supuesto vendedor le remitió una factura por el monto total abonado, la cual posteriormente fue eliminada de los mensajes. Asimismo, le indicó que la carga sería entregada en fecha 24 de enero de 2026, en horas de la mañana.
Llegado el día acordado y no recibiendo la mercadería, el denunciante intentó reiteradas veces comunicarse para consultar sobre el horario de entrega, recibiendo como respuesta que la carga llegaría “en breve”. No obstante, posteriormente fue bloqueado de toda comunicación, percatándose en ese momento de que había sido víctima de un hecho de estafa.
Por lo que viene a poner a conocimiento de las autoridades para los findes que hubiere lugar.', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, BARRIO VILLA INDUSTRIAL', NULL, NULL, 239, 224, 'Asunción', 'Suboficial Ayudante', 'MELANY MONSERRAT', 'MALDONADO CASTRO', NULL, NULL, '6A55C6A26', NULL, 'completada', '2026-01-24T19:23:48.717Z', NULL, NULL),
(341, 251, '2026-01-19T00:00:00.000Z', '09:49', '2025-08-15T00:00:00.000Z', '19:01', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Se presenta y manifiesta que hora mencionada mas arriba se encontraba en su domicilio, momento que le llega una notificación en su correo electrónico, donde le manifiesta que se encuentra atrasado en el pago de la cuota de un préstamo de dinero realizado en el banco UENO BANK, por valor de de 2.000.000gs (dos millones de guaraníes). Sigue manifestando que dicho préstamo el mismo no lo realizo, ingresando en su banca wed de dicho banco, corroborando que se realizo dicho préstamo y que posterior fue transferido a la cuenta N° 0001000007115504,  a cargo del banco Sudameris, a nombre de  CELINA ELIZABETH CABRERA SILVA, la suma de 2.000.000gs (dos millones de guaraníes) con comprobante N°2508153033960. Sigue relatando que la señorita Celina Cabrera es su ex pareja, y que la misma tiene acceso a su cuenta bancaria. Por tal hecho el recurrente le realiza llamada telefónica a su ex pareja, quien le manifiesta haber realizado el préstamo y que se niega en devolver el dinero y a pagar la deuda con el banco.- ', '', NULL, NULL, 162, 163, 'Asunción', 'Suboficial Inspector', 'JULIO CESAR', 'ROMERO ROMERO', NULL, NULL, '88E7CBA26', NULL, 'completada', '2026-01-19T13:18:19.265Z', NULL, NULL),
(361, 269, '2026-01-20T00:00:00.000Z', '15:43', '2026-01-19T00:00:00.000Z', '20:30', 'Acceso indebido a sistemas informáticos', NULL, 'Manifiesta el recurrente que en fecha y hora mencionada mas arriba recibe una notificacion del acceso de un dispositivo a su correo franciscogimenez.landfix@gmail.com siendo el dispositivo Galaxy S22, posterior a ello se realiza una transferencia  de 4.800.000 gs (Cuatro millones ochocientos mil guaranies) desde la cuenta del denunciante del banco familiar, teniendo como beneficiario a la cuenta Nº 301019171 de la entidad bancaria Solar banco, la misma a nombre de Julian Israel Fleitas Salinas con CINº 6.235.223, asi tambien el 19/01/2026 se registra compras en la tienda Game Cell por el valor de 30.100.000 gs (Treinta millones cien mil guaranies), sigue relatando el denunciante que habia realizado una denuncia del robo de su dispositivo celular Galaxy S22 en fecha 19/01/2026 en la comisaria 10ma de Asuncion. Tambien menciona que realizo el cambio de sus credenciales de acceso a sus cuentas personales. ', 'CIUDAD DE ASUNCIÓN, BARRIO SAN JORGE, JUEZ PINHO 2050 E/ VICTOR ABENTE HAEDO Y DR BESTARD', NULL, NULL, 180, 192, 'Asunción', 'Suboficial Ayudante', 'ISUSI ARAMI', 'GALEANO ALVARENGA', NULL, NULL, '70143DA26', NULL, 'completada', '2026-01-20T19:24:54.975Z', NULL, NULL),
(382, 290, '2026-01-21T00:00:00.000Z', '18:19', '2026-01-19T00:00:00.000Z', '13:30', 'EXTRAVÍO DE OBJETOS Y/O DOCUMENTOS', NULL, 'Que se presenta a esta direccion especializada a modo derealizar una denuncia de un supuesto hecho de extravio de objetos y/o documentos, la misma menciona que se encontraba en la estacion de servicio PETROBRAS sito sobre las calles EE.UU Y 25 DE MAYO, realizando una compra rutinaria, cuando en un momento dado extrae de su bolsillo su cartera para realizar el pago correspondiente donde, depositando dicho objeto en el mostrador, el miosmo menciona que despues de salir del lugar ya  a horarios de la tarde se percata de que ya no poseeia dicha cartera que segun el recurrente contenia su documento de identidad, una tarjeta de creditio de la entidad BANCO GNB y otra tarejeta de debito de la misma entidad, asi tambien menciona que contenia dinero en efectivo,  unmonto total de 250.000 guaranies (docientos cincuenta mil), razon por la cual viene a poner a conocimiento para los fines que ubiere lugar. ', 'CIUDAD DE ASUNCIÓN, BARRIO LA CATEDRAL, EE.UU Y 25 DE MAYO ', NULL, NULL, 198, 204, 'Asunción', 'Suboficial Ayudante', 'DANNA ARAMI', 'RODRIGUEZ FERNÁNDEZ', NULL, NULL, 'B0FA2EA26', NULL, 'completada', '2026-01-21T21:40:50.343Z', '2026-01-19T00:00:00.000Z', '17:30'),
(441, 366, '2026-01-24T00:00:00.000Z', '18:08', '2026-01-23T00:00:00.000Z', '21:46', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que en fecha y hora mencionada mas arriba se encontraba en su domicilio particular la misma es administradora de una cuenta en la red social Instagram, la cual utilizo con fines profesionales.

En los últimos días, ha tomado conocimiento de que la plataforma Instagram mostró o atribuyó a su cuenta imágenes que no le pertenecen, las cuales nunca estuvieron en su galería personal, nunca fueron subidas, publicadas, archivadas ni utilizadas, ni con consentimiento ni sin él.

Dichas imágenes corresponden a contenidos ajenos, sin relación alguna a la misma, pero fueron erróneamente asociadas a su perfil, situación que considera resultado de un error técnico o bug de la plataforma.

Como consecuencia directa de este hecho, esta siendo amenazada con acciones legales por supuesto uso indebido de imágenes, lo cual le genera un perjuicio legal, profesional y reputacional, pese a no haber realizado ninguna acción que justifique tales acusaciones. Por lo que viene a poner a conocimiento de las autoridades para los fines que hubiere lugar.', 'CIUDAD DE ASUNCIÓN, BARRIO LOS LAURELES,  DOCTOR TORIBIO PACHECO C/ R.I.6 BOQUERON ', NULL, NULL, 240, 158, 'Asunción', 'Oficial Ayudante', 'FRANCISCO NICOLAS', 'GALEANO BRITEZ', NULL, NULL, '460C84A26', NULL, 'completada', '2026-01-24T21:13:35.158Z', NULL, NULL),
(409, 335, '2026-01-22T00:00:00.000Z', '23:02', '2020-01-21T00:00:00.000Z', '15:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'El mismo manifiesta que el dia de la fecha mencionada mas arriba se encontraba en su consultorio cuando recibio una llamada de un supuesto conocido del abonado Nº0982821282 que tenia registrado en su directorio telefonico como el Dr.CARLOS MELGAREJO, la cual le habia proporcionado su secretaria de nombre ROSSANA MIÑO ,en la llamada  el supuesto conocido le manifiesta que queria hablar personalmente con el denunciante con el fin de pedirle ayuda monetariamente para un club situado en la ciudad de LUQUE , la cual el mismo acepta y decide hacer una transaccion de 150.000gs a la cuenta Nº8112736894 perteneciente al señor ANTONIO RUFINO GONZALEZ VALIENTE , el mismo se mostro muy agradecido por la transferencia realizada y como muestra de agradecimiento le ofreció carne vacuna , aceite y muslo de pollo , por la suma de 500.000gs, la cual el recurrente volvió a transferirle en la cuenta ya mencionada , y que le llegaría en horas de la noche , la cual no fue asi y se volvió a comunicar con el vendedor que le dijo que se había atrasado la encomienda y le llegaría en horas de la mañana , alrededor de las 09:00 vuelve a llamar el supuesto vendedor esta vez ofreciéndole Notebook, teléfonos ,televisor plana y una máquina para lavar autos por la suma de 800.000gs el cual el denunciante volvió a enviar el dinero por transferencia bancaria a la misma cuenta del supuesto vendedor , el cual nuevamente le pidió 200.000gs para supuestos tramites de aduanas para que el producto pueda llegar al denunciante , el cual el recurrente se negó a realizar la transacción sospechando que era una estafa , posterior a lo sucedido el recurrente trata de comunicarse nuevamente con el presunto estafador , el cual ya no le contestaba los mensajes ni las llamadas, y procedió a borrar todos los textos intercambiados por WHATSSAP. Por lo puesto viene a poner a conocimiento de la autoridad competente para los fines que hubiere lugar conforme a derecho.', 'CIUDAD DE ASUNCIÓN, BARRIO RECOLETA, CALLE CRUZ DEL CHACO 1245', NULL, NULL, 221, 188, 'Asunción', 'Suboficial Segundo', 'ROMINA GISELL', 'SÁNCHEZ SANABRIA', NULL, NULL, '729F13A26', NULL, 'completada', '2026-01-23T02:05:42.308Z', NULL, NULL),
(278, 225, '2026-01-16T00:00:00.000Z', '13:37', '2025-12-12T00:00:00.000Z', '14:27', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que se presenta ante esta Dependencia Especializada a fin de realizar una denuncia, menciona el recurrente que en febrero del año 2025, habia adquirido un perfume de un vendedor particular de supuesto nombre  JUAN FEDERICO MAXIMILIANO CUOMO MALPARTIDA, con                 C.I NRO. 2.128.677, por valor de 860.000 Gs. (Ochocientos sesenta mil guaranies), abonando como entrega inicial la suma de 200.000 Gs. (Doscientos mil guaranies) y posterior pago a cuotas, coordiandos entre ambos, continua relatando el recurrente que en ocasiones surgio algunos retrazos pero siempre conversables con el vendedor, en fecha 03/11/2025 el denunciante volvio a abonar la suma de 100.000 GS. (Cien mil guaranies), quedando como saldo la suma de 460.000 Gs. (Cuatro cientos sesenta mil guaranies), que pasado unos dias antes de cumplirse nuevamente el plazo para el pago recibe una notificacion prejudicial por parte de la empresa SEINCO, donde le comunicaron que dicha empresa habia adquirido a traves de un contrato de sesion de credito la cartera de clientes FEDERICO CUOMO, segun el recurrente la deuda era de un monto infimo a la actual deuda al que fue acreditado por la Empresa SEINCO, el cual ronda los 3.000.000 Gs. (Tres millones de guaranies), monto muy elevado a comparacion de la deuda inicial que manteria con la empresa anterior, tambien menciona que este vendedor procedio al incumplimiento verbal entre ambas partes - acuerdo inicial que habian mantenido al momento de la aquisicion del producto, por lo que menciona no ser coincidente con la fecha de pago y la apresurada venta del credito a la empresa SEINCO. Por lo expuesto viene a poner a conocimeitno de la autoridad competente para los fines que hubiere lugar.', 'CIUDAD DE ASUNCIÓN, BARRIO LAS MERCEDES, DE LAS RESIDENTAS 1075 ENTRE PADRE CARDOZO Y WASHINGTON', NULL, NULL, 148, 188, 'Asunción', 'Suboficial Segundo', 'ROMINA GISELL', 'SÁNCHEZ SANABRIA', NULL, NULL, '3CE96DA26', NULL, 'completada', '2026-01-16T17:06:12.893Z', NULL, NULL),
(410, 336, '2026-01-22T00:00:00.000Z', '22:34', '2026-01-22T00:00:00.000Z', '07:42', 'Estafa', NULL, 'que, el mismo viene  a realizar una denuncia por un hecho de estafa ocurrido en fecha y hora mencionada mas arriba, se puso en contacto a través de la red social Facebook específicamente en Marketplace con el usuario denominado RODRIGO SANCHEZ, con la intensión de adquirir una motocicleta de la marca Leopard Hb125 por un monto de 1.500.000 (Un millón quinientos mil guaraníes), por lo que le proporciona un numero de teléfono abonado al 0992338712 para seguir por la aplicación de mensajería instantánea WhatsApp. Una vez en la mensajería el supuesto vendedor le manifiesta la recurrente que necesitaba que realice un deposito de dinero para la realización del contrato privado que tendría un costo de 220.000 (doscientos veinte mil guaraníes) el cual accede a enviarle a través de una transferencia Bancaria a nombre de ANTONELLA RAQUEL MARTINEZ con C.I N° 4.368.829 y alias N° 4368829 cargo Banco TU FINANCIERA. Sigue manifestando el recurrente que posterior a eso el supuesto vendedor le pregunta al mismo si no necesitaba la habilitación y la cedula verde del biciclo y que ese tendría un costo de 130.000(ciento treinta mil guaraníes), el cual nuevamente accede a enviarle a través de una transferencia Bancaria a nombre de ANTONELLA RAQUEL MARTINEZ con C.I N° 4.368.829 y alias N° 4368829 cargo Banco TU FINANCIERA. Una vez cerrado dicho trato le manifiesta al denunciante que el envío del biciclo iba a ser realizado a través de una transportadora una vez aceptada las condiciones nuevamente le manifiesta que tuvieron un percance con la gente de la comisaria ya que supuestamente los documentos no estaban en regla y que para poder soltar el biciclo debía de pagar una suma de 100.000(cien mil guaraníes)  a una cuenta perteneciente a la señora ALICIA GIMENEZ con alias aliciahumenez@gmail.com. Sigue manifestando el denunciante que realizo varias transacciones mas a distintas cuentas Bancarias con la intención de hacer llegar la motocicleta hasta su domicilio. 
TRANSFERENCIA a nombre de José Rodrigo Martini Feltes alias N° aliciahumenez@gmail.com monto de 100.000 gs.
TRANSFERENCIA a nombre de Alicia Giménez alias N° 3.391.206 monto de 40.000 gs.
TRANSFERENCIA a nombre de ORLANDO DANIEL VALIENTE MIRANDA cuenta N° 1749867 con C.I N° 6.205.039 monto de 200.000 gs.
TRANSFERENCIA a nombre de Alicia Giménez alias aliciahumenez@gmail.com monto de 170.000 gs.
Por ultimo manifiesta el denunciante que le volvió a llamar al supuesto vendedor y que el mismo ya no atiende las llamadas y no le da retorno. Por lo que se percata de que fue un hecho de estafa y que viene a poner a conocimiento de la autoridad policial para los fines que hubiere lugar y para el esclarecimiento del hecho. ', 'CIUDAD DE ASUNCIÓN, BARRIO DR. GASPAR RODRIGUEZ DE FRANCIA, EDIFICIO PORVENIR', NULL, NULL, 222, 185, 'Asunción', 'Suboficial Ayudante', 'TIAGO JOSE', 'FRANCO AMARILLAS', NULL, NULL, 'F9E80FA26', NULL, 'completada', '2026-01-23T02:20:28.225Z', NULL, NULL),
