(411, 337, '2026-01-22T00:00:00.000Z', '23:11', '2026-01-21T00:00:00.000Z', '11:30', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que comparece ante esta dependencia Especializada a formular una denuncia  respecto a un supuesto hecho ocurrido, segun manifiesta el recurrente se encontraba navegando en la RED SOCIAL FACEBOOK-MARKETPLACE, buscando un alquiler de rodado UTV , la cual se contacto con el vendedor con el perfil de RICHARD GONZALEZ via MESSENGER para adquirir el servicio de alquiler , posterior a eso el supuesto vendedor le facilita su numero telefonico al denuciante, abonado Nº0983096522 el cual se ponen en contacto via WHATSAPP,el supuesto vendedor le solicita la suma de 1.600.000gs (un millon seiscientos mil guaranies) el cual el recurrente le envia mediante una transaccion bancaria al Nº de cuenta 6192366652 a nombre de LIDIA ESCOBAR con C.I Nº4626430 cargo UENO BANK , posterior a eso el supuesto vendedor le dice al denunciante que le iba a devolver el dinero en horas de la tarde , lo cual no fue asi , posterior a eso la victima trato de comunicarse con el supuesto vendedor pero este ya le habria bloqueado de todas sus redes cortando toda comunicación ', 'CIUDAD DE ASUNCIÓN, BARRIO RECOLETA, CALLE SIN NOMBRE', NULL, NULL, 223, 188, 'Asunción', 'Suboficial Segundo', 'ROMINA GISELL', 'SÁNCHEZ SANABRIA', NULL, NULL, '9B1887A26', NULL, 'completada', '2026-01-23T02:33:23.494Z', NULL, NULL),
(412, 338, '2026-01-23T00:00:00.000Z', '08:17', '2026-01-22T00:00:00.000Z', '10:00', 'EXTRAVÍO DE OBJETOS Y/O DOCUMENTOS', NULL, 'Manifiesta el denunciante que, en fecha de ayer, mientras se encontraba en su local comercial, se percató del extravio de su neceser que se hallaba en el interior de su mochila. Dicho neceser contenía cinco (05) chequeras en blanco, debidamente firmadas, detalladas de la siguiente manera: cuatro (04) chequeras de veinticinco (25) hojas cada una, correspondientes al Banco ITAÚ, asociadas a la cuenta N.° 700006437; y una (01) chequera de cincuenta (50) hojas correspondiente al Banco GNB, asociada a la cuenta N.° 13283373001, con número de referencia de chequera e141422012026, proveído por dicha entidad bancaria.', '', NULL, NULL, 224, 189, 'Asunción', 'Oficial Ayudante', 'MATIAS RAMÓN', 'ORTIGOZA GÓMEZ', NULL, NULL, 'CEAD87A26', NULL, 'completada', '2026-01-23T11:47:56.623Z', NULL, NULL),
(413, 339, '2026-01-23T00:00:00.000Z', '08:16', '2025-05-16T00:00:00.000Z', '13:00', 'Estafa', NULL, 'Que desde la fecha mencionada empezó a recibir propuestas de trabajo a través de la plataforma Telegram quien se identificó como Sandy Montaner posterior le deriva con su mentora Rosario para guiarle con el negocio para supuesta calificación de productos lo cual le iba a generar ganancias, posterior le facilitaron datos de cuentas en las cuales ella debería de transferir a varias cuentas, a nombre de NICOLÁS SAMUDIO CON C.I N° 5855118 a la cuenta N° 1641301 cargo BANCO ATLAS por el monto de 17.000 gs, la segunda fue a la misma cuenta ya mencionada por el valor de 6.500 gs, alegando que recibió una transferencia de 142.000 gs como ganancia desde la cuenta a nombre de DIEGO MOISÉS CANDIA CRISTALDO cargo BANCO FAMILIAR con cuenta N° ******65 en fecha 17/05/2025 agrega que su mentora le indicó que ya superó el nivel 1 y que si quería subir de nivel tenía que seguir invirtiendo a medida que se desempeñaba con su tarea debía realizar más transferencias, procediendo a realizar más transferencias como sigue, a nombre de BLAS SANTIAGO MENDEZ con C.I N° 180478 cargo BANCO ITAÚ con cuenta N° 29438734 POR EL MONTO DE 128.000 gs, la siguiente fue por el valor de 531.000 gs a nombre de ULISES MEDINA con C.I N° 5990789 a la cuenta N° 5856214 cargo BANCO SUDAMERIS, posteriormente vuelve a realizar otra transferencia por valor de 2.026.000 gs a la misma cuenta mencionada por pedido de su mentora, sigue mencionando que para retirar su ganancia desde su cuenta de Amazon debía abonar el 30% del monto total solicitado a retirar supuestamente porque su cuenta estaba en riesgo, indicando lo ocurrido a su mentora esta le deriva con atención al cliente, menciona además que le llega una notificación del sistema sobre la advertencia sobre el riesgo de su cuenta por error de número de tarjeta, indicando que desde atención al cliente le mencionaron que supuestamente su numero de cuenta se ingresó de forma incorrecta, mencionando la denunciante que ella habría brindado de forma correcta sus números pero que le vuelven a solicitar pago como seguro de reembolso para corregir el error de la plataforma, confiada en recuperar su dinero la misma vuelve a realizar la transferencia por el valor de 4.000.000 de gs a nombre de ALEXANDRA JAZMÍN CABRAL con C.I N° 7994902 con cuenta N° 8110917754 cargo BANCO FAMILIAR, sigue mencionando que le vuelve a solicitar el mismo valor para una nueva corrección de la plataforma ya mencionada, procediendo a realizar la transferencia a por el valor de 4.000.000 de gs a nombre de ALDO LOPEZ VERA con C.I N° 4216528 con cuenta N° 6191810984 cargo UENO BANK, le menciona su mentora que su puntuación habría bajado y que no podría acceder al monto de 30.000.000 gs, luego le menciona que debía de depositar un nuevo monto 10.000.000 gs para habilitar el acceso al canal de grandes cantidades, continuando con pagos fraccionados a distintas cuentas, la primera transferencia fue de un monto de 3.000.000 (tres millones) gs, a nombre de WILSON DANIEL FRANCO RODRÍGUEZ con C.I N° 5801393 con cuenta N° 619306790 cargo UENO BANK, la segunda transferencia  fue de 3.500.000 gs (tres millones quinientos mil) a nombre de TEÓFILA CENTURIÓN AMARILLA con C.I N° 6569683 con cuenta N° 73076241 cargo UENO BANK, la tercera transferencia de 3.500.000(tres millones quinientos mil) gs fue a nombre de WILSON DANIEL FRANCO RODRÍGUEZ con C.I N° 5801393 con cuenta N° 619306790 cargo UENO BANK, la cuarta de 4.900.000 gs a nombre de MONSERRATH DIAZ con C.I N° 5159192 con cuenta N° 54-21419 cargo BANCO FAMILIAR S.A.E.C.A, la quinta transferencia de 5.100.00 (cinco millones cien mil gs) a nombre de EMILCE PEREIRA RODAS con C.I N° 7168012 con cuenta N° 81-14729661 cargo BANCO FAMILIAR S.A.E.C.A, totalizando así la suma aproximada de guaraníes 50.672.000 (cincuenta millones seiscientos setenta y dos mil guaraníes), concluida con todas las transferencias citadas precedentemente el individuo le solicita otra transferencia de dinero a los efectos de poder retirar todas las ganancias que generó durante los meses, en ese lapso realiza una pequeña investigación particular a los efectos de saber la procedencia de dicha plataforma constatando así que fue víctima de un supuesto hecho punible contra el patrimonio (estafa), resaltando que todas las transferencias ut supra mencionadas lo efectúo desde su cuenta bancaria N° 68131777 con cargo TU FINANCIERA, cuenta N° 00094490117 cargo BANCO NACIONAL DE FOMENTO y cuenta N° 6192197540 cargo BANCO UENO BANK S.A. Sigue manifestando que lo ocurrido le causó un perjuicio patrimonial exorbitante y que por tal motivo solicita al agente fiscal de turno la realización de una investigación exhaustiva que pueda ayudarle a la dilucidación del supuesto hecho ilícito mencionado, además menciona que en el transcurso de los días acercará hasta el Ministerio Público todos los elementos materiales probatorios que pueda ayudar a conducir a su comprobación y calificación legal.   ', 'DEPARTAMENTO DE SAN PEDRO, CIUDAD DE GENERAL ISIDORO RESQUÍN, EN SU DOMICILIO PARTICULAR, SITO SOBRE LA CALLE MANUEL FRANCO Y YVYRARO, BARRIO 8 DE DICIEMBRE DE LA CIUDAD DE GRAL. ISIDORO RESQUIN, A UNA CUADRA DE LA IGLESIA ASAMBLEA DE DIOS', NULL, NULL, 225, 181, 'Asunción', 'Suboficial Segundo', 'JOSÉ GERÓNIMO', 'BENÍTEZ BENÍTEZ', NULL, NULL, '8EEB0CA26', NULL, 'completada', '2026-01-23T13:39:57.450Z', NULL, NULL),
(446, 373, '2026-01-25T00:00:00.000Z', '15:57', '2026-01-23T00:00:00.000Z', '10:27', 'Estafa', NULL, 'Que se presenta a esta Dependencia Especializada para realizar una denuncia de una supuesto hecho punible de Estafa, mencionando lo siguente, que el dia jueves 22/01/2026, a las 12:18 horas se comunica con la victima por la aplicacion Whatsapp una señora de supuesto nombre Romina Lizboa de España, con Cell Nº +1(782) 301-2146 , haciendose pasar por la amiga de la victima, diciendo que iba a venir de Espeña en fecha 30/01/2026, que llegaria de sopresa en el pais a sus familiares, pidiendole los datos personales a la recurrente para enviar encomiendas a su nombre, relata que la tal Romina le meciona que ya habia enviado sus datos personales a la empresa responsable del envio de la encomienda, empresa DHL, dicha empresa mencionada se comunica con la victima el 23/01/2026 a las 10:27 horas, via whatsapp con un asesor de nombre Edison Estupiñan Orduña, con Cel Nº 0991-938-891, diciendo que su paquete ya esta disponible, haciendole una llamada por dicha aplicacion ya mencionada, diciendole que debe abonar un monto por una supuesta mutal de 37.475.460.74 gs por sobrepeso de la encomienda, en donde la victima le menciona al supuesto Edison que solo consiguio 8.500.000 gs, ya que el plazo del pago era hasta las 14:00hs de dicha fecha ya mencionada, enviandole por transferencia de la entidad Banco Itau a la cuenta Nº 13999162 de Tu Financiera a nombre de Ana Carina Benitez Gimenez con CI Nº 3.982.840, Cel Nº 0976-151-580, el tal Edison le envia el comprobante del pago en fecha 24/01/2026, volviendole a pedir un pago de 10.000.000gs para la entrega de la encomienda, en donde se percata que estaba siendo victima de una supuesta estafa y el dia Domingo 25/01/2026 la victima se comunica con la tal Romina para comunicarle que supuestamente ya tenia el monto mecionado mas arriba, sigue relatando que la tal Romina le envia la cuenta en donde debera hacer la transferencia, de entidad Banco Itau Nº 25243486 a nombre de Ana Carina Benitez con CI Nº 3.982.840. La recurrente presentara ante al Ministerio Publico las siguientes documentaciones, comprobante de transferencia, metodo del pago, la confirmacion de la entrega y la multa impuesta por sobrecosto en paqueteria. ', 'CIUDAD DE ASUNCIÓN, BARRIO CIUDAD NUEVA, PETIROSSI CASI PAI PEREZ ', NULL, NULL, 244, 176, 'Asunción', 'Suboficial Ayudante', 'ALEXIS MIGUEL', 'AGÜERO GIMÉNEZ', NULL, NULL, 'F2C76AA26', NULL, 'completada', '2026-01-25T20:25:07.198Z', NULL, NULL),
(439, 364, '2026-01-24T00:00:00.000Z', '11:53', '2026-01-13T00:00:00.000Z', '22:54', 'Estafa mediante sistemas informáticos', NULL, 'Que, en fecha 15/01/2026, el denunciante se encontraba en su domicilio particular, momento en el cual ingresó a la aplicación de UENO BANK, vinculada a su caja de ahorro N.° 6191756720, donde visualizó una transferencia que no reconoce por el monto de Gs. 250.000 (doscientos cincuenta mil guaraníes), realizada a la cuenta cuyo titular es RODOLFO GABRIEL REINEZ ENCINA, Banco BNF, cuenta N.° 000099241169.

Dicha transferencia figura realizada en fecha 13/01/2026, a las 22:54 horas, con número de comprobante 2601135110131.

En fecha 15/01/2026, el denunciante se comunicó con el Call Center del banco, donde informó lo ocurrido, solicitándosele por parte del funcionario interviniente el envío del comprobante de la transacción vía correo electrónico, a fin de proceder a su verificación, así como la realización de la correspondiente denuncia para el inicio de la investigación. 

Continúa manifestando el denunciante que no reconoce dicha transacción, desconociendo a la persona que la habría realizado, y aclara que en ningún momento proporcionó ni envió datos de su cuenta bancaria a terceras personas. Refiere también que otras personas no tienen acceso a su cuenta de banco y tampoco a su aparato celular. Por lo que viene a poner a conocimiento de las autoridades para los fines que hubiere lugar. ', 'DEPARTAMENTO CENTRAL, CIUDAD DE LUQUE, BARRIO MARAMBURE, PADRES UNIDOS C/ LAS RESIDENTAS ', NULL, NULL, 238, 158, 'Asunción', 'Oficial Ayudante', 'FRANCISCO NICOLAS', 'GALEANO BRITEZ', NULL, NULL, '22D7A2A26', NULL, 'completada', '2026-01-24T15:25:06.784Z', NULL, NULL),
(301, 236, '2026-01-16T00:00:00.000Z', '16:38', '2026-01-16T00:00:00.000Z', '15:25', 'Estafa', NULL, 'Que se presenta en esta dependencia especializada a fin de formular su denuncia sobre un supuesto hecho de ESTAFA, menciona que en día de la fecha se encontraba en su domicilio particular recibe un mensaje en la red de mensajería WhatsApp del abonado N°0993529361 quien se hace pasar por GERMAN GABRIEL MALVETTI ACOSTA que es hijo del afectado, pidiendo un favor para efectuar un pago por que su limite diario se excedió, donde el denunciante no creyó del todo que era su hijo como le pidió dinero le dijo a la persona que al menos le diera un dato suyo para así poder acrecentar mas su identidad y el mismo le responde con la fecha exacta de su nacimiento con el que el recurrente quedo convencido que era su hijo, ínterin en el que accedió a realizar una transacción con N° de comprobante 193297379 cuenta N° 81-15837541 por el monto de 6.300.000 guaraníes cargo BANCO FAMILIAR al beneficiado ALVARO DENNIS ECHEVERRIA MARTINEZ con CI N°7.931.989 de fecha 16/01/2026, una vez realizado toda la transacción el afectado procede a llamar a su hijo al numero que tenia registrado entre sus contactos y que realmente era de su hijo en donde su  le dice que no haga ninguna transferencia que se trataba de una estafa, por lo que viene a poner a conocimiento de la autoridad policial para los fines que hubiere lugar.', 'CIUDAD DE ASUNCIÓN, BARRIO DR. GASPAR RODRIGUEZ DE FRANCIA, LAGERENZA', NULL, NULL, 152, 225, 'Asunción', 'Suboficial Ayudante', 'CESAR', 'FERREIRA BARRETO', NULL, NULL, 'E20E40A26', NULL, 'completada', '2026-01-16T20:07:27.314Z', NULL, NULL),
(291, 228, '2026-01-16T00:00:00.000Z', '15:34', '2025-07-18T00:00:00.000Z', '10:10', 'Estafa', NULL, 'Que se presenta ante esta Dependencia Polical a fin de realizar una denuncia, menciona la recurrente que en fecha 18/07/2025, recibio llamada telefonica del numero 0984 844 551, quien se identifico como Lic. SONIA RAQUEL TORRES, con C.I NRO. 3.233.255, quien supuestamente cumple el cargo de Coordinadora Pedagogica, esta persona le ofrecio supuestamente ayuda para acceder a un rubro de docencia, esta persona supuestamente supo de su interes a traves de una tercera persona, un conocido de la zona, continua relatando que en la llamada mencionada esta persona le ofrece su ayuda para conseguir el rubro pero que debia abonar la suma de 6.000.000 Gs. (Seis millones de guaranies), que con esa suma la misma podria acceder a 2 (dos), rubros, y si la misma aceptaba podria cargar inmediatamente sus datos para la acreditacion, mencionandoles que contaban con 24 horas, para realizar el pago antes que cirre el sistema, la recurrente interesada accede al envio de dinero mediante transfrencia bancaria a una de las cuentas 1) Nro. 6191682798, con alias 3233255, cargo UENO BANK Y 2) Cuenta Nro. 8112303054, cargo EKO FAMILIAR, ambas cuentas proporcionadas por la Licenciada SONIA, accediendo a la transfrencia en la cuenta Nro. 6191682798, con alias 3233255, cargo UENO BANK, por valor de 4.000.000 Gs. (Cuatro millones de guaranies), como anticipo, continua relatando que conforme pasaron los dias volvio a solicitar la suma de 1.000.000 Gs. (Un millon de guranies), a la misma cuenta cargo UENO BANK, para tramites de papeleos faltantes, acordando que los 1.000.000 Gs. (Un millon de guaranies), restantes los abonaria una vez finiquitado y ser beneficiada con los rubros, pero a la fecha solo recibe excusas por lo que cree que al pasar tanto tiempo de la fecha acordada cree que es victima de un supuesto hecho de estafa. Por lo que viene a poner a conocimiento de la autoridad competente para los fines que hubeire lugar conforme a derecho.', 'DEPARTAMENTO DE SAN PEDRO, CIUDAD DE SAN PEDRO DE YCUAMANDIYÚ, MARISCAL LOPEZ ENTRE LIBERATO MARECO', NULL, NULL, 150, 188, 'Asunción', 'Suboficial Segundo', 'ROMINA GISELL', 'SÁNCHEZ SANABRIA', NULL, NULL, 'FC9012A26', NULL, 'completada', '2026-01-16T18:28:31.494Z', NULL, NULL),
(300, 235, '2026-01-16T00:00:00.000Z', '15:23', '2026-01-12T00:00:00.000Z', '12:00', 'Estafa', NULL, 'Que se presenta en esta dependencia especializada para realizar una denuncia de un supuesto hecho de ESTAFA, manifiesta el recurrente que en fecha mencionado mas arriba se encontraba en su domicilio particular navegando en la red social FACEBOOK cuando visualiza una oferta de motocicleta en donde procedió a escribirle al supuesto vendedor y el mismo le facilito un abonado N°0984496431 en el cual empezaron a entablar una conversación sobre la oferta publicada en la red social y que el recurrente le dice al vendedor que esta interesado en adquirir la moto y le consulto sobre el precio que tenia, en donde el vendedor le dice que el valor del producto era de 5.000.000 guaraníes y que necesitaba el 50% del mismo en el cual le facilita una cuenta bancaria a la victima procedió a realizar una transacción a la cuenta N°619816484 cargo UENO BANK con el monto de 2.400.000 guaraníes al beneficiado PAULO ALBERTO ARMOA con CI N°4.888.035, mas tarde el supuesto vendedor le escribe de vuelta a la victima para consultarle si no tenia problema en que le mandara la motocicleta por transportadora de las empresa TSI, en donde posterior a eso recibe una llamada de un supuesto empleado de la mencionada empresa que también le manifestó que debía abonar el 100% del valor de la moto para así únicamente poder enviarle por la dicha transportadora y que el recurrente volvió a realizar otra transacción  a la misma cuenta bancaria mencionada mas arriba por el monto de 2.450.000 guaraníes y posterior a eso también le pidió que haga otra transferencia para poder pagar el contrato privado en la escribanía donde también realizo otra transacción a dicha cuenta por el monto de 300.000 guaraníes, ya hecho todas las transacciones requeridas por el supuesto vendedor y el personal de la empresa transportadora TSI le dijeron que ya estaban en camino a su domicilio para la entrega de su pedido, ínterin en el que recibe otra llamada de un supuesto personal policial que le dijo que el camión quedo retenido en un control policial en el peaje de la Cuidad de Ypacarai, y que necesitaba la suma de 2.000.000 guaraníes para así poder liberar el camión, momento el que el afectado se da cuenta que estaría siendo victima de una estafa por lo que viene a poner a conocimiento de la autoridad policial para los fines que hubiere lugar. 
', 'DEPARTAMENTO CENTRAL, CIUDAD DE LIMPIO, BARRIO COLONIA JUAN DE SALAZAR, FERNANDO MAGALLANES', NULL, NULL, 151, 225, 'Asunción', 'Suboficial Ayudante', 'CESAR', 'FERREIRA BARRETO', NULL, NULL, 'B39886A26', NULL, 'completada', '2026-01-16T19:05:06.445Z', NULL, NULL),
(302, 237, '2026-01-16T00:00:00.000Z', '16:53', '2024-07-30T00:00:00.000Z', '07:00', 'Acceso indebido a sistemas informáticos', NULL, 'Que viene a formular una denuncia sobre uso de su tarjeta de credito no autorizado ocurrido en fecha 30/07/2024 en horas de la mañana, desde su tarjeta de credito cargo Banco GNB Master Card Oro, con Numero 5454890000146294 con una linea de credito de 10.200.000 guaranies, del cual se realizo un pago de 7.588.567 guaranies en concepto de pago por GOOGLE ADS. sigue manifestando el recurrente que ese mismo dia verifica en su aplicacion del Banco GNB, en donde pudo constatar lo ocurrido y  se apersona hasta el banco para realizar la denuncia correspondiente y que se haga el bloqueo definitivo de dicha tarjeta. Sigue manifestando el denunciante que se habilito si su consentimiento otra tarjeta de credito Master Card Oro, con numero 5454890000146290, en donde le generan la misma deuda para seguir cobrando. Cabe mencionar que el Banco ya habia vendido a la empresa nexo la cuenta y que se fueron a consultar nuevamente ahi y que en ningun momento les dieron una respuesta. Por utimo manifiesta el recurrente que a partir de todo lo ocurrido sus familiares y el mismo no atienden llamadas de numeros desconocidos. Por lo que viene a poner a conocimiento de la autoridad Policial para los fines que hubiere lugar. No habiendo mas nada que agregar se por terminada el presente acta firmando al pie el personal interviniente y el denunciante.', 'CIUDAD DE ASUNCIÓN, BARRIO RECOLETA', NULL, NULL, 153, 225, 'Asunción', 'Suboficial Ayudante', 'CESAR', 'FERREIRA BARRETO', NULL, NULL, '9A4398A26', NULL, 'completada', '2026-01-16T20:25:34.659Z', NULL, NULL),
(304, 239, '2026-01-16T00:00:00.000Z', '19:17', '2026-01-15T00:00:00.000Z', '17:00', 'Estafa', NULL, 'Que se presenta en esta dependencia especializada a fin de formular una denuncia de un supuesto hecho de ESTAFA, relata el recurrente que el dia y hora mencionado mas arriba se encontraba en su domicilio particular navegando en la red social FACEBOOK cuando encuentra una pagina de alquiler de autos y envia un mensaje atra vez de la red de mensajeria MESSENGER en donde le facilitan un abonado Nº0982786741, en el cual empezaron a intercambiar mensajes referente al alquiler de un vehiculo donde le pide al recurrente que le facilte sus documentos personales en donde el mismo accede al pedido y que tambien deberia abonar la seña para asegurar el alquiler del auto, momento en donde le facilita una cuenta bancaria y el afectado realiza una transaccion a la cuenta Nº2011929501 entidad TU FINANCIERA con monto de 550.000 guaranies a nombre del beneficiada MILAGROS JHULIANA DIAZ CESPEDES con CI Nº 5.571.937 de fecha 15/01/2026, una vez realizado todo ese proceso se vuelve a contactar con el y nuevamente le pide un monto de dinero para el seguro de vida donde el recurrente accede de vuelta realizando otra transferencia de la suma 300.000 guaranies a la misma cuenta detallada mas arriba, cuando llego la hora de usufructuar el servicio que gestiono no recibio mas ninguna respuesta de la persona con quien contacto, en el que se da cuenta que estaria siendo victima de una estafa, por lo que viene a poner a conocimiento de la autoridad policial.', 'CIUDAD DE ASUNCIÓN, BARRIO SANTA LIBRADA, SANTA VERONICA', NULL, NULL, 155, 225, 'Asunción', 'Suboficial Ayudante', 'CESAR', 'FERREIRA BARRETO', NULL, NULL, 'CD5CE2A26', NULL, 'completada', '2026-01-16T22:47:32.712Z', NULL, NULL),
(310, 247, '2026-01-17T00:00:00.000Z', '15:37', '2026-01-17T00:00:00.000Z', '08:30', 'EXTRAVÍO DE OBJETOS Y/O DOCUMENTOS', NULL, 'El mismo se presenta como titular de la cta cte nº550500048 en dolares cargo banco ITAU, a presentar denuncia de extravio de una hoja de cheque con numero 3513639, con monto de 1000 dolares americanos ( mil dolares americanos), ocurrido en fecha 17/01/2026, via publica. Por lo que se presenta en esta unidad policial a poner a conocimiento de las autoridades competentes para los fines pertinentes.', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, BARRIO BARCEQUILLO, NO  PUDO ESPECIFICAR', NULL, NULL, 156, 158, 'Asunción', 'Oficial Ayudante', 'FRANCISCO NICOLAS', 'GALEANO BRITEZ', NULL, NULL, '85922DA26', NULL, 'completada', '2026-01-17T19:01:26.792Z', NULL, NULL),
(305, 240, '2026-01-17T00:00:00.000Z', '14:12', '2026-01-16T00:00:00.000Z', '18:17', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que, se presenta ante esta Dependencia Especializada a fin de formular una denuncia sobre un supuesto hecho ocurrido el día 16/01/2026, la misma refiere que en la mencionada fecha se encontraba en su domicilio particular citada precedentemente, en ese ínterin recibió un mensaje de texto en la mensajería instantánea de WhatsApp, de parte de una persona con abonado +12895639950, quien se le identifico como ANA MARÍA CABALLERO FERNÁNDEZ (supuesta amiga y colega de la recurrente) manifestándole que en la sede del Aeropuerto Internacional Silvio Pettirossi-Asunción se encuentran 2(dos) cajas de regalos y que necesitaba la ayuda de la misma para poder recibir dichos paquetes, las cuales le iban a llegar a través de la supuesta empresa DHL (Empresa Líder Mundial en Logística y Envíos de Paquetes) al día siguiente, a la vez le solicita datos personales como ser fotografía de cedula de identidad, dirección de domicilio  y correo electrónico, debido a que la denunciante se encontraba en horario laboral facilito los datos de su hijo Emir Diaz Quintana a los efectos de realizar el procedimiento de consignación de datos y ulterior entrega de encomienda, el día de la fecha 17/01/2026 su hijo Emir recibió una llamada telefónica de parte de una persona con abonado +17539994706 identificándose como Édison Estupiñán supuesto asesor de la empresa DHL, mencionándole que el motivo de su llamada seria a fin de corroborar sus datos personales para así entregarle en horas de la tarde la supuesta encomienda, subsiguientemente le comenta que sus paquetes arrojaron inconsistencias en sobre costo y que para poder liberar se tenia que abonar el monto de 35.000.000 millones de guaraníes aproximadamente, seguidamente le envían una supuesta notificación de Derechos Arancelarios en donde se establece una sanción de conducta penal de un sobre costo de encomiendas enviadas desde el extranjero y en el caso de no cancelar la multa consistente en guaraníes 35.000.000 incurriría a la Evasión de Impuestos Tributarios, estupefacto por lo observado empezó a realizar averiguaciones referente a lo acaecido constatando así que el documento recibido no correspondía de ninguna manera a un documento oficial de la DNIT, por el hecho de poseer varias anomalías, por ende deduce que fueron victimas de un supuesto hecho de intento de ESTAFA tipificado en nuestro Código Penal Paraguayo, resalta que temen  que lo acontecido le lleguen a perjudicar debido a que se facilito todos los datos de su hijo Emir Diaz Quintana, por lo que se deslinda de toda responsabilidad civil y penal que le puedan acarrear dicha situación.
  











', 'DEPARTAMENTO CENTRAL, CIUDAD DE FERNANDO DE LA MORA, BARRIO DOMINGO SAVIO, EN SU DOMICILIO PARTICULAR, SITO SOBRE LA CALLE JOSÉ CAZAL N°1846, A UNA CUADRA DEL COLEGIO EDUARDO KISHI', NULL, NULL, 157, 181, 'Asunción', 'Suboficial Segundo', 'JOSÉ GERÓNIMO', 'BENÍTEZ BENÍTEZ', NULL, NULL, '32149BA26', NULL, 'completada', '2026-01-17T18:06:39.189Z', NULL, NULL),
(311, 248, '2026-01-17T00:00:00.000Z', '17:57', '2026-01-09T00:00:00.000Z', '09:00', 'Estafa', NULL, 'Menciona la recurrente que es la cajera de Ana Multitiendas y el dia viernes 09 del corriente mes y año a las 09:00 hs aproximadamente llega hasta la caja una mujer que mas datos desconoce y queria pagar unas prendas (traje de baño) e intento pagar por transferencia el monto de 761.000 gs, pasaron unos minutos y la mujer exhibe a la cajera el comprobante de pago y posterior se retira del lugar, luego la cajera se percata que no le llego dicha transferencia.
Sigue relatando la recurrente que esta mujer pidio factura con el numero 517736-7, y tras averiguaciones que la misma hizo ese RUC corresponde a la Señora Carmen Benitez Jacobo, pero no es la misma señora quien supuestamente pago la prenda por lo que supone que seria algun familiar o conocida de la mujer con quien la denunciante estuvo tratando. Por lo que viene a poner a conocimiento de la autoridades competentes para los fines que hubiere lugar.', 'CIUDAD DE ASUNCIÓN, BARRIO CIUDAD NUEVA', NULL, NULL, 158, 216, 'Asunción', 'Oficial Segundo', 'BRUNO AMALIO', 'GIMÉNEZ GONZÁLEZ', NULL, NULL, 'A13241A26', NULL, 'completada', '2026-01-17T21:23:19.459Z', NULL, NULL),
(312, 249, '2026-01-19T00:00:00.000Z', '07:41', '2026-01-17T00:00:00.000Z', '16:22', 'HECHO PUNIBLE A DETERMINAR', NULL, ' Se presenta en esta unidad Policial y manifiesta que fecha y hora mencionada mas arriba se encontraba en su casa quinta en la ciudad de Villa Oliva-Departamento de Ñeembucú, momento que recibe una llamada telefónica del abonado N° 0983610708, de parte de una persona de sexo masculino quien se identifico como funcionario de la empresa TIGO, quien le consulto si tenia problemas con el servicio de la telefonía y que le estarían llamando del servicio técnico para la actualización de su dispositivo, donde también le menciona que recibiría un código de confirmación el cual le facilito. Sigue manifestando que una vez terminada la llamada con el supuesto funcionario de Tigo, recibe varias llamadas de parte de familiares y amigos que le mencionaron que se estaba solicitando dinero prestado desde la plataforma de mensajería de WhatsApp, momento que se percata que se le hackeo su WhatsApp.- ', 'DEPARTAMENTO DE ÑEEMBUCÚ, CIUDAD DE VILLA OLIVA, BARRIO CENTRO', NULL, NULL, 159, 163, 'Asunción', 'Suboficial Inspector', 'JULIO CESAR', 'ROMERO ROMERO', NULL, NULL, '1D6A4EA26', NULL, 'completada', '2026-01-19T11:24:42.731Z', NULL, NULL),
(313, 250, '2026-01-19T00:00:00.000Z', '08:34', '2026-01-18T00:00:00.000Z', '12:35', 'HECHO PUNIBLE A DETERMINAR', NULL, 'SE presenta y manifiesta, que fecha y hora mencionada mas arriba, se encontraba en su domicilio, donde le llega un mensaje en su correo electrónico de la confirmación de retiro de su cuenta de Apuestas Deportivas APOSTALA, el cual el mismo no realizo. Sigue manifestando que se apersono hasta el casino ubicado sobre la avenida quinta y Tacuarí, donde le mencionaron que una persona de sexo masculino retiro de su cuenta la suma de 350.000 gs (trecientos cincuenta mil guaraníes) y que después volvió a depositar en la cuenta CRISTIANFO30@gmail.con', 'CIUDAD DE ASUNCIÓN, BARRIO OBRERO INTENDENTE B. GUGGIARI, CALLE 11 PROYECTADA ENTRE MEXICO Y PARAGUARI', NULL, NULL, 160, 163, 'Asunción', 'Suboficial Inspector', 'JULIO CESAR', 'ROMERO ROMERO', NULL, NULL, 'F0334DA26', NULL, 'completada', '2026-01-19T11:54:58.733Z', NULL, NULL),
