(342, 252, '2026-01-19T00:00:00.000Z', '10:38', '2026-01-16T00:00:00.000Z', '16:33', 'Estafa', NULL, 'Que se presenta a esta dependencia especializada a fin de realizar una denuncia sobre un supuesto hecho de estafa menciona la recurrente que su madre María Cristina Gaona Galeano de CIN° 1295664 de Cell N°0981698710 se comunica con ella , mencionándole que se contacta vía Facebook Marketplace, con el perfil de La Morenita Benítez que dicho perfil se dedica a la venta de materiales de construcción, enviándole así su numero telefónico 0975837448 para comunicarse en la aplicación WhatsApp para una mejor información, ya que estaban interesado en poste de quebracho, ladrillo común, varilla de hierro, bolsa de cal, rollo de tejido, cemento, triturada, así comunicándose con un supuesto Narciso Escobar de la ciudad de San Estanislao en dicho numero mencionado mas arriba para realizar el pedido que le mencionaba que alcanzaría un monto de 3.300.000gs (TRES MILLONES TRECIENTOS MIL), relatando que el tal Narciso le dice a la madre que quiere la seña del 50% del monto total, estando de acuerdo y realizando así la recurrente la transferencia desde la entidad cooperativa Universitaria LTDA a las 16:20hs a la cuenta del señor Narciso a la entidad bancaria del denunciado con cuenta N°25292090 según numero de comprobante 1607169000415087 por la suma de 2.000.000gs, y una segunda transacción según numero de comprobante 16071690004165767 en fecha 17/01/2026 a las 17:07hs por la suma de 1.300.000gs, realizado en fecha 16/01/2026 a las 16:20hs, ambas correspondiente  a la entidad Banco Itaú N°25292090   comunicándole que el pedido ya se encontraba en camino, que estaba viniendo de San Estanislao, diciéndole que se contacte con el chofer del cargamento brindándole así sus datos, de nombre Josué Paredes, con Cell N°0985663579, que nuevamente pidió una suma de dinero en nuevo concepto momento en que la madre de la victima se percata de que todo era una estafa ', 'DEPARTAMENTO CENTRAL, CIUD