(345, 183, '2026-01-19T00:00:00.000Z', '13:19', '2026-01-14T00:00:00.000Z', '08:00', 'Estafa', NULL, 'Manifiesta el recurrente que en fecha y hora mencionada mas arriba recibe un mensaje de la plataforma WhatsApp desde el abonado n° 0994635171  quien manifiesta ser una empresa de crédito denominada  FINANZA CLICK el cual contacta con la asesora MARIA ELENA GARCIA el cual le comunica que su crédito de 15.000.000gs (QUINCE MILLONES) ha sido aprobado la misma le mencionada que para acceder a su crédito deberá abonar una mínima suma de 1.500.000 gs (UN MILLON QUINIENTOS MIL) el recurrente accede y el cual la supuesta asesora de pide los siguientes requisitos : documento de contrato firmando el cual deberá enviar una fotografía , su cedula de identidad , la ubicación de satelital por vía WhatsApp y donde será desembolsado el crédito , el recurrente le facilita todos los datos , la asesora insiste en la realización del pago mínimo el cual no brinda ningún dato en donde transferir el dinero, sigue relatando que se da cuenta que seria una estafa por el cual corta la comunicación con la asesora diciéndole que no seguiría con el crédito. También menciona que le escriben dos asesoras mas de la misma empresa identificandose como GABRIELA HERNANDEZ con el numero de teléfono 0994681990 y SOFiA MORA con el numero de teléfono 0992649572 dando el mismo argumento de lo mencionado mas arriba.
NO HABIENDO NADA MAS QUE AGREGAR SE DA POR TERMINADA EL ACTA, PREVIA LECTURA Y RATIFICACION DE SU CONTENIDO, FORMADO AL PIE EL DENUNCIANTE Y EL INTERVINIENTE , EN 3 (TRES) COPIAS DEL MISMO. ', 'DEPARTAMENTO CENTRAL, CIUDAD DE LUQUE, BARRIO SEGUNDO BARRIO, MANUEL DOMINGUEZ C/ BALNEARIO CAMBORIU', NULL, NULL, 165, 172, 'Asunción', 'Suboficial Ayudante', 'JACQUELINE MONTSERRAT', 'ESTIGARRIBIA ORTIZ', NULL, NULL, '96245DA26', NULL, 'completada', '2026-01-19T16:45:00.684Z', NULL, NULL),
(346, 255, '2026-01-19T00:00:00.000Z', '13:11', '2026-01-08T00:00:00.000Z', '10:13', 'Estafa', NULL, 'Que se presenta ante esta dependencia especialisada a fin de realizar una denuncia,menciona el recurrente que se encontraba en su lugar de trabajo en donde se percata en su telefono que le habia llegado un mensaje en su correo electronico, que meciona sobre un prestamo dei 08/01/2026 de 25.000.000 gs de la entidad banco itau a su cuenta N 722055018  que no reconose, en donde el dinero mencionado anteriormente registro un debito en su cuenta tranfiriendo ala entidad mango del monto de 100.000gs a las 10:14hs, 100.000gs a las 10:15 hs , 100.000 gs a las 10:16 hs, sumando asi un total de  300.000 gs en fecha 08/01/2026, a nombre de Lilian Ramo Martinez Sanchez, mecionando que el mismo no reconoce haber realizado dichas transacciones. ', 'DEPARTAMENTO CENTRAL, CIUDAD DE FERNANDO DE LA MORA, BARRIO DOMINGO SAVIO, CAMPO VIA Y LA SALLE', NULL, NULL, -2, 211, 'Asunción', 'Suboficial Ayudante', 'DERLIS DARIO', 'SOSA FUNEZ', NULL, NULL, '855A3BA26', NULL, 'borrador', '2026-01-19T17:03:08.622Z', NULL, NULL),
