(348, 256, '2026-01-19T00:00:00.000Z', '13:48', '2026-01-19T00:00:00.000Z', '08:00', 'Estafa', NULL, 'Que la recurrente, en fecha y hora indicadas, recibió una llamada telefónica por parte del abonado +595 992 150 751,  quien dijo llamarse OVIDIO GONZALEZ y manifestó que su número le fue proporcionado por el Presidente de la Asociación de Ganadería, destacando que contaba con muy buenas referencias respecto a su capacidad profesional como abogada. Asimismo, le indicó que tenía un caso para encomendarle.

Seguidamente, el mencionado sujeto le comentó que tenía un camión retenido en un control policial en la zona de Piribebuy, y que necesitaba que se encargara de realizar los trámites necesarios para que el vehículo pudiera llegar a su destino final, ofreciéndole por dicho servicio la suma de USD 50.000 (cincuenta mil dólares americanos), propuesta que la recurrente aceptó.

Minutos después, la recurrente recibió una segunda llamada telefónica desde el número 0994 684 674, por parte de una persona que se identificó como Comisario Jorge Palacios, quien le indicó que la solución al inconveniente requería el pago inmediato de la suma de Gs. 21.000.000, monto que debía ser depositado de manera urgente en distintas cuentas bancarias, conforme al siguiente detalle:

Gs. 5.000.000, depositados en Banco Solar, Cuenta N° 301019317, a nombre de Delio Alviso, en fecha 19/01/2026, Boleta N° 01170234.

Gs. 5.000.000, depositados en Banco Solar, Cuenta N° 301019295, a nombre de Teresa de Jesús Maidana, en la misma fecha, Boleta N° 01170222.

Gs. 5.000.000, depositados en Banco Solar, Cuenta N° 301019321, a nombre de Daniel Maidana, misma fecha, Boleta N° 01170224.

Gs. 5.000.000, depositados en Banco Solar, Cuenta N° 301019319, a nombre de Silveria Salinas, misma fecha, Boleta N° 01170223.

Finalmente, una transferencia de Gs. 1.500.000, realizada a la cuenta Cargo Banco UENO N° 6192654069, Transacción N° 11258289, en fecha 19/01/2026.

Manifiesta la recurrente que accedió a realizar dichas transferencias bajo continuos engaños y manipulaciones por parte del supuesto comisario, quien a cada paso le enviaba fotografías del camión, del despacho de aduana y otros documentos aparentando veracidad.

Asimismo, el supuesto cliente le aseguraba reiteradamente que no se preocupara, ya que había depositado la suma comprometida a su nombre a través de la casa de cambios Maxi Cambios, desde donde incluso recibió una llamada telefónica confirmando dicho depósito.

Posteriormente, la recurrente tomó conocimiento de que todo lo anteriormente relatado resultó ser una estafa, motivo por el cual se presenta ante esta dependencia a fin de que el hecho sea debidamente investigado conforme a derecho.

Deja constancia, además, del número telefónico del supuesto gerente de la casa de cambios Maxi Cambios, siendo este +595 981 209 410.', 'DEPARTAMENTO CENTRAL, CIUDAD DE FERNANDO DE LA MORA, BARRIO RESIDENTAS, DOMICILIO DE LA RECURRENTE', NULL, NULL, 167, 172, 'Asunción', 'Suboficial Ayudante', 'JACQUELINE MONTSERRAT', 'ESTIGARRIBIA ORTIZ', NULL, NULL, 'E6BEBAA26', NULL, 'completada', '2026-01-19T17:11:52.907Z', NULL, NULL),
(349, 257, '2026-01-19T00:00:00.000Z', '14:14', '2025-08-05T00:00:00.000Z', '16:30', 'Estafa', NULL, 'Que se presenta ante esta dependecia especializada a fin de realizar una denuncia, mencionando que en la fecha mencionada mas arriba la victima se encontraba en su bar denominado rack n roll en donde se encuentra con un cliente de nombre Renato David Arias Von Zastrow de fecha de nacimineto 03/10/1991 lugar de nacimiento asuncion con CI Nº 3206601, nacionalidad paraguaya, soltero con Cel Nº 0982-602-213, en donde esta persona le propone a la victima en ser socios para realizar una inversion de sándwiches de un evento para una empresa denomido G5 PRO que el tal Renato supuestamente tenia un contrato con la empresa, en donde le pide al recurrente un monto de 11.500.000gs para tal inversion en donde obtendria una ganancia de 5.000.000gs con un total de 16.500.000gs que deberia de ser abonado en fecha 03/10/2025 , aceptando la propuesta en la fecha 05/08/2025 haciendo dicha tranferencia por le entidad Banco Sudameris desde la cuena N 5652120 a la cuenta de Renato de la entidad Banco Familiar con cuenta N 2446059, primer monto 1,151,72$ DOLARES AMERICANOS a las 16:50hs ,en fecha 05/08/2025, siguiente transaccion en la misma cuenta bancaria de monto 435,68$ DOLARES AMERICANOS, en fecha 06/08/2025, a las 11:55hs, en el cual el tal Renato no mostro ningun contrato y tampoco devolvia el monto mencionado ni el equipamiento, ya que supuesto dicho acuerdo con la victima si no le devolviese el dinero, el equipamiento de sándwiches seria del recurrente hasta que recuperase el monto mecionado anteriormente, dando vueltas al asunto, donde la victima se percata que esta siendo victima de una estafa por medio de esta persona.
 
