(352, 260, '2026-01-19T00:00:00.000Z', '19:03', '2026-01-08T00:00:00.000Z', '10:13', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que se presenta ante esta dependencia especializada a fin de realizar una denuncia, menciona el recurrente que se encontraba en su lugar de trabajo en donde se percató en su celular que le había llegado un mensaje en su correo electrónico, que menciona sobre un préstamo del 08/01/2026 de 25.000.000gs de la entidad Banco Itaú a su cuenta N°722055018 que no reconoce, en donde el dinero mencionado anteriormente registro un debito en su cuenta transfiriendo a la entidad Mango del monto de 100.000gs a las 10:14hs, 100.000gs a las 10:15hs, 100.000gs a las 10:16hs, sumando así un total de 300.000gs en fecha 08/01/2026, a nombre de Lilian Ramo Martínez Sánchez, mencionando que el mismo no reconoce haber realizado dichas transacciones.', 'DEPARTAMENTO CENTRAL, CIUDAD DE FERNANDO DE LA MORA, BARRIO DOMINGO SAVIO, CAMPO VIA Y LA SALLE ', NULL, NULL, 171, 176, 'Asunción', 'Suboficial Ayudante', 'ALEXIS MIGUEL', 'AGÜERO GIMÉNEZ', NULL, NULL, '0B53EAA26', NULL, 'completada', '2026-01-19T22:10:48.433Z', NULL, NULL),
(353, 261, '2026-01-19T00:00:00.000Z', '19:14', '2026-01-14T00:00:00.000Z', '15:00', 'Estafa', NULL, 'Que se presenta a esta dependencia especializada a formular denuncia sobre un supuesto hecho punible de estafa, menciona cuando sigue que en fecha y hora mencionada mas arriba se encontraba en su domicilio, en donde ingreso en la plataforma de Facebook (Marketplace), encontrando una publicación realizado por el usuario Metal Arte en cual le intereso una publicación que se trataba sobre artículos de casilleros de metales, entablando así una conversación por la app Messenger, en donde el usuario le brindo su contacto N° 0982917345 para una mejor atención  por vía WhatsApp, en donde el supuesto vendedor le brinda fotografías del articulo mencionado anteriormente, mencionándole el costo de los artículos que seria la suma de 2.652.000gs (Dos millones Seiscientos Cincuenta y dos mil), sigue manifestando que el supuesto vendedor le menciona que tiene que abonar el 50% del valor total de los artículos para que corra la orden de trabajo, facilitando así una cuenta bancaria donde la recurrente realiza la siguiente transacción a la cuenta N°255056810 a la entidad BANCO BASA, titular Eliseo Ramon Falcon Chena con CI N° 6067917, la suma  2.652.000gs (Dos Millones Seiscientos Cincuenta y dos mil), posterior realizada la transferencia la denunciante le envía el comprobante de pago donde el supuesto vendedor le indica que la entrega de los artículos se realizaría el día sábado 17/01/2026 en horas de la tarde, por ultimo menciona que no recibió la mercadería en el día pactado realizando llamadas telefónicas y mensajes vía WhatsApp a su puesto vendedor de nombre Marcos González y hasta el día de la fecha no recibió respuesta alguna, llegando a la conclusión que estaría siendo victima de una estafa  ', 'DEPARTAMENTO CENTRAL, CIUDAD DE LAMBARÉ, BARRIO SANTA ROSA II, CONSTITUCION NACIONAL 536 CASI SAN JUAQUIN ', NULL, NULL, 172, 176, 'Asunción', 'Suboficial Ayudante', 'ALEXIS MIGUEL', 'AGÜERO GIMÉNEZ', NULL, NULL, 'AEE43FA26', NULL, 'completada', '2026-01-19T22:50:27.052Z', NULL, NULL),
(354, 262, '2026-01-19T00:00:00.000Z', '20:01', '2026-01-19T00:00:00.000Z', '15:44', 'HECHO PUNIBLE A DETERMINAR', NULL, 'que se presenta a esta dependencia especializada a formular denuncia sobre  un supuesto hecho de estafa mencionando lo siguiente que en día fecha y hora mencionada mas arriaba entro en la plataforma Facebook encuentra una publicidad de un supuesto asesor de prestamos de una entidad bancaria específicamente UENO BANK con quien se comunica vía WhatsApp al abonado N° 0972524039, la recurrente menciona que el supuesto asesor del banco mencionado mas arriba le menciona que ya cuenta con su préstamo  aprobado y depositado en su cuenta bancaria de N°5585490064724862 de la entidad UENO BANK (T. DEBITO), mencionando que la victima en ese instante comparte pantalla de su celular a dicho abonado ya mencionado, por video llamada en la aplicación WhatsApp, compartiendo así su numero de tarjeta, su contraseña y fotografía de CI las dos caras, en donde el supuesto gestor le solicita a la victima la cantidad de 800.000gs (ochocientos mil guaraníes), sigue relatando que el supuesto gestor extrajo de su tarjeta de debito una suma de 22.500 gs, a la cuenta de la  App  Azar Latino (CASINO ONLINE), en donde la victima se percata de que esta siendo victima de una supuesta estafa ', '', NULL, NULL, 173, 175, 'Asunción', 'Suboficial Ayudante', 'MARCIANO ROLANDO', 'BOGADO MARTINEZ', NULL, NULL, 'AF2DD1A26', NULL, 'completada', '2026-01-19T23:54:23.902Z', NULL, NULL),
(356, 264, '2026-01-20T00:00:00.000Z', '08:40', '2026-01-19T00:00:00.000Z', '14:55', 'HECHO PUNIBLE A DETERMINAR', NULL, 'La misma refiera que mantenía una relación de aproximadamente 19 años con el Sr. Milciades Rojas, C.I N° 3.911.594, quienes se encontraban residiendo en España – Europa, manifiesta la recurrente que desde siempre sufría constantes humillaciones y maltratos (físico y psicológico) de parte del sindicado y en el mes de diciembre del 2025, mientras que la recurrente se encontraba de visita a sus familiares en Paraguay, estando en la ciudad de Capiatá la misma habría decidió cortar todo tipo de relación con él ya que no soportaba más los maltratos ocasionados.
Sigue manifestando la recurrente que posterior a lo ocurrido, la misma habría conocido a otra persona, quien actualmente sería su pareja sentimental y con quien esta residiendo en la ciudad de Capiatá, en la dirección ubicada sobre la calle 06 de enero, ruta D027, Km 22. Y en fecha 19 de enero de 2025 estando en su domicilio recibió varios mensajes y llamadas de parte de su expareja Milciades Rojas, desde el abonado N° +34604160021, quien le habría amenazado nuevamente y le manifestó que su nueva pareja no podía llegar a su domicilio, dichos mensajes minutos después fueron eliminados, posteriormente menciona que le había amenazado de muerte a su nueva pareja por medio de la denunciante. Asimismo, la recurrente manifiesta que la propiedad se encuentra a su nombre, por todo lo acontecido y temiendo por su vida y por la de su nueva pareja la recurrente se acerca hasta esta Dependencia Policial a poner a conocimiento de la autoridad competente para los fines que hubiere lugar. ', 'DEPARTAMENTO CENTRAL, CIUDAD DE CAPIATÁ, BARRIO SAN MIGUEL, CALLE 06 DE ENERO, RUTA D027, KM 22', NULL, NULL, 175, 154, 'Asunción', 'Suboficial Ayudante', 'DILMA MARIA', 'ALVARENGA OJEDA', NULL, NULL, '59FB9EA26', NULL, 'completada', '2026-01-20T12:05:24.340Z', NULL, NULL),
(357, 265, '2026-01-20T00:00:00.000Z', '10:24', '2026-01-02T00:00:00.000Z', '23:55', 'Estafa', NULL, 'Manifiesta la compareciente que en fecha y hora mencionado mas arriba se encontraba navegando en la red social Facebook, momento que recibe una solicitud de amistad de un perfil denominado LUIS ALBERTO KENNEDY NIEDEMBUERGUERTS, posterior empiezan a entablar varias conversaciones vía Messenger, seguidamente el usuario le proporciona el abonado numero 0987-291-864 para proseguir con la conversación, consecuentemente entre conversaciones y conversaciones el usuario o el señor ALBERTO se presenta como medico y supuestamente estaba trabajando en el IPS de ciudad del Este y  por la ciudad de Hernandarias y que en su día libre residía por la Ciudad de Cordillera, tal así que sale y le dice a la señora que podría ayudarla para poder percibir mas su salario, ya que la misma es Jubilada, la recurrente le comenta que tiene su amiga y que si le podría ayudar a las dos, envian un monto de dinero de GS 340.000 (TRESCIENTOS CUARENTA MIL) a la cuenta corriente N° 12925297003, entidad BANCO GNB, a nombre de Osmar Gomez Camarichi, con CI N°1.161.428, la misma recurre hasta esta Dependencia Especializada con el fin de dejar un precedente y poder identificar a la persona que estaría operando detrás de dicho Perfil.
Así también deja constar que la misma proveyó imagen de la cedula de identidad de su amiga ROSA ZAMPHIROPOLOS VDA DE FERRARI y numero de cedula de recurrente.', 'DEPARTAMENTO CENTRAL, CIUDAD DE LAMBARÉ, BARRIO MBACHIO I, ANGEL GABRIEL CASI ALBERDI', NULL, NULL, 176, 178, 'Asunción', 'Suboficial Segundo', 'ARNALDO ANDRÉS', 'AVALOS RUIZ DÍAZ', NULL, NULL, 'F94E3DA26', NULL, 'completada', '2026-01-20T14:13:42.498Z', NULL, NULL),
(358, 266, '2026-01-20T00:00:00.000Z', '11:59', '2025-06-01T00:00:00.000Z', '08:00', 'Estafa', NULL, 'El recurrente manifiesta que en el mes de junio de 2025 contacto con el señor Eduardo Pavon Cabral con el abonado N° 0985229884 a fin de adquirir un automóvil de la marca IST, modelo 2011, color negro, con una entrega de 15.000.000 gs. (Quince millones de guaraníes), el cual fue realizado a través de tres transferencias realizada desde su cuenta cargo UENO BANK, los cuales se detallan a continuación:
•	Transferencia a favor de Eduardo Rodolfo Pavon Cabral, cuenta N° 619164316, cargo UENO BANK, comprobante N° 5022781, realizado en fecha 30/07/2025, por el monto de 6.000.000 gs.
•	Transferencia a favor de Eduardo Rodolfo Pavon Cabral, cuenta N° 619164316, cargo UENO BANK, comprobante N° 1892115, realizado en fecha 29/08/2025, por el monto de 3.000.000 gs.
Manifiesta el recurrente que ya no posee la tercera transacción realizada. Acto seguido, dicho vehículo seria entregado en la semana del pago. Transcurrido los días el señor Eduardo Pavon le menciona al recurrente que el vehículo no podría ser entregado por supuestas imperfecciones. 
Posteriormente, el recurrente le solicita la devolución de la entrega realizada debido a que ya paso mucho tiempo y no hubo respuestas de parte del vendedor, a lo cual el sindicado le realizo una transferencia de la suma de 5.000.000 gs. (Cinco millones de guaraníes) a su cuenta N° 619260955 cargo UENO BANK, según comprobante N° 563600, realizada en fecha 08/11/2025. Sigue manifestando el recurrente que el señor Eduardo Pavon le mantiene con reiteradas promesas respecto a la devolución del monto restante correspondiente a la entrega realizada, sin que hasta la fecha se haya efectivizado dicho pago. Por todo lo acontecido se acerca hasta esta dependencia policial a poner a conocimiento de la autoridad competente para los fines que hubiere lugar.
', 'DEPARTAMENTO CENTRAL, CIUDAD DE CAPIATÁ, BARRIO POSTA YBYCUA,  CALLE JOSE LOPEZ GODOY KM 20 RUTA D027', NULL, NULL, 177, 154, 'Asunción', 'Suboficial Ayudante', 'DILMA MARIA', 'ALVARENGA OJEDA', NULL, NULL, '4A6C8CA26', NULL, 'completada', '2026-01-20T15:31:47.277Z', '2026-01-19T00:00:00.000Z', '11:13'),
(359, 267, '2026-01-20T00:00:00.000Z', '12:49', '2025-12-21T00:00:00.000Z', '10:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Manifiesta la recurrente que, en el mes de diciembre, a través de la plataforma de MEEFF, (aplicación de citas) conoció a una persona de nombre HENRY PETERSON y posteriormente la conversación fue derivada en la plataforma de TELEGRAM, transcurrido los días el supuesto Henry le manifiesta que quería enviarle un regalo, que consistía en una caja que contenía zapatos, perfumes y carteras, para lo cual le solicitó sus datos personas y datos de su dirección de domicilio.
Manifiesta la recurrente que llegó a facilitar, fotografía de su Pasaporte, número de casa con dirección de calle y ciudad. En fecha 21 de diciembre el Sr. Peterson le manifiesta que el envío ya se había realizado por la Agencia BASIC DELIVERY & LOGISTICS, y en fecha 22 de diciembre recibió un correo electrónico por parte de la supuesta Agencia opsbasicdeliveryandlogistics@gmail.com manifestándole que la recurrente debía abonar la suma de 5.800.000 gs., por supuestos impuesto de 	ADUANA, a lo que la recurrente se percata que se podría tratar de una Estafa y decide cortar todo tipo de comunicación no realizando la transferencia solicitada, motivo por el cual se acerca hasta esta dependencia policial a poner a conocimiento de la autoridad competente para los fines que hubiere lugar ya que la misma llegó a facilitar fotografía de su Pasaporte.
', 'DEPARTAMENTO CENTRAL, CIUDAD DE ITAUGUÁ, BARRIO ESTANZUELA, CALLE CANTOS DEL BOSQUE Nº 1353 CASI RUTA AREGUA - PATIÑO', NULL, NULL, 178, 154, 'Asunción', 'Suboficial Ayudante', 'DILMA MARIA', 'ALVARENGA OJEDA', NULL, NULL, 'A75620A26', NULL, 'completada', '2026-01-20T16:04:29.525Z', NULL, NULL),
(360, 268, '2026-01-20T00:00:00.000Z', '15:18', '2026-01-19T00:00:00.000Z', '17:22', 'Estafa', NULL, 'Manifiesta la recurrente que el día 19 de enero del 2026 se encontraba navegando por la plataforma de Facebook buscando un mueble y contacta con la cuenta de Facebook, en la sección de Marketplace, con el usuario “Mirian Duarte” con URL https://www.facebook.com/laluquenita.benitez.5?rdid=BAeGgz2zF18mR3Au&share_url=https%3A%2F%2Fwww.facebook.com%2Fshare%2F16NtdnJqci%2F# en el apartado de Messenger y luego le facilitaron el abonado número “0993639924”, que supuestamente sería de la empresa WIINDO COMERCIAL, tras confirmar el mueble deseado el supuesto autor procede a mandar un número para transferencias vía Giros Tigo “0982945182”  y datos para realizar transferencia bancaria, lo que la denunciante realiza una transferencia bancaria cargo Banco Continental, número de cuenta: 4689700701, Nombre: RIVELA RAMIREZ, ARMANDO DAVID, Número de documento: 7565287, la suma de 387.000  gs. (trecientos ochenta y siete mil guaraníes), posterior no volvió a recibir respuestas favorables en la red de mensajería WhatsApp. Por todo lo acontecido se acerca hasta esta dependencia policial a poner a conocimiento de la autoridad competente para los fines que hubiere lugar.', 'CIUDAD DE ASUNCIÓN, BARRIO SAJONIA, CORONEL LOPEZ ENTRE DIAZ DE SOLIS Y ALEJO GARCIA', NULL, NULL, 179, 186, 'Asunción', 'Oficial Ayudante', 'PABLO MARCELO', 'ESPINOZA ROMERO', NULL, NULL, '83FDBAA26', NULL, 'completada', '2026-01-20T19:02:35.717Z', '2026-01-19T00:00:00.000Z', '17:31'),
(363, 271, '2026-01-20T00:00:00.000Z', '17:14', '2026-01-02T00:00:00.000Z', '17:00', 'Estafa', NULL, 'Menciona el recurrente que en fecha y hora mencionado mas arriba a través de un aplicativo denominado PIMER se contacto con una persona para un servicio de instalación de cielo razo en su domicilio, posterior se comunica con el mismo el abonado numero 0993-358-646 identificado como Fabricio,  la persona se acerco hasta su domicilio para realizar la las mediciones correspondiente y de dar el presupuesto, tal así que llegaron en un acuerdo con el monto del presupuesto, el supuesto trabajador pide un adelanto de 50 % pero ante la negativa del recurrente llegaron un acuerdo y el recurrente le envía a través de cuenta Bancaria guaraníes 400.000 (cuatrocientos mil) a la cuenta numero 819719598, entidad Banco Familiar, a nombre de EDGAR MOISES OVIEDO, con CI N° 7.031.800, el recurrente al enviar dicho dinero ya esperaba que se realizara el trabajo, insiste con el supuesto trabajador lo cual el mismo ya no le contesta los mensajes, un momento dado ante la insistencia del supuesto trabajador la victima empieza a sospechar y realizar averiguaciones sobre dicha persona, y el dueño de APP le afirma que específicamente el señor EDGAR MOISES OVIEDO seria la persona quien se acerco a su domicilio para supuestamente realizar los trabajos.
El mismo se acerca a formular su denuncia para los fines pertinentes, ya que la persona habia ingresado dentro de su domicilio y conoce ya su movimiento habitual diario.', 'DEPARTAMENTO CENTRAL, CIUDAD DE CAPIATÁ, BARRIO ROJAS CAÑADA, LIBERTAD CASI YVYRARO, A UNA CUADRA DE LA CAPILLA SAN RAFAEL', NULL, NULL, 182, 178, 'Asunción', 'Suboficial Segundo', 'ARNALDO ANDRÉS', 'AVALOS RUIZ DÍAZ', NULL, NULL, 'EB79A0A26', NULL, 'completada', '2026-01-20T20:45:00.518Z', NULL, NULL),
(364, 272, '2026-01-20T00:00:00.000Z', '19:09', '2026-01-20T00:00:00.000Z', '16:29', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que se presenta ante esta unidad especializada a fin de formular una denuncia sobre  un supuesto hecho ocurrido, manifiesta la recurrente que en fecha y hora ya mencionada mas arriba la recurrente se encontraba en la red social FACEBOOK-Marketplace donde de pronto le llamo la atención una publicación de un Usuario de nombre Pedro Daniel Villalba, de un vehículo en venta de la marca Toyota modelo vitz año 2000 con chapa numero BZU429 con chasis N° NCP600201093 Color GRIS, La cual la recurrente procede a enviar un mensaje a este usuario para más información, Esta persona procede a enviarle el abonado numero 0993442704 para poder seguir la negociación desde la red de mensajería instantánea WhatsApp, manifiesta la recurrente que habían llegado a un acuerdo para la compra del mencionado vehículo, este le menciona que necesita abonar por el contrato privado de compra-venta, la misma realiza la siguiente transferencia: 
cuenta beneficiaria cargo Finlatina S.A de finanzas, titular Jackeline Rodríguez, cuenta numero 194264, comprobante numero 2044937, fecha 20/01/2016, por el monto de 350.000 guaraníes. 
En fecha 20/01/2026 recibe una llamada del mismo abonado manifestándole que el vehículo en mención fue retenido en un control policial y le solicito que realice una transferencia, la recurrente procede realizar las siguientes transferencias:
Cuenta beneficiaría cargo UENO BANK, Titular Luis Arias, cuenta numero 6192325968, la suma de 500.000 guaraníes.
Cuenta beneficiaría cargo UENO BANK, Titular Luis Arias, cuenta numero 6192325968, la suma de 2.000.000 guaraníes, comprobante numero 2058636.
sigue manifestando la recurrente que recibió mensaje del abonado numero 0984567495 quien le pide realizar una transferencia para la cancelación de la compra del automóvil, la misma procede a realizar una transferencia a la cuenta cargo UENO BANK, Titular Luis Arias, cuenta numero 6192325968, la suma de 7.150.000 guaraníes, comprobante numero 1736914. posterior a las transferencias realizadas la misma ya no tuvo retorno del supuesto vendedor y posteriormente se percata que fue bloqueada por el abonado numero, percatándose que fue victima de un supuesto hecho de estafa. por todo lo acontecido se acerca a esta dependencia policial a poner a conocimiento de la autoridad competente para los fines que hubiere lugar.', 'CIUDAD DE ASUNCIÓN, BARRIO OBRERO INTENDENTE B. GUGGIARI, QUINTA PROYECTADA CASI 15 DE MAYO', NULL, NULL, 183, 184, 'Asunción', 'Suboficial Ayudante', 'AXEL FERNANDO', 'DUARTE ORTIGOZA', NULL, NULL, '146C46A26', NULL, 'completada', '2026-01-20T23:01:54.776Z', NULL, NULL),
(365, 273, '2026-01-20T00:00:00.000Z', '22:24', '2026-01-20T00:00:00.000Z', '16:44', 'Acceso indebido a sistemas informáticos', NULL, 'La recurrente manifiesta que, el día de la fecha recibió una llamada telefónica del abonado número 0984467833, quien se identificó como supuesto funcionario de la Empresa de telefonía de TIGO, de nombre Matías, manifestándole que el motivo de su llamada sería a fin de verificar sobre el funcionamiento de su línea telefónica 0981552181, la recurrente confiada le manifiesta que está funcionando de manera correcta, acto seguido, el supuesto funcionario le menciona que le estaría llegando un código en su WhatsApp y que ellos estarían necesitando dicho código para registrar que el número ya está funcionando de manera correcta, el cual sería necesario para culminar el procedimiento en cuestión por la mencionada empresa. La recurrente le menciona que cualquier cosa ella se estaría acercando hasta la empresa TIGO ZABALAS CUE junto al funcionario Matías y ante la insistencia del supuesto funcionario la recurrente procedió a proporcionar el código recibido, quien momento después perdió el acceso a su aplicación de mensajería de WhatsApp. Minutos después, recibió una llamada de parte de su sobrina de nombre Mariana, quien le preguntó si la misma se encontraba bien ya que desde su cuenta de WhatsApp le estaban solicitando dinero, y facilitando la cuenta N° 379242379, titular MIRIAN ORTIZ, C.I N° 2922404, perteneciente a la entidad bancaria FAMILIAR, como así mismo otros allegados a la recurrente también recibieron mensajes solicitando que realicen transferencia de dinero a nombre de la recurrente.
Sigue manifestando la denunciante que, posterior a lo ocurrido, aproximadamente  las 17:45 horas se acercó hasta la empresa de TIGO, ubicada sobre la calle San Martín casi Moisés Bertoni de la ciudad de Asunción, a fin de obtener mas detalles con respecto al abonado número 0984467833, donde le facilitaron que dicho abonado figuraba a nombre de BLACIDA ACOSTA BAEZ, por todo lo acontecido se acerca hasta esta dependencia policial a poner a conocimiento de la autoridad competente para los fines que hubiere lugar.', 'DEPARTAMENTO CENTRAL, CIUDAD DE LAMBARÉ, BARRIO LA VICTORIA, CALLE PINDO 2776 ENTRE ECUADOR Y RCA. ARGENTINA', NULL, NULL, 184, 154, 'Asunción', 'Suboficial Ayudante', 'DILMA MARIA', 'ALVARENGA OJEDA', NULL, NULL, '753795A26', NULL, 'completada', '2026-01-21T02:01:11.008Z', NULL, NULL),
(366, 274, '2026-01-21T00:00:00.000Z', '07:56', '2026-01-17T00:00:00.000Z', '09:40', 'Acceso indebido a sistemas informáticos', NULL, 'Que se presenta ante esta dirección especializada a modo de realizar una denuncia de un supuesto hecho de acceso indebido a datos personales, el presente manifiesta poseer una cuenta de caja de ahorro N° 25256278 y tarjeta de debito N° 5421 1690 1684 4006 (que actualmente se encuentra inactiva a pedido del recurrente) con la entidad bancaria BANCO ITAU,  sigue relatando el presente que en la fecha indicada mas arriba recibió un mensaje en su correo personal del mencionado ente financiero sobre movimientos financieros que se están realizando en su cuenta, seguidamente se comunica vía telefónica a su ente bancario donde es atendido por un representante y se le informa a la ves que se realizaron solicitudes y transacciones monetarias varias atraves de sistemas informáticos que se detallan a continuación:   
* Caja de ahorro con monto en guaraníes 10.500.000 (Diez millones quinientos mil) aproximadamente.
* Préstamo pre-aprobado con monto en guaraníes 13.940.000 (Trece millones novecientos cuarenta mil).
* Retiro anticipado de ahorro programado con monto en guaraníes 10.752.000 (Diez millones setecientos cincuenta y dos mil).
El afectado manifiesta que no realizo ninguna transacción ni solicitud monetaria, manifestada en la presente acta, motivo por el cual solicita el bloqueo inmediato de su cuenta personal, por lo ocurrido le mencionan al mismo que la cuenta ya se encuentra inactiva, el recurrente sigue manifestando que en la fecha mencionada recibió llamadas varias e insistentes en su teléfono particular desde el numero telefónico 0974-984-629, a lo cual no atendió a ninguna de ellas, posterior recibe una llamada de su lugar de trabajo por parte de su compañero mencionándole de que dicho numero habría llamado preguntando por el recurrente mencionando de que por error le habrían transferido a su cuenta de banco un supuesto monto de 13.940.000 (trece millones novecientos cuarenta mil), por lo cual inmediatamente se comunica con dicha entidad bancaria a solicitar el bloqueo correspondiente, el presente en el momento no posee consigo el detalle y/o extracto de su cuenta personal por lo que no sabe   donde fueron transferidos los montos mencionados mas arriba, una vez obtenida los datos por minorizado estaría presentando ante la autoridad competente, el presente manifiesta desconocer plenamente quien o quienes pudieron acceder a su cuenta personal ya que el mismo posee en su dominio la aplicación bancaria proveída por el mismo ente y que solamente el mismo es el operario para el acceso de la mencionada aplicación.   ', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN ANTONIO, BARRIO NARANJATY, TRES FRONTERAS, BARRIO MBOCAYATY', NULL, NULL, 185, 230, 'Asunción', 'Suboficial Mayor', 'CESAR ENRIQUE', 'RODAS MOREL', NULL, NULL, '9B7A21A26', NULL, 'completada', '2026-01-21T11:57:40.939Z', '2026-01-21T00:00:00.000Z', '08:05'),
(367, 275, '2026-01-21T00:00:00.000Z', '09:57', '2026-01-19T00:00:00.000Z', '18:00', 'Lesión de confianza', NULL, 'Se presenta ante esta dependencia especializada con el fin de realizar una denuncia de un supuesto hecho de lesión de confianza, la misma manifestó que en la fecha y hora indicada mas arriba encuentra una publicación en FACEBOOK sobre la venta de un vehículo automotor (camioneta) que quería adquirir, seguidamente se comunica Vía WhatsApp al N° telefónico 0991 739 520, quien se contacta con una persona la cual se identifica con el nombre de JOSE CARLOS MOREL LATERSA, y el mismo manifiesta que el valor del mencionado rodado es de 30.000.000 GS (TREINTA MILLONES) pero podría mejorar el costo  hasta el monto de    guaraníes 29.500.000  (VEINTE Y NUEVE MILLONES QUINIENTOS MIL), manifiesta la recurrente que el mismo día ella realiza la transferencia de 11.500.000 GS (ONCE MILLONES QUINIENTOS MIL GUARANIES) a cargo de la cuenta N° 619655892 de la entidad UENO BANK S.A. a nombre de CESAR CORONEL, el mismo le manifiesta que a partir de las 17:00 HS ya no se reciben transferencias superiores a cinco millones , por lo cual la recurrente envía el dinero por partes en el cual se detalla en el extracto de cuenta que la misma presenta. La recurrente manifiesta que en fecha 20/01/2026 se percata que el monto transferido por monto de 11.500.000 gs (ONCE MILLONES QUINIENTOS MIL GUARANIES) fue debitado de su cuenta personal según comprobante N° 6494051, por lo que se vuelve a comunicar con el señor CARLOS MOREL LATERSA y le manifiesta lo ocurrido sobre el descuento realizado y el mismo vuelve a revertir en la cuenta personal N° 619700047  que la misma posee con la entidad bancaria UENO BANK, la suma de 10.000.000 GS (DIEZ MILLONES) no así el valor restante de guaraníes 1.500.000 (UN MILLON QUNIENTOS MIL), A lo que la misma le menciona al sindicado sobre la diferencia a transferir y el mismo refiere de que no posee en su cuenta personal el monto requerido ya que según su manifiesto habría recibido el monto de GS 10.000.000 (DIEZ MILLONES), la presente solicita a su entidad bancaria su extracto de cuenta personal y en el mismo figura que el monto total mencionado fue descontado y transferido en su totalidad a la cuenta del señor CARLOS MOREL, la recurrente manifiesta que al día siguiente de haber adquirido el vehículo motor el mismo comenzó a tener desperfectos mecánicos considerables. ', 'DEPARTAMENTO CENTRAL, CIUDAD DE MARIANO ROQUE ALONSO, RUTA 03 ESQ. GONZALEZ DE LOTO (A LADO DE LA CONSTRUCTORA MM S.A)', NULL, NULL, 186, 230, 'Asunción', 'Suboficial Mayor', 'CESAR ENRIQUE', 'RODAS MOREL', NULL, NULL, '850B7CA26', NULL, 'completada', '2026-01-21T14:07:53.103Z', NULL, NULL),
(369, 277, '2026-01-21T00:00:00.000Z', '11:02', '2026-01-08T00:00:00.000Z', '12:20', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que se presenta ante esta direccion especializada a modo realizar una denuncia de un supuesto hecho de transaccion erronea, el mismo menciona que en fecha y hora mencionada mas arriba se encontrava en el local comercial denominada ELECTRONICA SAN MIGUEL, sito sobre las calles Eusevio Ayala c/ 22 de Septiembre, a los efectos de realizar la copra de un electrodomestico (visicooler de la marca GODWEATHER 350 litos) por un valor de 3.150.000 guaranies (tres millones ciento cincuenta mil), que accedio a pagar por medio de transferencia a la cuenta comercial de la emprersa, menciona tambien que el mismo se habria equibocado de numero de cueta destinando asi la trasferencia a otra cuenta personal Nº 6192385392  a nombre de IGNACIA LEZCANO  CI Nº 3390370  monto 3.150.000 de guaranies ( tres millones ciento cincuenta mil), que debia de ser a la cuenta Nº 619166184 a nombre de la propietaria HERENIA FLOR CI Nº 3930370  de dicho local comercial, sigue relatando que intento comunicarse con la titular de dicha cuenta para solicitarle la devolucion de dicho dinero transferido erroneamente, a lo cual la misma hizo caso omiso, por lo cual se vio obligado a realizar otra transferencia del mismo monto a la cuenta de empresa ya mencionada  para concretar la compra, a continuacion se adjunta copia del comprobante de la transferencia erronea. ', 'CIUDAD DE ASUNCIÓN, BARRIO CIUDAD NUEVA, AVENIDA EUSEBIO AYALA C/ 22 DE SEPTIEMBRE ', NULL, NULL, 187, 230, 'Asunción', 'Suboficial Mayor', 'CESAR ENRIQUE', 'RODAS MOREL', NULL, NULL, 'BE5054A26', NULL, 'completada', '2026-01-21T14:44:26.194Z', NULL, NULL),
(370, 278, '2026-01-21T00:00:00.000Z', '11:12', '2024-08-14T00:00:00.000Z', '15:00', 'Estafa', NULL, 'Que, se presenta a esta Dependencia Especializada a realizar una denuncia sobre un supuesto hecho punible de estafa en fecha y hora mencionada, relata que en fecha 14/08/2024 se comunica con una persona de nombre de Diego Castellanos con quien menciona que trabaja en IRONFX SOLID TRADING y este sugiere a la afectada primeramente entregar un monto de 400 dólares americanos para poder ser miembro de dicha empresa, la cual la misma transfiere en la fecha de 14/08/2024, luego de esto la misma fue al Banco ITAU a hacer un reembolso de dicho dinero pero de 200 dólares americanos, que desde el momento hasta la fecha la afectada menciona que el perjuicio hacia su persona asciende a un monto aproximado de guaraníes 59.000.00 (cincuenta nueve millones aproximadamente), sigue manifestando la presente que con la misma se esta contactando desde el número telefónico +34631282079 con una persona el cual se identifica con el nombre de LAURA JIMENEZ, la afecta menciona que en fecha 09/01/2026 realiza dos transacciones por monto de guaraníes, 20.000.000( veinte millones), 19.125.000 ( diecinueve millones cientos veinticinco mil) que la misma transfirió a la entidad bancaria GNB donde es titular de una cuenta el señor ELIAS DAVID MACIEL ALDERETE, con cedula de identidad N° 4.196.6118, seguidamente en fecha 18/12/2025 realiza nuevamente dos transacciones por monto de guaraníes 6.496.361 (seis millones cuatrocientos noventa y seis mil trecientos sesenta y uno), 13.690.000 ( trece millones seiscientos noventa mil) la misma transfirió a la entidad bancaria BANCO CONTINENTAL donde figura como titular de cuenta JORGE ADALBERTO LOBO RUIZ DIAZ, la afectada menciona que hasta la fecha las personas mencionadas intentan seguir con el sistema de vulnerar su confianza para seguir cometiendo el acto mencionado en perjuicio a su patrimonio económico y que estaría presentando ante las autoridades documentos la cual respalda sobre las transacciones realizadas por la misma.', 'CIUDAD DE ASUNCIÓN, BARRIO VISTA ALEGRE', NULL, NULL, 188, 230, 'Asunción', 'Suboficial Mayor', 'CESAR ENRIQUE', 'RODAS MOREL', NULL, NULL, '5024A1A26', NULL, 'completada', '2026-01-21T15:32:16.100Z', NULL, NULL),
(371, 279, '2026-01-21T00:00:00.000Z', '12:24', '2026-01-05T00:00:00.000Z', '09:00', 'Acceso indebido a sistemas informáticos', NULL, 'Que se presenta a esta direccion especializada a modo de realizar una denuncia de un supuesto hecho de acceso indevido a su cuenta de banco, el mismo menciona que en fecha 08/01/2026, en horarios de la mañana ingreso a su aplicacion de BANCO ITAU a modo de ver sus movimientos momento en cual se percata de que su tarjeta de credito de cuenta Nº 3791 915001 00953  AMERICAN EXPRESS, con saldo total de 2.000.000 (dos millones de guaranies) de la entidad BANCO ITAU, estaba siendo utilizada con multiples transacciones de bajo monto que figuran a partir de la fecha 05/01/2026 hasta el 07/01/2026 , totalizando un monto total de 1.049.360 guaranies (un millon cuarenta y nueve mil treciento sesenta) , cuyo extracto de cuenta se adjuntan mas adelante, posterio menciona otra tarjeta de credito de la entidad BANCO ITAU VISA con saldo total de 3.900.000 de guaranies  ( tres millones novecientos mil) con  cuenta Nº 4338 28431269 5187 a nombre del recurrente con mismas transacciones desconocidas por un valor total de 216.339 guaranies  (doscientos dieciseismil trecientos treinta y nueve), cuyo extracto se adjuntan mas adelante, sigue relatando que el mismo posee otra tarjeta de credito de la entidad BANCO ITAU con saldo total de2.000.000 de guaranies  (dos millones) con cuenta Numero 4338 2843 2227 4510, que al igual que las anteriores tambien figuran con varias transacciones desconocidas por un valor total de 93.409 de guaranies ( noventa y tres mil cuatrocientos nueve) cuyo extracto se adjuntan mas adelante, sigue relatando el recurrente que posee otra tarjeta de debito de la entidad bancaria BANCO ITAU con numero de cuenta 5421 1690 0507 0506, que tambien fue vulnerado con diferentes transacciones totalizando un monto total de 710.054 guaranies (setecientos diez mil sincuenta y cuatro), el mismo manifiesta desconocer el motivo por el cual fueron realizados dichas transacciones.', 'CIUDAD DE ASUNCIÓN, BARRIO LAS MERCEDES, AVENIDA ESPAÑA C/ GENERAL SANTOS ', NULL, NULL, 189, 230, 'Asunción', 'Suboficial Mayor', 'CESAR ENRIQUE', 'RODAS MOREL', NULL, NULL, 'B8BBB6A26', NULL, 'completada', '2026-01-21T16:44:24.749Z', '2026-01-21T00:00:00.000Z', '09:00'),
(372, 280, '2026-01-21T00:00:00.000Z', '12:39', '2026-01-21T00:00:00.000Z', '08:30', 'Acceso indebido a sistemas informáticos', NULL, 'Se encontraba trabajando en el Hospital de IPS Ingavi, entre pacientes, donde recibe una llamada telefónica vía WhatsApp del abonado numero 0985128390, cuenta de empresas con la foto de perfil del logotipo del banco ITAU, de quien se identificó como personal de dicha entidad bancaria, y le refirió que contada con una tarjeta de crédito pre aprobada que había solicitado vía app del banco, a lo que la denunciante manifestó no estar interesada y que en caso de haber solicitado, quería cancelar dicha solicitud, para lo cual le pidieron corroborar sus datos personales, que el llamante le proporcionó íntegramente todos los datos de la denunciante, tales como nombre completo, profesión, número de cédula de identidad, número de cuenta bancaria, que la misma asentó como correctos.  Siendo las 08:57 horas la recurrente recibió varios mensajes de texto del número 4828, donde le notificaban sobre transacciones realizadas, que la misma no reconocía, por lo que procede a llamar al numero de atención al cliente del banco ITAU 0216171000, donde manifestó lo acontecido y advirtió sobre una posible estafa, solicitando a su vez la cancelación de su cuenta, donde el corresponsal le menciono que su cuenta bancaria se encontraba sin fondos y que además se había solicitado un crédito por 50.000.000 Gs (cincuenta millones de guaranies), que ya fue acreditado a su cuenta y que ya fue transferido a otras cuentas bancarias que se detallan a continuación: 1) Entidad: UENO Bank, Titular: PPK IMPORT EAS, Ruc. N° 800150048-6, monto: 44.000.000 Gs (cuarenta y cuatro millones de guaranies); 2) Entidad: UENO Bank, Titular: MICAELA TORRES, CI N° 7.364.867, monto: 5.000.000 Gs (cinco millones de guaraníes); 3) Entidad: UENO Bank, Titular: MARIA JULIA ESCALANTE, CI N° 4.260.366, monto: 5.745.313 Gs. (cinco millones setecientos cuarenta y cinco mil, trescientos sesenta y seis guaranies); 4) Entidad: TIGO MONEY, monto: 2.366.000 Gs. (dos millones trescientos sesenta y seis mil guaraníes); y 5) Entidad: PERSONAL PAY, monto 1.500.000 Gs. (un millón quinientos mil guaranies), que al momento de la denuncia no cuenta con los comprobantes de las transacciones mencionadas. Posteriormente, se percata de que le habia llegado dos correos electrónicos de la dirección no-reply@itau.com.py, con códigos de transacción, así como un  correo de la direccion info@itau.com.py, sobre activación de pin exitoso.', 'DEPARTAMENTO CENTRAL, CIUDAD DE FERNANDO DE LA MORA, HOSPITAL IPS INGAVI', NULL, NULL, 190, 206, 'Asunción', 'Suboficial Ayudante', 'ARACELI LUJAN', 'FRANCO DELGADILLO', NULL, NULL, 'E13F4BA26', NULL, 'completada', '2026-01-21T17:19:08.108Z', NULL, NULL),
(373, 281, '2026-01-21T00:00:00.000Z', '13:58', '2026-01-21T00:00:00.000Z', '01:01', 'Extorsión', NULL, 'Que se presenta a esta direccion especializada a modo de realizar una denuncia de un supuesto hecho de Extorsion, el mismo menciona que en la fecha y hora mencionada mas arriba contacta con una persona de nombre Maria Rolon a traves de la red social FACEBOOK especificamente por la mensajeria MESSENGER donde inician una conversacion, el recurrente menciona que la misma le solicita su numero de Whatsapp donde el mismo accede y le facilita su numero de telefono, minutos despues le llega un mensaje al Whatsapp de abonado Nº 0986910967, inician una conversacion donde la misma le envia fotografias y videos y le solicita una transferencia de Gs. 100.000 el recurrente menciona que realizo una transferencia de Gs. 30.000 a traves de Giros Tigo al abonado Nº 0987296159, momento donde le manda una publicacion de FACEBOOK con fotografias suyas  con la descripcion de ACOSADOR DE MENORES y le vuelve a solicitar dinero para borrar dicha publicacion donde el recurrente menciona que ya no accedio y procedio a bloquear dicho numero.', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, BARRIO BARCEQUILLO, AVELINO MARTINEZ C/ 15 DE ENERO', NULL, NULL, 191, 169, 'Asunción', 'Suboficial Ayudante', 'WALTER DAVID', 'FRANCO CABRERA', NULL, NULL, '820BE3A26', NULL, 'completada', '2026-01-21T17:36:13.798Z', NULL, NULL),
