(376, 284, '2026-01-21T00:00:00.000Z', '15:00', '2026-01-16T00:00:00.000Z', '08:00', 'Lesión de confianza', NULL, 'Relata que mediante la red social Meyo la recurrente conoció a un usuario de nombre Maykol , con el cual entablo una conversación y posteriormente entablaron una relacion de amistad. trascurrido el tiempo el mencionado le facilita a la recurrente sus números telefónicos :0994.809.734, 0982.770.482 . medio por los cuales el mismo se comunicaba mediante la aplicación de WhatsApp (mensajería) el mencionado le solicita a la misma si pudiere realizarle un favor muy personal. a la cual la misma accedió voluntariamente en ayudarle, el favor consistía en  que la misma pueda crear apertura de cuentas bancarias la cual la misma procedió a facilitarle el acceso a sus cuentas personales bancarias que se detallan a continuación:
1-)BANCO SOLAR, NRO DE CUENTA: 301017766, NRO DE CLIENTE: 1195771
2-)INTERFISA BANCO/ ECLUB, NRO DE CUENTA: 259029442
La presente sigue manifestando que la confianza que deposito en el mencionado fue tanta que el mismo de forma engañosa solicito y convenció a la misma para que pueda facilitarle el acceso y dominio referente a la utilización de ambas cuentas bancarias, la misma se percata que desde la fecha 16/01/2026 hasta el 20/01/2026 ambas cuentas comenzaron a tener movimientos repentinos en ingreso y transferencias a diferentes cuentas bancarias que la presente desconoce quienes serian los titulares de las mismas, seguidamente la recurrente intenta comunicarse en reiterada ocasiones con el mencionado Maikol para poder hacer consulta sobre lo referido a lo que no obtuvo respuesta alguna eludiendo el mismo así cualquier tipo de pregunta que la misma le realizaba sobre los movimientos de cuentas, menciona la misma que le sindicado le habría dejado en su cuenta personal la suma de guaraníes 465.000 (CUATROCIENTOS SESENTA Y CINCO MIL), Sigue manifestando la presente; que el movimiento total en la cuenta de la entidad Bancaria Solar Banco consiste en guaraníes 8.555.000 (OCHO MILLONES QUINIENTOS CINCUENTA Y CINCO MIL), Interfisa Banco/Eclub consiste en guaraníes 9.908.537 ( NUEVE MILLONES NOVECIENTOS OCHO MIL QUINIENTOS TREINTA Y SIETE MIL), totalizando la suma de guaraníes 18.463.537 (DIECIOCHO MILLONES CUATROCIENTOS SECENTA Y TRES MIL QUINIENTOS TREINTA Y SIETE), la denunciante pone a conocimiento de que no conoce en forma personal ni el paradero del mencionado y que además los códigos de acceso de las cuentas que la misma es titular ya fueron modificadas según su manifiesto, se anexa a la presente acta copias de extractos bancarios.', '', NULL, NULL, 194, 212, 'Asunción', 'Suboficial Ayudante', 'ENZO LEONARDO', 'MORINIGO GAMARRA', NULL, NULL, '09D1FDA26', NULL, 'completada', '2026-01-21T19:08:12.476Z', NULL, NULL),
(379, 287, '2026-01-21T00:00:00.000Z', '16:24', '2026-01-21T00:00:00.000Z', '09:00', 'Estafa', NULL, 'Que se acerca  esta dirección especializada a  fin de realizar una denuncia sobre un supuesto hecho de estafa, ocurrido en fecha ya mencionada el mismo manifiesta que recibe un mensaje desde la plataforma de mensajería instantánea telegrama, desde el usuario del nombre Valentina quien le menciona que podría ganar dinero desde su dispositivo móvil, donde le envía el contacto de George  donde le agrega a un grupo de la misma plataforma de nombre grupo de trabajo 2026 de Google, el mismo creyendo en la veracidad de lo comentado accede a realizar las tareas, las cuales seria comentar y calificar lugares atraves Google map, donde el recibe la suma de 4.000 gs. (cuatro mil guaraníes) por tarea, mencionándole que podría generar mas ingresos subiendo de nivel, donde el mismo accede a realizar los nuevos recados solicitándole la suma de 100.000 gs (cien mil guaraníes), accediendo a enviar dicha suma a la cuenta N°816308906 a nombre de Alejandro Fabian Torres Velázquez de la entidad bancaria (eko), recibiendo la suma de 140.000gs (ciento cuarenta mil guaraníes ) por el trabajo realizado, al momento le menciona que podría generar aun mas ingreso donde el mismo accede a realizar la tarea la cual seria invertir la suma de 1.500.000 gs. ( un millón quinientos mil guaraníes ), enviando a la cuenta N°6192255051 a nombre de Ricardo Daniel Dehnike Molina con C.I N° 5.954.951  donde el supuestamente recibiría  una suma de 2.250.000gs (dos millones doscientos cincuenta mil ), luego de eso le menciona que obtendría que enviar la suma de 4.980.000gs (cuatro millones novecientos ochenta mil guaraníes ) el mismo se negó a realizar el trabajo, donde el supuesto planificador le menciona que perdería el monto invertido, donde ya no volvieron a entablar ninguna conversación. Por la que se apersona a esta dependencia a poner en conocimiento del hecho.', 'CIUDAD DE ASUNCIÓN, BARRIO SAN ANTONIO, TESTANOVA Y CORONEL GRACIA ', NULL, NULL, 195, 208, 'Asunción', 'Suboficial Ayudante', 'ULISES GABRIEL', 'TORRES ROA', NULL, NULL, '55C952A26', NULL, 'completada', '2026-01-21T20:23:55.988Z', NULL, NULL),
(380, 288, '2026-01-21T00:00:00.000Z', '17:20', '2026-01-21T00:00:00.000Z', '16:15', 'Daño', NULL, 'Que se presenta ante esta dependencia especializada, a los efectos de formular una denuncia sobre un supuesto hecho de DAÑO A LA IMAGEN, el recurrente manifiesta que en la fecha y hora indicada mas arriba recibe un mensaje de sus dos hermanas de nombre OLIVIA CARDOZO SARUBBI con el abonado Nº 0981 248 337, ADRIANA CARDOZO SARUBBI del abonado Nº 0971 114 356, la misma le manifiesta que recibe un mensaje desde el abonado Nº +595 992 044 608 y del Nº +595 985 903 778 haciendose pasar por el ciudadano, solicitandole el dinero por el motivo de que su cuenta bancaria se encontraba fuera de servicio por acceder el limite de transaccion, lo cual llamo la atencion del mismo y viene a poner a conocimiento de la autoridad competente, por miedo a que utilicen su imagen para fines fraudulentos.', 'CIUDAD DE ASUNCIÓN, BARRIO VILLA AURELIA, ARTURO ANSINA 7372', NULL, NULL, 196, 204, 'Asunción', 'Suboficial Ayudante', 'DANNA ARAMI', 'RODRIGUEZ FERNÁNDEZ', NULL, NULL, '4E8A26A26', NULL, 'completada', '2026-01-21T20:47:43.639Z', NULL, NULL),
(383, 291, '2026-01-21T00:00:00.000Z', '18:40', '2026-01-21T00:00:00.000Z', '09:28', 'Estafa', NULL, 'Que se acerca a esta dependencia especializada a fin de formular una denuncia sobre un supuesto hecho de Estafa ocurrido en la fecha ya mencionada, la misma menciona que se encontraba en su domicilio navegando en la plataforma de la red social Facebook específicamente en el apartado Marketplace donde visualiza una publicación con el URL: https://www.facebook.com/share/17iJhqdUw3, sobre producto (ventilador) poniéndose en contacto con el supuesto vendedor de nombre Edgar Riveros quien le facilita el abonado numero 0985225011, quien le menciona que el producto tendría un valor de  200.000gs (dos cientos mil guaraníes), por la cual la misma quiso adquirir tres ventiladores, donde el supuesto vendedor le haría un descuento abonando la suma de 540.000 gs. (quinientos cuarenta mil guaraníes), accediendo enviar dicha monto a la cuenta n°259083394, a nombre de Lucas Giovanni Ramírez Villamayor   con C.I n° 6138839, luego de eso le menciona que el producto seria llevado por un delivery, donde recibe un mensaje desde el abonado numero 0991261606, quien le menciona que el costo del delivery seria la suma de 50.000gs (cincuenta mil guaraníes ), posterior le había enviado dicho monto al abonado numero 0985327348, posterior el delivery le había enviado un mensaje de audio diciéndole que tenia problemas con su móvil, solicitándole la suma de 80.0000gs (ochenta mil guaraníes ), donde la misma se niega realizar dicha transacción sospechando que fue victima de una estafa, al momento le reclama al señor Edgar sobre lo sucedido, donde el supuesto vendedor le amenaza que usaría su imagen e información para realizar estafas solicitándole la suma de 2.500. US. (dos mil quinientos dólares americanos ), la misma se niega a realiza el pago y menciona que hasta el  momento de la denuncia  sigue recibiendo amenazas y hostigamientos del parte del supuesto vendedor. Por la que se apersona a esta dependencia a poner conocimiento del hecho      ', 'CIUDAD DE ASUNCIÓN, BARRIO MBURICAO, LA FRANCONI CHOFERES DEL CHACO ', NULL, NULL, 199, 208, 'Asunción', 'Suboficial Ayudante', 'ULISES GABRIEL', 'TORRES ROA', NULL, NULL, '9F94E0A26', NULL, 'completada', '2026-01-21T22:53:19.340Z', NULL, NULL),
(384, 292, '2026-01-21T00:00:00.000Z', '19:55', '2026-01-17T00:00:00.000Z', '13:00', 'Estafa', NULL, 'Que se presenta a esta direccion especializada a fin de formular una denuncia de un supuesto hecho de estafa, ocurrido en dia y fecha mencionada, la recurrente manifiesta que se encontraba nabegando en la red social FACEBOOK especificamente en el apartado MARCEPLACE, en busca de alquilar una casa para vacacionar, momento en el que visualiza una publicacion que le llamo la atencion de un perfil denominado TAMMY ACOSTA, exponiendo el alquiiler de una casa por valor de 1.000.000 de guaranies (un millon),  dejando como referencia de contacto el abonado Nº 0993-632-907, medio por el cual la recurrente se comunico con el supuesto dueño a travez de la aplicacion whatsapp, a lo cual el supuesto dueño les manifesto que para dicho alquiler deberian abonar el 50% del valor total del alquiler, proporcionando la cuenta Nº 817416844, de la entidad bancaria BANCO FAMILIAR  a nombre de ARTURO GASTON VILLALBA VAEZ CI Nº 6282401   realizando una  transferencia de 500.000 guaranies (quinientos mil) con la condicion de que enviarian el total antes de las veinticuatro horas de recidir en dicha ubicación, sigue relatando que pasados los dias a llegar con lo acordado la mencionada se contacta con el supuesto dueño a modo de realizarle el pago total , a lo que procede a la transferencia correspondiente a la misma cuenta mencionada el monto faltante de 500.000 guaranies (quiniemtos mil), donde el mismo le facilita la factura de pago Nº 001-001-0094227 con timbrado Nº 16755889 con RUC Nº 451569-1,  llegado el dia Sabado 17/01/2026 se apersonan a dicha ubicacion donde ya no reciben retorno del mismo, dandose cuenta de que a sido victima de un supuesto hecho de estafa.', 'DEPARTAMENTO DE COORDILLERA, CIUDAD DE SAN BERNARDINO, EE.UU Y CURUPAYTY ', NULL, NULL, 200, 195, 'Asunción', 'Suboficial Ayudante', 'ANGEL GABRIEL', 'CARVALLO FLORENTIN', NULL, NULL, '500971A26', NULL, 'completada', '2026-01