(386, 294, '2026-01-21T00:00:00.000Z', '22:56', '2026-01-21T00:00:00.000Z', '21:35', 'Acceso indebido a sistemas informáticos', NULL, 'Que se acerca a esta dependencia especializada  a fin de realizar una denuncia sobre un supuesto hecho de Acceso indebido a sistemas informáticos en fecha ya mencionada mas arriba ,el mismo menciona que se encontraba en su domicilio momento en que recibió un mensaje desde la plataforma de mensajería WhatsApp, del abonado N° 0985714482 haciéndose pasar por el  señor José Candia, quien seria amigo del mismo entablando conversación el supuesto señor José Candia le solicita una transferencia, la cual el mismo se niega realizar, el mismo menciona que recibió un código en su dispositivo móvil al momento el supuesto señor José Candia  le solicita el mencionado código el cual por temor no envía, sigue mencionando que el señor José Candia le manifiesta que recibiría una llamada de su supuesta sobrina, al momento recibe una llamada del abonado N° 085714482, diciéndole que verifique el numero  de código  donde el accede a verificar facilitándole dicho código momento en que pierde acceso a su cuenta de WhatsApp al momento realiza los pasos necesario para la recuperación de su cuenta lográndolo exitosamente. Por la que se apersona a esta dependencia para poner conocimiento del hecho.', 'CIUDAD DE ASUNCIÓN, BARRIO LA ENCARNACION, AYOLAS 834', NULL, NULL, 202, 208, 'Asunción', 'Suboficial Ayudante', 'ULISES GABRIEL', 'TORRES ROA', NULL, NULL, '2576A5A26', NULL, 'completada', '2026-01-22T02:30:54.562Z', NULL, NULL),
(447, 374, '2026-01-25T00:00:00.000Z', '17:42', '2026-01-24T00:00:00.000Z', '07:00', 'Acceso indebido a sistemas informáticos', NULL, 'El recurrente manifiesta que, en la fecha y hora previamente señaladas, recibió en su correo electrónico diversas notificaciones relacionadas con un supuesto acceso indebido a la cuenta asociada al dominio nanoes09@gmail.com

Asimismo, el recurrente declara desconocer dichos intentos de acceso, por lo que presume que terceras personas se encuentran realizando de manera reiterada tales acciones sin su autorización.

En razón de lo anterior, formula la presente denuncia, con el objeto de deslindar cualquier responsabilidad derivada del uso indebido o potencial de la cuenta de correo electrónico mencionada.

Finalmente, el recurrente manifiesta su plena disposición para poner a disposición del Ministerio Público su dispositivo móvil, así como las credenciales de acceso al correo electrónico referido, a fin de coadyuvar en el esclarecimiento de los hechos.', 'CIUDAD DE ASUNCIÓN, BARRIO GENERAL BERNARDINO CABALLERO, AZARA ESQ. GENERAL SANTOS ', NULL, NULL, 245, 172, 'Asunción', 'Suboficial Ayudante', 'JACQUELINE MONTSERRAT', 'ESTIGARRIBIA ORTIZ', NULL, NULL, 'D0A627A26', NULL, 'completada', '2026-01-25T20:56:09.818Z', NULL, NULL),
(414, 340, '2026-01-23T00:00:00.000Z', '10:25', '2026-01-22T00:00:00.000Z', '07:30', 'Acceso indebido a sistemas informáticos', NULL, 'La recurrente menciona que en fecha 12/01/2026 habia realizado un pago a traves de la aplicacion de su banco ITAU, (cuyos datos no posee), a la telefonia claro en concepto de pago de servicio por el monto de 90.000 gs (noventa mil guaranies), menciona que posterior a eso ya no pudo utilizar app del banco itau por que lo notifcaban que su token era invalido,  posterior a eso en fecha 19/01/2026 se bloquea su servicio de telefonia CLARO por lo que la denunciante acude a una de las sucursales de CLARO a realizar el reclamo correspondiente y los funcionarios de la telefonia claro le informaron que se habia realizado el pago que la misma efectuo, pero que fue pagado la cuenta de otra persona, tambien le mencionaron que harian la queja correspondiente  al banco ITAU previo llenado de formulario con adjunto del comprobante de  la transferencia, sigue mencionando que ya en fecha 20/01/2026 en horas de la mañana se acerco hasta la oficina central del Banco ITAU a fin de realizar la reactivacion del token de dicha app, donde fue atendido por un funcionario de atencion al cliente del area comercial, primeramente procedieroan a acercarse al cajero para realizar el cambio de token lo cual fue sin exito, por lo que se acercaron hasta el vox donde el funcionario le indico que iba a realizar el cambio de toquen a traves de sus sistema y que una vez realizado para verificar la recurrente procede a realizar una transferencia desde su cuenta del banco itau a su cuenta del Banco Ueno Bank lo cual lo realizo con exito, sin inconveninetes, posterior procede a retirarse del lugar, agrega que el mismo dia en horas del medio dia quiso pagar un servicio desde su aplicacion del banco y le notifica que su toquen es invalido y que debia de acercarse a un cajero para reactivar el toquen, lo cual le fue raro, menciona ademas que en fecha 22/01/2026 se acerco hasta un cajero del banco Itau ubicado cerca del local de Doña Angela ubicada en la ciudad de Mariano Roque Alonso, para poder reactivar el toquen de su aplicacion, donde no pudo realizarlo, por lo que al realizar algunas compras realizo el pago utilizando la tarjeta de debito del banco Itau, agrega que el dia de la fecha se acerco hasta un cajero ubicado sobre la calle 25 de mayo y alberdi de la ciudad de Asuncion, especificamente en un local de Biggie con la intencion de poder realizar extraciones de dinero, momento en la que se percata de que no tenia fondos y que se habian realizado varias extraciones de su cuenta sin su  consentimiento, seguidamnete procede a llamar al callcenter del banco Itau en donde la funcionaria que le atendio le indico que iba abloquear los accesos  a su cuenta por precaucion indicacndole ademas que los debitos realizados fueron via QR a traves de aplicaciones de mango, los cuales la misma refiere desconocer ya que no pudo mas utilizar desde su aplicacion por la invalidacion del toquen. ', '', NULL, NULL, 226, 165, 'Asunción', 'Suboficial Segundo', 'CAROLINA NOEMI', 'SARABIA GONZALEZ', NULL, NULL, '1C2950A26', NULL, 'completada', '2026-01-23T14:11:22.825Z', NULL, NULL),
(430, 356, '2026-01-23T00:00:00.000Z', '18:21', '2026-01-23T00:00:00.000Z', '13:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Manifiesta que el día de la fecha recibió un mensaje de parte de una amiga donde esta le menciona que una persona conocida suya le había enviado unos mensajes mencionándole que había visualizado fotografías íntimas de la recurrente en una plataforma para adultos compartiendo además el link que es https://www.erome.com/a/n4HVDFSi. Agregando de que al ingresar al link pudo visualizar de que en realidad se encontraban varias fotografías suyas antiguas con más de 3.200 visualizaciones.  Manifiesta además que solicitó a su amiga que pueda reportar la página y que en minutos más tarde al verificar nuevamente el link ya no tuvo acceso a las fotos ya que aparecía  una notificación de que la página no se encontraba disponible, sigue manifestando que dichas imágenes fueron divulgadas sin su consentimiento en septiembre del 2019 por parte de un conocido suyo, agregando que en aquel entonces este conocido ya mencionado afirmó de que accedió a las fotografías desde el celular de la ex pareja de la recurrente, sin la autorización de su ex pareja y que además compartió con otras dos personas más, agrega que en aquel entonces llegaron a un acuerdo verbal de que esta persona que accedió a las imágenes iba a borrar los archivos que tenía en relación a la denunciante. Sigue mencionando que solicita la identificación del IP del link, diligencias pertinentes y como medida urgente el bloqueo y eliminación de la página y reconocimiento del autor autor de dichas publicaciones realizadas sin su consentimiento. ', 'CIUDAD DE ASUNCIÓN, BARRIO SAN ROQUE, SOBRE LA CALLE GRAL. REYCHERD 855', NULL, NULL, 235, 165, 'Asunción', 'Suboficial Segundo', 'CAROLINA NOEMI', 'SARABIA GONZALEZ', NULL, NULL, '7A1D35A26', NULL, 'completada', '2026-01-23T22:30:24.611Z', NULL, NULL),
(387, 298, '2026-01-22T00:00:00.000Z', '07:53', '2026-01-21T00:00:00.000Z', '12:38', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que se presenta ante esta Dependencia Especializada a fin de realizar una denuncia, menciona la recurrente que en fecha 21/01/2026 aproximadamente a las 12:38 horas recibe un mensaje a través de la plata forma de Facebook, en donde una página denominada Chimoso Py, la acusa de tener una relación sentimental con un compañero de trabajo, y que iba a divulgar la supuesta información sobre lo mencionado contra la denunciante, minutos después se percata de que existían varios intentos de etiquetas  a su perfil de Facebook como Instagram, con mensajes acusándola de ser la amante, inclusive visualizo fotografías familiares de la persona con quien es acusada de mantener una relación extramatrimonial, continua relatando que hasta horas de las noches continuaba recibiendo constantes mensajes ofensivos a través de la palta forma de Instagram desde el perfil denominado descubriendoinfiel18, con dirección de URL https://www.instagram.com/descubriendoinfiel18?igsh=eHo3eHlyaGhqNm93, en ambos perfiles le acusaban de lo mismo, la denunciante fue hostigada en todo momento, también este perfil le mencionaba que haría publico dentro de su lugar de trabajo, todo con la intención de dañar su imagen, de acuerdo a los hechos mencionados la misma cree que esta información se genera dentro de su área laboral de parte de algún compañero@, que este intentando dañando la imagen personal de la afectada. Por todo lo expuesto viene a poner a conocimiento de la autoridad competente para los fines que hubiere lugar, conforme a derecho.', 'CIUDAD DE ASUNCIÓN, BARRIO HIPODROMO, GUARAYOS C/ INCIENSO', NULL, NULL, 203, 188, 'Asunción', 'Suboficial Segundo', 'ROMINA GISELL', 'SÁNCHEZ SANABRIA', NULL, NULL, 'FFB846A26', NULL, 'completada', '2026-01-22T10:59:15.556Z', NULL, NULL),
(442, 367, '2026-01-25T00:00:00.000Z', '09:44', '2026-01-24T00:00:00.000Z', '07:00', 'Difamación', NULL, 'Que, en virtud de lo expuesto, la recurrente pone en conocimiento de las autoridades que, en la fecha y hora mencionadas precedentemente, se encontraba participando desde hace aproximadamente un año en un grupo de la red social Facebook denominado “INJUSTICIAS Y ESCRACHES DEL IPS SIN CENSURA”, identificado bajo la dirección URL: X:https://www.facebook.com/share/g/1A3wobXQj4/?mibextid=wwXIfr

Manifiesta la recurrente que, dentro de dicho grupo, un usuario desconocido y anónimo realizó diversas publicaciones que la señalan de manera difamatoria. Al verificar los enlaces correspondientes a dichas publicaciones, a saber:

https://www.facebook.com/share/p/1DMEZDbmGo/

https://www.facebook.com/share/p/1ByZJUVcUJ/

se puede constatar que actualmente las mismas se encuentran inactivas o eliminadas. No obstante, conforme surge de las capturas de pantalla que se adjuntan, en dichas publicaciones se observan comentarios falsos y lesivos al buen nombre y honor de la recurrente.

Ante esta situación, la recurrente procedió a reportar las publicaciones ante la plataforma y solicitó asimismo la colaboración de sus contactos para realizar el correspondiente reporte, logrando en un primer momento que el contenido fuera eliminado. Sin embargo, el usuario desconocido volvió a publicar reiteradamente el mismo contenido, pese a los reportes realizados.', 'DEPARTAMENTO CENTRAL, CIUDAD DE MARIANO ROQUE ALONSO, BARRIO ROSA MISTICA, CORONEL FACETTI Y MIGUEL FERNANDEZ ', NULL, NULL, 241, 172, 'Asunción', 'Suboficial Ayudante', 'JACQUELINE MONTSERRAT', 'ESTIGARRIBIA ORTIZ', NULL, NULL, 'D49646A26', NULL, 'completada', '2026-01-25T13:28:23.493Z', NULL, NULL),
(448, 375, '2026-01-26T00:00:00.000Z', '07:32', '2025-09-01T00:00:00.000Z', '14:00', 'Estafa', NULL, 'La recurrente manifiesta que en el mes de septiembre del año 2025 se encontraba navegando en la plataforma de STARMAKER (aplicación de karaoke y red social musical), recibió un mensaje del usuario JohnYoo_star_star576, ID 100085757327, quien se mostró interesado por la recurrente y tras intercambiar mensajes por varias semanas, en fecha 27 de septiembre del 2025 el Sr. John Yoo le menciona a la recurrente que le gustaría hacerle llegar un regalo por motivo de su cumpleaños, pero que el mismo se encontraba residiendo en Estados Unidos, minutos después le envía un comprobante de una supuesta transferencia por el monto de USD 6.500. Acto seguido, se contacto con la recurrente la empresa DELIVERY COMPANY, con correo deliverycompany9007@gmail.com, manifestándole que su paquete se encontraba de salida desde Nueva York, con destino a Paraguay, como así también para recibir el regalo la misma debía cumplir con las normas de la empresa, que sería realizar una transferencia de 2.000.000 gs. (dos millones de guaraníes), así en fecha 28/09/2025 realiza una transferencia a la cuenta cargo BANCO FAMILIAR, cuenta N° 811014797, titular LUZ CARINA SANTA CRUZ RODRIGUES, comprobante N° 2509283968625, siendo las 08:58 hs.
Sigue manifestando la recurrente que en fecha 09/09/2025 la compañía DELIVERY COMPANY le solicita el monto de 3.500.000 gs. (tres millones quinientos mil guaraníes), el cual sería para pagar el impuesto en la Aduana, la misma realiza una transferencia a la entidad cargo UENO BANK, cuenta N° 619698951, titular MARÍA DEL CARMEN BENÍTEZ CORONEL, comprobante N° 3548744, siendo las 15:13 hs, y le mencionan que su paquete de regalo se encontraba en proceso.
En fecha 11 de octubre del 2025 recibe otro correo de DELIVERY COMPANY, deliverycompany9007@gmail.com, a fin de manifestarle que la recurrente necesitaba realizar otro pago por motivo de “Tarifa de Transferencia”, que sería el último envío, la misma confiada por lo manifestado, realiza un envío cargo UENO BANK, cuenta N° 619698951, titular MARÍA DEL CARMEN BENÍTEZ CORONEL, comprobante N° 4624895, siendo las 11:35 horas, la suma de 6.000.000 gs. (seis millones de guaraníes). Sigue manifestando la recurrente que posterior a las transferencias realizadas no recibió ningún regalo, como así también hasta el 13 de enero del 2026 recibió correo de la empresa DELIVERY COMPANY, solicitándole más transferencias para que su paquete sea entregado, pero que la misma ya no realizo ninguna transferencia, como así también manifiesta que hasta el sábado 24 de enero del 2026 mantuvo conversación con el Sr.  John Yoo. Las transferencias fueron realizadas desde la cuenta de su mamá ELIDA PAEZ QUINTANA, C.I N° 3599552, cargo UENO BANK, cuenta N° 619762663, y desde la cuenta de la recurrente cargo UENO BANK, cuenta N° 6191699187.  Por todo lo manifestado la recurrente se acerca hasta esta Dependencia Policial a poner a conocimiento de la autoridad competente para los fines que hubiere lugar. 
', 'DEPARTAMENTO CENTRAL, CIUDAD DE YPANÉ, BARRIO SAN BLAS CONAVI, CALLE 25 DE DICIEMBRE Y 3 DE FEBRERO, N° 264', NULL, NULL, 246, 154, 'Asunción', 'Suboficial Ayudante', 'DILMA MARIA', 'ALVARENGA OJEDA', NULL, NULL, '784A13A26', NULL, 'completada', '2026-01-26T11:31:50.487Z', '2025-11-01T00:00:00.000Z', '15:40'),
(449, 376, '2026-01-26T00:00:00.000Z', '10:22', '2026-01-18T00:00:00.000Z', '21:34', 'Acceso indebido a sistemas informáticos', NULL, 'Que se presenta hasta esta Dependencia Especializada a fin de formular una denuncia y manifiesta cuanto sigue; que en fecha y hora mencionada mas arriba se percata que en su cuenta de Hotmail le llegaba notificaciones sobre inicio de sesión y cambios de contraseña, también le llega notificación de un archivo que estaba transcripto en Ingles, y según la victima pudo traducir y le solicitaban dinero la suma de USD 700.0 (SETECIENTOS ) dólares Americanos que debía de depositar en una cuenta de BITCOINT a fin de no compartir sus datos personales, sigue relatando la victima que también se registro intento de inicio de sesión en su cuenta de INSTAGRAM Y FACEBOOK. Por todo lo manifestado viene a poner a conocimiento, ya que dicha operación mencionado se pudo realizar de otros paises según pudo observar en las notificaciones que le había llegado.', 'DEPARTAMENTO CENTRAL, CIUDAD DE FERNANDO DE LA MORA, BARRIO PITIANTUTA, MARCOS RIERA ENTRE ZAVALA CUE Y RODRIGUEZ DE FRANCIA', NULL, NULL, 247, 178, 'Asunción', 'Suboficial Segundo', 'ARNALDO ANDRÉS', 'AVALOS RUIZ DÍAZ', NULL, NULL, 'E08398A26', NULL, 'completada', '2026-01-26T13:48:10.811Z', NULL, NULL),
