(457, 383, '2026-01-26T00:00:00.000Z', '20:07', '2026-01-27T00:00:00.000Z', '15:00', 'Estafa', NULL, 'Manifiesta el recurrente que se encontraba navegando en la plataforma de Red social Facebook, específicamente en la sección de Marketplace, donde visualiza un articulo de su interés, consistente en un aparato celular de la marca Apple, modelo IPhone 13 pro Max, de 256 GB, color Blanco, por el monto de 2.000.000 gs., dicho producto fue publicado por el perfil denominado BASTIAN CANO, con URL https://www.facebook.com/share/1DRzzFAosp/?mibextid=wwXIfr, interesado el recurrente, en el apartado de Messenger consulta por la disponibilidad del producto y en caso de ser así facilitó su abonado número 0972615675. Acto seguido, recibe un mensaje de texto en la aplicación de mensajería instantánea WhatsApp del abonado N° 0976472765, identificándose como personal de ELECTRO STOCK, y le manifiesta que el método de pago por el producto solicitado sería a través de transferencia, realizando el pago total del valor, mas un aporte por delivery, que sería de 120.000 gs.
