(458, 384, '2026-01-26T00:00:00.000Z', '21:19', '2026-01-24T00:00:00.000Z', '14:26', 'Estafa', NULL, 'la recurrente manifiesta que se encontraba navegando en la plataforma de red social TIKTOK, donde visualiza una publicación de su interés, consistente en un aparato celular de la marca Apple, modelo IPhone 13 pro Max, de 128 GB, color blanco, por el monto de 1.500.000 gs., el cual fue publicado desde el usuario VIP CELL IMPORTADOS, con URL , la misma, interesada por el producto pregunta por la disponibilidad a través de la plataforma de mensajería de WhatsApp, al abonado N° 0981219337, quienes le manifestaron que el producto se encuentra disponible y el método de pago sería a través de carga de billetera, la recurrente realiza una recarga al abonado N° 0971-240-391, el monto de 500.000 gs., según N° de transacción 318651021, y otra recarga por el mismo monto al mismo abonado 0971-240-391, con N° de transacción 318651695.
Sigue manifestando la recurrente que su amiga de nombre Ivanna Valentina Sugastti también realizó una recarga de billetera al abonado N° 0971240391, por el monto de 500.000 gs., con N° de transacción 318651695. Posterior a las transferencias realizadas el encargado del local le menciona que personal de la transportadora TSI se contactaría con la recurrente para realizar la entrega correspondiente, ya que la casa comercial se encontraba en la ciudad de Encarnación. Seguidamente en fecha 25/01/2026 la recurrente realiza consulta sobre su producto en mención, quienes le manifestaron que el día lunes su pedido sería entregado, una vez llegado el día lunes la recurrente seguía sin recibir el producto, y al consultar el día de la entrega la misma no recibió respuestas favorables y horas mas tardes se percata que fue bloqueada, presumiendo así que fue víctima de un supuesto hecho de Estafa. Por todo lo acontecido se acerca hasta esta dependencia policial a poner a conocimiento de la autoridad competente para los fines que hubiere lugar. ', 'DEPARTAMENTO CENTRAL, CIUDAD DE FERNANDO DE LA MORA, BARRIO DOMINGO SAVIO, CALLE CURUPAYTY N° 405 CASI RÍO YPANE', NULL, NULL, 255, 154, 'Asunción', 'Suboficial Ayudante', 'DILMA MARIA', 'ALVARENGA OJEDA', NULL, NULL, '45C035A26', NULL, 'completada', '2026-01-27T00:38:12.333Z', NULL, NULL),
(459, 385, '2026-01-27T00:00:00.000Z', '07:37', '2026-01-26T00:00:00.000Z', '16:56', 'Acceso indebido a sistemas informáticos', NULL, 'Se presenta a esta dependencia a fin de realizar una denuncia sobre un supuesto hecho de acceso indebido a sistemas informáticos, el mismo manifiesta que en fecha y hora menciona mas arriba se encontraba en su domicilio donde recibe varias llamadas desde el abonado numero telefónico 0992-424887, el mimo menciona que seria funcionario de la entidad bancaria Banco Itaú, donde le menciona que se estaría intentando vulnerar su cuenta bancaria de esa entidad, donde le ofrecía su ayuda y que se apersonara frente al cajero y le devolviera la llamada para realizar los pasos correspondientes, donde el mismo menciona que se niega a realizar los pasos requeridos, sigue relatando que ingresa a su banca web donde visualiza de que se habrían realizado tres operaciones sin su consentimiento, las cuales fueron destinadas a su cuenta en una caja de ahorro programada, la primera por el monto 20.000.000 gs. (veinte millones de guaraníes), la segunda 5.000.000 gs. (cinco millones de guaraníes), la tercera por el monto de 4.648.346 gs. (cuatro millones seiscientos cuarenta y ocho mil trecientos cuarenta y seis) el mimo menciona que desconoce la manera en la que se realizo dichas operaciones ya que en ningún momento facilito su clave o algún tipo de contraseña. ', 'DEPARTAMENTO CENTRAL, CIUDAD DE MARIANO ROQUE ALONSO, BARRIO MARIA AUXILIADORA, DAVID BUENO 963', NULL, NULL, 256, 229, 'Asunción', 'Suboficial Ayudante', 'JUAN HERNAN', 'MACIEL GALEANO', NULL, NULL, '56EE39A26', NULL, 'completada', '2026-01-27T11:17:35.153Z', NULL, NULL),
(460, 386, '2026-01-27T00:00:00.000Z', '09:21', '2026-01-26T00:00:00.000Z', '15:30', 'Estafa', NULL, 'se presenta a esta dependencia a fin de realizar una denuncia sobre un supuesto hecho y manifiesta cuanto sigue, que el día de la fecha mencionada se encontraba en su domicilio donde recibe un mensaje dé desde el abonado numero 0994999409, donde le menciona que seria su hermana quien se encontraba en el interior del pías de nombre Zully Acuña solicitándole dinero, momento en el que ella accede a enviar la suma de 150.000 gs. al abonado numero 0984257920 con C.I N°5010005, luego de eso le vuelve a solicitar la suma de 80.000 gs. donde accede a enviar al abonado numero 0984257920 con C.I N°5010005, luego de eso recibe una llamada desde el abonado numero 0986489757 mencionándole que seria un empleado de la telefonía Tigo y la guiaría para poder recuperar su dinero, siguiendo los pasos mencionados por el supuesto trabajador se percata de que habría perdido acceso a su cuenta de mensajería instantánea WhatsApp, momento en el que comienza a realizar los pasos de recuperación del mismo logrando así bloquear temporal mente la cuenta, sigue relatando que dicho numero sigue activo intentando estafar a gente de su entorno utilizando su imagen. ', 'DEPARTAMENTO CENTRAL, CIUDAD DE LUQUE, BARRIO ISLA BOGADO, SANDRA ROSALIA N°127', NULL, NULL, 257, 229, 'Asunción', 'Suboficial Ayudante', 'JUAN HERNAN', 'MACIEL GALEANO', NULL, NULL, '891032A26', NULL, 'completada', '2026-01-27T12:51:29.699Z', NULL, NULL),
(461, 387, '2026-01-27T00:00:00.000Z', '09:57', '2026-01-17T00:00:00.000Z', '11:30', 'Estafa', NULL, 'Se presenta ante esta dependencia policial a fin de realizar una denuncia sobre un supuesto hecho de estafa realizada en fecha y hora mencionada, la misma manifiesta de que habría visualizado una publicidad en plataformas de redes sociales donde se hacia publicidad sobre automóviles financiando por la cual se pone en contacto con el abonado numero telefónico 0987125600 quien se presento con el nombre de Ara supuesta vendedora del local SAGITARIO MOTORS, luego de eso en facha 17/01/2026 se apersona hasta dicho local don es atendido por un hombre quien le manifestó que seria el vendedor, donde le menciona que tendría que hacer el pago inicial por el monto de 2.250.000 gs.(dos millones doscientos cincuenta mil guaraníes), donde ella accede a realizar dicho pagó enviando así la suma acordada a la cuenta N° 31587772 a nombre de MARCOS BERNAL, luego de eso le menciona que tendrían que esperar para que se realizara la entrega del automóvil, pasados los días se vuelve a poner en contacto con el abonado numero 0981169993 quien le manifiesta que seria el encargado de la entrega, mencionándole que tendría que abonar 12 cuotas cada mes y tendría que poner garante, cosa que le pareció extraña ya que en ningún momento le habrían mencionado eso requisitos al momento de ralizar el primer pago para la entrega.', 'DEPARTAMENTO CENTRAL, CIUDAD DE VILLA ELISA, BARRIO 29 DE SETIEMBRE, AV. DEFENSORES DEL CHACO Y VIRGILIO ENCISO', NULL, NULL, 258, 229, 'Asunción', 'Suboficial Ayudante', 'JUAN HERNAN', 'MACIEL GALEANO', NULL, NULL, '5F4F09A26', NULL, 'completada', '2026-01-27T13:25:37.627Z', NULL, NULL),
(462, 388, '2026-01-27T00:00:00.000Z', '10:32', '2026-01-21T00:00:00.000Z', '11:00', 'Acceso indebido a sistemas informáticos', NULL, 'La recurrente se presebnta ante esta dependencia policial a fin manifestar cuanto sigue, que la misma es titular de la tarjeta credito VISA GOLD 4066 9943 5248 0591 perteneciente a la entidad bancaria ITAÙ, sigue manifestando la presente que al estar haciendo un control de su extracto financiero se pervata de compras varias y transferrencias monetarias que la misma segùn manifiesta no realizò, instante seguido se comunica con su ente financiero donde es atendido por un representante, manifiesta lo ocuirrido y solicita el bloqueo total de su tarjeta de credito a lo que indican a la misma que el bloqueo ya se realizo de manera automatica, en fecha 26/01/2026 siendo aproximadamente las 21:00 hs, la presente se percata de que su saldo que la misma posee en su tarjeta de credito fue utilizado nuevamente utilizado sin autorizarzciòn de la misma, donde seguidamente se vuelve a comunicar a su entidad bancaria donde realiza el reclamo respectivo sobre la utilizaciòn de su saldo que la misma posee en su cuenta personal ya que la misma se le habria indicado de que su tarjeta ya se encontraba bloqueada por el reclamo de uso no autorizado realizado con anteriroridad, a lo que le indican que el uso de la misma se estaria utilizando en forma normal deacuerdo a las vinculaciones a las aplicaciones que la misma pueda estar teniendo en forma activa. La presente manifiesta de que el dominio de uso de su tarjeta de credito es de manejo unico de la misma y desconoce quien o queines pudieron acceder al uso del mismo. ', 'DEPARTAMENTO CENTRAL, CIUDAD DE FERNANDO DE LA MORA, BARRIO LAGUNA GRANDE, BELLA VISTA Nº 2320 CASI MUÑOZ', NULL, NULL, 259, 230, 'Asunción', 'Suboficial Mayor', 'CESAR ENRIQUE', 'RODAS MOREL', NULL, NULL, '3FCA27A26', NULL, 'completada', '2026-01-27T14:01:25.612Z', '2026-01-25T00:00:00.000Z', '16:28'),
(463, 389, '2026-01-27T00:00:00.000Z', '10:29', '2026-01-20T00:00:00.000Z', '17:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Se presenta a esta dependencia a fin de realizar una denuncia sobre un supuesto hecho a determinar, la misma manifiesta que se desempeña como delivery en la empresa CENTAL SHOP, donde el día de la fecha mencionada habría recibido un encargo de una entrega de un dispositivo celular de la marcha IPhone modelo 17 pro max, la misma lleva dicho producto hasta el lugar indicado entregando así al señor  Carlos Daniel Amarilla, donde proceden a verificar el paquete (DESLACRANDO EL PRODUCTO) percatándose de que en el caja se encontraba un dispositivo de gama baja y de menor valor, por la cual el cliente le solicitándole pagare y rechaza el producto, por la cual ella accede a realizar dicho procedimiento, al momento se comunica con la empresa al abonado numero 0971109204, de nombre ANIBAL CACERES, pasados los días se percata de que se le habría cargado una deuda de  20.400.000 gs. (veinte millones cuatrocientos  mil guaraníes), el día 26/01/2026 se apersona hasta la empresa consultándole el motivo por el cual se le habría cargado dicha suma, donde le manifiestan que no habría presentado evidencia, sigue relatando que además el cliente se habría presentado para demostrar de que el producto habría llegado de esa forma, la misma relata de que la habrían desvinculado de dicha empresa sin dar explicaciones sobre lo acontecido.  ', 'CIUDAD DE ASUNCIÓN, BARRIO LOS LAURELES, R.I 6 BOQUERON CASI TERESA LAMAS CARISSIMO ', NULL, NULL, 260, 229, 'Asunción', 'Suboficial Ayudante', 'JUAN HERNAN', 'MACIEL GALEANO', NULL, NULL, '2DE1DEA26', NULL, 'completada', '2026-01-27T14:03:52.428Z', NULL, NULL),
(467, 393, '2026-01-27T00:00:00.000Z', '11:44', '2026-01-20T00:00:00.000Z', '15:30', 'Acceso indebido a sistemas informáticos', NULL, 'Se presenta ante esta dependencia a fin de realizar una denuncia sobre un supuesto hecho de acceso indebido a sistemas informaticos, la recurrente menciona que en fecha y hora mencionada mas arriba, ingresa a su cuenta de banco a traves de su banca web del cargo Banco Itau con Nº de Cuenta 704150612, titular Susana Yser Achon con Nº de CI 3602356, momento donde intenta realizar un pago y no le permitio, la aplicacion le solicita el Token de seguridad, la recurrente indica que procedio a llamar al banco para consultar referente al Token que le solicito, donde le indica que aparentemente se estaba manipulando su cuenta desde un celular de la marca Samsung, mas datos se desconoce, lo cual la recurrente desconoce y solicita el bloqueo de su cuenta. La recurrente presume que el acceso indebido seria a traves de Router pertenecinete a la linea Tigo con Security Mode: WPA2-PSK ( AES ), WPS PIN: 04268116, por lo que procedio a cambiar la contraseña, el mismo no le permite y vuelve a la contraseña anterior, motivo por el cual procedio a llamar al abonado Nº 0981611611, soporte tecnico de Tigo, donde solicita el cambio del equipo de router o verificacion tecnica, ante la negativa de parte del soporte la misma solicita la baja del servicio.', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, BARRIO SANTA ANA, LAPACHO C/ SATURIO RIOS', NULL, NULL, 264, 169, 'Asunción', 'Suboficial Ayudante', 'WALTER DAVID', 'FRANCO CABRERA', NULL, NULL, '1DAA8DA26', NULL, 'completada', '2026-01-27T15:16:33.809Z', NULL, NULL),
(468, 394, '2026-01-27T00:00:00.000Z', '13:19', '2026-01-26T00:00:00.000Z', '17:00', 'Difamación', NULL, 'Manifiesta la recurrente que desde hace seis meses aproximadamente recibe comentarios hirientes y amenazantes, en sus publicaciones en la red social Instagram, de perfil Apoloniagx URL: https://www.instagram.com/apoloniagx?igsh=MWZuYzliMGp5YXExcA==, refiriéndose hacia su persona con insultos de toda índole, denigrándola como mujer, tratándola de mala persona por prohibir que su marido vea a su hijo. Así mismo, manifiesta que en la página Churero.co de la red social de Instagram, el día de ayer lunes 26/01/2026 siendo las 17:00hs aproximadamente, se publicó una captura de pantalla de una conversación que, copiado textualmente dice: "Chure muy lindas la palabras la de Dahiana Pero muy santa no es porque le deja a un niño sin papa al prohibirle que le vea y le cuide. Que le haga parte de su vida. Todo lo lindo pero en la vida todo llega y así como ella vio que el karma le llegó a la que se metió en su vida con su ex a ella le llegará el karma por meterse con una criatura al dejarle sin papá", publicación que fue varias veces comentada por el perfil Apologiagx, siempre con insultos y declaraciones falsas y perjudiciales para la reputación y el honor de la denunciante. Tras lo ocurrido, la recurrente menciona que el día de la fecha, envió un mensaje al directo del perfil en cuestión donde le advirtió de la denuncia que formularía en su contra por los hechos acontecidos, momento que tras ello, el perfil procedió a eliminar todos los comentarios de la publicación referida.
Sigue mencionando que, a raíz de ciertos detalles particulares y personales contenidos en los comentarios, que según la denunciante no son de conocimiento público, la misma tiene la sospecha que el perfil en cuestión sería de la mamá del hijo de su ahora marido, la ciudadana SADY BEATRIZ BENEGAS TINTEL, paraguaya, soltera, mayor de edad, con quien tiempo atrás ya tuvo inconvenientes similares. ', 'CIUDAD DE ASUNCIÓN, BARRIO VILLA AURELIA, TTE 1° JOSE D. LOPEZ', NULL, NULL, 265, 169, 'Asunción', 'Suboficial Ayudante', 'WALTER DAVID', 'FRANCO CABRERA', NULL, NULL, '918DB9A26', NULL, 'completada', '2026-01-27T16:55:11.204Z', NULL, NULL),
(473, 399, '2026-01-27T00:00:00.000Z', '15:06', '2025-12-31T00:00:00.000Z', '11:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que se precenta ante esta dependencia  Especializada a modo de realizar una denuncia sobre un supuesto hecho ocurrido en fecha ya mencionada mas arriba, la misma manifiesta que desde de la fecha indicada a recibido varios  avisos por parte de familiares y conocidos de que existe un abonado Nº+591262782925, que se hace pasar por la recurrente quien les escribe constantemente solicitando informacion personal de la victima  con fines desconocido, mensiona tambien de que en fecha lunes 26/01/2026  vuelve a recibir llamadas por parte de sus contactos diciendole que vuelven a recibir mensajes de texto por parte del abonado Nº+591 -698739261 haciendose pasar por la misma, la recurrente indica desconocer por que y por quienes y con que fin se estarian efectuando estos hechos, por lo que pone a conocimiento ante la autoridad competente para los fines que hubiere lugar.', 'DEPARTAMENTO CENTRAL, CIUDAD DE LAMBARÉ, BARRIO SANTA ROSA II, AV SANTA ROSA 431 ENTRE AMERICA Y SAN JUAQUIN ', NULL, NULL, 268, 208, 'Asunción', 'Suboficial Ayudante', 'ULISES GABRIEL', 'TORRES ROA', NULL, NULL, 'AA06E4A26', NULL, 'completada', '2026-01-27T18:46:40.258Z', NULL, NULL),
(469, 395, '2026-01-27T00:00:00.000Z', '13:29', '2026-01-26T00:00:00.000Z', '11:50', 'Estafa', NULL, 'Que se presenta ante esta depencia especializada a fin de realizar una denuncia de un supuesto hecho de estafa ocurrido en fecha ya mencionada, la recurrente manifiesta que se encontraba navegando en la red social FACEBOOK, especificamente en el apartado MARKEPLACE, con inteciones de adquirir un ( PLAYSTATION 3), momento en el cual visualiza una publicacion de un perfil denominado Mercedes Ibarra, sobre un aparato electronico con las caractereisticas ya mencionadas publicado en venta por la suma de GS 742.000 (setecientos cuarenta y dos mil), donde la misma procede a preguntar la disponibilidad del producto a la supuesta vendedora, donde la misma le solicita su numero pareticular, esta a su ves facilitandole el mismo, minutos depues dicho vendedor se comunica con ella atraves de abonado Nº 0974-738-761 mencionandole de que para la adquisicion de dicho articuilo debia abonar una suma de dinero a eleccion de la interesada, para posterior establecer un financiamiento, la recurrente le menciona de que en ese momento no poseia monto alguno, comprometiedose con el pago total para el dia lunes 26/01/2026, una vez llegada la fecha esta se vuelve a comunicar con el vendedor quien le facilito la cuenta Nº 155942660, de entidad bancaria BASA con CI Nº 5498572 a nombre de Maria Lujan Lopez Toledo, transfiriendole la suma total de GS 742.000 (cetecientos cuarenta y dos mil) con comprobante Nº 2420215135, asi tambien facilitando su ubicacion para el envio correspondiente del articulo. transcurridos unas horas la afectada vuelve a recibir un mensaje de texto en su WhatsApp  atraves del abonado Nº 0991-860-488,  por parte de alguien quien simulaba ser dueño de dicho articulo en mencion, manifestando de que dicho monto acoradado no era correspondiente al articulo, indicandole a la recurrente de que debia abonar una suma de GS 800.000 (ochocientos mil), suma que fue transferido a la miama cuenta en mencion. el supuesto vendedor al recbir dicha transferencia le menciona a la misma que se comunicara con su delivery para hacercarle el producto, sigue relatando de que transcurridos unos minutos, vuelve a recibir un mensaje de texto a travez de abonado Nº 0986-729-836, quien se hizo pasar por el gestor de finanzas de la empresa solicitandole la suma de GS 500.000 (quinientos mil) supuestamente para completar el precio real del articulo en mencion, momento en el cual la afectada cobra conciencia y se percata de que podria estar siendo victima de una supuesta estafa.', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, BARRIO BARCEQUILLO, PY02 MARISCAL ESTIGARRIBIA C/ AV. PASTORA CESPEDES ', NULL, NULL, 266, 195, 'Asunción', 'Suboficial Ayudante', 'ANGEL GABRIEL', 'CARVALLO FLORENTIN', NULL, NULL, '03FFC1A26', NULL, 'completada', '2026-01-27T17:35:06.485Z', NULL, NULL),
(472, 398, '2026-01-27T00:00:00.000Z', '14:00', '2026-01-26T00:00:00.000Z', '18:00', 'Acceso indebido a sistemas informáticos', NULL, 'Manifiesta la recurrente que en la fecha 26/01/2026 siendo las 18:00 horas aproximadamente se apersona hasta la casa Central de Unicentro, sito sobre las calles Palma y Estrella, donde la misma cuenta con una tarjeta de crédito, menciona que llega hasta la casa comercial para el pago de su tarjeta, donde la funcionaria le indica que cuenta con una deuda de Gs. 1.177.996 ( un millón ciento setenta y siete mil novecientos noventa y seis mil guaraníes ), deuda que la recurrente no reconoce y solicita el extracto de su cuenta, sigue manifestando la recurrente que la funcionaría procede a facilitarle los detalles de su movimiento que se detallan a continuación: 
