menciona la recurrente que dichas operaciones no fueron realizadas por ella y solicita que los días de morosidad sean canceladas hasta que sea aclarado el hecho, por lo que se apersona hasta esta dependencia para dejar constancia y poner a conocimiento de las autoridades competentes para los fines pertinentes. A continuación se adjuntan copia del extracto.', 'CIUDAD DE ASUNCIÓN, BARRIO SAJONIA, DE LAS LLANAS 1930 ESQ ALFEREZ SILVA', NULL, NULL, 267, 169, 'Asunción', 'Suboficial Ayudante', 'WALTER DAVID', 'FRANCO CABRERA', NULL, NULL, '29B09CA26', NULL, 'completada', '2026-01-27T18:07:00.638Z', NULL, NULL),
(474, 400, '2026-01-27T00:00:00.000Z', '16:39', '2024-07-25T00:00:00.000Z', '16:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que se presenta ante esta dependencia Especializada a modo de formular una denuncia sobre un supuesto hecho  a determinar, ocurrido en  fecha ya mencioinada mas arriba, la misma  menciona que habia comprado un aparato telefonico, modelo iPhone 15 Pro Max  (A3106)de color gris con IMEI: 353650690451708, de la tienda PHONELAD de Gonzalo Sebastian Ortiz Godoy, sito sobre las calles  Avda Mcal Lopez /c Dr Morra, Asuncion por el monto de Gs 4.490.000 (cuatro millones cuatrocientos noventa mil guaranies ), mas un celular de la marca iPHONE 12 Pro como parte de pago, la misma menciona que en fecha 22 de septiembre del 2025 viajo al Brasil, donde su aparato celular no le funciono y la misma menciona que cuenta con roaming. Sigue mencionando que en fecha 11/01/2026 aproximadamente consulta en una pagina Web https://imeicheck.com/es/verificador-imeigoogle_vignette, donde le indica que  el IMEI Nº 353650690451708, fue reportado como; perdido / robado / no pago o fraudulento, la misma alega que se comunico con dicha tienda mencionando lo ocurrido donde le indicaron para apersonarse al local, manifiesta la denunciante que en el dia de la fecha llego hasta el local donde procedio a mostrar el celular y realizaron una verificacion del mismo, momento donde le indican que no se puede realizar el cambio de celular por que  cuenta con un punto negro en la pantalla. A lo cual se apersona ante esta dependencia para dejar constancia y comunicar a las autoridades competentes para los fines pertinentes.', 'CIUDAD DE ASUNCIÓN, BARRIO DR. GASPAR RODRIGUEZ DE FRANCIA, RIO DE LA PLATA Y DOCTOR MACIEL', NULL, NULL, 269, 208, 'Asunción', 'Suboficial Ayudante', 'ULISES GABRIEL', 'TORRES ROA', NULL, NULL, '883241A26', NULL, 'completada', '2026-01-27T20:33:29.143Z', NULL, NULL),
(476, 402, '2026-01-27T00:00:00.000Z', '17:20', '2026-01-27T00:00:00.000Z', '10:00', 'Estafa', NULL, 'Que se presenta ante esta Dirección especializada a modo de realizar una denuncia de un supuesto hecho de estafa, ocurrido el día de la fecha, el recurrente menciona que se encontraba navegando en la red social FACEBOOK específicamente en el apartado MARKEPLACE, con intenciones de adquirir un televisor de la marca TOKIO modelo SMART DE 50¨, momento en el que visualiza una publicación en el perfil denominado, Susana,  de un televisor con las características ya mencionadas, publicada en venta por un valor total de GS 1.100.000 (un millón cien), a lo cual el recurrente le consulto sobre la disponibilidad de dicho producto vía Messenger, al supuesto vendedor quien le proporciono el abonado N° 0971-289-603 para la consulta, quien le menciono que para la adquisición del producto debía abonar el 30% del monto total facilitando una cuenta N° 816266448 entidad BANCO FAMILIAR a nombre de Cecilia Soledad Ledezma Torrez CI N° 8.602.827, cuenta a la cual el afectado transfirió el monto de GS 300.000 (Trescientos mil),  trascurridos unos minutos el supuesto vendedor vuelve a solicitarle la suma de GS 300.000 (trecientos mil) monto que fue trasferido otra vez por el recurrente a la misma cuenta en mención, supuestamente por ser cliente nuevo, sigue relatando de que el supuesto vendedor volvió a pedirle una suma de GS 500.000 (quinientos mil) con la escusa de concretar la venta, monto que fue transferido a la misma cuenta en mención, quien posterior le comunico de que ya se contactaría con su delivery para acercarle su pedido, sigue relatado que transcurridos unos minutos, le escribe una persona atraves del abonado N° 0992-590-272, simulando ser el jefe del negocio a la cual el mismo estaba realizando la compra mencionándole de que le faltaba abonar un moto de GS 200.000 (doscientos mil) por un supuesto incremento en el precio del televisor proporcionando un numero de teléfono 0985-146-192 para realizar un giro, operación que fue realizada otra vez por el afectado a dicho numero,  quedando con el acuerdo de que dicho producto seria enviado, menciona el recurrente de que trascurridos unos minutos vuelve a recibir un mensaje por parte de este ultimo solicitando la suma de GS 140.000 (ciento cuarenta mil)  con la escusa de que necesitaba solucionar un inconveniente mecánico para el transportador de su pedido, momento en el cual este cobra conciencia percatándose de que podría ser victima de un supuesto hecho de estafa, el recurrente menciona que hasta la fecha todavía no recibe retorno del supuesto vendedor ni a recibido su compra. ', 'DEPARTAMENTO CENTRAL, CIUDAD DE AREGUÁ, BARRIO COSTA FLEITAS, 13 DE NOVIEMBRE AREGUA COSTA FLEITAS ', NULL, NULL, 271, 195, 'Asunción', 'Suboficial Ayudante', 'ANGEL GABRIEL', 'CARVALLO FLORENTIN', NULL, NULL, '0DB452A26', NULL, 'completada', '2026-01-27T21:14:52.617Z', NULL, NULL),
(478, 404, '2026-01-27T00:00:00.000Z', '18:25', '2026-01-27T00:00:00.000Z', '15:35', 'Acceso indebido a sistemas informáticos', NULL, 'Manifiesta la recurrente que en fecha y hora mencionada mas arriba recibe una llamada telefónica del abonado N° 0976627177 identificándose como Nicolás Sanabria, funcionario del Banco Itaú, el mismo le consulta si tiene conocimiento de una transferencia del monto de Gs. 3.200.000 ( tres millones doscientos mil guaraníes ) a lo cual la recurrente le menciona que no estaba a conocimiento de dicho movimiento, momento en el cual el supuesto funcionario le indica que es un error de sistema y le solicita el Token de seguridad para proceder a la reversión de dicha transferencia, le solicita que se apersone hasta un cajero para confirmar el Token, la denunciante menciona que comunica a su nuera de la llamada y de la solicitud que del Token que le hicieron, la misma procedió a comunicarse con el Call Center del Banco y le indican de que no hubo ninguna llamada departe del Banco, momento donde le solicita el Bloqueo de la cuenta. Sigue mencionando la recurrente que ingresa a su banca Web donde logra visualizar un movimiento del monto ya mencionado mas arriba en la fecha 27/01/2026 con N° de comprobante 823265, concepto Transfer.Internet Banking, manifiesta además de que no podía descargar el comprobante del movimiento.', 'DEPARTAMENTO CENTRAL, CIUDAD DE LAMBARÉ, BARRIO VALLE APU''A II, ERNESTO SAN MARTIN ESQ PILCOMAYO', NULL, NULL, 272, 169, 'Asunción', 'Suboficial Ayudante', 'WALTER DAVID', 'FRANCO CABRERA', NULL, NULL, '78D8B1A26', NULL, 'completada', '2026-01-27T22:01:28.375Z', NULL, NULL),
(479, 405, '2026-01-27T00:00:00.000Z', '18:14', '2026-01-26T00:00:00.000Z', '16:30', 'Estafa mediante sistemas informáticos', NULL, 'Se presenta ante esta dependencia especializada a fin de formular denuncia por un presunto hecho punible de estafa, ocurrido en fecha anteriormente indicada.
El denunciante manifiesta que tomó contacto con el ciudadano JOSE GABRIEL SOSA ROMERO, portador de la Cédula de Identidad N.º 8.087.404, a través de la plataforma de compra y venta de productos denominada “Marketplace”, donde el mismo ofrecía a la venta postes rajados de quebracho para alambrados.
El supuesto autor le proporcionó su número de línea telefónica personal N.º 0971 329 803, entablando posteriormente comunicación mediante la aplicación WhatsApp, ocasión en la cual el denunciante solicitó la adquisición de los siguientes productos:

*234 postes rajados de 2,20 m

*19 firmes de quebracho de 3,20 m

*4 rollos de alambre Gerdav 17/15

*1 trinca N.º 12

*544 balancines

Los productos mencionados ascienden a la suma total de Gs. 11.844.000 (once millones ochocientos cuarenta y cuatro mil guaraníes).
El denunciante refiere que solicitó realizar el pago mediante transferencia bancaria a la cuenta N.º 269095212, a nombre de JOSE GABRIEL SOSA ROMERO, perteneciente a Interfisa Banco, efectuando un pago parcial de Gs. 5.922.000 (cinco millones novecientos veintidós mil guaraníes).
Posterior a la realización de dicha transferencia, el supuesto autor le facilitó el contacto del presunto chofer JOSUÉ PAREDES, con número telefónico N.º 0992 146 246, con quien debía coordinar la entrega de los productos en la fecha de hoy.
El denunciante manifiesta que, luego de intercambiar algunos mensajes, siendo aproximadamente las 18:35 horas, el supuesto chofer le informó que la compra de los productos había sido cancelada y que le fue exigido no mantener comunicación alguna con el mismo.
El denunciante agrega que mediante la aplicacion de WhatsApp se le fue exigido el pago totalidad para realizar la entrega del los productos mencionados. a lo cual el mismo se niega y menciona que el pago completo se realizaria en forma presencial. a lo cuál el supuesto proveedor se nego a hacer la entrega.', '', NULL, NULL, 273, 212, 'Asunción', 'Suboficial Ayudante', 'ENZO LEONARDO', 'MORINIGO GAMARRA', NULL, NULL, 'EE954CA26', NULL, 'completada', '2026-01-27T22:15:55.524Z', NULL, NULL),
(480, 406, '2026-01-27T00:00:00.000Z', '21:12', '2026-01-27T00:00:00.000Z', '20:10', 'Acceso indebido a sistemas informáticos', NULL, 'Manifiesta el recurrente que en la fecha y hora mencionada mas arriba, se percata de que su dispositivo movil se encontraba sin señal, el mismo procedio a reiniciar el celular pero menciona que seguia con el problema de cobertura. Ingresa a la aplicacion de mensajeria de Wahatsapp donde le solicita el codigo de verificacion para el cambio de dispositivo, el denunciante manifiesta que rechaza dicha solicitud y procede a realizar la autenticacion de dos pasos, donde la aplicacion de Whatsapp cierra cesion y el mismo ya no puede acceder a la misma durante las 48 horas siguientes, por lo que le genera miedo de que posterior a las 48 horas transcurridas pueda volver a entrar a su whatsapp dicha persona. Sigue manifestando el recurrente que realiza una llamada desde el abonado Nº 0981625910 al abonado Nº 0981079228 la cual pertenecia al denunciante, menciona que fue atendido por su Madre identificada como Norma Lucia Vargas Rojas con CI Nº 1193110 domiciliada en la direccion ya mencionada mas arriba, la misma le responde AHI TE COBRE y posterior cuelga la llamada. El denunciante alega que minutos despues vuelve a recibir una llamada al abonado Nº 0981625910 perteneciente a su esposa del abonado Nº 0982849221 donde no menciono nada, quedo en silencio. Menciona ademas el recurrente que no puede acceder a su banca Web del Banco Familiar con Nº cuenta 0-8306669 por lo que presume que fue cambiado su contraseña ya que el mismo esta vinculado al numero de telefono 0981079228, alega ademas que en su mensajeria de Whatsapp cuenta con temas de trabajos delicados que son irrecuperables. El mismo pone a conocimiento de las autoridades competentes para los fines pertinentes.', 'CIUDAD DE ASUNCIÓN, BARRIO VILLA AURELIA, TTE 1º JOSE LOPEZ C/ MAYOR EDUARDO VERA DUPLEX 3', NULL, NULL, 274, 169, 'Asunción', 'Suboficial Ayudante', 'WALTER DAVID', 'FRANCO CABRERA', NULL, NULL, '8FCB9AA26', NULL, 'completada', '2026-01-28T01:23:59.094Z', NULL, NULL),
(482, 408, '2026-01-27T00:00:00.000Z', '22:43', '2026-01-26T00:00:00.000Z', '15:46', 'Estafa', NULL, 'Se hace presente ante esta dependencia especializada a fin de formular denuncia por un presunto hecho punible de estafa, ocurrido en la fecha precedentemente indicada.
La denunciante manifiesta que, a través de un grupo denominado “AL MEJOR PRECIO MAYORISTA”, perteneciente a la aplicación de mensajería instantánea WhatsApp, visualizó la oferta de una sombrilla para playa con un costo de Gs. 70.000 (setenta mil guaraníes) y seis sillones para playa por un valor de Gs. 270.000 (doscientos setenta mil guaraníes), productos que despertaron su interés, motivo por el cual procedió a solicitar mayores informes con la intención de adquirirlos.
En ese contexto, fue contactada por una persona que se identificó como OSCAR MIGUEL REYES MEDINA, de nacionalidad paraguaya, titular de la Cédula de Identidad N° 8.898.741, con número telefónico 0985 568 749, quien sería el supuesto autor del hecho. El mencionado facilitó a la denunciante los datos de una cuenta bancaria del Banco Interfisa, correspondiente al N° de cuenta 259065745, a la cual la misma efectuó una transferencia monetaria por la suma de Gs. 340.000 (trescientos cuarenta mil guaraníes).
Posteriormente, el citado sujeto le informó que, debido al horario aproximado de las 18:37 horas, no sería posible realizar el envío de la encomienda en ese momento, asegurando que el mismo se efectuaría al día siguiente. Sin embargo, siendo aproximadamente las 09:27 horas del día 27/01/2026, la denunciante constató que había sido eliminada del grupo donde se realizaban las operaciones comerciales. Ante dicha situación, procedió a realizar el correspondiente reclamo al mencionado individuo, siendo bloqueada de manera inmediata, perdiendo todo tipo de comunicación con el mismo.', '', NULL, NULL, 276, 212, 'Asunción', 'Suboficial Ayudante', 'ENZO LEONARDO', 'MORINIGO GAMARRA', NULL, NULL, 'FBDBF2A26', NULL, 'completada', '2026-01-28T02:18:45.276Z', NULL, NULL),
(484, 410, '2026-01-28T00:00:00.000Z', '08:51', '2025-12-18T00:00:00.000Z', '09:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Por lo que viene a formular su denuncia en esta dependencia especializada, relata que en fecha mencionada mas arriba integro una plataforma denominado TRADEANDO para realizar un curso de inversion en la cual habia algunos requisistos para poder integrar en el curso que debia abonar una suma de dinero en donde el recurrente accedio a realizar una trassacion con monto de 182,64 euros a la pagina  HOT MART de fecha 18/12/2025, sigue relatando que pasado un tiempo le vuelve a solicitar una transaccion con monto de 182,64 euros a la misma cuenta que recibio la transsacion anterior de fecha 18/01/2026, una vez realizado todas estas transaciones el recurrente le pide a la empresa que le den debaja a su cuenta que ya no quiere seguir interactuando con ello ya que al denunciante le esta causando malestares en su salud en el que le manifiesta la gente de la empresa que eso va ser imposible ya que hay un contrato de por medio por un año y que por ese motivo no lo pueden dar de baja, por lo que viene a realizar su denuncia en esta dependencia especializada para los fines correspondientes. ', 'CIUDAD DE ASUNCIÓN, BARRIO SAN PABLO, DR LUIS ESCURRA', NULL, NULL, 277, 225, 'Asunción', 'Suboficial Ayudante', 'CESAR', 'FERREIRA BARRETO', NULL, NULL, '5C5507A26', NULL, 'completada', '2026-01-28T12:15:48.438Z', NULL, NULL),
(483, 409, '2026-01-28T00:00:00.000Z', '08:36', '2026-07-27T00:00:00.000Z', '21:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que comparece ante esta Dependencia Especializada a fin de formular una denuncia sobre un supuesto hecho a determinar, menciona el recurrente que en la fecha mencionada mas arriba se encontraba en su domicilio particular momento en que contacto con una persona vía FACEBOOK específicamente vía MESSENGER quien registra como JESSICA NOEMI CABALLERO BRITEZ, luego de una conversación la persona le solicita su numero telefónico en donde el denunciante le facilito y comenzaron a  escribir vía WHATSAAP abonado al numero 0971198869, nuevamente tuvo una conversación con la misma en donde la misma le envió fotos y videos íntimos, así también le solicito al denunciante a que le envié lo mismo, en donde el denunciante accedió enviándole lo solicitado, posterior a eso según el denunciante la persona había publicado sus fotos en la pagina de televisión  (SNT CERRO CORA) y que también estaría publicando en otras paginas televisivas, sigue manifestando el recurrente que le solicito la suma de suma de 800.000 (ochocientos mil guaraníes) para que la persona pueda borra lo publicado en donde el denunciante le envió la suma de 500.000 (quinientos mil guaraníes) por giros TIGO al numero 0983842839 numero facilitado por la persona, motivo que le reclama que le envié todo lo solicitado. También manifiesta que los videos le corresponde a una supuesta hermana menor de edad y que si no le proporcionaba lo faltante esta publicaría la foto de su familia entre ellas la foto de su nieta menor de edad, así como también acudiría hasta una sede policial a fin de realizar una denuncia en contra del recurrente', 'DEPARTAMENTO CENTRAL, CIUDAD DE FERNANDO DE LA MORA, BARRIO DOMINGO SAVIO, CAMPO VIA Y CURUPAYTY', NULL, NULL, 278, 167, 'Asunción', 'Suboficial Ayudante', 'FATIMA', 'BERNAL FARIÑA', NULL, NULL, 'CD13C3A26', NULL, 'completada', '2026-01-28T12:13:41.380Z', NULL, NULL),
(495, 420, '2026-01-28T00:00:00.000Z', '18:21', '2026-01-28T00:00:00.000Z', '14:48', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que se presenta en esta dependencia para formular su denuncia sobre un SUPUESTO HECHO A DETERMINAR, menciona la recurrente que en el día de la fecha la madre de la recurrente recibe un mensaje del abonado N°0974551203 en el cual la madre de la recurrente procede a bloquear dicho abonado, ya que se percato que estaban utilizando la imagen de su hija y nombre apellido de la misma, menciona también la recurrente que en fecha anterior había recibido un mensaje del abonado N°0984213515 pidiéndole un código de seis dígitos en la cual la recurrente no cayo y procedió a bloquear dicho abonado, por lo que se presenta a formular su denuncia en esta dependencia especializada para los fines correspondientes.  ', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, BARRIO VILLA DEL AGRONOMO, CHILE 271 C/ SAMU U', NULL, NULL, 288, 225, 'Asunción', 'Suboficial Ayudante', 'CESAR', 'FERREIRA BARRETO', NULL, NULL, 'FDF44AA26', NULL, 'completada', '2026-01-28T21:43:42.554Z', NULL, NULL),
