(485, 390, '2026-01-28T00:00:00.000Z', '09:28', '2026-01-15T00:00:00.000Z', '17:00', 'EXTRAVÍO DE OBJETOS Y/O DOCUMENTOS', NULL, 'Que se presenta ante esta Dependencia Especializada a fin de realizar una denuncia sobre un supuesto hecho de extravío. Menciona la recurrente que en fecha mencionada mas arriba al momento de realizar el cierre de inventario de factura de la empresa LAS TACUARAS S.A-NUTRIHUEVO con RUC N° 80025390-6, donde cumple sus funciones en el sector de créditos y cobranzas, momento en el que se percató del extravío de 2 (dos) hojas de facturas a créditos  emitidas a las siguientes empresas 1. FLORIDA S.A, RUC N°80028176-4, factura electrónica N°001-004-0077245, timbrado N° 16060225 con fecha de inicio de vigencia 02/12/2022, 2. MARIAS S.A, RUC N° 80045975-0 factura electrónica N°001-004-0077357, timbrado N° 16060225 con fecha de inicio de vigencia 02/12/2022  En circunstancias desconocidas. Por lo que viene a poner a conocimiento e la autoridad competente para los fines que hubiere lugar.', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, BARRIO REDUCTO, AVENIDA LA VICTORIA N° 801', NULL, NULL, 279, 167, 'Asunción', 'Suboficial Ayudante', 'FATIMA', 'BERNAL FARIÑA', NULL, NULL, 'CADBE2A26', NULL, 'completada', '2026-01-28T12:37:53.512Z', NULL, NULL),
(488, 413, '2026-01-28T00:00:00.000Z', '12:05', '2026-01-28T00:00:00.000Z', '10:57', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que se presenta ante esta Dependencia Especializada para realizar su denuncia sobre un supuesto hecho a determinar ocurrido en la fecha mencionada mas arriba, la recurrente solicitó un préstamo a la entidad CREDIMARKET por un monto de 3.000.000 de guaraníes ( tres millones de guaraníes) en donde los mismos le solicitó a la denunciante su usuario y contraseña de MARANGATU para ellos poder hacer una auditoria INSITU alegando que era una política de la empresa para que ella pueda acceder a ese préstamo antes de firmar el pagaré, en donde la misma le menciona que eso no le podía facilitar por el hecho de que es ilegal, sigue mencionando la recurrente que a raíz de eso ya existe varias denuncias de personas quienes reclaman que CREDIMARKET solicita esos datos que según la denunciante es ilegal proporcionar, por lo que viene a realizar su denuncia ante esta dependencia para los fines que hubiere lugar.', 'CIUDAD DE ASUNCIÓN, BARRIO PINOZA, AVENIDA EUSEBIO AYALA N° 836', NULL, NULL, 282, 167, 'Asunción', 'Suboficial Ayudante', 'FATIMA', 'BERNAL FARIÑA', NULL, NULL, 'ED9A8FA26', NULL, 'completada', '2026-01-28T15:38:07.418Z', NULL, NULL),
(486, 411, '2026-01-28T00:00:00.000Z', '10:28', '2025-08-12T00:00:00.000Z', '08:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que se presenta ante esta Dependencia Especializada a fin de realizar una denuncia, menciona la recurrente que durante el mes de octubre al verificar su extracto de cuenta relacionada a la Tarjeta de Crédito Infinite N° 469 VISA, cargo Banco Itaú, se percató de una compra a través de la Empresa AERIC. S.A., que serian debitadas en 12 cuotas según se observa en los detalles de movimientos, dándose cuenta de la transacción no reconocida en fecha 12/08/2025, por debito en pago por la cuota número 2 (dos), de las 12 (doce), cuotas de 231.208 Gs. (Doscientos treinta y un mil doscientos ocho guaraníes), continua relatando que por el hecho mencionado decidió contactar con un agente de cuenta del Banco Itaú, a fin de realizar su reclamo (denuncia), en donde le mencionaron de que debía seguir unos pasos para que se pueda realizar el reembolso, pero conforme pasaron los meses y a la fecha le informaron que dicha transacción no fue reconocido como fraude debido a que supuestamente la compra fue realizada desde un aparato celular IPhone 14. Ante todo lo expuesto la denunciante afirma desconocer la compra, sin conocer los detalles del suceso. Por lo expuesto viene a poner a conocimiento de la autoridad competente para los fines que hubiere lugar conforme a derecho.', 'CIUDAD DE ASUNCIÓN, BARRIO LOS LAURELES, R.I 6 BOQUERON', NULL, NULL, 280, 188, 'Asunción', 'Suboficial Segundo', 'ROMINA GISELL', 'SÁNCHEZ SANABRIA', NULL, NULL, 'AE80E6A26', NULL, 'completada', '2026-01-28T13:46:42.364Z', NULL, NULL),
