Por lo que viene a poner a conocimiento de la autoridad policial para los fines que hubiere lugar, como así también para la investigación correspondiente.', 'CIUDAD DE ASUNCIÓN, BARRIO HIPODROMO, SIN NOMBRE', NULL, NULL, 281, 198, 'Asunción', 'Suboficial Segundo', 'YONNY ARIEL', 'YAHARI AYALA', NULL, NULL, 'AACCBDA26', NULL, 'completada', '2026-01-28T14:57:02.104Z', NULL, NULL),
(491, 416, '2026-01-28T00:00:00.000Z', '13:15', '2026-01-09T00:00:00.000Z', '10:59', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que se presenta ante esta dependencia especializada a fin den formular una denuncia de un SUPUESTO HECHO A DETERMINAR, relata que en fecha mencionada mas arriba se contacto con la señora ELIZABETH MARIA BURGOS DE CASSERA atraves de la aplicación BINANCE  donde la misma le menciona que quiere cambiar su guaraníes a criptomonedas, el recurrente en su carácter de prestador del servicio le facilita todas las condiciones y pasos a seguir en donde la mencionada acepta todas las condiciones facilitándole todos sus datos para de esa forma poder elaborar el contrato del servicio, el recurrente le manifiesta que el servicio requerido tendría un costo de 39.125.000 y que debía abonar en dos pagos ella aceptando lo requerido la misma realiza 2 trasferencia a la cuenta del recurrente con monto de 19.125.000 guaraníes a la cuenta N° 13046463002 a nombre del titular ELIAS DAVID MACIEL ALDERETE comprobante N°2335965 de fecha 09/01/2026 a las 11:35 horas, segunda transacción con monto de 20.000.000 guaraníes a la misma cuenta detallada mas arriba, una vez que el denunciante recibió la trasferencia procede a cargarle la criptomonedas a su billetera de BINANCE con N° de orden 22842942460650487808 apodo del comprador User_a8408 con monto de 5.262,55 USDT que equivale al monto que recibió el denunciante, unos días después el mismo procede a revisar su extracto de cuenta en donde se percata que su cuanta a sido bloqueada, donde procede a apersonarse al banco GNB en el cual los oficiales de la entidad bancaria le manifiesta que se había formulado una denuncia por estafa en su contra departe de la señora ELIZABETH MARIA BURGOS DE CASSERA y que por tal motivo procedieron a bloquear su cuenta, el denunciante hace constar que la denuncia que formulo la mencionada señora es totalmente falso ya que el cumplió el trato que había tenido con ella, es por eso que se apersona hasta esta dependencia especializada con todas las pruebas de las cargas que realizo tanto como el contrato de servicio que se adjunta con la copia de la denuncia. ', 'CIUDAD DE ASUNCIÓN, BARRIO SAN VICENTE, 18 DE JULIO C/ ING JULIO RAMON', NULL, NULL, 284, 225, 'Asunción', 'Suboficial Ayudante', 'CESAR', 'FERREIRA BARRETO', NULL, NULL, '05F4C8A26', NULL, 'completada', '2026-01-28T17:00:38.507Z', NULL, NULL),
(489, 414, '2026-01-28T00:00:00.000Z', '12:37', '2026-01-26T00:00:00.000Z', '13:10', 'Estafa', NULL, 'Que el compareciente se presenta ante esta Dependencia Especializada a fin de formular una denuncia, menciona el recurrente que en fecha 25/01/2026 se encontraba navegando por la red social FACEBOOK- MARKETPLACE en donde visualiza un producto (incubadora) de su interes ofertado por la suma de 1.000.000 Gs (Un millon de guaranies), por la cual decidio entablar una conversacion con el supuesto vendedor de nombre ANGEL VERA GAYOSO con URL de perfil  https://www.facebook.com/share/1DCjC4Z8Zd/?mibextid=wwXIfr a traves de la APP MESSENGER en donde el supuesto vendedor le facilita su numero de la APP WHATSAPP  (0975 314 487), mediante el cual esta persona le envio videos y detalles de las caracteristicas de la incubadora, el supuesto local se encontraba a varias horas de viaje le ofreció que si estaba interesado en acceder a la compra, la entrega del equipo se podria realizar mediante un envio por la transportadora TSI. El denunciante interesado en adquirir la incubadora continuó con las negociaciones acordando que la entrega se realize a través de la TRANSPORTADORA en mencion, el vendedor le solicito que abonara la totalidad del costo mediante transferencia bancaria a la cuenta Nº 150051129801 A nombre del titular NIDIA CAROLINA VERA GAYOZO con c.i. 5.555.574, cargo BANCO CONTINENTAL. El denunciante al recibir un ticket de entrega a la trasnportadora por medio de fotografia procedio al envio el costo del producto, mas la suma de 40.000 Gs. (Cuarenta mil guaranies), para cubrir el gasto de envio. Una vez que realizo la transferencia ya no recibio respuesta alguna por el supuesto vendedor, decicio contactar a la empresa TRANSPORTADORA, donde sus funcionarios le mencionaron que el comprobante contaba con adulteraciones y que no correspondIa a la empresa en cuestion, por lo que probablemente este hecho se trataria de una estafa. Por lo expuesto viene a poner a conocimiento de la autoridad competente para los fines que hubiere lugar conforme a derecho', 'DEPARTAMENTO CENTRAL, CIUDAD DE LUQUE, BARRIO CUARTO BARRIO, BENITO JUAREZ C/ BOQUERON', NULL, NULL, 283, 182, 'Asunción', 'Suboficial Ayudante', 'GERMAN EMANUEL', 'RUIZ DÍAZ', NULL, NULL, '97338BA26', NULL, 'completada', '2026-01-28T16:14:34.669Z', NULL, NULL),
(490, 415, '2026-01-28T00:00:00.000Z', '13:36', '2026-01-28T00:00:00.000Z', '12:11', 'Estafa', NULL, 'Que la compareciente se presenta ante esta Dependencia Especializada a fin de formular una denuncia sobre un supuesto hecho de estafa, menciona la recurrente que el dia de la fecha siendo las 12:11 hs recibe un mensaje a través de WHATSAPP del numero 0992 044 608 con foto de perfil de su hija DRA. MARIA LIS ALARCON BERNAL en compañia de su esposo MARCELO GONZALEZ, como dicha fotografia pertenecia al perfil de FACEBOOK, la denunciante creyo que se trataba de la misma, en el mensaje recibido le solicitaba una transferencia para que pueda realizar un pago de caracter urgente, excusandose de que la misma se encontraba en una reunion por la cual no podia efectuar ella misma el supuesto pago, facilitandole los siguientes numeros de cuentas, las cuales se detallan como sigue: 1- Nº 301019734 a nombre de PABLA VERA VERA con c.i. 5.985.144 a cago de BANCO SOLAR 
2- Nº 301019862 a nombre de PEDRO TROCHE MORAGA con c.i. 4.523.031 a cargo de BANCO SOLAR, posteriormente la denunciante realiza dicha transferencia a la primera cuenta mencionada mas arriba por el monto de 7.600.000 Gs. (SIETE MILLONES SEISCIENTOS MIL GUARANIES) desde su entidad con Nº 7431539 A nombre y con c.i. de la denunciante cargo BANCO SUDAMERIS. La misma ingresa a su banca web donde visualizo la revercion del monto depositado por lo que posterior a eso realiza una llamada telefonica al BANCO SUDAMERIS al abonado Nº de telefono 0972 923 849 en donde ANA PORTILLO funcionaria de dicho banco le confirma la reversion.', 'CIUDAD DE ASUNCIÓN, BARRIO REPUBLICANO, DR. CRISPIN INSAURRALDE', NULL, NULL, 285, 182, 'Asunción', 'Suboficial Ayudante', 'GERMAN EMANUEL', 'RUIZ DÍAZ', NULL, NULL, '7C0BE0A26', NULL, 'completada', '2026-01-28T16:45:49.631Z', NULL, NULL),
(492, 417, '2026-01-28T00:00:00.000Z', '14:59', '2026-01-28T00:00:00.000Z', '11:26', 'Acceso indebido a sistemas informáticos', NULL, 'que se presenta para formular su denuncia sobre un supueto hecho a determinar, menciona que el dia de la fecha en horas de la mañana recibe una llamada del abonado Nº 0984239333 quien le menciona que es funcionario de la empresa de telefonia tigo en cual le consulta si no tiene inconvenientes con su linea, donde el recurrente le menciona que no tiene ningun problema la persona quien le llamo le menciono  que tenia que marcar al *555*121212*121212# al cual el recurrente procedio a marcar al mismo, momento mas tarde quiso acceder a su aplicacion whatsApp y se percata que ah sido vulnerado interin en el que recibe varias llamadas de los contactos que tenia registrado en su telefono celular le mencionaron que estaban pidiendo dinero haciendose pasar por el y que tambien estaban facilitando una cuenta bancaria en el cual puedan recibir las transferencias alias Nº 0974886407 entidad BANCO FAMILIAR a nombre del titular ALEJANDRO ARIEL PAEZ, interin el que el recurrente se apersona hasta la empresa de telefonia tigo donde le mencionan que no le van a poder ayudar ya que la aplicacion vulnerada es independiente a la misma por esa razon viene a formular su denuncia en esta dependencia especializada para los fines correspondientes. ', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, BARRIO LERIDA, GALATI', NULL, NULL, 286, 225, 'Asunción', 'Suboficial Ayudante', 'CESAR', 'FERREIRA BARRETO', NULL, NULL, '6C7A23A26', NULL, 'completada', '2026-01-28T18:29:22.059Z', NULL, NULL),
(493, 418, '2026-01-28T00:00:00.000Z', '17:43', '2026-01-28T00:00:00.000Z', '13:50', 'Hurto', NULL, 'Que se presenta ante esta dependencia especializada a fin de formular su denuncia sobre un SUPUESTO HECHO DE HURTO DE APARATO CELULAR, relata que el día de la fecha se encontraba sobre la AV ESPAÑA C/ SAN MARTIN en la parada de bus cuando le intercepto 2 personas de sexo masculino abordo de una motocicleta cubiertos totalmente que los mismos lo despojaron de su aparato celular, mas tarde procede a llamar a las entidades bancarias ITAU y UENO BANK para cancelar su tarjeta de crédito y debito tanto los digitales como los físicos que tenían instaladas en su aparato celular en eso mismo procede también a llamar al atención al cliente de la empresa TIGO y PERSONAL para también proceder a bloquear sus números de teléfono, ínterin en el que la madre de la recurrente hace una llamada al numero de su hija en el cual era atendida por una persona con vos masculina y le manifiesta que el mismo tiene en su poder el celular de la victima y que le va a devolver, momento mas tarde la persona que le hizo la llamada nunca mas volvió a dar retorno, la afectada después de todo lo ocurrido ingreso a la pagina de Samsung y empezó a rastrear su dispositivo celular la cual le marcaba la ubicación de MALUTIN C/ DEL MAESTRO de la cuidad de ASUNCION, por lo que viene a formular su denuncia en esta dependencia especializada para los fines que hubiere lugar.', 'CIUDAD DE ASUNCIÓN, BARRIO LOMA PYTA, AV ESPAÑA', NULL, NULL, 287, 225, 'Asunción', 'Suboficial Ayudante', 'CESAR', 'FERREIRA BARRETO', NULL, NULL, '2B6188A26', NULL, 'completada', '2026-01-28T21:15:10.887Z', NULL, NULL),
(494, 419, '2026-01-28T00:00:00.000Z', '17:59', '2026-01-26T00:00:00.000Z', '19:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que se presenta ante esta Dependencia Especializada a fin de realizar una denuncia sobre un supuesto hecho a determinar ocurrido en la fecha mencionada mas arriba, manifiesta la recurrente que recibio un mensaje de texto por via WHATSAAP abonado al numero +1 (581) 267-6781 de una supuesta amiga de nombre ZUNILDA ADORNO que reside en ESPAÑA, quien le solicitó  el favor de que la recurrente retirara una encomienda para dar una sorpresa a su familia de Paraguay ya que la misma supuestamente llegaria a este pais en fecha 5 de febrero del corriente año y que la encomiensa que necesitaba que se retire habia llegado a destino antes de la fecha que se habia establecido inicialmente, mencionandole que se trataba de dos cajas medianas, la denunciante creyendo que se trataba de la amiga accedio en ayudarle con el favor solicitado procediendo asi a enviarle la fotografia de cedula de identidad de su hijo LUIS ANTONIO DIAZ quien iba a se r el encargado de retirar la encomienda en cuestion, por lo que minutos después recibe un  supuesto comprobante de la empresa DHL donde se detallaba la direccion de entrega y el nombre del beneficiario. En fecha 27 de enero en hotas de la mañana la supuesta amiga le solicita el numero de contacto de su hijo con el fin de coordinar el retiro de las encomiendas, por lo que la recurrente le proporciono lo solicitado, posterior el hijo de la misma le menciona que recibio una llamada relacionada al paquete que debia recibir por parte de un supuesto funcionario de la Direccion Nacional de Ingresos Tributarios- DENIT, informandole de que los paquetes sobrepasaba el pesaje permitido, por lo que para poder retirar debian abonar una multa de 37.000.000 de gs (treinta y siete millones de guaranies), como el monto era muy elevado la recurrente decidio consultar a la amiga que podrian hacer esta le dice que si no contaba con alguna persona que pudiera  prestarle esa suma de dinero y que la misma iba a reponer con el doble del valor, ya que supuestamente lo que contenia las cajas eran altas sumas de dinero por valor aproximado de 250.000 dolares, como la denuncia no s sintio convencida con la historia de la supuesta amiga decidio contactar con un perfil de FACEBOOK ,que segun los datos observados pertenecian a la amiga mencionandole que hbia recibido un mensaje via WHATSAPP  y que queria confirmar si se trataba de la mismarecibirndo como respuesta de que el numero en cuebtion no pertenecia a la misma y que ella no habia solicitado ninguna ayuda, por lo que creen que se estaba tratando de cometer un supuesto hecho de estafa. Por lo expuesto viene a poner a conocimiento de la autoridad competente para los fines que hubiere lugar.', 'DEPARTAMENTO CENTRAL, CIUDAD DE CAPIATÁ, BARRIO CERRITO, GABRIALLI 113', NULL, NULL, 289, 167, 'Asunción', 'Suboficial Ayudante', 'FATIMA', 'BERNAL FARIÑA', NULL, NULL, '1865B4A26', NULL, 'completada', '2026-01-28T21:35:07.731Z', NULL, NULL),
(496, 421, '2026-01-28T00:00:00.000Z', '19:48', '2026-01-27T00:00:00.000Z', '12:05', 'Estafa', NULL, 'Que se presenta ante esta dependencia especializada a fin de formular su denuncia de un supuesto hecho de ESTAFA, menciona que en fecha mencionada mas arriba recibe un mensaje del abonado N°+62 878-9697-0613    que se identifica como una supuesta amiga intima de la recurrente que reside en EE.UU  y que tenia planeado viajar a Paraguay con llegada al pais de fecha05/02/2026 y que también iba a enviar un paquete de encomiendas con regalos para la familia mientras ella se organiza su viaje y le pide el favor de recibir su paquete a la cual la recurrente acepta sin problema, al otro día  recibe un mensaje de otro abonado N°0991938891 quien se identifica como EDISON ESTUPIÑAN ORDUÑA supuesto funcionario de la empresa DHL empresa de encomiendas internacionales oficina ubicada en el aeropuerto internacional Silvio Petirossi donde el mismo le pide confirmación de datos teniendo en cuenta que existe una factura electrónica a nombre de la afectada, a la vez le  explica los inconvenientes que tiene la carga que ella iba a recibir y que tenia un multa de 37.475.460 guaraníes generada por la DNIT y que si no pagaba esa multa seria investigada por evasión de impuestos, ínterin en el que su supuesta amiga le dice que ella no cuenta con el monto requerido para pagar la multa por su encomienda y le pide otro favor a la afectada que pague la multa y que ella le devolvería apenas pueda en donde realizo una transacción a la cuenta N°61990467 con monto de 10.000.000 guaraníes a la entidad UENO BANK a nombre de la titular DANA MARISOL PEDERSEN BARROS con C.I N°4981189 de fecha 27/01/2026, ínterin el que el supuesto funcionario de la empresa de encomienda le dice que no pudo retirar el paquete y que debía abonar el 100% de la multa en donde nuevamente procedió a realizar otra transacción a la cuenta N°61990467 con monto de 27.475.460 guaraníes a la entidad UENO BANK a nombre de la titular DANA MARISOL PEDERSEN BARROS con C.I N°4981189 de fecha 27/01/2026, después realizado todo este proceso la afectada intento comunicarse con ello y el mismo jamás le volvió a dar retorno por lo que se percata que estaría siendo victima de una estafa, el día de hoy se apersono hasta la sucursal de UENO BANK ubicado en la cuidad de Luque en donde la oficial de cuenta le manifiesta que debía realizar su denuncia en esta dependencia para así poder ellos proseguir con la diligencias y para también poder recuperar el monto de dinero perdido. Se adjunta copias de las transacciones realizadas y datos de la persona quien recibió el deposito. ', 'DEPARTAMENTO CENTRAL, CIUDAD DE LUQUE, BARRIO CUARTO BARRIO, TTE RIVAS', NULL, NULL, 290, 225, 'Asunción', 'Suboficial Ayudante', 'CESAR', 'FERREIRA BARRETO', NULL, NULL, '427CDCA26', NULL, 'completada', '2026-01-28T22:52:52.833Z', NULL, NULL),
(497, 422, '2026-01-28T00:00:00.000Z', '19:44', '2026-01-28T00:00:00.000Z', '19:00', 'Estafa', NULL, 'Se presentan en esta Dependencia Policial para formular una denuncia sobre un supesto de estafa, ocurrido en fecha y hora mencionada mas arriba, y manifiesta el señor  LUCAS ZARATE, que en horas de la tarde ingreso enla plataforma de Facebook y encontro una publicacion en Marketplace, donde se estaba ofertando un celular de la marca IPHONE moledo 17 pro MAX, de color naranja, momento que se pone encontacto con el usuario por medio de messenger, donde el supuesto vendedor le facilito en mumero Nº 0982754583, iniciando asi la conversacion por medio de la mensajeria de WhatsApp, momento que el supuesto vendedor le envio fotografias del aparato celular y mencionandole en precio que seria de 7.000.000gs (siete millones de guaranies)sigue manifestando el señor Lucas Zarate que llego un acuerdo con el vendedor, quien le solicito su ubicacion de su domicilio para enviarle el celular y que una vez revisado y si esta conforme le realize el pago por medio de transferencia Bancaria facilitando la cuenta  Nº 619735998 a cargo del Banco UENO BANK, titular de la cuenta MARIA MAGDALENA ORTIZ PALACIOS, con C.I.Nº 1.098.909. el señor Ulises Esteche menciona que una persona de sexo masculino se contacto con el por medio de la mensajeria de WhatsApp del abonado  Nº 0982754583, mencinandole que estaba interesado en un aparato celular que el recurrente estaba ofreciendo, consultandole el precio y que si le podia llevar en la ciudad de ASUNCION facilitandole una ubicacion georeferencial, sigue manifestando que el supuesto vendedor le menciono que el lugar le recibiria un primo suyo de nombre LUCAS, y que una vez verificado el celular le realizaria la transferencia, refiere el señor Ulises que se dirigio al lugar proporcionado por el supuesto comprador, y que en el lugar fue recibido por el señor LUCAS ZARATE, a quien entrego el celular para su revision. Posterior el señor lucas una vez revisado y verifiacodo el celular realiza las siguientes transferencias a la 1) cuenta Nº 619735998 a cargo del Banco UENO BANK, titular de la cuenta MARIA MAGDALENA ORTIZ PALACIOS, con C.I.Nº 1.098.909 la suma de 3.500.000gs (tres millones quinientos mil guaraniers)con numero de comprobante Nº 8837777, 2) Nº 27459258 a cargo de Tu Financiera S.A, titular de la cuenta MARIA MAGDALENA ORTIZ PALACIOS, con C.I.Nº 1.098.909,  la suma de 3.500.000gs (tres millones quinientos mil guaraniers)con numero de comprobante Nº 2601287720464. momento que le menciona al señor Ulises que ya rrealizo el las tranferencias al señor Rodrigo. Por tal hecho el señor ULISES le reclama el apago `por el celular al supuesto comprador ingresando en su WhatsApp, momento en que se percata que el señor RODRIGO ya habia borrado todos los mensajes, realizandole llamada telefonica el cual no fue contestada, momento que que se percatan que fueron victimas de una presunta estafa.-', 'CIUDAD DE ASUNCIÓN, BARRIO SAN VICENTE, TTE. OTAZU Nº 1585', NULL, NULL, 291, 163, 'Asunción', 'Suboficial Inspector', 'JULIO CESAR', 'ROMERO ROMERO', NULL, NULL, 'BFF1BDA26', NULL, 'completada', '2026-01-29T00:26:07.343Z', NULL, NULL),
(500, 426, '2026-01-29T00:00:00.000Z', '10:21', '2026-01-28T00:00:00.000Z', '18:00', 'Extorsión', NULL, 'Manifiesta el denunciante que en fecha 28/01/2026, siendo aproximadamente las 14:30 horas, inició contacto a través de la aplicación Messenger con una persona que se identificaba como su amiga en la red social Facebook, denominada Noemí Ramírez, con URL: https://www.facebook.com/porfile.php?id=61587065347360. Posteriormente, la conversación fue derivada a la aplicación de mensajería instantánea WhatsApp, utilizando el número abonado 0987 337 127, ocasión en la que la supuesta amiga le solicitó fotografías íntimas, a lo cual el recurrente accedió, recibiendo igualmente imágenes de similar tenor por parte de dicha persona. Refiere el denunciante que recibió un mensaje proveniente del abonado N.º 0994 527 856, cuyo perfil exhibía la imagen de un camarada suyo, en el cual se le informaba sobre la existencia de una publicación que contenía sus fotografías, en la que se lo señalaba falsamente como “pedófilo acosador de menores”. Seguidamente, el denunciante manifiesta que comenzó a recibir amenazas, consistentes en la divulgación de dichas imágenes si no realizaba envíos de dinero a los números que le serían facilitados. Ante esta situación, el afectado realizó un giro de dinero por el monto de Gs. 530.000 (quinientos treinta mil guaraníes) al abonado 0992 184 338, conforme boleta N.º 162811043890051, en fecha 28/01/2026, siendo las 17:48 horas. Luego de efectuado dicho giro, la misma persona insistió nuevamente en que realice otro envío de dinero para no publicar las imágenes, accediendo el denunciante a realizar un segundo giro al abonado 0985 125 799, por el monto de Gs. 500.000 (quinientos mil guaraníes), conforme transacción N.º 24881648, en fecha 29/01/2026, siendo las 08:01 horas. Finalmente, el recurrente manifiesta que, transcurridos varios minutos, dicha persona volvió a contactarlo exigiendo un nuevo envío de dinero, bajo amenaza de publicar las fotografías íntimas, a lo cual ya no accedió. Por todo lo expuesto, el denunciante pone los hechos en conocimiento de la autoridad policial, a los efectos legales que hubiere lugar.', 'CIUDAD DE ASUNCIÓN, BARRIO LAS MERCEDES, SOBRE LAS CALLES ESPAÑA ENTRE PADRE CARDOZO', NULL, NULL, 294, 224, 'Asunción', 'Suboficial Ayudante', 'MELANY MONSERRAT', 'MALDONADO CASTRO', NULL, NULL, '3D8663A26', NULL, 'completada', '2026-01-29T14:47:29.449Z', NULL, NULL),
(505, 432, '2026-01-29T00:00:00.000Z', '19:01', '2026-01-29T00:00:00.000Z', '15:32', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que, el dia de la fecha recibio un mensaje desde el abonado Nº +62 858-2246-4931 haciendose pasar por una amiga suya que se encuantra en los Estados Unidos de nombre Maigualida cuya fotografia de perfil corresponde a su amiga y le menciona que la misma tenia previsto llegar al pais en fecha 05 de febrero del año en curso de sorpresa a la familia, pero que habia enviado unos paquetes antes "unos reales, unas cositas pensando comercializar en el pais" ya que pensaba en poner un negocio despues, por lo cual el dia de la fecha ha recibido mensajes via correo electronico desde una trasportadora mencionandole que dichas encomiendas ya habian llegado al aeropuerto internacional Silvio Petirorri, solicitandole el despacho de los mismos o caso contrario se reportaria como abandonado, por ende le escribe a la denunciante y le solicta en favor si la misma podria recibirle esos paquetes porque no queria que su familia se enterase de su venida, solicitandole datos personales como ser direccion exacta, correo electronico, numero de contacto, nombre completo de la misma y las fotografias de su cedula de idnetidad, por lo que confiada la recurrente creyendo que era su amiga le facilita los datos solicitados, indicando que envio la direccion de su oficina no asi de su domicilio particular, sigue mencionadno que minutos mas tarde le parecia raro que esta persona no le enviara ningun mensaje de voz por lo que le solicta a que le envie un mensaje de voz y su supuesta amiga le indica que no puede enviar porque esta conectada al whatsapp desde una computadora lo cual le parecio raro ya que estapersona realizo primeramente una llamada pero que no se llego a escuchar nada, agrega ademas que se puso en contacto con otra conocida en comun que tienen con Maigualida en donde esta le facilita el numero de su amiga Maigualida poniendose en cotacto con la misma la denunciante, y le indica que ella en ningun momento le solicito ningun favor, por lo que se percata que son personas mal intensionadas lo que pidieron sus datos personales, y que teme a que se utilice sus datos sin su consentimiento. 
Sigue manifestando que hace tres años aproximadamnete al momento de ralizar las llamadas via whatsapp le eran silenciadas, y que actaulmente se le silencian las llamadas por whatsapp y a las llamadas de sus contactos de los cuales al recibir las llamdas ella no puede escuchar nada, lo cual le es raro, por lo que indica que la misma tienen las pruebas de todo y que posteriormente va a presentar ante el Ministerio Publico, agregando que solicita al Ministerio Publico que siga su curso penal para que se pueda identificar al titular de la linea telefonica como asi tambien de las personas que acceden a silenciar sus llamdas, motivo por lo cual viene a realizar su denuncia para su respaldo ante cualquer hecho que se pueda cometer con sus datos sin su consentimiento (su cedula de identidad). 
', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, BARRIO SAN JUAN - CALLE''I, ESTANDO EN SU DOMICILIO PARTICULAR', NULL, NULL, 298, 165, 'Asunción', 'Suboficial Segundo', 'CAROLINA NOEMI', 'SARABIA GONZALEZ', NULL, NULL, 'D84DBBA26', NULL, 'completada', '2026-01-29T22:36:58.959Z', NULL, NULL),
(508, 436, '2026-01-29T00:00:00.000Z', '21:57', '2026-01-29T00:00:00.000Z', '15:30', 'Estafa', NULL, 'La misma manifiesta que habia solicitado una cuenta nueva en dolares al banco Itau en fecha 27//01/2026, a lo que su oficial de cuenta le indica que tardaria 72 hs en habilitar una cuenta, por lo que sugirio que se agilice esa cuenta por que tenia que recibir un pago por un trabajo, posterior pasado las 24 hs, se comunican nuevamente con la denunciante para anunciarle que su cuenta ya estaba habilitada y que al otro dia estaria funcionando (29/01/2026), sigue manifestando que recibe otra llamada del numero 0993020130 de un supuesto funcionario del banco Itau presentandose como Gorostiaga, diciendole que el prestamo que habia solicitado ya habia sido aprobado, a lo que la denunciante le responde que en ningun momento solicito ningun prestamo, posterior a eso la denunciante recibe un mensaje de parte de su oficial de su cuenta de itau, el cual le menciona sobre la solicitud de prestamo pre aprobada a nombre de la recurrente, en donde la misma vuelve a manifiestar no haber solicitado y que ya habia recibido una llamada de parte de un compañero suyo por lo que tuvo como respuesta que ignorara el correo que le habian enviado por EMAIL, posterior a eso, vuelve a recibir una llamado del otro supuesto funcionario, reiterandole que el prestamo ya estaba hecho, ahi la denunciante le vuelve a decir que no solicito ningun prestamo y aprovecho pensando que era un funcionario legitimo del banco itau, para  consultar sobre la cancelación de su tarjeta de credito la cual tenia una deuda de 300.000 gs aproximadamente y le menifiesta que queria desactivar dicha tarjeta, a lo que el supuesto acesor le indica que tenia que recurrir hasta un cajero automático para dicha desactivacion y que le iba a indicar los pasos a seguir, posterior a las 15:20hs apoximadamente la recurrente se acerca hasta el cajero automatico del banco itau ubicada sobre la avenida ESPAÑA Y KUBITSCHEK de la ciudad de Asuncion para realizar dicho proceso, una vez en lugar el estando en llamada telefonica con el supuesto funcionrio del banco mencionandole los pasos a seguir lo cual la recurrente efectuo sin percatarse de que en el momento accedieron a su cuenta del banco, posterior a eso el supuesto funcionario le indica a que desinstale su aplicacion de cuenta del banco ITAU por 1 hora aproximadamnete, posterior a eso se percata de que accedieron a sus cuentas del banco Itaú (dolares y guaranies)y procedieron a realizar varias trnsacciones sin el consentimiento de la afectada detallando como sigue; 
- Gs.54.164.125 a la orden de: TAMOÑARO S.A cuenta nro 190****0519 cargo banco nacional de Fomento con operacion nro:2601292588264 desde la cuenta nro:721***671.
- Pago de servicio a personal pay por el momnto de 1.500.000 con comprobante nro 3601084  desde la cuenta nro:721***671. 
- Pago de servicio a personal pay por el momnto de 583.000 con comprobante nro 3605132  desde la cuenta nro:721***671.
-  Pago de servicio a personal pay por el momnto de 79.500 gs comprobante nro 3620782desde la cuenta nro:721***671.
- cuenta debito 710***844 por el valor de 52.760.000 gs. a favor de la cuenta Nº 721***671 a la orden de KARINA GALINDO CASTANHEIRA cargo banoc Itau con operacion Nº 1381322.
-   cuenta debito 710***844 por el valor de 2.163.160 gs. a favor de la cuenta Nº 721***671 a la orden de KARINA GALINDO CASTANHEIRA cargo banoc Itau con operacion Nº 1382244.
- cuenta debito 710***844 por el valor de 32.975.000 a la cuenta Nº 793***837 a la orden de REIS S.A. cargo Zeta Banco SAECA, con comprobante Nº 2601292588150. 
- Tarjeta Amex Platinum, personal recarga de saldo por el valor de 100.000 g. con comprobante Nº 5113632124.
- Tarjeta Amex Platinum, Tigo Paquetigo por el valor de 9.000 g. con comprobante Nº 5113625860.
Los cuales manifiesta desconocer de los movimientos mencionado, cuyos detalles fue proporcionado por un funcionario del banco posterior a su llamada al banco y solicitud de  bloqueo una vez que se ha percatado de que la misma perdio acceso a sus cuentas.  Agrega por ultimo, que desde al aboando numero 0993020130 le seguia escribiendo via whatsapp y que si tenia alguna duda se comunique con la linea baja del banco (021)6171000, alegando ademas que el sistema no funcionaba en el momento, indicando la denucniante que se percato de que procedieron al cambio de su correo electronico pero cuyos detalles no posee, ya que la misma no recibio mas notificacion sobre los movimientos.  
', 'CIUDAD DE ASUNCIÓN, BARRIO GENERAL BERNARDINO CABALLERO, AVND ESPAÑA Y KUBITSCHEK', NULL, NULL, 302, 165, 'Asunción', 'Suboficial Segundo', 'CAROLINA NOEMI', 'SARABIA GONZALEZ', NULL, NULL, '72253BA26', NULL, 'completada', '2026-01-30T02:28:30.027Z', NULL, NULL),
(509, 437, '2026-01-30T00:00:00.000Z', '00:20', '2026-01-29T00:00:00.000Z', '01:45', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que, la misma se presenta en compañía de su hermano JUAN CRUZ CELLAMAMARE con C.I. N° 7.025.885, y manifiesta que posee un aparato celular de la Marca Samsung A56, y que actualmente esta utilizando el abonado N° 0985-980-079, con correo electrónico gabrielajorge@gmail.com y anacella190092@gmail.com, manifiesta la misma que desde hace aproximadamente seis meses atrás que la misma no puede cerrar cesiones de cuantas de Business y que cree que otras personas accedieron a sus datos del dispositivos, agrega además que constantemente le llegaban las notificaciones vía correo electrónico sobre los cambios de contraseñas de sus cuentas de redes sociales sin que la misma haya realizado un cambio de seguridad, por lo que en varias ocasiones había cerrado sesión y que después le indicaban que las contraseñas eran incorrectas al momento de intentar ingresar a la cuenta, agregando que hace aproximadamente un mes atrás le había llegado un mensaje de texto sobre el cambiado del token de la aplicación del banco Familiar que la misma tenia en su dispositivo, por lo que se había acercado hasta la entidad bancaria en donde le indicaron de que el numero desde el cual recibió el mensaje no le corresponde a la entidad bancaria. Sigue manifestando que desde hace unos días atrás al realizar un posteo en el estado de WhatsApp automáticamente le vuelve a aparecer fotografías similares en los estados de sus contactos y que actualmente comenzó a recibir varias llamadas de números extranjeros en horas de la madrugada, por último, fue el día de hoy en la madrugada siendo las 01:45 horas había recibido una llamada desde el +43142409376201,  como así tambien, que la alarma empieza a sonar a las 03:00 horas de la madrugada sin que la misma haya programado, lo cual le pareció raro. Indica que al verificar datos de su identidad en los anuncios de Google le figura que su ubicación es de Estados Unidos.
Sigue mencionando que, en varias ocasiones ya procedió al borrar todas las aplicaciones de su aparato celular además de reinstalar el sistema operativo de su dispositivo celular y que posteriormente de igual forma se procedió a la descarga automática de varias aplicaciones que la misma no ha autorizado, indica además que al momento de utilizar el teléfono empieza a abrirse varias pestañas a la vez mencionado que la misma no ha autorizado, por lo que le parece todo muy extraño y teme a que personas extrañas accedan a sus datos o utilicen sin su consentimiento. 
Por último, manifiesta que, siendo las 21:00 horas procede a apagar su aparato celular y que la misma no va a volver a utilizar el abonado N° 0985-980-079 eliminando así tambien su cuenta de WhatsApp vinculada al número mencionado, y que no se hará cargo si ocurre algún hecho relacionado con el número y con los correos mencionados de ahora en más.   
', 'DEPARTAMENTO CENTRAL, CIUDAD DE LAMBARÉ, AVDA. CACIQUE LAMBARÉ 2129, FRENTE A LA COOPERATIVA LAMBARÉ ', NULL, NULL, 303, 165, 'Asunción', 'Suboficial Segundo', 'CAROLINA NOEMI', 'SARABIA GONZALEZ', NULL, NULL, '2596F9A26', NULL, 'completada', '2026-01-30T03:24:20.735Z', NULL, NULL),
(501, 427, '2026-01-29T00:00:00.000Z', '11:51', '2024-06-11T00:00:00.000Z', '17:30', 'Estafa', NULL, ' Que, los comparecientes se presentan a fin de formular denuncia por un supuesto hecho de Estafa, manifestando que son socios de la empresa ALEXANDRIA EAS, con RUC N°: 80145136-1, con domicilio en la ciudad de Villa Elisa, sobre la calle Chile casi Ecuador, Barrio Gloria María.
Refieren que habrían celebrado varios contratos de acuerdo de partes sobre inversión de dinero con el ciudadano Nestor Damian Martinez Villalba, soltero, paraguayo, con C.I. N°: 3.637.603, domiciliado en la vivienda ubicada sobre la calle San Salvador entre Chile y Venezuela del Barrio Espíritu Santo de la ciudad de San Lorenzo, el cual incumplió con dichos contratos desde finales del mes de agosto del año 2024, los cuales consistían en los siguientes términos:
1) En la ciudad de Ñemby, en fecha 11/06/2024, el señor Aleksandr Poslavski  acuerda con el señor Nestor Damian Martinez Villalba otorgar capital en efectivo de guaraníes veintinueve millones ochocientos ochenta mil (29.880.000), a ser invertido en un plazo de tres meses (03), destinado a la compra del producto supra 95, correspondiendo una rentabilidad mensual de guaraníes nueve millones novecientos setenta mil (9.960.000) por cada carga vendida, comprometiéndose el mismo a abonar dichos montos, siempre que se concrete la venta.
2) En la ciudad de Ñemby, en fecha 11/06/2024, el señor Aleksandr Poslavski  acuerda con el señor Nestor Damian Martinez Villalba otorgar capital en efectivo de guslavskaraníes setenta y cinco millones (75.000.000), a ser invertido en un plazo de tres meses (03), destinado a una carga de diez mil litros (10.000 Lts.) del producto diésel común, correspondiendo una rentabilidad mensual de guaraníes ocho millones (8.000.000) por cada carga vendida, comprometiéndose el mismo a abonar dichos montos, siempre que se concrete la venta.
3) En la ciudad de Ñemby, en fecha 11/06/2024, el señor Aleksandr Poslavski acuerda con el señor Nestor Damian Martinez Villalba otorgar capital en efectivo de guaraníes ciento doce millones quinientos mil (112.500.000), a ser invertido en un plazo de tres meses (03), destinado a una carga de quince mil litros (15.000 Lts.) del producto diésel común, correspondiendo una rentabilidad mensual de guaraníes doce millones (12.000.000) por cada carga vendida, comprometiéndose el mismo a abonar dichos montos, siempre que se concrete la venta.
4) En la ciudad de Ñemby, en fecha 06/07/2024, los señores Aleksandr Vovkogon y Artem Koslov acuerdan con el señor Nestor Damian Martinez Villalba otorgar capital en efectivo de guaraníes ciento cinco millones (105.000.000), a ser invertido en un plazo de dos meses (02), destinado a una carga de quince mil litros (15.000 Lts.) del producto diésel común. En dicho acuerdo, Artem Koslov invierte guaraníes treinta y cinco millones (35.000.000), correspondiendo una rentabilidad mensual de guaraníes cuatro millones (4.000.000) por cada carga vendida, y Aleksandr Vovkogon Vovkogon invierte guaraníes setenta millones (70.000.000), correspondiendo una rentabilidad mensual de guaraníes ocho millones (8.000.000) por cada carga vendida, comprometiéndose el denunciado a abonar dichos montos, siempre que se concrete la venta.
5) En la ciudad de Ñemby, en fecha 22/07/2024, la empresa Alexandria EAS acuerda con la empresa Grupo Silverfox otorgar capital en efectivo de guaraníes ciento doce millones quinientos mil (112.500.000), a ser invertido en un plazo de tres meses (03), destinado a una carga de quince mil litros (15.000 Lts.) del producto diésel común, correspondiendo una rentabilidad semanal de guaraníes tres millones (3.000.000) por cada carga vendida, comprometiéndose la misma a abonar dichos montos, siempre que se concrete la venta.
6) En la ciudad de Ñemby, en fecha 22/07/2024, la empresa Alexandria EAS acuerda nuevamente con la empresa Grupo Silverfox otorgar capital en efectivo de guaraníes ciento doce millones quinientos mil (112.500.000), a ser invertido en un plazo de tres meses (03), destinado a una carga de quince mil litros (15.000 Lts.) del producto diésel común, correspondiendo una rentabilidad semanal de guaraníes tres millones (3.000.000) por cada carga vendida, comprometiéndose la misma a abonar dichos montos, siempre que se concrete la venta.
7) En la ciudad de Ñemby, en fecha 12/08/2024, el señor Aleksandr Poslavski acuerda con el señor Nestor Damian Martinez Villalba otorgar capital en efectivo de guaraníes ciento doce millones quinientos mil (112.500.000), a ser invertido en un plazo de tres meses (03), destinado a una carga de quince mil litros (15.000 Lts.) del producto diésel común, correspondiendo una rentabilidad semanal de guaraníes doce millones (12.000.000) por cada carga vendida, comprometiéndose el mismo a abonar dichos montos, siempre que se concrete la venta.
Asimismo, las partes acuerdan que se considera un plazo de tolerancia de quince (15) días de atraso, por los siguientes motivos:
1) Inclemencia del tiempo, debido a que no se podría realizar la descarga a clientes que poseen tanques subterráneos al aire libre, pudiendo contaminarse el producto con agua de lluvia.
2) Inconvenientes logísticos por parte del área de fletes (fallas del camión, problemas mecánicos, entre otros).
3) Atrasos en los pagos por parte de los clientes, tales como no percibir subsidios del Estado en fecha o no contar con fondos propios suficientes al momento de la descarga.
Así también la empresa Grupo Silverfox se compromete y obliga a hacer el pago en el tiempo establecido si así no cumpliera incurrirá en mora y en caso de no pagar, la empresa Alexandria EAS podrá accionar judicialmente, debiendo a la empresa Grupo Silverfox devolver el monto inicial de la inversión estipulada mas sus intereses 2.5% mensual (tasa judicial) y todos los gastos judiciales que ocasionare el juicio y compensar la inflación monetaria durante el transcurso del juicio (basándose en el promedio de la inflación calculada por el Banco Central del Paraguay)  
Finalmente, los recurrentes manifiestan que los contratos fueron realizados ante la escribana Gisela María Gladys Pfingst Rojas, Registro N°: 1156, y que actualmente no poseen los contratos originales, en razón de haberlos entregado al abogado Juan José Patricio Bernis Allegretti, C.I. N°: 1.575.497, Matrícula Profesional N°: 18.500.', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, BARRIO ESPIRITU SANTO, SAN SALVADOR Y CHILE, BARCOS Y RODADOS', NULL, NULL, 295, 189, 'Asunción', 'Oficial Ayudante', 'MATIAS RAMÓN', 'ORTIGOZA GÓMEZ', NULL, NULL, '360DB8A26', NULL, 'completada', '2026-01-29T15:22:39.933Z', NULL, NULL),
(502, 429, '2026-01-29T00:00:00.000Z', '13:55', '2026-01-28T00:00:00.000Z', '18:29', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Manifiesta el recurrente que, en la fecha mencionada precedentemente, se encontraba en su domicilio particular y que, al intentar realizar una transferencia bancaria al Sr. HUGO DANIEL BÁEZ ARANDA en concepto de pago por la adquisición de algunos productos, efectuó una transferencia por el monto de Gs. 742.650 (setecientos cuarenta y dos mil seiscientos cincuenta guaraníes). Que, al momento de ingresar los datos de la cuenta bancaria, debía consignar la cuenta N.º 619182499; sin embargo, por un error involuntario, ingresó la cuenta N.º 6191822499, la cual pertenece al Sr. NELSON OSVALDO CABRERA PORTILLO, conforme consta en el comprobante de transferencia N.º 8826067. Ambas cuentas corresponden a la entidad bancaria UENO BANK.
Sigue manifestando el recurrente que se apersonó posteriormente a una sucursal del banco mencionado, ubicada en la ciudad de Asunción, a fin de realizar el reclamo correspondiente y solicitar la devolución del monto transferido. No obstante, los funcionarios de la entidad bancaria le informaron que debía realizar la denuncia correspondiente ante las autoridades competentes, en razón de que la persona que recibió el monto transferido no brindaba respuesta alguna. Cabe mencionar que la transferencia fue realizada desde la cuenta del recurrente cargo UENO BANK; el recurrente solicita la devolucion del capital transferido. Por lo que viene a poner a conocimiento a las autoridades a los fines que hubiere lugar. ', 'CIUDAD DE ASUNCIÓN, BARRIO OBRERO INTENDENTE B. GUGGIARI', NULL, NULL, 296, 224, 'Asunción', 'Suboficial Ayudante', 'MELANY MONSERRAT', 'MALDONADO CASTRO', NULL, NULL, 'EE1167A26', NULL, 'completada', '2026-01-29T17:24:03.219Z', NULL, NULL),
(503, 430, '2026-01-29T00:00:00.000Z', '16:58', '2026-01-29T00:00:00.000Z', '14:00', 'Estafa', NULL, 'Manifiesta la recurrente que, en fecha 25/01/2026, siendo aproximadamente las 09:45 horas, recibe un mensaje vía mensajería instantánea de quien sería su amiga CELIA MENDEZ, quien se encontraría en la ciudad de Madrid, proveniente del abonado N° +63 912 559 9641. La recurrente refiere que, al observar que dicho número contaba con la fotografía de perfil de su amiga, presume que la misma habría cambiado de número telefónico, motivo por el cual responde al mensaje.
Prosiguiendo con la conversación, en fecha 27/01/2026, la supuesta amiga le solicita que reciba unas mercaderías que se encontrarían en el Aeropuerto Internacional Silvio Pettirossi de la ciudad de Luque, requiriéndole para ello sus datos personales y la ubicación de su domicilio. Ante dicha solicitud, la recurrente le manifiesta que en ese momento se encontraba fuera del país, pero que a su regreso podría recibir la encomienda.
Continúa manifestando la recurrente que, en fecha 28/01/2026, comunica a su amiga que ya se encontraba retornando a su domicilio particular, y que, minutos después, recibe un mensaje de un supuesto funcionario de la empresa de envíos DHL, desde el abonado N° 0991 938 891, registrado a nombre de EDISON ESTUPIÑAN ORDUÑA, quien le manifiesta que, por la hora, ya no sería posible realizar la entrega, quedando la misma programada para fecha 29/01/2026.

Relata además que, en fecha 29/01/2026, comienza a recibir nuevos mensajes del mencionado funcionario, quien le indica que debía abonar una multa, caso contrario las mercaderías serían devueltas, solicitándole un pago por la suma de 37.000.000 Gs. (treinta y siete millones de guaraníes). Ante dicha exigencia, la recurrente le responde que no contaba con ese monto de dinero, comunicando a su vez la situación a su supuesta amiga, quien le manifiesta que intentara conseguir el dinero, asegurándole que posteriormente se lo devolvería, ya que no deseaba perder la mercadería.
Ante esta situación, la recurrente accede a la solicitud y consigue dinero de otra persona, procediendo a realizar una transferencia bancaria por el monto total de 9.000.000 Gs. (nueve millones de guaraníes), a la cuenta a nombre de HERMENEGILDA BENITEZ DE PIJUSH, con C.I. N° 5.554.577, del Banco UENO BANK, cuenta N° 61992431, en fecha 29/01/2026, siendo aproximadamente las 14:00 horas, según comprobante N° 9070185.
Cabe mencionar que dicha transferencia fue realizada desde la cuenta bancaria de su sobrina LORENA SOLEDAD ALEMAN GOMEZ, del Banco UENO BANK, cuenta N° 619186972. Por lo que viene a poner a conocimiento de las autoridades policiales para los fines que hubiere lugar.', '', NULL, NULL, 297, 224, 'Asunción', 'Suboficial Ayudante', 'MELANY MONSERRAT', 'MALDONADO CASTRO', NULL, NULL, '4EDB43A26', NULL, 'completada', '2026-01-29T20:50:32.584Z', NULL, NULL),
(513, 441, '2026-01-30T00:00:00.000Z', '11:34', '2026-01-20T00:00:00.000Z', '15:35', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Manifiesta que, en la fecha y hora indicadas más arriba, se encontraba en su lugar de trabajo, ocasión en la que al realizar una transferencia de dinero por la suma de 1.645.200 (un millon seiscientos cuarenta y cinco mil doscientos) a favor de la empresa GRUPO CONSULTORA AVANCE, con número de cuenta N.º 1583275, perteneciente a la entidad Banco Atlas S.A. No obstante, por un error involuntario, la transferencia fue enviada a nombre de la empresa GRUPO RELIANCE S.A., con número de cuenta N.º 1276695, también perteneciente al Banco Atlas S.A., operación identificada con el comprobante N.º 2601 2086 0748, emitido por la entidad bancaria Ueno Bank. Asimismo, manifiesta que advirtio sobre este error y se comunica de manera inmediata con la entidad bancaria de Ueno Bank a fin de informar lo ocurrido.', 'CIUDAD DE ASUNCIÓN, BARRIO CIUDAD NUEVA, PETTIROSSI', NULL, NULL, 307, 206, 'Asunción', 'Suboficial Ayudante', 'ARACELI LUJAN', 'FRANCO DELGADILLO', NULL, NULL, '626E62A26', NULL, 'completada', '2026-01-30T15:06:16.715Z', NULL, NULL),
