(504, 431, '2026-01-29T00:00:00.000Z', '18:22', '2026-01-26T00:00:00.000Z', '10:46', 'Estafa', NULL, 'Que, en fecha 26/01/2026, siendo aproximadamente las 08:45 horas, recibe una llamada telefónica proveniente del número 0992753008, de una persona que se identificó como José Elías Muller, quien manifestó ser el supuesto propietario de la empresa denominada Ganadera Carandayty S.A., con supuesto número de RUC 80011966-5, y correo electrónico mullerjose176@gmail.com
Dicha persona refirió que se comunicaba con la denunciante por encontrarse interesado en la adquisición de cuatro mil quinientas (4.500) unidades de Kitadol Forte, a un costo unitario de siete mil quinientos (7.500) guaraníes, totalizando la suma de treinta y tres millones setecientos cincuenta mil (33.750.000) guaraníes, supuestamente con fines de donación. En ese contexto, ambas partes acordaron que el retiro del producto se realizaría únicamente una vez efectuado el pago correspondiente.
Posteriormente, el mencionado José Elías Muller confirmó su intención de compra, indicando que su asistente se estaría comunicando con la denunciante a los efectos de coordinar el pago. En consecuencia, se comunica con la recurrente una persona que se identificó como Juan Benítez Pérez, supuesto empleado del mencionado, desde el número telefónico 0991600264, quien le remitió un comprobante de depósito de cheque por el valor de treinta y tres millones setecientos cincuenta mil (33.750.000) guaraníes, correspondiente al Banco Itaú, con N° de cheque 4143444, supuestamente depositado por Derlis Escobar, con C.I. N° 1.218.639, al Banco Continental, para la cuenta a nombre de Distritotal S.A., con N° de cuenta 622317298704.
Ante dicha situación, la denunciante remitió el comprobante al grupo de transferencias encargado de la verificación de comprobantes, así como a su compañera Rosa Mel Duarte. Manifiesta que no posee el número telefónico personal de su compañera, pero sí el corporativo N° 0993402020, quien le confirmó que el depósito se habría realizado. En virtud de ello, la denunciante continuó con el procedimiento correspondiente, remitiendo la ubicación de la empresa y avanzando con el proceso de entrega, procediéndose a las 16:35 horas a la entrega del pedido al supuesto Juan Benítez Pérez.
Prosigue relatando la denunciante que, en fecha martes 27/01/2026, siendo aproximadamente las 07:33 horas, recibe una llamada a través de la aplicación WhatsApp del número 0992667906, de una persona que se identificó como Gustavo Abel Brítez, quien manifestó ser el supuesto encargado de compras de la empresa WA Construcciones, interesado en adquirir los siguientes productos: dos mil (2.000) unidades de Kitadol Relax a ocho mil quinientos (8.500) guaraníes cada uno; dos mil (2.000) unidades de Kitadol Forte a siete mil quinientos (7.500) guaraníes cada uno; y dos mil (2.000) unidades de Prodent Biotic a nueve mil (9.000) guaraníes cada uno, totalizando la suma de cincuenta millones (50.000.000) de guaraníes.
Confirmado el pedido, el supuesto Gustavo Abel Brítez remitió a la denunciante un comprobante de depósito de cheque por el valor de cincuenta millones (50.000.000) de guaraníes, correspondiente al Banco Atlas, con N° de cheque en estado poco visible, supuestamente depositado por Gustavo Brítez, con C.I. N° en estado poco legible, al Banco Nacional de Fomento, sucursal Itauguá, recibido en caja por Francisco Pino, para la cuenta a nombre de Distritotal S.A., con N° de cuenta 568523178.
La denunciante procedió nuevamente a enviar dicho comprobante al grupo de transferencias encargado de la verificación, siendo confirmado una vez más por su compañera Rosa Mel Duarte, motivo por el cual se continuó con el proceso de entrega. Siendo aproximadamente las 10:46 horas, se presentó la persona encargada de retirar la mercadería, cuyos datos personales se desconocen, procediéndose a la entrega de los productos.
Finalmente, manifiesta la recurrente que en la fecha de hoy, siendo aproximadamente las 15:45 horas, fue informada de que los cheques no fueron efectivamente depositados, y que los mismos se encuentran denunciados como extraviados. Ante esta situación, la víctima se comunicó con la empresa WA Construcciones, al número telefónico 0972472693, obtenido mediante una búsqueda en su navegador de internet, donde le informaron que el supuesto Gustavo Abel Brítez no es trabajador de dicha empresa. Refiere además que la mencionada empresa no proveyó mayor información ni asistencia adicional, alegando que ya habrían emitido un comunicado en sus redes sociales y realizado la denuncia correspondiente.                                                                                                                                                                                                                                                                                            ', 'DEPARTAMENTO CENTRAL, CIUDAD DE FERNANDO DE LA MORA, BARRIO VILLA OFELIA, HUMAITA CASI CHACO BOREAL, DISTRIBUIDORA DISTRITOTAL', NULL, NULL, 299, 189, 'Asunción', 'Oficial Ayudante', 'MATIAS RAMÓN', 'ORTIGOZA GÓMEZ', NULL, NULL, '39DD75A26', NULL, 'completada', '2026-01-29T22:18:49.249Z', NULL, NULL),
(506, 433, '2026-01-29T00:00:00.000Z', '21:02', '2026-01-23T00:00:00.000Z', '10:22', 'Apropiación', NULL, 'Manifiesta la recurrente que en fecha 23/01/2026 siendo las 10:30 horas aproximadamente  la misma recibe un mensaje vía WhatsApp en donde la empresa BRISTOL S.A le informa que ya estaba listo la entrega de su producto y que este le solicitaba la ubicación para coordinar la entrega, momento en que la misma se apersona en la sucursal de BRISTOL S.A sobre San Martin en donde es atendida por un asesor, la denunciante le comenta que no solicitó ningún producto a su nombre y solicita la verificación del caso, el asesor procede a averiguar para esclarecerle que la carga de productos (no identificados) este se percata que los mismos fueron cargados a su nombre en la sucursal de BRISTOL S.A sobre Kubitschek, y que la denunciante no tenía conocimiento de la adquisición, posterior el asesor bloquea la solicitud dejando el pedido sin efecto. La denunciante manifiesta también que en fecha 28/01/2026 siendo las 16:36 aproximadamente recibe nuevamente un mensaje por el mismo medio mencionado anteriormente, del BANCO SUDAMERIS en donde le informan la aprobación de su tarjeta MASTERCAR  con una línea de 3.000.000 de guaraníes (tres millones de guaranies) para usufructuar, la denunciante procede a realizar una llamada telefónica para esclarecimiento de lo ocurrido, esta fue atendida por Ruth Santacruz y le menciona que no hay ninguna tarjeta de crédito a su nombre y que no posee con ningún crédito del cual deba responsabilizarse.', 'CIUDAD DE ASUNCIÓN, BARRIO VILLA MORRA, SAN MARTIN 658 CASI LIRIO', NULL, NULL, 300, 168, 'Asunción', 'Suboficial Ayudante', 'MARICELA ', 'PEREIRA GONZÁLEZ', NULL, NULL, '67D599A26', NULL, 'completada', '2026-01-30T00:31:06.693Z', NULL, NULL),
