(507, 435, '2026-01-29T00:00:00.000Z', '21:34', '2025-12-22T00:00:00.000Z', '11:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Que, en fecha 22/12/2025, el recurrente se constituyó en la entidad bancaria correspondiente con el fin de realizar el cobro de su aguinaldo en carácter de jubilado. En dicha oportunidad, al intentar disponer de los fondos existentes en su cuenta bancaria, se percató de una situación irregular, constatando que terceras personas habrían accedido de manera indebida y sin su autorización a su cuenta bancaria.
Al verificar los movimientos registrados, el denunciante tomó conocimiento de que se habrían efectuado un total de sesenta y dos (62) extracciones, conforme consta en la boleta N° 005022283027, de fecha 22/12/2025, a las 11:00 horas. Dichas extracciones alcanzaron en su totalidad el monto de 2.911.814 (dos millones novecientos once mil ochocientos catorce) guaraníes.
Asimismo, y de acuerdo al extracto bancario proveído por la entidad financiera, el recurrente pudo constatar la existencia de veinticuatro (24) descuentos que no reconoce como propios, ni autorizados por él, los cuales se encuentran discriminados de la siguiente manera: catorce (14) descuentos realizados en fecha 10/11/2025, uno (1) en fecha 11/12/2025, seis (7) en fecha 17/11/2025, y tres (3) en fecha 23/12/2025, ascendiendo dichos descuentos a un monto total de cuatrocientos sesenta y un mil (461.000) guaraníes.
Todos los movimientos mencionados fueron debidamente presentados y respaldados por el recurrente, mediante la documentación correspondiente, consistentes en extractos bancarios y comprobantes oficiales, los cuales fueron proveídos por el banco Itaú, correspondientes a la tarjeta N° 375169002606226.
Cabe señalar que el denunciante no cuenta con banca web o alguna aplicación bancaria donde realizar sus tramites de manera digital, ya que solamente se maneja con tarjeta física, por lo que desconoce completamente el origen de las extracciones y descuentos mencionados, manifestando que no realizó ni autorizó dichas operaciones, por lo que presume la posible comisión de un hecho punible relacionado al acceso indebido y uso no autorizado de su cuenta bancaria, por lo que pone a conocimiento a la autoridad competente.
Finalmente, se deja constancia que se adjuntan al final de la presente denuncia todos los extractos y boletas correspondientes, conforme a lo solicitado por el denunciante, conteniendo todos los datos exactos y oficiales proveídos por la entidad bancaria Itaú, a fin de respaldar los hechos denunciados y facilitar las diligencias investigativas pertinentes.', 'DEPARTAMENTO CENTRAL, CIUDAD DE CAPIATÁ, BARRIO PUERTA DEL SOL, ARATIRI 306, ENTRE ZUBIZARRETA Y EUGENIO A. GARAY', NULL, NULL, 301, 189, 'Asunción', 'Oficial Ayudante', 'MATIAS RAMÓN', 'ORTIGOZA GÓMEZ', NULL, NULL, 'A06024A26', NULL, 'completada', '2026-01-30T01:24:09.198Z', NULL, NULL),
(510, 438, '2026-01-30T00:00:00.000Z', '09:32', '2026-01-29T00:00:00.000Z', '16:53', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Menciona la denunciante, que en el día de ayer 29//01/2026 en horas de la tarde siendo las 16:53 horas aproximadamente recibe una llamada telefónica desde el abonado numero 0981.624.171, identificándose como  JOSE SEGOVIA DEPARTAMENTO DE COBRANZAS DEL BANCO CONTINENTAL, y le manifiesta que la denunciante contaba con una mora de su tarjeta de crédito por 51 días, donde la recurrente le manifiesta no poseer ninguna tarjeta de crédito del BANCO CONTINENTAL, momento donde la recurrente corta la llamada telefónica, seguidamente la denunciante realiza una llamada telefónica al call center del BANCO CONTINENTAL, y le manifiesta la denunciante no tiene en su poder ninguna tarjeta de crédito del Banco Continental como así también no reconoce ninguna transacción comercial que se haya realizado con dicha tarjeta, y tampoco solicito ni recibió ninguna tarjeta por lo que presume que alguna persona estaría utilizando esa tarjeta y que desconoce de quien se trataría.
