(511, 439, '2026-01-30T00:00:00.000Z', '09:41', '2026-01-20T00:00:00.000Z', '14:50', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Manifiesta la denunciante que se encontraba en su domicilio cuando recibió un mensaje proveniente de Canadá, enviado por su amiga Ana Argüello, quien le informó que había recibido una solicitud de amistad a través de la red social Facebook desde un perfil que utilizaba el nombre “María Carlina Báez Presser”, haciendo uso indebido de la identidad de la denunciante. Relata la víctima que desconoce dicho perfil de Facebook, ya que cuenta con un perfil propio y activo en dicha red social. En razón de ello, procedió a publicar un mensaje en su cuenta personal de Facebook informando que terceros estarían utilizando su nombre de manera fraudulenta.
Asimismo, la recurrente manifiesta que posteriormente recibió un mensaje a través de su cuenta de Gmail, en el cual se le notificaba un supuesto intento de cambio de contraseña, hecho que la misma desconoce completamente. Seguidamente, recibió una llamada telefónica proveniente del abonado numero 0986 675 775, correspondiente a una persona que se identificó como Natalia Pastorino, quien seria secretaria del INSTITUTO GRETTA MARKETING quien esta le alertó que, supuestamente estarian utitlizando el nombre y fotos de la afectadas, ante esta situación, la denunciante se comunicó con su amiga Marta Fretes, quien le informó que estaría recibiendo mensajes provenientes del número +1 (249) 524-3135, en los cuales la persona que enviaba los mensajes se hacía pasar por la víctima, manifestando que dicho número le pertenecía y que se encontraría en Brasil, asimismo, en dichos mensajes se indicaba que supuestamente se estaría enviando un paquete desde Brasil dirigido a la señora Marta Fretes, conocida de la afectada quien la victima desconoce sobre ello.
También comunica la denunciante que el abonado número 0982 562202 se estaría haciendo pasar por su amiga Ana Argüello, quien se encuentra en Canadá. Dicho número habría ingresado al grupo de WhatsApp denominado “CMA MM 81”, perteneciente a la afectada, y una vez dentro del grupo cambió su nombre de usuario a “Esteban”, enviando posteriormente videos de contenido pornográfico al mencionado grupo.', 'DEPARTAMENTO CENTRAL, CIUDAD DE LAMBARÉ, BARRIO VALLE YVATE', NULL, NULL, 305, 206, 'Asunción', 'Suboficial Ayudante', 'ARACELI LUJAN', 'FRANCO DELGADILLO', NULL, NULL, 'F9F9B2A26', NULL, 'completada', '2026-01-30T14:27:11.763Z', NULL, NULL),
(512, 440, '2026-01-30T00:00:00.000Z', '10:45', '2026-01-29T00:00:00.000Z', '09:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Concurre la denunciante y manifiesta que recibe un mensaje a través de la aplicación Facebook, presumiendo que se trataría de un perfil falso que se hace pasar por su amiga de nombre María Carlina Báez, con URL: https://www.facebook.com/share/17nqt6tNRh/
