Continúa manifestando la denunciante que, en horas de la tarde, recibe un mensaje de la supuesta empresa DHL Express, informándole que el paquete o encomienda habría tenido inconvenientes durante el traslado con agentes de control de la DNIT, motivo por el cual le solicitan realizar un depósito de dinero por la suma de 37.000.000 Gs.

