(521, 449, '2026-01-30T00:00:00.000Z', '20:12', '2026-01-29T00:00:00.000Z', '17:00', 'Estafa', NULL, 'Manifiesta la denunciante que, en la fecha y hora indicadas precedentemente, se encontraba en su lugar de trabajo, ocasión en la cual recibió un mensaje a través de la aplicación Telegram, proveniente de un perfil denominado “SOFIA BANES”, quien afirmaba supuestamente desempeñarse laboralmente en la empresa denominada “Mac Can Do”.
Dicha persona le ofreció la posibilidad de acceder a un supuesto trabajo part-time en la República del Paraguay, mediante el cual podría generar ingresos económicos. Ante dicha propuesta, la afectada accedió, tras lo cual la persona identificada como SOFIA BANES procedió a agregarla a un grupo de trabajo, en el que se le indicó que debía realizar un total de 25 tareas.
Luego de efectuar algunas de dichas tareas, la denunciante recibió un pago inicial de 108.000 (ciento ocho mil) guaraníes, lo que generó confianza en la supuesta oferta laboral.
Posteriormente, tras la realización de varias tareas, la mencionada persona comenzó a solicitarle la transferencia de diversas sumas de dinero, supuestamente correspondientes a distintas tareas, conforme al siguiente detalle:
1-100.000 (cien mil) guaraníes, correspondiente a la tarea N.° 5, transferidos a nombre de DAHIANA MARICHEL CAMACHO RIVEROS, C.I. N.° 6.670.392, cuenta N.° 81-16684511, del Banco Familiar, comprobante N.° 5482622.
2- 250.000 (doscientos cincuenta mil) guaraníes, correspondiente a la tarea N.° 10, transferidos a nombre de ELÍAS EMANUEL MARTÍNEZ RAMÍREZ, C.I. N.° 5.935.787, cuenta N.° 81-16617184, del Sudameris Bank, comprobante N.° 5527749.
3- 980.000 (novecientos ochenta mil) guaraníes, solicitados de manera adicional, sin corresponder a una tarea específica, transferidos a nombre de GUSTAVO RAMÓN BENÍTEZ ROJAS, C.I. N.° 6.032.030, cuenta N.° 0001000006323372, del Sudameris Bank, comprobante N.° 5534775., 
Luego de efectuadas dichas transferencias, las personas que decían representar a la mencionada empresa exigían una entrega por la suma de 15.000.000 (quince millones) de guaraníes, manifestando la denunciante que no contaba con dicho monto comenzaron a intimidar y amenazar a la víctima por no querer abonar dicha cantidad de dinero. Por tanto la victima comienza a realizar dos transferencias de 5.000.000 ( cinco millones de guaraníes)a
la primera transferencia de 5.000.000 (cinco millones) de guaraníes, transferidos a nombre de NICOLÁS GONZÁLEZ, C.I. N.° 6.840.840.472, del Sudameris Bank, comprobante N.° 5555182.
segunda transferencia de 5.000.000 (cinco millones) de guaraníes, igualmente transferidos a nombre de NICOLÁS GONZÁLEZ, conforme comprobante correspondiente
Ante la negativa, estas personas comenzaron a proporcionar datos personales de familiares de la víctima, así como información relacionada con sus cuentas bancarias y tarjetas, insinuando que podrían causarle daño tanto a ella como a sus familiares en caso de no efectuar el pago exigido.', 'CIUDAD DE ASUNCIÓN, BARRIO YKUA SATI, AVENIDA AVIADORES DEL CHACO', NULL, NULL, 315, 206, 'Asunción', 'Suboficial Ayudante', 'ARACELI LUJAN', 'FRANCO DELGADILLO', NULL, NULL, '297F46A26', NULL, 'completada', '2026-01-31T00:49:16.981Z', NULL, NULL),
(522, 450, '2026-01-30T00:00:00.000Z', '21:38', '2026-01-29T00:00:00.000Z', '14:30', 'Estafa', NULL, 'La recurrente comparece ante esta Unidad Especializada y manifiesta que visualizó una publicidad en la plataforma Facebook, en la cual se ofrecía un supuesto préstamo aprobado mediante la aplicación denominada Mango. Refiere que, al acceder al enlace correspondiente, se comunica a través de la plataforma WhatsApp con el abonado número 0976727897, donde una persona se presenta como asesor financiero, identificándose con el nombre de Marcelo Pérez.

Seguidamente, la denunciante indica que accedió a remitir sus datos personales, así como la fotografía de su cédula de identidad. Posteriormente, toma conocimiento de una transferencia bancaria no autorizada, por el monto de 99.999 GS, realizada a la cuenta número 155947146, a nombre de Zunilda Falcón, perteneciente a la entidad Banco Basa S.A., con número de transacción 105178413, operación que manifiesta desconocer.

Asimismo, continúa manifestando que, al verificar dicha transferencia, se percata de la creación de una cuenta bancaria en la entidad Banco Basa S.A., la cual desconoce haber solicitado o autorizado, presumiendo en ese momento que su cuenta habría sido vulnerada.

Igualmente, señala que constató en su cuenta bancaria de la entidad Ueno Bank, correspondiente a la Duo Card Crédito número 5585480003751696, la realización de varios pagos no autorizados, por un monto total de 28.000 GS, los cuales manifiesta no haber efectuado, presumiendo que su cuenta de dicha entidad también fue objeto de vulneración.

En virtud de lo expuesto, la recurrente comparece ante esta Unidad Especializada a fin de dejar constancia de los hechos denunciados, para los fines legales que hubiere lugar.', 'DEPARTAMENTO CENTRAL, CIUDAD DE FERNANDO DE LA MORA, BARRIO BERNARDINO CABALLERO, 11 DE SETIEMBRE Y ALGODONAL', NULL, NULL, 316, 174, 'Asunción', 'Suboficial Ayudante', 'JEREMÍAS JOSÉ', 'ARMOA ESCOBAR', NULL, NULL, '7F9C5AA26', NULL, 'completada', '2026-01-31T01:27:03.638Z', NULL, NULL),
(523, 451, '2026-01-30T00:00:00.000Z', '22:37', '2026-07-30T00:00:00.000Z', '18:00', 'Estafa', NULL, 'Manifiesta el recurrente que visualizó una publicidad en la red social Facebook referente a un supuesto vendedor de aparatos celulares. Refiere que, tras establecer contacto, le fue facilitado el número telefónico 0994584236 a los efectos de concretar la compra del producto ofrecido.

Continúa manifestando el denunciante que procedió a realizar una transferencia bancaria por la suma total de 1.550.000 Gs., a la cuenta N° 8116530711, a nombre de JULIA MERCEDES ARRUA FLEITA, perteneciente a la entidad BANCO FAMILIAR S.A.E.C.A., operación efectuada bajo comprobante N° 2601309627786.

Posteriormente, el supuesto vendedor continuó solicitando el pago de la totalidad del producto, circunstancia ante la cual el denunciante se percató de que podría estar siendo víctima de un hecho punible de estafa.

Por tal motivo, acude a esta Unidad Especializada a fin de dejar constancia de lo ocurrido.', 'CIUDAD DE ASUNCIÓN, BARRIO VISTA ALEGRE, AMANCIO GONZALEZ ENTRE AZTECAZ Y ARAUCANOS', NULL, NULL, 317, 174, 'Asunción', 'Suboficial Ayudante', 'JEREMÍAS JOSÉ', 'ARMOA ESCOBAR', NULL, NULL, '8BDA7EA26', NULL, 'completada', '2026-01-31T02:00:16.500Z', NULL, NULL),
(524, 452, '2026-01-30T00:00:00.000Z', '22:41', '2026-01-30T00:00:00.000Z', '15:30', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Manifiesta que, en fecha y hora indicadas más arriba, se encontraba en su domicilio cuando recibió una llamada telefónica proveniente del número de abonado 0992 682 373, desconociendo la identidad y titularidad del mismo.
La persona que realizó la llamada le manifestó que, para acceder a un crédito en la entidad denominada MANGO, debía realizar un pago previo. Seguidamente, el desconocido solicitó la suma de Gs. 567.000 (quinientos sesenta y siete mil guaraníes), y posteriormente requirió una carga adicional de Gs. 100.000 (cien mil guaraníes), indicando que dicho monto debía ser transferido a nombre de SALVADOR MUJICA, con C.I. N.º 1.770.407, cuenta perteneciente al Banco ATLAS.
Asimismo, el interlocutor manifestó que el crédito no podía realizarse a través de la plataforma MANGO, sugiriendo que se efectuara mediante la aplicación CONTI. Acto seguido, realizó una videollamada, ocasión en la cual el afectado le mostró algunos datos de su cuenta CONTI, bajo el supuesto de que dicha persona le estaría enviando dinero correspondiente a un crédito solicitado por la suma de Gs. 8.000.000 (ocho millones de guaraníes).
Posteriormente, al ingresar a la aplicación CONTI, el desconocido le solicitó que depositara la suma de Gs. 2.700.000 (dos millones setecientos mil guaraníes) en su propia cuenta de MANGO. Ante la imposibilidad de retirar dicho monto desde la plataforma, el interlocutor le indicó que acudiera a un cajero automático para efectuar la extracción, lo cual el afectado manifestó que no podía realizar.
Seguidamente, el desconocido le solicitó que mostrara su cuenta CONTI en la sección correspondiente a la tarjeta y le pidió que realizara una captura de pantalla de dichos datos. El afectado realizó la captura, pero no llegó a enviar dicha información a la persona desconocida.
Posteriormente, el mismo volvió a comunicarse a través del número de abonado mencionado, sugiriendo que enviara sus datos personales, tales como número de cédula de identidad, número de tarjeta y PIN de la tarjeta, mediante mensajes de texto convencional, a los números 885.513 y 858.413.
Momentos más tarde, el afectado se percató, a través de su cuenta CONTI, de la realización de seis (6) transacciones no reconocidas, por los montos de Gs. 450.000 (cuatrocientos cincuenta mil), Gs. 800.000 (ochocientos mil), Gs. 300.000 (trescientos mil), Gs. 500.000 (quinientos mil), Gs. 500.000 (quinientos mil) y la última por la suma de Gs. 600.000 (seiscientos mil guaraníes) que el afectado desconoce sobre estas transacciones.', 'DEPARTAMENTO CENTRAL, CIUDAD DE LIMPIO', NULL, NULL, 318, 206, 'Asunción', 'Suboficial Ayudante', 'ARACELI LUJAN', 'FRANCO DELGADILLO', NULL, NULL, '41AAAAA26', NULL, 'completada', '2026-01-31T03:04:56.486Z', NULL, NULL),
