(533, 449, '2026-01-31T00:00:00.000Z', '19:47', '2026-01-30T00:00:00.000Z', '13:54', 'Estafa', NULL, 'La recurrente manifiesta que, en la fecha y hora señaladas anteriormente, se encontraba en su lugar de trabajo cuando recibió un mensaje a través de la aplicación Telegram. El remitente, bajo el usuario @DDYU9898 e identificado como "RECEPCIONISTA-LAURA★", le ofreció una oportunidad de inversión con rendimientos del 40%, 60% y 100%. Atraída por la oferta, la denunciante accedió y procedió a realizar las siguientes transferencias bancarias:
Gs. 250.000 a la cuenta N° 8116617184 del Banco Familiar, a nombre de Elias Emanuel Martínez Ramírez (C.I. N° 5.935.787).
Gs. 980.000 a la cuenta N° 0001000006323372 del Banco Sudameris, a nombre de Gustavo Ramón Benítez Rojas (C.I. N° 6.032.030).
Gs. 5.000.000 a la cuenta N° 5462973 del Banco Sudameris, a nombre de Nicolás Sebastián González Céspedes (C.I. N° 6.840.472).
Al notar la ausencia de retornos, la recurrente solicitó el reembolso de su capital. Ante esto, la supuesta "Laura" condicionó la devolución al pago previo de Gs. 15.000.000. Al manifestar que no disponía de dicha suma, la víctima comenzó a recibir amenazas coactivas. Los victimarios afirmaron poseer datos sensibles de su entorno familiar, incluyendo el lugar de trabajo de su esposo y el centro educativo de su hijo y sobrinos, advirtiendo que les harían daño si no pagaba.
Bajo fundado temor, la recurrente realizó un cuarto depósito por Gs. 5.000.000 a la cuenta N° 5462973 del Banco Sudameris (a nombre de Nicolás Sebastián González Céspedes). Tras este pago, volvió a exigir el reembolso total, pero le informaron que el dinero no sería devuelto debido a una supuesta "deuda acumulada" de Gs. 10.000.000. Le indicaron que tiene un plazo de un año para cancelar dicha deuda antes de recuperar su capital y las ganancias prometidas.
', 'CIUDAD DE ASUNCIÓN, BARRIO YKUA SATI, AVDA. AVIADORES DEL CHACO ', NULL, NULL, 327, 166, 'Asunción', 'Oficial Ayudante', 'MARÍA SOLEDAD', 'MIRANDA AMARILLA', NULL, NULL, 'EED385A26', NULL, 'completada', '2026-01-31T23:16:39.437Z', NULL, NULL),
(526, 454, '2026-01-31T00:00:00.000Z', '09:02', '2026-01-30T00:00:00.000Z', '16:25', 'Estafa mediante sistemas informáticos', NULL, 'Que, el recurrente manifiesta haber sido víctima del hecho punible supra mencionado, y pasa a detallar los hechos:

Que, en fecha 30 de enero de 2026, recibió un mensaje a través del servicio de mensajería instantánea WhatsApp, específicamente a las 16:26 horas, proveniente del abonado N.º +595 992 044 608, el cual tenía como fotografía de perfil la imagen de su hijo. Dicha persona se hacía pasar por el mismo, manifestando que necesitaba con suma urgencia la suma de Gs. 7.600.000 (siete millones seiscientos mil guaraníes), proporcionando para el efecto una cuenta bancaria.

La cuenta indicada correspondía a UENO BANK, a nombre de ALERSON DAVID CANDIA, Cuenta N.º 19.349.484, a la cual el recurrente procedió a realizar la transferencia, en razón de que creyó estar auxiliando a su hijo. Dicha operación consta en el comprobante de transferencia N.º 1.757.616, realizada en la misma fecha a las 16:29:53 horas, desde su cuenta del Banco Nacional de Fomento.

Acto seguido, casi de manera inmediata, el mismo abonado volvió a solicitar una nueva transferencia, situación que llamó la atención del recurrente, motivo por el cual intentó comunicarse telefónicamente con dicho número, sin obtener respuesta. Ante ello, procedió a llamar al número habitual de su hijo, quien le manifestó que en ningún momento había cambiado de número telefónico ni había solicitado suma de dinero alguna.

En consecuencia, el recurrente se percató de que había sido víctima de un hecho delictivo, por lo que solicita la pronta intervención y actuación de la Policía Nacional y del Ministerio Público, a fin de esclarecer los hechos y determinar a los responsables.', 'DEPARTAMENTO CENTRAL, CIUDAD DE CAPIATÁ, BARRIO LOMA BARRERO, BOLIVAR (DOMICILIO DE LA VICTIMA)', NULL, NULL, 320, 226, 'Asunción', 'Suboficial Segundo', 'LIZANDRY CAMILA', 'PANIAGUA BERNAL', NULL, NULL, '6E47B9A26', NULL, 'completada', '2026-01-31T12:16:17.269Z', NULL, NULL),
