(530, 460, '2026-01-31T00:00:00.000Z', '13:57', '2026-01-31T00:00:00.000Z', '09:30', 'Estafa', NULL, 'La misma manifiesta que se encontraba en su domicilio y que, en un momento dado, su esposo de nombre Leonardo Fabián Inchausti Mercadal, con C.I. N° 5.142.767, recibe una llamada en su número 0981 249084, proveniente del abonado N° 0972 458152, quien se identifica como “Walter”, supuesto personal de UENO Bank. Dicha persona le ofrece préstamos de la mencionada entidad bancaria, indicando que el mismo era un usuario calificado. Asimismo, le solicita sus datos personales y también los de su esposa, requiriendo posteriormente la realización de una videollamada con pantalla compartida para que pueda ingresar a su cuenta bancaria de Itaú, a lo cual el recurrente accede, proporcionando además el número telefónico de su esposa.
Momentos después, la recurrente recibe una llamada en la cual le solicitan otra vez sus datos personales y proceden a compartir pantalla, mientras ingresaban a las aplicaciones de Banco Familiar y GNB.
Seguidamente, la recurrente recibe varios correos electrónicos por parte de Banco Basa, en los cuales se mencionan diversas transacciones que la misma no reconoce, ya que no posee cuenta bancaria en dicha entidad. Esta situación le genera desconfianza, por lo que ingresa a su cuenta bancaria de UENO, donde visualiza que se había realizado un préstamo por el monto de 10.000.000 Gs. (diez millones de guaraníes) y que posteriormente se efectuaron las siguientes transacciones:
800.000 Gs. (ochocientos mil guaraníes) a la cuenta N° 155950038, cargo Banco Basa, registrada a nombre de la recurrente.
4.000.000 Gs. (cuatro millones de guaraníes) a la cuenta N° 155951390, cargo Banco Basa, registrada a nombre de la recurrente.
2.000.000 Gs. (dos millones de guaraníes) a la cuenta N° 155944253, cargo Banco Basa, registrada a nombre de la recurrente.
5.000.000 Gs. (cinco millones de guaraníes) a la cuenta N° 155954393, cargo Banco Basa, registrada a nombre de la recurrente.
3.000.000 Gs. (tres millones de guaraníes) a la cuenta N° 155954393, cargo Banco Basa, registrada a nombre de ERIKA LESME CHAMORRO.
2.000.000 Gs. (dos millones de guaraníes) a billetera personal, al abonado N° 0976733824, con C.I N° 5.442.673.
Asimismo, recibe un correo electrónico por parte de operbancaweb donde se menciona el pago por QR a través de FAMILIAR A TODA HORA, en el comercio ELECTROCELL, por el monto de 1.930.000gs (un millón novecientos treinta mil guaraníes),a las 11:51hs, con operación N° 322197692.
Posteriormente, su esposo también revisa su cuenta bancaria de Itaú y constata que el monto de 670.000 Gs. (seiscientos setenta mil guaraníes) que poseía en su caja de ahorro N° 820000189 fue transferido a dos cuentas con cargo a Banco Basa, de las cuales desconoce mayores datos, ya que había bloqueado su cuenta de Itaú y perdió el acceso a la misma.
', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, BARRIO VILLA AMELIA, JOVENES DE LA DEMOCRACIA Y VICTOR CACERES', NULL, NULL, 324, 166, 'Asunción', 'Oficial Ayudante', 'MARÍA SOLEDAD', 'MIRANDA AMARILLA', NULL, NULL, 'A953FCA26', NULL, 'completada', '2026-01-31T17:40:18.632Z', NULL, NULL),
(531, 461, '2026-01-31T00:00:00.000Z', '16:01', '2026-01-30T00:00:00.000Z', '14:49', 'Estafa', NULL, 'Manifiesta el recurrente que, en fecha y hora mencionado  mas arriba se encontraba en su  domicilio particular navegando en la plataforma de Facebook (MARKETPLACE), El interesado se contacta  con una supuesta  ferretería  denominado San Cayetano ubicado supuestamente en el departamento de Cordillera ciudad de loma medina, que lo deriva directamente al servicio de mensajería WhatsApp, al abonado N° 0976304973 sin identificarse, le envía fotos y detalles del producto a adquirir que serian Conjunto de baños de piezas de cerámica (lavatorio con canilla, inodoro, bidet,) inicialmente .menciona que le solicita una seña de 620.000gs (Seiscientos veinte mil)gs. el mismo accede y procede a realizar la transferencia en la cuenta indicada 
-UENO BANK a nombre de LUIS DARIO MARTINEZ SOSA con  Cuenta N° 6192619989 con comprobante N° 5555599 la suma de 620.000 gs (seiscientos veinte mil gs ).
Acto seguido de manera  inmediata el mismo, le volvió a solicitar una nueva trasferencia, alegando que tiene una promoción  que incluye (bidet, tapa de asiento, lavatorio con canilla columna ,cisterna cepillo para inodoro y porta jabonera ) Una vez convencido la victima le vuelve a trasferir la suma de 230.000 (doscientos treinta mil gs).
En UENO BANK   nombre de LUIS DARIO MARTINEZ SOSA con  Cuenta N° 6192619989 con comprobante N° 5587110. el supuesto vendedor le envía una supuesta factura de N° 575 de fecha 30/01/2026 donde detalla la descripción del producto (kit juegos de Baño color negro) y la dirección de entrega en la  Avda. Próceres de mayo 733/Italia indicando que el día de la entrega seria el día de hoy 31/01/2026 a las 08:30 am aproximadamente,. El recurrente llama al abonado numero de la supuesta ferretería y no contestan las llamadas y le había  bloqueado en WhatsApp, sospechando que seria una estafa  por esta razón busca información por su propia cuenta en el navegador de internet constatando que tiene varias quejas y escraches con ese nombre y perfil donde, en una de las publicaciones aparece su  numero de cedula identificado como  LUIS DARIO MARTINEZ SOSA con C.I.N°  5.531.709 con celular N° 0986882453 con cuenta ahorro a la vista N° 301016845 de Cargo SOLAR BANCO. Por esta razón pone a conocimiento de las autoridades competentes para lo que hubiere lugar.
', 'CIUDAD DE ASUNCIÓN, BARRIO PINOZA, AVDA PEROCERES DE MAYO CASI ITALIA', NULL, NULL, 325, 226, 'Asunción', 'Suboficial Segundo', 'LIZANDRY CAMILA', 'PANIAGUA BERNAL', NULL, NULL, 'CCFB33A26', NULL, 'completada', '2026-01-31T20:22:09.352Z', NULL, NULL),
(534, 463, '2026-01-31T00:00:00.000Z', '21:43', '2025-09-29T00:00:00.000Z', '07:00', 'Estafa', NULL, 'La recurrente manifiesta que, encontrándose en la red social TikTok, se hallaba en la búsqueda de personas que pudieran venderle ropas en buen estado con el fin exclusivo de destinarlas a donaciones para niños. En dicho contexto, ingresó a una página identificada con el usuario @FASHIONEUROPEA5, denominada “Fashion Mujeres Emprendedoras”, donde tomó contacto con una persona de sexo femenino que se identificó como “Marilyn”, posteriormente individualizada como Gloria Tomasa Acosta Cáceres.

La mencionada persona le ofreció ropas para niños, así como también réplicas de marcas reconocidas. La recurrente aclaró de manera expresa que únicamente se encontraba interesada en ropas para niños de entre 6 y 12 años, a lo que la vendedora respondió afirmativamente, comprometiéndose a buscar la mercadería solicitada y a realizar un “en vivo” en la red social, en el cual exhibiría prendas acordes a lo requerido para que la recurrente pudiera seleccionarlas.

En fecha 02/12, la recurrente realizó un primer pedido de mercaderías con las características mencionadas, efectuando los siguientes pagos:

Una transferencia desde la cuenta del Banco GNB del esposo de la recurrente a favor de la Sra. Gloria Tomasa Acosta Cáceres, C.I. Nº 3.334.603, a la cuenta del Banco Familiar Nº 8114913235, según comprobante Nº 60165839, por la suma de 500.000 Gs.
Dicha mercadería llegó con considerable retraso respecto a lo pactado.

Asimismo, en esa misma fecha, la recurrente realizó transferencias a favor del Sr. Ricardo Ramón Mendoza Sosa, C.I. Nº 5.180.989, a la cuenta del Banco Familiar Nº 816409144, por un total de 4.000.000 Gs., discriminados de la siguiente manera:

3.000.000 Gs., comprobante Nº 251205237901, en fecha 05/12/2025, a las 01:44 hs.

1.000.000 Gs., comprobante Nº 2512028079417, en fecha 02/12/2025, a las 20:55 hs.

Las mercaderías correspondientes a dichas transferencias debían arribar en el transcurso de la misma semana; sin embargo, recién llegaron en la segunda semana de diciembre, y lo hicieron en condiciones totalmente distintas a las acordadas, presentando prendas defectuosas, incompletas y faltantes, situación que solo fue parcialmente atendida luego de reiterados reclamos por parte de la recurrente.

Posteriormente, y luego de extensas conversaciones, insistencias y disculpas por parte de la vendedora, la recurrente decidió realizar una nueva compra, siempre con fines benéficos. Para ello, efectuó un pago desde su cuenta de Ueno Bank a la cuenta de la Sra. Gloria Tomasa Acosta Cáceres, Cta. Nº 8114913235, según comprobante Nº 2512148171823, por la suma de 1.500.000 Gs. El saldo restante fue entregado en efectivo en el local comercial de la mencionada señora, ubicado en Ciudad del Este, específicamente en el local denominado “EUROPEA”, con cartelería visible que menciona “Europea”, al cual la recurrente llegó siguiendo instrucciones del Sr. Ricardo, quien le compartió la ubicación vía WhatsApp. En dicho lugar, la recurrente entregó la suma de 1.500 dólares americanos, completando el valor total de la mercadería.

La mercadería debía llegar en el transcurso de la semana siguiente, lo cual nunca ocurrió, pese a los reiterados reclamos. Ante esta situación, la recurrente volvió a trasladarse a Ciudad del Este para reclamar personalmente, ocasión en la que se le manifestó que existían problemas para completar el pago del transporte en el cual venían las mercaderías, solicitándole nuevamente dinero bajo distintos conceptos, tales como consignación para futuras compras y supuestas compensaciones.

En ese contexto, la recurrente realizó las siguientes transferencias adicionales:

16/12/2025: 2.500.000 Gs. a la cuenta del Sr. Ricardo Mendoza, comprobante Nº 251216611794.

14/12/2025: 1.500.000 Gs. a la cuenta de la Sra. Gloria, comprobante Nº 2512148171823.

19/12/2025: 1.000.000 Gs. a la cuenta del Sr. Ricardo, comprobante Nº 2512193160002.

28/12/2025: 1.000.000 Gs. a la cuenta del Sr. Ricardo, comprobante Nº 2512281115360.

28/12/2025: 1.500.000 Gs. a la cuenta del Sr. Ricardo, comprobante Nº 170605825.

30/12/2025: 750.000 Gs. a la cuenta del Sr. Ricardo, comprobante Nº 171261882.

31/12/2025: 315.000 Gs.

06/01/2026: 1.000.000 Gs. a la cuenta de la Sra. Gloria, comprobante Nº 2601069177062.

3.000.000 Gs. a la cuenta del Sr. Ricardo, comprobante Nº 171269338.

Todas estas transferencias fueron realizadas bajo engaños reiterados, invocando supuestos pagos de impuestos, tasas aduaneras, mercadería en tránsito y promesas de que los montos serían reconocidos como consignación para futuras compras. Asimismo, los denunciados recurrieron a manipulación emocional, enviando imágenes de una niña a la que identificaban como su hija (ZARAY) en presunto estado de enfermedad, así como relatos de supuesta violencia ejercida por el Sr. Ricardo contra la Sra. Gloria, haciendo referencia a su carácter violento, con expresiones tales como: “hacé nomás la transferencia porque no quiero que te haga lo que me hace a mí”, todo ello con el claro propósito de inducir a la recurrente a seguir realizando pagos.

Finalmente, en fecha 09/01/2026, llegaron varios paquetes, constatándose nuevamente un faltante significativo de prendas. Al efectuar el reclamo correspondiente, la Sra. Gloria y el Sr. Ricardo alegaron que la mercadería restante sería entregada en una próxima remesa, ofreciendo además nuevas prendas a precios accesibles. Confiando nuevamente en dichas promesas, la recurrente realizó nuevos pagos:

17/01/2026: 1.000.000 Gs. a la cuenta de la Sra. Gloria, comprobante Nº 16071690004163007.

18/01/2026: 3.000.000 Gs., comprobante Nº 2601189259657.

En esa misma fecha, la Sra. Gloria (alias “Marilyn”) y el Sr. Ricardo realizaron un en vivo en TikTok, durante el cual la recurrente efectuó un reclamo público. Lejos de cumplir con lo prometido, ambos realizaron amenazas, indicando que conocían el domicilio de la recurrente y a su familia, advirtiendo que cualquier acción legal traería consecuencias graves para ella y su familia.

El día 31/01/2026, nuevamente realizaron un en vivo en la mencionada red social, donde reiteraron amenazas verbales en contra de la recurrente y de su familia.

La recurrente pasa a citar los números telefónicos involucrados en el hecho denunciado:
+595 986 941 894 (supuesto familiar del Sr. Ricardo, quien habría materializado amenazas contra la integridad física),+595 971 842 000 (persona que se presentó como supuesto abogado),+595 984 446 636,+595 992 827 134 (correspondiente al Sr. Ricardo), +595 994 398 878 (correspondiente a un tal Ali Ala, quien sería el encargado de ejecutar amenazas en Ciudad del Este), ademas el dia de la fecha recibe una llamada por parte del abonado +554598477450, quien textualmente le realizo amenazas contra la integridad fisica e incluso la vida de sus familiares y de ella misma.

Por todo lo expuesto, la recurrente manifiesta que, además del grave daño patrimonial sufrido, teme fundadamente por su vida y la de su familia, motivo por el cual solicita la pronta intervención e investigación del Ministerio Público, así como la debida custodia y medidas de seguridad por parte de la Policía Nacional, a fin de que las personas denunciadas sean debidamente procesadas por los hechos punibles de estafa, amenazas y concierto para la comisión de hechos punibles, o aquellos que resulten aplicables conforme a derecho y según la conducta relatada. En ese orden de ideas, la recurrente solicita que se dispongan de manera inmediata las medidas y diligencias de seguridad que resulten pertinentes, atendiendo a que reviste la calidad de cónyuge de una persona que ejerce un cargo político, específicamente el Sr. David Rafael Velázquez Seiferheld, Viceministro de Educación Superior y Ciencias del Ministerio de Educación y Ciencias, y Encargado de Despacho del Viceministerio de Culto, circunstancia que incrementa el nivel de riesgo y torna necesaria la adopción de resguardos especiales para la protección de su integridad física y la de su grupo familiar. Asimismo, solicita que la presente denuncia y la investigación derivada de la misma se tramiten con el debido sigilo y discreción, a fin de evitar mayores riesgos y resguardar la seguridad de la recurrente y de su familia.', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, BARRIO LAURELTY', NULL, NULL, 328, 166, 'Asunción', 'Oficial Ayudante', 'MARÍA SOLEDAD', 'MIRANDA AMARILLA', NULL, NULL, '4A95D7A26', NULL, 'completada', '2026-02-01T04:18:31.860Z', '2026-01-31T00:00:00.000Z', '22:03'),
