(535, 464, '2026-02-01T00:00:00.000Z', '09:14', '2026-01-31T00:00:00.000Z', '18:30', 'Acceso indebido a sistemas informáticos', NULL, 'Manifiesta el recurrente que en la fecha y hora mencionada mas arriba, queriendo realizar una transacción desde su cuenta y al momento de confirmar el Itoken le aparecía contraseña incorrecta, por lo que realiza una llamada al call center del banco itau, quienes le indicaron para realizar la revalidación. Acto seguido le llego en su correo electrónico el código de verificación de seis dígitos.
Sigue manifestando el recurrente que una vez realizado dicho proceso y al momento de querer ingresar a su aplicación le aparece contraseña incorrecta, una vez recuperado la cuenta al cambiar la contraseña, se percata que su saldo se encontraba en cero y visualiza movimientos realizados desde su cuenta cargo banco Itaú, tarjeta de débito perteneciente a la cuenta N° 320000520, perteneciente al recurrente, las transacciones se detallan a continuación: 
•	Transferencia realizada a favor de SANDRA CANO CABRERA, entidad NETEL PARAGUAY S.A., cuenta N° 0975599296, realizada en fecha 31/01/2026, la suma de 3.860.000 gs., según comprobante N° 86005.
•	Transferencia realizada a favor de SANDRA CANO CABRERA, entidad NETEL PARAGUAY S.A., cuenta N° 0975599296 realizada en fecha 31/01/2026, la suma de 7.500 gs.
Manifiesta el recurrente que desconoce completamente dichas transferencias realizadas, por lo que se acerca hasta esta dependencia policial a poner a conocimiento de la autoridad competente para los fines que hubiere lugar.
', 'DEPARTAMENTO CENTRAL, CIUDAD DE CAPIATÁ, BARRIO SAN LUIS, CALLE LOPEZ GODOY Y LOS LAGOS', NULL, NULL, 329, 192, 'Asunción', 'Suboficial Ayudante', 'ISUSI ARAMI', 'GALEANO ALVARENGA', NULL, NULL, '4A8D4DA26', NULL, 'completada', '2026-02-01T12:42:57.756Z', NULL, NULL),
(536, 465, '2026-02-01T00:00:00.000Z', '11:49', '2026-01-31T00:00:00.000Z', '23:30', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Manifiesta la denunciante que en fecha y hora ya mencionada recibe un mensaje en la plataforma de mensajeria instantanea WhatsApp de su pareja sentimental DINO NOVARA,  con abonado número 0981061747 , que desde el usuario de la plataforma INSTAGRAM registado como MAJIP_080 con URL https://www.instagram.com/majip_080?igsh=N3NhcGttbXp3YzRu, le estarían difamando, la cual la recurrente procede a buscar y se percata que no le aparece el perfil mencionado, por lo que procede a buscar desde otra cuenta y se percata sobre la existencia de dicho usuario, y el mismo poseia historias, con conversaciones a traves de la plataforma de mensajería instantatanea WhatsApp hablando mal de su persona y de su familia. manifiesta tambien que no seria la primera vez que se realizan publicaciones refiriendose de mala manera hacia su persona y su familia, haciendoles quedar mal ante personas allegadas a los mismos.', 'DEPARTAMENTO CENTRAL, CIUDAD DE SAN LORENZO, BARRIO SAN MIGUEL, SAN MIGUEL 122 CASI LAGUNA GRANDE', NULL, NULL, 330, 184, 'Asunción', 'Suboficial Ayudante', 'AXEL FERNANDO', 'DUARTE ORTIGOZA', NULL, NULL, '0FDED2A26', NULL, 'completada', '2026-02-01T15:21:39.626Z', NULL, NULL),
(537, 466, '2026-02-01T00:00:00.000Z', '13:29', '2026-02-01T00:00:00.000Z', '12:30', 'HECHO PUNIBLE A DETERMINAR', NULL, 'La recurrente manifiesta que habia interactuado con una persona a través de la plataforma de red social Facebook, quien utilizaba el nombre de perfil ABEL MARTÍNEZ, con URL: https://www.facebook.com/share/1Bw3U5A5dA/ Posteriormente, el mencionado usuario le solicitó continuar la conversación a través de la red de mensajería instantánea WhatsApp, requiriéndole su número de teléfono, a lo cual la denunciante accedió voluntariamente. Seguidamente, dicho usuario se contactó con la denunciante mediante el abonado número 0991831469. Conforme a lo manifestado por la recurrente, el sindicado le solicitó el envío de fotos íntimas, a lo cual la misma accedió. No obstante, de manera inmediata y posterior a la recepción de dicho material, el usuario del abonado anteriormente citado comenzó a amenazar a la denunciante con divulgar las referidas fotografías en distintas redes sociales, en caso de que esta no accediera a enviarle más fotos y videos de contenido íntimo. Por lo expuesto, la recurrente formula la presente denuncia, a fin de que se investiguen los hechos y se determinen las responsabilidades conforme a derecho.   ', 'CIUDAD DE ASUNCIÓN, BARRIO TACUMBU, URSISINO VELAZCO Y VIRGEN DE GUADALUPE', NULL, NULL, 331, 184, 'Asunción', 'Suboficial Ayudante', 'AXEL FERNANDO', 'DUARTE ORTIGOZA', NULL, NULL, '329FA7A26', NULL, 'completada', '2026-02-01T17:01:11.781Z', NULL, NULL),
(539, 468, '2026-02-01T00:00:00.000Z', '20:27', '2026-01-31T00:00:00.000Z', '13:00', 'Estafa', NULL, 'Relata la recurrente que en fecha y hora mencionada más arriba se encontraba navegando en la red social FACEBOOK en su apartado MARKETPLACE en el que visualiza la publicación de una heladera de la marca MIDAS promocionado a bajo costo por lo que se contacta con el usuario denominado (COMFORT HOUSE), este le proporciona un número de WhatsApp(0975799564) para coordinar dicha compra, tras negociar la denunciante le transfiere la suma de 70.000( setenta mil guaranies) al alias proporcionado (9279601) a nombre de MIGUELA VERDUN FLORENTIN de la entidad bancaria FINANCIERA S.A. cuenta N° 2015319801, posterior le exige el 50% del total, la victima realiza otra transferencia por la suma de 1.200.000(un millon doscientos mil guaranies) a la cuenta N° 1768595 titular ARIEL BRITEZ RAMIREZ entidad bancaria BANCO ATLAS S.A., tambien realiza una transferencia por billetera TIGO MONEY al numero 0975349086 la suma de 45.000(cuarenta y cinco mil guaranies), con esta última transferencia supuestamente quedaria cancelada la compra en lo que posterior le exige nuevamente más dinero a lo que la víctima se niega y luego recibe amenazas vía WhatsApp del número 0993638985 que se hace pasar por supuesto personal policial pidiendole dinero para liberar la compra, la victima hace caso omiso y bloquea dicho dinero.', 'CIUDAD DE ASUNCIÓN, BARRIO CIUDAD NUEVA, GENERAL ELIZARDO AQUINO', NULL, NULL, 333, 193, 'Asunción', 'Suboficial Ayudante', 'DAISY NOEMI', 'AGUILAR CABAÑAS', NULL, NULL, '30DE2EA26', NULL, 'completada', '2026-02-02T00:15:32.381Z', NULL, NULL),
