- Banco Sudameris, cuenta N° 2065060, hoja de cheque N° 46196718, con fecha de emisión: 29 de enero, fecha de pago 28 de febrero del 2026, por un monto de Gs. 16.000.000 (DIECISÉIS MILLONES DE GUARANÍES).
- Banco Sudameris, cuenta N° 2065060, hoja de cheque N° 46196723, con fecha de emisión: 29 de enero, fecha de pago 7 de marzo del 2026, por un monto de Gs. 21.000.000 (VEINTIÚN MILLONES DE GUARANÍES).
