(541, 470, '2026-02-01T00:00:00.000Z', '21:32', '2026-01-30T00:00:00.000Z', '15:30', 'Estafa', NULL, 'Relata la recurrente que en fecha y hora mencionada más arriba se encontraba navegando en la red social FACEBOOK en su apartado MARKETPLACE, donde visualiza la publicación de una motocicleta de la marca KENTON modelo BLITZ 110CC color azul, por lo que se pone en contacto con el usuario para pedir más información sobre ello, este le facilita el abonado número 0985666528 para contacto via WhatsApp quien se presenta con el nombre de ANTONIO CABRERA ROLON supuesto titular de la motocicleta, le indica a la victima que debera realizar una transferencia por la suma de guaranies 120.000(ciento veinte mil)en concepto de pago de tramites con la escribanía, a la cuenta Nº 6192393285 de la entidad bancaria UENO BANK a nombre del titular LUZ MILAGROS BRITEZ CACERES, una vez realizado dicha transacción le meciona que el producto se encontaba en camino pero que en el trayecto tuvieron invonvenientes con el traslado por lo que le exige enviarle un nuevo monto de guaranies 300.000(trescientos mil) a la cuenta Nº 64010907 de la entidad bancaria TU FINANCIERA S.A. titular ELSA SOLEDA QUINXXONEZ AQUINO, manifiesta la recurrente que realiza una nueva transferencia con el monto de guaranies 200.000(doscientos mil)a la primera cuenta redactada más arriba al titular de nombre LUZ BRITEZ, continuamente le solicitaban más envios de dinero a lo que la victima se niega y empiezan a ostigarle de otra manera, enviando una supuesta publicación en una página de noticias utilizando la imagen de su Cédula de Identidad que la misma le habia proporcionado para el supuesto contrato, por lo que se apersona a esta Dependencia a formular su denuncia para los fines que hubiere lugar.', 'DEPARTAMENTO CENTRAL, CIUDAD DE FERNANDO DE LA MORA, BARRIO ITA KA''AGUY, CALLE SOLDADO OVELAR Y SAN FRANCISCO', NULL, NULL, 335, 193, 'Asunción', 'Suboficial Ayudante', 'DAISY NOEMI', 'AGUILAR CABAÑAS', NULL, NULL, '9EF766A26', NULL, 'completada', '2026-02-02T01:28:13.836Z', NULL, NULL),
(542, 471, '2026-02-01T00:00:00.000Z', '22:48', '2026-02-01T00:00:00.000Z', '11:00', 'HECHO PUNIBLE A DETERMINAR', NULL, 'Quien suscribe, en su carácter de denunciante, manifiesta que en fecha y hora ya mencionadas más arriba recibió una llamada telefónica proveniente del abonado número 0983710389, cuyo interlocutor se hizo pasar por un supuesto asesor de la empresa TIGO. el mencionado individuo le indicó, de manera sospechosa, que le llegaría un mensaje con un código de seguridad, el cual debía introducir con el fin de calibrar la señal de la red. Ante esta situación, el denunciante interpretó que se trataba de un intento de vulneración de sus datos personales, por lo que procedió a cortar la llamada, asegurando que en ningún momento proporcionó ni mencionó código alguno al citado abonado. posteriormente, el denunciante se percató de que su red de mensajería instantánea había sido vulnerada, constatando que otro dispositivo estaría controlando dicha cuenta. De manera paralela, también fue vulnerada su cuenta de usuario de la plataforma Facebook, registrada a nombre de ALFREDO GUSTAVO MEDINA. ante estos hechos, el denunciante procedió de inmediato a eliminar y desinstalar dichas aplicaciones de su dispositivo móvil. Sin embargo, con posterioridad, varios amigos le manifestaron que continuaban recibiendo mensajes enviados desde sus cuentas, en los cuales se solicitaban transferencias de dinero a una cuenta bancaria determinada, sobre la cual el denunciante manifiesta no tener conocimiento alguno. por todo lo expuesto, el denunciante pone los hechos en conocimiento de la autoridad competente, a fin de que se investiguen los mismos y se determinen las responsabilidades correspondientes conforme a derecho. ', 'DEPARTAMENTO CENTRAL, CIUDAD DE MARIANO ROQUE ALONSO, BARRIO AREKAJA, GRAL AQUINO 1036', NULL, NULL, 336, 184, 'Asunción', 'Suboficial Ayudante', 'AXEL FERNANDO', 'DUARTE ORTIGOZA', NULL, NULL, '0A3323A26', NULL, 'completada', '2026-02-02T02:18:50.456Z', NULL, NULL),
(543, 472, '2026-02-02T00:00:00.000Z', '00:04', '2026-02-01T00:00:00.000Z', '20:30', 'Acceso indebido a sistemas informáticos', NULL, 'Menciona el recurrente que en fecha y hora mencionada mas arriba se percata que perdió acceso a sus dos teléfonos celulares, el primero de la marca SAMSUNG,modelo GALAXY S23,IMEI 358709981641016, con tarjeta Sim en su interior de la Línea TIGO, con abonado Nº (0986)336.788; Y segundo dispositivo de la Marca MOTOROLA, modelo GS23, con tarjetra Sim en su interior de la Línea TIGO, con abonado Nº (0987)149.927; ya que menciona que la contraseña (patrón) que utilizaba en ambos dispositivos ya no funciona y que desconoce haber realizado algun cambio ni proporcionado datos a terceros. Señala que, pese a los intentos realizados no ha logrado recuperar el control de los equipos, por lo que comparece ante esta dependencia especializada a efectos de dejar de constamcia de lo ocurrido y deslindar cualquier responsabilidad por el uso que terceros podrían dar a los mismos.', 'CIUDAD DE ASUNCIÓN, BARRIO GENERAL BERNARDINO CABALLERO, CALLE JOSE ASUNCION FLORES C/ KUBISCHEK', NULL, NULL, 337, 173, 'Asunción', 'Suboficial Ayudante', 'JORGE JEREMIAS', 'LOPEZ LOPEZ', NULL, NULL, 'C1C3F9A26', NULL, 'completada', '2026-02-02T03:48:43.265Z', NULL, NULL);

